			Rows.Add( new LocalizationRow("Enter your Google credentials. If you are using 2 step verification on your Google account, generate a password specifically for Unity GoogleFu. ",
														"Saisissez vos identifiants Google. Si vous utilisez la v\u00e9rification en 2 \u00e9tapes sur votre compte Google, g\u00e9n\u00e9rer un mot de passe sp\u00e9cifique pour l'unit\u00e9 GoogleFu.",
														"Immettere le credenziali di Google. Se si utilizza la verifica 2 step sul tuo account Google, generare una password specifica per l'Unit\u00e0 GoogleFu.",
														"Geben Sie Ihre Google-Anmeldeinformationen. Wenn Sie mit 2-Schritt-Pr\u00fcfung auf Ihrem Google-Konto, ein Passwort zu generieren, die speziell f\u00fcr Unity GoogleFu.",
														"Introduzca sus credenciales de Google. Si utiliza la verificaci\u00f3n de 2 pasos en su cuenta de Google, generar una contrase\u00f1a espec\u00edfica para la Unidad googleFU.",
														"\u0625\u062f\u062e\u0627\u0644 \u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0627\u0639\u062a\u0645\u0627\u062f Google \u0627\u0644\u062e\u0627\u0635 \u0628\u0643. \u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0633\u062a\u062e\u062f\u0645 2 \u062e\u0637\u0648\u0629 \u062a\u062d\u0642\u0642 \u0639\u0644\u0649 \u062d\u0633\u0627\u0628 Google \u0627\u0644\u062e\u0627\u0635 \u0628\u0643\u060c \u0625\u0646\u0634\u0627\u0621 \u0643\u0644\u0645\u0629 \u0645\u0631\u0648\u0631 \u062e\u0635\u064a\u0635\u0627 \u0645\u0646 \u0623\u062c\u0644 \u0627\u0644\u0648\u062d\u062f\u0629 GoogleFu.",
														"\uadc0\ud558\uc758 Google \uc790\uaca9 \uc99d\uba85\uc744 \uc785\ub825\ud569\ub2c8\ub2e4. \ub2f9\uc2e0\uc774 \ub2f9\uc2e0\uc758 \uad6c\uae00 \uacc4\uc815\uc5d0 2 \ub2e8\uacc4 \uc778\uc99d\uc744 \uc0ac\uc6a9\ud558\ub294 \uacbd\uc6b0, \uc720\ub2c8\ud2f0 GoogleFu\uc5d0 \ub300\ud574 \uad6c\uccb4\uc801\uc73c\ub85c \uc554\ud638\ub97c \uc0dd\uc131\ud569\ub2c8\ub2e4.",
														"\u8f93\u5165\u60a8\u7684\u8c37\u6b4c\u7684\u51ed\u636e\u3002\u5982\u679c\u4f60\u5bf9\u4f60\u7684\u8c37\u6b4c\u8d26\u6237\u4f7f\u75282\u6b65\u9aa4\u9a8c\u8bc1\uff0c\u751f\u6210\u4e13\u4e3a\u7edf\u4e00GoogleFu\u5bc6\u7801\u3002",
														"Google\u306e\u8a8d\u8a3c\u60c5\u5831\u3092\u5165\u529b\u3057\u307e\u3059\u3002\u3042\u306a\u305f\u306f\u3001Google\u30a2\u30ab\u30a6\u30f3\u30c8\u306b2\u6bb5\u968e\u8a8d\u8a3c\u30d7\u30ed\u30bb\u30b9\u3092\u4f7f\u7528\u3057\u3066\u3044\u308b\u5834\u5408\u306f\u3001\u30e6\u30cb\u30c6\u30a3GoogleFu\u306e\u305f\u3081\u306b\u7279\u5225\u306b\u30d1\u30b9\u30ef\u30fc\u30c9\u3092\u751f\u6210\u3002",
														"\u0412\u0432\u0435\u0434\u0438\u0442\u0435 \u0443\u0447\u0435\u0442\u043d\u044b\u0435 \u0434\u0430\u043d\u043d\u044b\u0435 Google. \u0415\u0441\u043b\u0438 \u0432\u044b \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0435 2 \u0434\u0432\u0443\u0445\u044d\u0442\u0430\u043f\u043d\u0443\u044e \u0430\u0443\u0442\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u044e \u043d\u0430 \u0432\u0430\u0448\u0435\u043c \u0441\u0447\u0435\u0442\u0443 Google, \u0441\u0433\u0435\u043d\u0435\u0440\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u043f\u0430\u0440\u043e\u043b\u044c \u0432 \u0447\u0430\u0441\u0442\u043d\u043e\u0441\u0442\u0438 \u0434\u043b\u044f Unity GoogleFu.",
														"Nh\u1eadp th\u00f4ng tin \u0111\u0103ng nh\u1eadp Google c\u1ee7a b\u1ea1n. N\u1ebfu b\u1ea1n \u0111ang s\u1eed d\u1ee5ng x\u00e1c minh 2 b\u01b0\u1edbc tr\u00ean t\u00e0i kho\u1ea3n Google c\u1ee7a b\u1ea1n, t\u1ea1o ra m\u1ed9t m\u1eadt kh\u1ea9u ri\u00eang cho Unity GoogleFu.",
														"Voer uw Google-referenties. Als u gebruik maakt van 2 step verificatie van uw Google-account, het wachtwoord genereren specifiek voor Unity GoogleFu.",
														"Gee jou Google geloofsbriewe. As jy met 2 stap verifikasie op jou Google-rekening, genereer 'n wagwoord spesifiek vir Eenheid GoogleFu.",
														"\u0412\u044a\u0432\u0435\u0434\u0435\u0442\u0435 \u0432\u0430\u0448\u0438\u0442\u0435 \u0438\u0434\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u043e\u043d\u043d\u0438 \u0434\u0430\u043d\u043d\u0438 \u043d\u0430 Google. \u0410\u043a\u043e \u0438\u0437\u043f\u043e\u043b\u0437\u0432\u0430\u0442\u0435 \u043f\u0440\u043e\u0432\u0435\u0440\u043a\u0430 2 \u0441\u0442\u044a\u043f\u043a\u0430 \u043f\u043e \u0441\u043c\u0435\u0442\u043a\u0430\u0442\u0430 \u0441\u0438 \u0432 Google, \u0441\u0435 \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430 \u043f\u0430\u0440\u043e\u043b\u0430 \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u043d\u043e \u0437\u0430 Unity GoogleFu.",
														"\u041a\u0430\u043b\u0456 \u043b\u0430\u0441\u043a\u0430, \u0443\u0432\u044f\u0434\u0437\u0456\u0446\u0435 \u0443\u043b\u0456\u043a\u043e\u0432\u044b\u044f \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u044f Google. \u041a\u0430\u043b\u0456 \u0432\u044b \u0432\u044b\u043a\u0430\u0440\u044b\u0441\u0442\u043e\u045e\u0432\u0430\u0435\u0446\u0435 2 \u0434\u0432\u0443\u0445\u044d\u0442\u0430\u043f\u043d\u0443\u044e \u0430\u045e\u0442\u044d\u043d\u0442\u044b\u0444\u0456\u043a\u0430\u0446\u044b\u044e \u043d\u0430 \u0432\u0430\u0448\u044b\u043c \u0440\u0430\u0445\u0443\u043d\u043a\u0443 Google, \u0437\u0433\u0435\u043d\u0435\u0440\u0430\u0432\u0430\u0446\u044c \u043f\u0430\u0440\u043e\u043b\u044c \u0443 \u043f\u0440\u044b\u0432\u0430\u0442\u043d\u0430\u0441\u0446\u0456 \u0434\u043b\u044f Unity GoogleFu.",
														"Introdueixi les seves credencials de Google. Si utilitza la verificaci\u00f3 de 2 passos en el seu compte de Google, generar una contrasenya espec\u00edfica per a la Unitat googleFU.",
														"Zadejte pov\u011b\u0159en\u00ed Google. Pokud pou\u017e\u00edv\u00e1te ov\u011b\u0159en\u00ed 2 kroc\u00edch na va\u0161em \u00fa\u010dtu Google, generov\u00e1n\u00ed hesla konkr\u00e9tn\u011b pro Unity GoogleFu.",
														"Rhowch eich cymwysterau Google. Os ydych yn defnyddio dilysu 2 cam ar eich cyfrif Google, gynhyrchu cyfrinair yn benodol ar gyfer Undod GoogleFu.",
														"Sisesta oma Google volikirja. Kui kasutate 2 samm kontroll oma Google'i konto, luua parool spetsiaalselt Unity GoogleFu.",
														"\u0627\u0637\u0644\u0627\u0639\u0627\u062a \u06a9\u0627\u0631\u0628\u0631\u06cc Google \u062e\u0648\u062f \u0631\u0627 \u0648\u0627\u0631\u062f \u06a9\u0646\u06cc\u062f. \u0627\u06af\u0631 \u0634\u0645\u0627 \u0628\u0627 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0627\u0632 \u062a\u0623\u06cc\u06cc\u062f \u0635\u062d\u062a 2 \u0645\u0631\u062d\u0644\u0647 \u062f\u0631 \u062d\u0633\u0627\u0628 Google \u0634\u0645\u0627\u060c \u06a9\u0644\u0645\u0647 \u06cc \u0639\u0628\u0648\u0631 \u0628\u0647 \u0637\u0648\u0631 \u062e\u0627\u0635 \u0628\u0631\u0627\u06cc \u0648\u062d\u062f\u062a GoogleFu.",
														"Anna Google valtakirjaa. Jos k\u00e4yt\u00e4t 2 kaksivaiheisen vahvistuksen Google tilin, luoda salasanan nimenomaan Unity GoogleFu.",
														"Cuir isteach do dinti\u00fair Google. M\u00e1 t\u00e1 t\u00fa ag baint \u00fas\u00e1ide as f\u00edor\u00fa 2 c\u00e9im ar do chuntas Google, a ghini\u00faint focal faire go sonrach le haghaidh Unity GoogleFu.",
														"Introduza as s\u00faas credenciais de Google. Se est\u00e1 usando verificaci\u00f3n de 2 etapas na s\u00faa conta de Google, xerar un contrasinal especialmente para a Unidade GoogleFu.",
														"\u0905\u092a\u0928\u0947 Google \u0915\u094d\u0930\u0947\u0921\u0947\u0902\u0936\u093f\u092f\u0932 \u0926\u0930\u094d\u091c \u0915\u0930\u0947\u0902. \u0906\u092a \u0905\u092a\u0928\u0947 \u0917\u0942\u0917\u0932 \u0916\u093e\u0924\u0947 \u092a\u0930 2 \u0915\u0926\u092e \u0938\u0924\u094d\u092f\u093e\u092a\u0928 \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902, \u090f\u0915\u0924\u093e GoogleFu \u0915\u0947 \u0932\u093f\u090f \u0935\u093f\u0936\u0947\u0937 \u0930\u0942\u092a \u0938\u0947 \u090f\u0915 \u092a\u093e\u0938\u0935\u0930\u094d\u0921 \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902.",
														"Unesite Google vjerodajnice. Ako koristite 2 koraka na svoj Google ra\u010dun, generirati lozinku posebno za Unity GoogleFu.",
														"Antre nan kalifikasyon Google ou. Si w ap itilize verifikasyon 2 etap sou kont Google ou, jenere yon modpas espesyalman pou Inite GoogleFu.",
														"Masukkan kredensial Google Anda. Jika Anda menggunakan 2 langkah verifikasi akun Google Anda, menghasilkan password khusus untuk Unity GoogleFu.",
														"Sl\u00e1\u00f0u inn Google pers\u00f3nuskilr\u00edki. Ef \u00fe\u00fa ert a\u00f0 nota sannpr\u00f3fun 2 skrefum \u00e1 Google reikningnum \u00fe\u00ednum, b\u00faa til lykilor\u00f0 s\u00e9rstaklega fyrir Unity GoogleFu.",
														"\u05d4\u05d6\u05df \u05d0\u05ea \u05d4\u05ea\u05e2\u05d5\u05d3\u05d5\u05ea \u05e9\u05dc Google \u05e9\u05dc\u05da. \u05d0\u05dd \u05d0\u05ea\u05d4 \u05de\u05e9\u05ea\u05de\u05e9 \u05d1\u05d0\u05d9\u05de\u05d5\u05ea 2 \u05e6\u05e2\u05d3 \u05d1\u05d7\u05e9\u05d1\u05d5\u05df Google \u05e9\u05dc\u05da, \u05dc\u05d9\u05e6\u05d5\u05e8 \u05e1\u05d9\u05e1\u05de\u05d0 \u05e1\u05e4\u05e6\u05d9\u05e4\u05d9\u05ea \u05dc\u05d0\u05d7\u05d3\u05d5\u05ea GoogleFu.",
														"\u012eveskite savo Google \u012fgaliojimai. Jei naudojate patikrinimas 2 \u017eingsnis j\u016bs\u0173 \"Google\" paskyros, generuoti slapta\u017eod\u012f specialiai Vienyb\u0117s GoogleFu.",
														"Ievadiet Google akredit\u0101cijas datus. Ja j\u016bs izmantojat 2 divpak\u0101pju verifik\u0101ciju sav\u0101 Google kont\u0101, \u0123ener\u0113t paroli konkr\u0113ti par Vienot\u012bbas GoogleFu.",
														"\u0412\u043d\u0435\u0441\u0435\u0442\u0435 \u0458\u0430 \u0432\u0430\u0448\u0430\u0442\u0430 Google \u0438\u043d\u0433\u0435\u0440\u0435\u043d\u0446\u0438\u0438\u0442\u0435. \u0410\u043a\u043e \u043a\u043e\u0440\u0438\u0441\u0442\u0438\u0442\u0435 2 \u0447\u0435\u043a\u043e\u0440 \u0432\u0435\u0440\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0458\u0430 \u043d\u0430 \u0432\u0430\u0448\u0430\u0442\u0430 Google \u0441\u043c\u0435\u0442\u043a\u0430, \u0434\u0430 \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430 \u043b\u043e\u0437\u0438\u043d\u043a\u0430 \u0441\u043f\u0435\u0446\u0438\u0458\u0430\u043b\u043d\u043e \u0437\u0430 \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u043e GoogleFu.",
														"Masukkan data Google anda. Jika anda menggunakan pengesahan 2 langkah pada akaun Google anda, menjana kata laluan khusus untuk Perpaduan GoogleFu.",
														"Ikteb kredenzjali Google tieg\u0127ek. Jekk inti qed tu\u017ca verifikazzjoni 2 pass fuq il-kont Google tieg\u0127ek, ji\u0121\u0121eneraw password spe\u010bifikament g\u0127all-Unit\u00e0 GoogleFu.",
														"Skriv inn Google-IDen. Hvis du bruker to trinns bekreftelse p\u00e5 din Google-konto, generere et passord spesifikt for Unity GoogleFu.",
														"Wprowad\u017a po\u015bwiadczenia Google. Je\u015bli u\u017cywasz 2 etap weryfikacji na koncie Google, wygenerowa\u0107 has\u0142o specjalnie dla Unity GoogleFu.",
														"Insira suas credenciais do Google. Se voc\u00ea estiver usando verifica\u00e7\u00e3o de 2 etapas em sua conta do Google, gerar uma senha especificamente para a Unidade GoogleFu.",
														"Introduce\u021bi datele de autentificare Google. Dac\u0103 utiliza\u021bi verificare 2 pas \u00een contul dvs. Google, de a genera o parol\u0103 special pentru Unitatea GoogleFu.",
														"Zadajte poverenia Google. Ak pou\u017e\u00edvate overenie 2 krokoch na va\u0161om \u00fa\u010dte Google, generovanie hesla konkr\u00e9tne pre Unity GoogleFu.",
														"Vpi\u0161ite Google poverilnice. \u010ce uporabljate preverjanje 2 korak na svoj ra\u010dun pri Googlu, ustvarite geslo posebej za Unity GoogleFu.",
														"Shkruani kredencialet tuaja Google. N\u00ebse jeni duke p\u00ebrdorur verifikimin 2 hap n\u00eb llogarin\u00eb tuaj t\u00eb Google, t\u00eb gjeneroj\u00eb nj\u00eb fjal\u00ebkalim n\u00eb m\u00ebnyr\u00eb specifike p\u00ebr t\u00eb Unitetit GoogleFu.",
