														"\ub2f9\uc2e0\uc740 \uc124\uc815 \ud0ed\uc5d0\uc11c \uad6c\uae00 \uacc4\uc815\uc73c\ub85c \ub85c\uadf8\uc778\uc744 \uc120\ud0dd\ud558\uc5ec Google \uacc4\uc815\uacfc \uc5f0\uacb0\ub41c \ud1b5\ud569 \ubb38\uc11c \ub610\ub294 \uc218\ub3d9\uc73c\ub85c \ub3c4\uad6c\ub97c \uc0ac\uc6a9\ud558\uae30 \uc804\uc5d0 \ud1b5\ud569 \ubb38\uc11c \ud0ed\uc744 \uc0ac\uc6a9\ud558\uc5ec \uac8c\uc2dc \ub41c \ud1b5\ud569 \ubb38\uc11c\ub97c \ucd94\uac00\ud574\uc57c\ud569\ub2c8\ub2e4.",
