														"\u0412\u044b \u0434\u043e\u043b\u0436\u043d\u044b \u043b\u0438\u0431\u043e \u0432\u043e\u0439\u0442\u0438 \u0432 \u0441\u0432\u043e\u0439 \u0430\u043a\u043a\u0430\u0443\u043d\u0442 Google \u043d\u0430 \u0432\u043a\u043b\u0430\u0434\u043a\u0435 \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043a \u0438 \u0432\u044b\u0431\u0440\u0430\u0442\u044c Workbook \u0432 \u0432\u0430\u0448\u0435\u0439 \u0443\u0447\u0435\u0442\u043d\u043e\u0439 Google, \u0438\u043b\u0438 \u0432\u0440\u0443\u0447\u043d\u0443\u044e \u0434\u043e\u0431\u0430\u0432\u0438\u0442\u044c \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u043d\u044b\u0439 Workbook \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u0432\u043a\u043b\u0430\u0434\u043a\u0438 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u043a\u043d\u0438\u0433, \u043f\u0440\u0435\u0436\u0434\u0435 \u0447\u0435\u043c \u0432\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u044b.",
														"B\u1ea1n ph\u1ea3i th\u1ec3 \u0111\u0103ng nh\u1eadp v\u00e0o t\u00e0i kho\u1ea3n Google c\u1ee7a b\u1ea1n trong tab Settings v\u00e0 ch\u1ecdn m\u1ed9t Workbook li\u00ean k\u1ebft v\u1edbi t\u00e0i kho\u1ea3n Google c\u1ee7a b\u1ea1n, ho\u1eb7c t\u1ef1 th\u00eam m\u1ed9t Workbook \u0111\u01b0\u1ee3c xu\u1ea5t b\u1ea3n b\u1eb1ng c\u00e1ch s\u1eed d\u1ee5ng tab S\u1ed5 l\u00e0m vi\u1ec7c tr\u01b0\u1edbc khi b\u1ea1n c\u00f3 th\u1ec3 s\u1eed d\u1ee5ng c\u00e1c c\u00f4ng c\u1ee5.",
