														"\u0412\u044b \u043f\u0430\u0432\u0456\u043d\u043d\u044b \u0430\u043b\u044c\u0431\u043e \u045e\u0432\u0430\u0439\u0441\u0446\u0456 \u045e \u0441\u0432\u043e\u0439 \u0440\u0430\u0445\u0443\u043d\u0430\u043a Google \u043d\u0430 \u045e\u043a\u043b\u0430\u0434\u0446\u044b \u043d\u0430\u043b\u0430\u0434 \u0456 \u0432\u044b\u0431\u0440\u0430\u0446\u044c Workbook \u045e \u0432\u0430\u0448\u0430\u0439 \u045e\u043b\u0456\u043a\u043e\u0432\u0430\u0433\u0430 Google, \u0430\u0431\u043e \u045e\u0440\u0443\u0447\u043d\u0443\u044e \u0434\u0430\u0434\u0430\u0446\u044c \u0430\u043f\u0443\u0431\u043b\u0456\u043a\u0430\u0432\u0430\u043d\u044b Workbook \u0437 \u0434\u0430\u043f\u0430\u043c\u043e\u0433\u0430\u0439 \u045e\u043a\u043b\u0430\u0434\u043a\u0456 \u0440\u0430\u0431\u043e\u0447\u044b\u0445 \u043a\u043d\u0456\u0433, \u043f\u0435\u0440\u0448 \u0447\u044b\u043c \u0432\u044b \u043c\u043e\u0436\u0430\u0446\u0435 \u0432\u044b\u043a\u0430\u0440\u044b\u0441\u0442\u043e\u045e\u0432\u0430\u0446\u044c \u0456\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u044b.",
