														"GoogleFu \u043d\u0435 \u0437\u043c\u043e\u0436\u0443\u0442\u044c \u0437\u0432'\u044f\u0437\u0430\u0442\u0438\u0441\u044f Google \u0421\u0435\u0440\u0432\u0435\u0440\u0438 \u0432 \u0442\u043e\u0439 \u0447\u0430\u0441 \u044f\u043a \u0432\u0438 \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0435\u0441\u044c \u0432 \u0446\u044c\u043e\u043c\u0443 Platform Target. GoogleFu \u0431\u0443\u0434\u0443\u0442\u044c \u0432\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0456 \u0434\u043e \u0442\u0438\u0445 \u043f\u0456\u0440, \u043f\u043e\u043a\u0438 \u0437\u043d\u043e\u0432\u0443 \u043d\u0435 \u043f\u0456\u0434\u0442\u0440\u0438\u043c\u0443\u0432\u0430\u043d\u043e\u043c\u0443 Target.",
														"\u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d5\u05d5\u05e2\u05d8 \u05e0\u05d9\u05d8 \u05d6\u05d9\u05d9\u05df \u05d1\u05d9\u05db\u05d5\u05dc\u05ea \u05e6\u05d5 \u05e7\u05d0\u05b8\u05e0\u05d8\u05d0\u05b7\u05e7\u05d8 Google \u05e1\u05e2\u05e8\u05d5\u05d5\u05e2\u05e8\u05e1 \u05d1\u05e9\u05e2\u05ea \u05d0\u05d9\u05e8 \u05d6\u05e2\u05e0\u05e2\u05df \u05d0\u05d9\u05df \u05d3\u05e2\u05dd \u05e4\u05bc\u05dc\u05d0\u05b7\u05d8\u05e4\u05d0\u05b8\u05e8\u05de\u05e2 \u05d8\u05d0\u05b7\u05e8\u05d2\u05e2\u05d8. \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d5\u05d5\u05e2\u05d8 \u05d6\u05d9\u05d9\u05df \u05e4\u05d0\u05b7\u05e8\u05e7\u05e8\u05d9\u05e4\u05bc\u05dc\u05d8 \u05d1\u05d9\u05d6 \u05d0\u05d9\u05e8 \u05d1\u05d0\u05b7\u05e9\u05d8\u05d9\u05de\u05e2\u05df \u05e6\u05d5\u05e8\u05d9\u05e7 \u05e6\u05d5 \u05d0\u05b7 \u05d2\u05e2\u05e9\u05d8\u05d9\u05e6\u05d8 \u05d8\u05d0\u05b7\u05e8\u05d2\u05e2\u05d8.",
														"GoogleFu\u5c07\u7121\u6cd5\u806f\u7e6b\u8c37\u6b4c\u7684\u670d\u52d9\u5668\uff0c\u800c\u4f60\u5728\u9019\u500b\u5e73\u53f0\u7684\u76ee\u6a19\u3002 GoogleFu\u5c07\u88ab\u7981\u7528\uff0c\u76f4\u5230\u60a8\u5207\u63db\u56de\u652f\u6301\u7684\u76ee\u6a19\u3002"));
			Rows.Add( new LocalizationRow("Creating a database on your Google Drive.  It will be named \"Untitled\" until you change it from within Google directly. ",
														"Cr\u00e9ation d'une base de donn\u00e9es sur votre Google Drive. Il sera nomm\u00e9 \"Untitled\" jusqu'\u00e0 ce que vous changiez \u00e0 partir de Google directement.",
														"Creazione di un database sul tuo Google Drive. Si chiama \"Senza titolo\" finch\u00e9 non viene modificata dal di dentro Google direttamente.",
														"Schaffung einer Datenbank \u00fcber Google Drive. Es wird \"Untitled\" benannt werden, bis Sie es direkt von Google innerhalb \u00e4ndern.",
														"Creaci\u00f3n de una base de datos en Google Drive. Se llamar\u00e1 \"Sin t\u00edtulo\" hasta que se cambie desde dentro de Google directamente.",
														"\u0625\u0646\u0634\u0627\u0621 \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a \u0639\u0644\u0649 \u0645\u062d\u0631\u0643 \u062c\u0648\u062c\u0644 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643. \u0648\u0633\u0648\u0641 \u0623\u0637\u0644\u0642 \u0639\u0644\u064a\u0647\u0627 \u0627\u0633\u0645 \"\u0628\u062f\u0648\u0646 \u0639\u0646\u0648\u0627\u0646\" \u062d\u062a\u0649 \u062a\u0642\u0648\u0645 \u0628\u062a\u063a\u064a\u064a\u0631\u0647 \u0645\u0646 \u062f\u0627\u062e\u0644 Google \u0645\u0628\u0627\u0634\u0631\u0629.",
														"\uadc0\ud558\uc758 Google \ub4dc\ub77c\uc774\ube0c\uc5d0\uc11c \ub370\uc774\ud130\ubca0\uc774\uc2a4\ub97c \uc791\uc131. \uc9c1\uc811 \uad6c\uae00 \ub0b4\uc5d0\uc11c \ubcc0\uacbd\ud560 \ub54c\uae4c\uc9c0\uc774 \"\uc81c\ubaa9 \uc5c6\uc74c\"\ub77c\ub294 \uc774\ub984\uc744 \ud655\uc778\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
														"\u521b\u5efa\u60a8\u7684\u8c37\u6b4c\u9a71\u52a8\u5668\u7684\u6570\u636e\u5e93\u3002\u76f4\u5230\u5b83\u5728\u8c37\u6b4c\u76f4\u63a5\u66f4\u6539\u5c06\u88ab\u547d\u540d\u4e3a\u201c\u65e0\u9898\u201d\u3002",
														"Google\u30c9\u30e9\u30a4\u30d6\u4e0a\u306b\u30c7\u30fc\u30bf\u30d9\u30fc\u30b9\u3092\u4f5c\u6210\u3059\u308b\u3002\u3042\u306a\u305f\u306f\u76f4\u63a5Google\u306e\u4e2d\u304b\u3089\u305d\u308c\u3092\u5909\u66f4\u3059\u308b\u307e\u3067\u3001\u300c\u7121\u984c\u300d\u3068\u3044\u3046\u540d\u524d\u306b\u306a\u308a\u307e\u3059\u3002",
														"\u0421\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u0431\u0430\u0437\u044b \u0434\u0430\u043d\u043d\u044b\u0445 \u043d\u0430 \u0432\u0430\u0448\u0435\u043c Google Drive. \u042d\u0442\u043e \u0431\u0443\u0434\u0435\u0442 \u043d\u0430\u0437\u044b\u0432\u0430\u0442\u044c\u0441\u044f \"\u0411\u0435\u0437 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u044f\", \u043f\u043e\u043a\u0430 \u0432\u044b \u043d\u0435 \u0438\u0437\u043c\u0435\u043d\u0438\u0442\u0435 \u0435\u0433\u043e \u0438\u0437\u043d\u0443\u0442\u0440\u0438 Google \u043d\u0430\u043f\u0440\u044f\u043c\u0443\u044e.",
														"T\u1ea1o ra m\u1ed9t c\u01a1 s\u1edf d\u1eef li\u1ec7u tr\u00ean Google Drive c\u1ee7a b\u1ea1n. N\u00f3 s\u1ebd \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean l\u00e0 \"Untitled\" cho \u0111\u1ebfn khi b\u1ea1n thay \u0111\u1ed5i n\u00f3 t\u1eeb b\u00ean trong Google tr\u1ef1c ti\u1ebfp.",
														"Het cre\u00ebren van een database op uw Google Drive. Het krijgt de naam \"Untitled\" totdat u deze wijzigt vanuit Google rechtstreeks.",
														"Skep van 'n databasis op jou Google Drive. Dit sal \"Untitled\" genoem word totdat jy dit verander van binne Google direk.",
														"\u0421\u044a\u0437\u0434\u0430\u0432\u0430\u043d\u0435 \u043d\u0430 \u0431\u0430\u0437\u0430 \u0434\u0430\u043d\u043d\u0438 \u043d\u0430 \u0432\u0430\u0448\u0438\u044f Google \u0414\u0440\u0430\u0439\u0432. \u0422\u044f \u0449\u0435 \u0441\u0435 \u043a\u0430\u0437\u0432\u0430 \"Untitled\", \u0434\u043e\u043a\u0430\u0442\u043e \u043d\u0435 \u0433\u043e \u043f\u0440\u043e\u043c\u0435\u043d\u0438\u0442\u0435 \u043e\u0442\u0432\u044a\u0442\u0440\u0435 Google \u0434\u0438\u0440\u0435\u043a\u0442\u043d\u043e.",
														"\u0421\u0442\u0432\u0430\u0440\u044d\u043d\u043d\u0435 \u0431\u0430\u0437\u044b \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u0445 \u043d\u0430 \u0432\u0430\u0448\u044b\u043c Google Drive. \u0413\u044d\u0442\u0430 \u0431\u0443\u0434\u0437\u0435 \u043d\u0430\u0437\u044b\u0432\u0430\u0446\u0446\u0430 \"\u0411\u0435\u0437 \u043d\u0430\u0437\u0432\u044b\", \u043f\u0430\u043a\u0443\u043b\u044c \u0432\u044b \u043d\u0435 \u0437\u043c\u0435\u043d\u0456\u0446\u0435 \u044f\u0433\u043e \u0437\u043d\u0443\u0442\u0440\u044b Google \u043d\u0430\u043f\u0440\u0430\u043c\u0443\u044e.",
														"Creaci\u00f3 d'una base de dades a Google Drive. Es dir\u00e0 \"Sense t\u00edtol\" fins que es canvi\u00ef des de dins de Google directament.",
														"Vytvo\u0159en\u00ed datab\u00e1ze na Disku Google. To se bude jmenovat \"Untitled\", dokud ji nezm\u011bn\u00edte v Google p\u0159\u00edmo.",
														"Creu cronfa ddata ar eich Google Drive. Bydd yn cael ei enw \"Untitled\" nes i chi ei newid o'r tu mewn Google yn uniongyrchol.",
														"Andmebaasi loomine teie Google Drive. Seda nimetatakse \"Untitled\", kuni te muudate seda seestpoolt Google otse.",
														"\u0627\u06cc\u062c\u0627\u062f \u06cc\u06a9 \u067e\u0627\u06cc\u06af\u0627\u0647 \u062f\u0627\u062f\u0647 \u062f\u0631 Google Drive \u0634\u0645\u0627. \u0627\u06cc\u0646 \u0646\u0627\u0645 \u062e\u0648\u0627\u0647\u062f \u0634\u062f \"\u0628\u062f\u0648\u0646 \u0639\u0646\u0648\u0627\u0646\" \u062a\u0627 \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u0634\u0645\u0627 \u0622\u0646 \u0631\u0627 \u0627\u0632 \u062a\u063a\u06cc\u06cc\u0631 \u062f\u0631 \u06af\u0648\u06af\u0644 \u0628\u0647 \u0637\u0648\u0631 \u0645\u0633\u062a\u0642\u06cc\u0645.",
														"Luominen tietokanta Google Drive. Se nimet\u00e4\u00e4n \"Nimet\u00f6n\", kunnes muutat sen sis\u00e4ll\u00e4 Googlen suoraan.",
														"Ag cruth\u00fa bunachar sonra\u00ed ar do Google Drive. Beidh s\u00e9 a bheith ainmnithe \"Untitled\" go dt\u00ed go leat \u00e9 a athr\u00fa \u00f3 laistigh Google d\u00edreach.",
														"Creando unha base de datos no seu Google Drive. El ser\u00e1 chamado \"Untitled\" ata que sexa modificada a partir de Google directamente.",
														"\u0905\u092a\u0928\u0947 \u0917\u0942\u0917\u0932 \u0921\u094d\u0930\u093e\u0907\u0935 \u092a\u0930 \u090f\u0915 \u0921\u0947\u091f\u093e\u092c\u0947\u0938 \u092c\u0928\u093e\u0928\u093e. \u0906\u092a \u0938\u0940\u0927\u0947 \u0917\u0942\u0917\u0932 \u0915\u0947 \u092d\u0940\u0924\u0930 \u0938\u0947 \u0907\u0938\u0947 \u092c\u0926\u0932\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u091c\u092c \u0924\u0915 \u092f\u0939 \"\u0936\u0940\u0930\u094d\u0937\u0915\u0939\u0940\u0928\" \u0928\u093e\u092e \u0926\u093f\u092f\u093e \u091c\u093e\u090f\u0917\u093e.",
														"Stvaranje baze podataka o va\u0161em Google Drive. Ona \u0107e se pod nazivom \"Bez naslova\", dok je ne promijenite iznutra Googlea izravno.",
														"Kreye yon baz done sou Google Drive ou. Li pral rele \"Untitled\" jiskaske ou chanje li soti nan Google dir\u00e8kteman.",
														"Membuat database di Google Drive. Ini akan diberi nama \"Untitled\" sampai Anda mengubahnya dari dalam Google secara langsung.",
														"B\u00faa til gagnagrunn \u00e1 Google Drive. \u00dea\u00f0 mun heita \"Untitled\" \u00fear til \u00fe\u00fa breytir \u00fev\u00ed \u00far innan Google beint.",
														"\u05d9\u05e6\u05d9\u05e8\u05ea \u05de\u05e1\u05d3 \u05e0\u05ea\u05d5\u05e0\u05d9\u05dd \u05d1\u05db\u05d5\u05e0\u05df Google \u05e9\u05dc\u05da. \u05d6\u05d4 \u05d9\u05d4\u05d9\u05d4 \u05e9\u05dd \"\u05dc\u05dc\u05d0 \u05db\u05d5\u05ea\u05e8\u05ea\" \u05e2\u05d3 \u05e9\u05ea\u05e9\u05e0\u05d4 \u05d0\u05d5\u05ea\u05d4 \u05de\u05d1\u05e4\u05e0\u05d9\u05dd \u05d2\u05d5\u05d2\u05dc \u05d9\u05e9\u05d9\u05e8\u05d5\u05ea.",
														"Duomen\u0173 baz\u0119 \"Google Drive k\u016brimas. Jis bus pavadintas \"Be pavadinimo\", kol j\u016bs j\u012f pakeisti i\u0161 vidaus \"Google\" tiesiogiai.",
														"Datub\u0101zi par Google Drive radot. Tas tiks nosaukts \"Untitled\", l\u012bdz j\u016bs main\u012bt no iek\u0161ienes Google tie\u0161i.",
														"\u041a\u0440\u0435\u0438\u0440\u0430\u045a\u0435 \u043d\u0430 \u0431\u0430\u0437\u0430 \u043d\u0430 \u043f\u043e\u0434\u0430\u0442\u043e\u0446\u0438 \u043d\u0430 \u0432\u0430\u0448\u0438\u043e\u0442 Google Drive. \u0422\u043e\u0430 \u045c\u0435 \u0431\u0438\u0434\u0435 \u043d\u0430\u0440\u0435\u0447\u0435\u043d\u0430 \"\u0411\u0435\u0437 \u043d\u0430\u0441\u043b\u043e\u0432\", \u0434\u043e\u0434\u0435\u043a\u0430 \u043d\u0435 \u0433\u043e \u043c\u0435\u043d\u0443\u0432\u0430 \u043e\u0434 \u0432\u043d\u0430\u0442\u0440\u0435 \u043d\u0430 Google \u0434\u0438\u0440\u0435\u043a\u0442\u043d\u043e.",
														"Mewujudkan pangkalan data di Google Drive anda. Ia akan dinamakan \"Untitled\" sehingga anda mengubahnya dari dalam Google secara langsung.",
														"\u0126olqien ta 'database fuq Google Drive tieg\u0127ek. Hija se jkun jisimha \"Untitled\" sakemm inti jibdlu minn \u0121ewwa Google direttament.",
														"Opprette en database p\u00e5 din Google Drive. Det vil bli kalt \"Untitled\" til du endrer den fra Google direkte.",
														"Tworzenie bazy danych na Dysku Google. B\u0119dzie si\u0119 nazywa\u0107 \"Bez tytu\u0142u\", dop\u00f3ki nie zmieni go bezpo\u015brednio z poziomu Google.",
														"Criando um banco de dados em seu Google Drive. Ele ser\u00e1 chamado \"Untitled\" at\u00e9 que seja alterada a partir do Google diretamente.",
														"Crearea unei baze de date de pe unitatea Google. Acesta va fi numit \"Untitled\", p\u00e2n\u0103 c\u00e2nd le modifica\u021bi din cadrul Google direct.",
														"Vytvorenie datab\u00e1zy na Disk Google. To sa bude vola\u0165 \"Untitled\", k\u00fdm ju nezmen\u00edte v Google priamo.",
														"Ustvarjanje baze podatkov o va\u0161em Google Drive. To se bo imenovala \"Untitled\" dokler je ne spremenite znotraj Googla neposredno.",
														"Krijimi i nj\u00eb baze t\u00eb dh\u00ebnash p\u00ebr Google Drive tuaj. Ajo do t\u00eb quhet \"Untitled\" derisa ju t\u00eb ndryshoj\u00eb at\u00eb nga brenda Google direkt.",
														"\u041a\u0440\u0435\u0438\u0440\u0430\u045a\u0435 \u0431\u0430\u0437\u0435 \u043f\u043e\u0434\u0430\u0442\u0430\u043a\u0430 \u043e \u0413\u043e\u043e\u0433\u043b\u0435 \u0414\u0440\u0438\u0432\u0435. \u0422\u043e \u045b\u0435 \u0431\u0438\u0442\u0438 \u043d\u0430\u0437\u0432\u0430\u043d\u0430 \"\u0423\u043d\u0442\u0438\u0442\u043b\u0435\u0434\" \u0441\u0432\u0435 \u0434\u043e\u043a \u0442\u043e \u043d\u0435 \u043f\u0440\u043e\u043c\u0435\u043d\u0438\u0442\u0435 \u0443 \u043e\u043a\u0432\u0438\u0440\u0443 \u0413\u043e\u043e\u0433\u043b\u0435-\u0430 \u0434\u0438\u0440\u0435\u043a\u0442\u043d\u043e.",
														"Skapa en databas p\u00e5 din Google Drive. Den kommer att heta \"Untitled\" tills du \u00e4ndrar den inifr\u00e5n Google direkt.",
														"Kujenga database juu ya Google Drive yako. Itakuwa aitwaye \"Untitled\" mpaka mabadiliko hayo kutoka ndani ya Google moja kwa moja.",
														"\u0e01\u0e32\u0e23\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e10\u0e32\u0e19\u0e02\u0e49\u0e2d\u0e21\u0e39\u0e25\u0e43\u0e19 Google \u0e44\u0e14\u0e23\u0e1f\u0e4c\u0e02\u0e2d\u0e07\u0e04\u0e38\u0e13 \u0e21\u0e31\u0e19\u0e08\u0e30\u0e21\u0e35\u0e0a\u0e37\u0e48\u0e2d \"\u0e0a\u0e37\u0e48\u0e2d\" \u0e08\u0e19\u0e01\u0e27\u0e48\u0e32\u0e04\u0e38\u0e13\u0e08\u0e30\u0e40\u0e1b\u0e25\u0e35\u0e48\u0e22\u0e19\u0e08\u0e32\u0e01\u0e20\u0e32\u0e22\u0e43\u0e19 Google \u0e42\u0e14\u0e22\u0e15\u0e23\u0e07",
														"Paglikha ng isang database sa iyong Google Drive. Ito ay pinangalanang \"Walang pamagat na\" hanggang sa baguhin mo ito mula sa loob ng Google nang direkta.",
														"Google Drive \u00fczerinde bir veritaban\u0131 olu\u015fturma. Do\u011frudan Google'dan gelen de\u011fi\u015ftirene kadar \"\u0130simsiz\" adl\u0131 olacakt\u0131r.",
														"\u0421\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u044f \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u0438\u0445 \u043d\u0430 \u0432\u0430\u0448\u043e\u043c\u0443 Google Drive. \u0426\u0435 \u0431\u0443\u0434\u0435 \u043d\u0430\u0437\u0438\u0432\u0430\u0442\u0438\u0441\u044f \"\u0411\u0435\u0437 \u043d\u0430\u0437\u0432\u0438\", \u043f\u043e\u043a\u0438 \u0432\u0438 \u043d\u0435 \u0437\u043c\u0456\u043d\u0438\u0442\u0435 \u0439\u043e\u0433\u043e \u0437\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0438 Google \u0431\u0435\u0437\u043f\u043e\u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e.",
														"\u05e7\u05e8\u05e2\u05d0\u05b7\u05d8\u05d9\u05e0\u05d2 \u05d0\u05b7 \u05d3\u05d0\u05b7\u05d8\u05d0\u05b7\u05d1\u05d0\u05b7\u05e1\u05e2 \u05d0\u05d5\u05d9\u05e3 \u05d3\u05d9\u05d9\u05df \u05d2\u05d5\u05d2\u05dc \u05d3\u05e8\u05d9\u05d9\u05d5\u05d5. \u05e2\u05e1 \u05d5\u05d5\u05e2\u05d8 \u05d6\u05d9\u05d9\u05df \u05d2\u05e2\u05d4\u05d9\u05d9\u05e1\u05df \"\u05d0\u05b8\u05df \u05e7\u05d9\u05d9\u05df \u05d8\u05d9\u05d8\u05dc\" \u05d1\u05d9\u05d6 \u05d0\u05d9\u05e8 \u05d8\u05d5\u05d9\u05e9\u05df \u05e2\u05e1 \u05e4\u05d5\u05df \u05d9\u05df Google \u05d2\u05dc\u05d9\u05d9\u05b7\u05da.",
														"\u5275\u5efa\u60a8\u7684\u8c37\u6b4c\u9a45\u52d5\u5668\u7684\u6578\u64da\u5eab\u3002\u76f4\u5230\u5b83\u5728\u8c37\u6b4c\u76f4\u63a5\u66f4\u6539\u5c07\u88ab\u547d\u540d\u70ba\u201c\u7121\u984c\u201d\u3002"));
			Rows.Add( new LocalizationRow("Unable to find the xlsx file at GoogleFu/Assets/Samples/Data, or another program has it locked.  Either way, we couldn't access it. ",
														"Impossible de trouver le fichier xlsx \u00e0 GoogleFu / Actif / samples / donn\u00e9es, ou un autre programme l'a verrouill\u00e9e. De toute fa\u00e7on, nous n'avons pas pu y acc\u00e9der.",
														"Impossibile trovare il file xlsx in GoogleFu / Attivit\u00e0 / Samples / dati, o un altro programma lo ha bloccato. Ad ogni modo, non abbiamo potuto accedervi.",
														"Unf\u00e4hig, die xlsx-Datei an GoogleFu / Assets / Samples / Daten, oder ein anderes Programm hat es gesperrt zu finden. So oder so, k\u00f6nnten wir nicht darauf zugreifen.",
														"No se pudo encontrar el archivo xlsx en googleFU / Activos / Samples / Datos, u otro programa lo tiene bloqueado. De cualquier manera, no podr\u00eda acceder a \u00e9l.",
														"\u062a\u0639\u0630\u0631 \u0627\u0644\u0639\u062b\u0648\u0631 \u0639\u0644\u0649 \u0645\u0644\u0641 XLSX \u0641\u064a GoogleFu / \u0627\u0644\u0623\u0635\u0648\u0644 / \u0639\u064a\u0646\u0627\u062a / \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a\u060c \u0623\u0648 \u0628\u0631\u0646\u0627\u0645\u062c \u0622\u062e\u0631 \u0641\u0642\u062f \u0643\u0644 \u0645\u0624\u0645\u0646. \u0648\u0641\u064a \u0643\u0644\u062a\u0627 \u0627\u0644\u062d\u0627\u0644\u062a\u064a\u0646\u060c \u0644\u0645 \u0646\u062a\u0645\u0643\u0646 \u0645\u0646 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u064a\u0647.",
														"\uc7a0\uaca8\uc788\ub2e4 GoogleFu / \uc790\uc0b0 / \uc0d8\ud50c / \ub370\uc774\ud130, \ub610\ub294 \ub2e4\ub978 \ud504\ub85c\uadf8\ub7a8\uc5d0\uc11c XLSX \ud30c\uc77c\uc744 \ucc3e\uc744 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4. \uc5b4\ub290 \ucabd\uc774\ub4e0, \uc6b0\ub9ac\ub294 \uadf8\uac83\uc744 \uc561\uc138\uc2a4 \ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4.",
														"\u65e0\u6cd5\u627e\u5230\u5728GoogleFu /\u8d44\u4ea7/\u6837\u54c1/\u6570\u636e\uff0c\u6216\u5176\u4ed6\u7a0b\u5e8f\u7684XLSX\u6587\u4ef6\u6709\u5b83\u9501\u5b9a\u3002\u65e0\u8bba\u54ea\u79cd\u65b9\u5f0f\uff0c\u6211\u4eec\u65e0\u6cd5\u5bf9\u5176\u8fdb\u884c\u8bbf\u95ee\u3002",
														"\u305d\u308c\u304c\u30ed\u30c3\u30af\u3055\u308c\u3066\u3044GoogleFu /\u8cc7\u7523/\u30b5\u30f3\u30d7\u30eb/\u30c7\u30fc\u30bf\u3001\u307e\u305f\u306f\u5225\u306e\u30d7\u30ed\u30b0\u30e9\u30e0\u3067\u306exlsx\u30d5\u30a1\u30a4\u30eb\u304c\u898b\u3064\u304b\u308a\u307e\u305b\u3093\u3002\u3044\u305a\u308c\u306b\u305b\u3088\u3001\u79c1\u305f\u3061\u306f\u305d\u308c\u306b\u30a2\u30af\u30bb\u30b9\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u305b\u3093\u3067\u3057\u305f\u3002",
														"\u041d\u0435 \u0443\u0434\u0430\u0435\u0442\u0441\u044f \u043d\u0430\u0439\u0442\u0438 \u0444\u0430\u0439\u043b XLSX \u0432 GoogleFu / \u0410\u043a\u0442\u0438\u0432\u044b / \u041e\u0431\u0440\u0430\u0437\u0446\u044b / Data, \u0438\u043b\u0438 \u0434\u0440\u0443\u0433\u043e\u0439 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u044b \u0435\u0441\u0442\u044c \u044d\u0442\u043e \u0437\u0430\u043f\u0435\u0440\u0442\u043e\u0439. \u0412 \u043b\u044e\u0431\u043e\u043c \u0441\u043b\u0443\u0447\u0430\u0435, \u043c\u044b \u043d\u0435 \u043c\u043e\u0433\u043b\u0438 \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u044c \u043a \u043d\u0435\u043c\u0443 \u0434\u043e\u0441\u0442\u0443\u043f.",
														"Kh\u00f4ng th\u1ec3 t\u00ecm th\u1ea5y t\u1eadp tin xlsx t\u1ea1i GoogleFu / t\u00e0i s\u1ea3n / m\u1eabu / d\u1eef li\u1ec7u, ho\u1eb7c m\u1ed9t ch\u01b0\u01a1ng tr\u00ecnh kh\u00e1c c\u00f3 n\u00f3 \u0111\u00e3 b\u1ecb kh\u00f3a. D\u00f9 b\u1eb1ng c\u00e1ch n\u00e0o, ch\u00fang t\u00f4i kh\u00f4ng th\u1ec3 truy c\u1eadp n\u00f3.",
														"Kan het xlsx bestand op GoogleFu / Assets / Samples / gegevens, of een ander programma heeft het slot te vinden. Hoe dan ook, konden we geen toegang toe.",
														"Kan nie die l\u00eaer xlsx by GoogleFu / bates / Monsters / Data of 'n ander program het dit gesluit te vind. \u00d3f manier, kan ons nie toegang tot dit.",
														"\u041d\u0435 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0441\u0435 \u043d\u0430\u043c\u0435\u0440\u0438 \u0444\u0430\u0439\u043b\u0430 XLSX \u0432 GoogleFu / \u0410\u043a\u0442\u0438\u0432\u0438 / \u041f\u0440\u043e\u0431\u0438 / Data, \u0438\u043b\u0438 \u0434\u0440\u0443\u0433\u0430 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0430, \u0438\u043c\u0430 \u044f \u0437\u0430\u043a\u043b\u044e\u0447\u0438. \u0422\u0430\u043a\u0430 \u0438\u043b\u0438 \u0438\u043d\u0430\u0447\u0435, \u043d\u0438\u0435 \u043d\u0435 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0433\u043e \u043e\u0442\u0432\u043e\u0440\u0438\u0442\u0435.",
														"\u041d\u0435 \u045e\u0434\u0430\u0435\u0446\u0446\u0430 \u0437\u043d\u0430\u0439\u0441\u0446\u0456 \u0444\u0430\u0439\u043b XLSX \u045e GoogleFu / \u0410\u043a\u0442\u044b\u0432\u044b / \u0423\u0437\u043e\u0440\u044b / Data, \u0430\u0431\u043e \u0456\u043d\u0448\u0430\u0439 \u043f\u0440\u0430\u0433\u0440\u0430\u043c\u044b \u0451\u0441\u0446\u044c \u0433\u044d\u0442\u0430 \u0437\u0430\u043c\u043a\u043d\u0451\u043d\u044b\u043c. \u0423 \u043b\u044e\u0431\u044b\u043c \u0432\u044b\u043f\u0430\u0434\u043a\u0443, \u043c\u044b \u043d\u0435 \u043c\u0430\u0433\u043b\u0456 \u0430\u0442\u0440\u044b\u043c\u0430\u0446\u044c \u0434\u0430 \u044f\u0433\u043e \u0434\u043e\u0441\u0442\u0443\u043f.",
														"No s'ha pogut trobar el fitxer xlsx a googleFU / Actius / Samples / Dades, o altre programa el t\u00e9 bloquejat. De qualsevol manera, no podria accedir-hi.",
														"Nelze naj\u00edt soubor XLSX na GoogleFu / aktiva / samples / dat nebo jin\u00e9ho programu je, \u017ee jsou zam\u010den\u00e9. A\u0165 tak \u010di onak, my jsme nemohli p\u0159istupovat.",
														"Methu canfod y ffeil xlsx yn GoogleFu Samplau / Data, neu raglen / Asedau / un arall wedi ei gloi. Naill ffordd neu'r llall, nid oeddem yn gallu cael mynediad iddo.",
														"Ei leia xlsx faili GoogleFu / Assets / proovid / andmed, v\u00f5i m\u00f5ni teine \u200b\u200bprogramm on see lukus. Nii v\u00f5i teisiti, me ei saa seda kasutada.",
														"\u0642\u0627\u062f\u0631 \u0628\u0647 \u067e\u06cc\u062f\u0627 \u06a9\u0631\u062f\u0646 \u0641\u0627\u06cc\u0644 XLSX \u062f\u0631 GoogleFu / \u062f\u0627\u0631\u0627\u06cc\u06cc / \u0646\u0645\u0648\u0646\u0647 / \u062f\u0627\u062f\u0647\u060c \u0648 \u06cc\u0627 \u06cc\u06a9 \u0628\u0631\u0646\u0627\u0645\u0647 \u062f\u06cc\u06af\u0631 \u0622\u0646 \u0631\u0627 \u0642\u0641\u0644 \u0634\u062f\u0647 \u0627\u0633\u062a. \u062f\u0631 \u0647\u0631 \u0635\u0648\u0631\u062a\u060c \u0645\u0627 \u0645\u06cc \u062a\u0648\u0627\u0646\u062f \u0622\u0646 \u062f\u0633\u062a\u0631\u0633\u06cc \u067e\u06cc\u062f\u0627 \u06a9\u0646\u06cc\u062f.",
														"Ei l\u00f6ydy xlsx tiedoston GoogleFu / Assets / n\u00e4ytteet / Data, tai toinen ohjelma on lukittuna. Joko niin, emme voineet k\u00e4ytt\u00e4\u00e4 sit\u00e4.",
														"N\u00edf\u00e9idir teacht ar an gcomhad xlsx ag GoogleFu / S\u00f3cmhainn\u00ed / Sampla\u00ed / Sonra\u00ed, n\u00f3 cl\u00e1r eile a bhfuil faoi ghlas. Sl\u00ed amh\u00e1in n\u00f3 sl\u00ed, n\u00ed raibh muid \u00e1balta rochtain a fh\u00e1il air.",
														"Non se puido atopar o ficheiro xlsx no GoogleFu / Activos / Samples / datos, ou outro programa ten bloqueado. De calquera xeito, non poderiamos acceder a ela.",
														"\u092f\u0939 \u092c\u0902\u0926 \u0939\u0948 GoogleFu / \u0906\u0938\u094d\u0924\u093f\u092f\u094b\u0902 / \u0928\u092e\u0942\u0928\u0947 / \u0921\u093e\u091f\u093e, \u092f\u093e \u0915\u093f\u0938\u0940 \u0905\u0928\u094d\u092f \u0915\u093e\u0930\u094d\u092f\u0915\u094d\u0930\u092e \u092e\u0947\u0902 xlsx \u092b\u093c\u093e\u0907\u0932 \u092a\u093e\u0928\u0947 \u092e\u0947\u0902 \u0905\u0938\u092e\u0930\u094d\u0925. \u092c\u0939\u0930\u0939\u093e\u0932, \u0939\u092e \u0907\u0938\u0947 \u0909\u092a\u092f\u094b\u0917 \u0928\u0939\u0940\u0902 \u0915\u0930 \u0938\u0915\u093e.",
														"Nije mogu\u0107e prona\u0107i xlsx datoteku na GoogleFu / aktiva / uzoraka / podataka, ili nekom drugom programu ima ona zaklju\u010dana. Bilo kako bilo, nismo mogli pristupiti.",
														"Kapab jwenn dosye a kslso nan GoogleFu / Byen / Samples / Done, oswa yon l\u00f2t pwogram gen li f\u00e8men. Nenp\u00f2t fason, nou pa t 'kapab jwenn aks\u00e8 li.",
														"Tidak dapat menemukan file xlsx di GoogleFu / Aset / Sampel / Data, atau program lain memiliki itu terkunci. Either way, kita tidak bisa mengaksesnya.",
