														"\u05dc\u05d0 \u05e0\u05d9\u05ea\u05df \u05dc\u05de\u05e6\u05d5\u05d0 \u05d0\u05ea \u05e7\u05d5\u05d1\u05e5 xlsx \u05d1GoogleFu / \u05e0\u05db\u05e1\u05d9\u05dd / \u05d3\u05d5\u05d2\u05de\u05d0\u05d5\u05ea / \u05e0\u05ea\u05d5\u05e0\u05d9\u05dd, \u05d0\u05d5 \u05ea\u05db\u05e0\u05d9\u05ea \u05d0\u05d7\u05e8\u05ea \u05d9\u05e9 \u05dc\u05d5 \u05e0\u05e2\u05d5\u05dc. \u05db\u05da \u05d0\u05d5 \u05db\u05da, \u05dc\u05d0 \u05d4\u05d9\u05d9\u05e0\u05d5 \u05d9\u05db\u05d5\u05dc\u05d9\u05dd \u05dc\u05d2\u05e9\u05ea \u05d0\u05dc\u05d9\u05d5.",
														"Nepavyko rasti xlsx fail\u0105 i\u0161 \u010dia GoogleFu / Turtas / Pavyzd\u017eiai / Duomen\u0173, ar kitos programos turi ji u\u017erakinta. Bet kokiu atveju, mes negal\u0117jome pasiekti.",
														"Nevar atrast XLSX failu pie GoogleFu / Akt\u012bvu / Paraugi / Data, vai cit\u0101 programm\u0101 ir tas blo\u0137\u0113ta. Katr\u0101 zi\u0146\u0101, m\u0113s nevar\u0113tu piek\u013c\u016bt.",
														"\u041d\u0435 \u043c\u043e\u0436\u0430\u043c \u0434\u0430 \u043d\u0430\u0458\u0434\u0430\u043c \u043d\u0430 xlsx \u0434\u0430\u0442\u043e\u0442\u0435\u043a\u0430 \u0432\u043e GoogleFu / \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0430 / \u041f\u0440\u0438\u043c\u0435\u0440\u043e\u0446\u0438 / \u043f\u043e\u0434\u0430\u0442\u043e\u0446\u0438, \u0438\u043b\u0438 \u0434\u0440\u0443\u0433\u0430 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u0430 \u0438\u043c\u0430 \u0437\u0430\u043a\u043b\u0443\u0447\u0435\u043d\u0430. \u0412\u043e \u0441\u0435\u043a\u043e\u0458 \u0441\u043b\u0443\u0447\u0430\u0458, \u043d\u0438\u0435 \u043d\u0435 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0434\u043e\u0458\u0434\u0435 \u0434\u043e \u043d\u0435\u0430.",
														"Tidak dapat mencari fail xlsx di GoogleFu / Aset / Sampel / data, atau program lain mempunyai ia dikunci. Sama ada cara, kita tidak boleh mengaksesnya.",
														"Kapa\u010bi li ssib il-fajl xlsx fil GoogleFu Assets / Kampjuni / Data, jew programm / ie\u0127or g\u0127andu dan msakkra. Jew il-mod, a\u0127na ma setg\u0127ux a\u010b\u010bess g\u0127aliha.",
														"\u00c5 finne den xlsx fil GoogleFu / eiendeler / Samples / data, eller et annet program har den l\u00e5st ute av stand. Uansett, vi kunne ikke tilgang til den.",
														"Nie mo\u017cna odnale\u017a\u0107 pliku xlsx w GoogleFu / assets / pr\u00f3bek / danych lub innego programu ma on zablokowany. Tak czy inaczej, nie mo\u017cemy do niego dost\u0119p.",
														"N\u00e3o foi poss\u00edvel encontrar o arquivo xlsx no GoogleFu / Ativos / Samples / dados, ou outro programa tem bloqueado. De qualquer maneira, n\u00e3o poder\u00edamos acess\u00e1-lo.",
														"Imposibil de g\u0103sit fi\u0219ierul xlsx la GoogleFu / Active / probe / date, sau un alt program are \u00eencuiat. Oricum, noi nu-l putea accesa.",
														"Nemo\u017eno n\u00e1js\u0165 s\u00fabor XLSX na GoogleFu / akt\u00edva / samples / d\u00e1t alebo in\u00e9ho programu je, \u017ee s\u00fa zamknut\u00e9. \u010ci tak alebo onak, my sme nemohli pristupova\u0165.",
														"Ne morem najti datoteko xlsx na GoogleFu / sredstva / Vzorci / podatkov ali drugega programa, je bilo zaklenjeno. Kakorkoli, nismo mogli dostopiti.",
