			Rows.Add( new LocalizationRow("To acess private Google Spreadsheets tied to your Google Drive, you must provide your Google User name and Password.\n \nSecurity Warning: Credentials are saved in the EditorPrefs, which are plain text. This is so the plugin can automatically log in when the window is closed, or between sessions. If you Log Out manually after every session, the variables are cleared.  \n\nLogging in with a Google account is not necessary, however you will only be allowed to access published spreadsheets.",
														"Pour acess Tableur Google priv\u00e9es li\u00e9es \u00e0 votre Google Drive, vous devez fournir votre nom d'utilisateur et mot de passe Google.\n\u00a0\nAvertissement de s\u00e9curit\u00e9: Les pouvoirs sont enregistr\u00e9s dans les EditorPrefs, qui sont texte brut. Il en est ainsi du plugin peut automatiquement se connecter lorsque la fen\u00eatre est ferm\u00e9e, ou entre les sessions. Si vous vous d\u00e9connectez manuellement apr\u00e8s chaque session, les variables sont effac\u00e9es.\n\nConnexion avec un compte Google n'est pas n\u00e9cessaire, mais vous ne serez autoris\u00e9 \u00e0 acc\u00e9der \u00e0 des feuilles de calcul publi\u00e9es.",
														"Per acess fogli di calcolo di Google private legate al tuo Google Drive, \u00e8 necessario fornire il proprio nome utente e la password di Google.\n\u00a0\nAvviso di protezione: Le credenziali vengono salvate nei EditorPrefs, che sono testo normale. Questo \u00e8 in modo che il plugin pu\u00f2 accedere automaticamente quando la finestra \u00e8 chiusa, o tra le sessioni. Se ci si disconnette manualmente dopo ogni sessione, le variabili vengono cancellati.\n\nL'accesso con un account Google non \u00e8 necessario, tuttavia vi sar\u00e0 consentito solo per accedere a fogli di calcolo pubblicati.",
														"An private Google Spreadsheets, um Ihre Google Drive gebunden Acess, m\u00fcssen Sie Ihr Google-Benutzernamen und das Passwort angeben.\n\u00a0\nSicherheitswarnung: Die Anmeldeinformationen werden in den EditorPrefs, die Klartext gespeichert werden. Das ist so das Plugin automatisch anmelden, wenn das Fenster geschlossen ist, oder zwischen den Sitzungen. Wenn Sie sich abmelden manuell nach jeder Sitzung werden die Variablen gel\u00f6scht.\n\nAnmeldung mit einem Google-Konto ist nicht n\u00f6tig, aber Sie werden nur erlaubt, ver\u00f6ffentlichten Tabellen zuzugreifen.",
														"Para acess Hojas de c\u00e1lculo de Google privadas vinculadas a Google Drive, usted debe proporcionar su nombre de usuario y contrase\u00f1a de Google.\n\u00a0\nAdvertencia de seguridad: Las credenciales se guardan en los EditorPrefs, que son de texto plano. Esto es lo que el lector puede conectarse autom\u00e1ticamente cuando se cierra la ventana, o entre las sesiones. Si se desconecta de forma manual despu\u00e9s de cada sesi\u00f3n, se borran las variables.\n\nInicio de una sesi\u00f3n con una cuenta de Google, no es necesario, sin embargo, tendr\u00e1 s\u00f3lo permitir\u00e1 acceder a las hojas de c\u00e1lculo publicadas.",
														"\u0627\u0644\u0633\u0646\u0629 \u0627\u0644\u062d\u0627\u0644\u064a\u0629 \u0625\u0644\u0649 \u062c\u062f\u0627\u0648\u0644 \u062c\u0648\u062c\u0644 \u062e\u0627\u0635\u0629 \u0645\u0631\u062a\u0628\u0637\u0629 \u0645\u062d\u0631\u0643 \u062c\u0648\u062c\u0644 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643\u060c \u064a\u062c\u0628 \u062a\u0648\u0641\u064a\u0631 \u062c\u0648\u062c\u0644 \u0627\u0633\u0645 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0648\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0643.\n\u00a0\n\u062a\u062d\u0630\u064a\u0631 \u0623\u0645\u0646\u064a: \u064a\u062a\u0645 \u062d\u0641\u0638 \u0648\u062b\u0627\u0626\u0642 \u0627\u0644\u062a\u0641\u0648\u064a\u0636 \u0641\u064a EditorPrefs\u060c \u0648\u0627\u0644\u062a\u064a \u0647\u064a \u0646\u0635 \u0639\u0627\u062f\u064a. \u0647\u0630\u0627 \u0647\u0648 \u0630\u0644\u0643 \u0627\u0644\u0628\u0631\u0646\u0627\u0645\u062c \u0627\u0644\u0645\u0633\u0627\u0639\u062f \u064a\u0645\u0643\u0646 \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644 \u062a\u0644\u0642\u0627\u0626\u064a\u0627 \u0641\u064a \u0639\u0646\u062f \u0625\u063a\u0644\u0627\u0642 \u0646\u0627\u0641\u0630\u0629\u060c \u0623\u0648 \u0628\u064a\u0646 \u0627\u0644\u062f\u0648\u0631\u0627\u062a. \u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062e\u0631\u0648\u062c \u064a\u062f\u0648\u064a\u0627 \u0628\u0639\u062f \u0643\u0644 \u062f\u0648\u0631\u0629\u060c \u064a\u062a\u0645 \u0645\u0633\u062d \u0627\u0644\u0645\u062a\u063a\u064a\u0631\u0627\u062a.\n\n\u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u062d\u0633\u0627\u0628 Google \u0644\u064a\u0633\u062a \u0636\u0631\u0648\u0631\u064a\u0629\u060c \u0648\u0644\u0643\u0646 \u0633\u0648\u0641 \u064a\u0633\u0645\u062d \u0644\u0643 \u0641\u0642\u0637 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u062c\u062f\u0627\u0648\u0644 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0645\u0646\u0634\u0648\u0631\u0629.",
														"\uadc0\ud558\uc758 Google \ub4dc\ub77c\uc774\ube0c\uc5d0 \ubb36\uc5ec \uac1c\uc778 \uad6c\uae00 \uc2a4\ud504\ub808\ub4dc \uc2dc\ud2b8 \uc774\ud6c4 \ub3d9\uc791\uc744 \uc9c4\ud589\ud558\ub824\uba74 \uad6c\uae00\uc758 \uc0ac\uc6a9\uc790 \uc774\ub984\uacfc \uc554\ud638\ub97c \uc81c\uacf5\ud574\uc57c\ud569\ub2c8\ub2e4.\n\u00a0\n\ubcf4\uc548 \uacbd\uace0 : \uc790\uaca9 \uc99d\uba85\uc740 \uc77c\ubc18 \ud14d\uc2a4\ud2b8 \uc544\ub974 EditorPrefs\uc5d0 \uc800\uc7a5\ub429\ub2c8\ub2e4. \uc774 \ub54c\ubb38\uc5d0 \ud50c\ub7ec\uadf8\uc778\uc740 \uc790\ub3d9\uc73c\ub85c \ucc3d\uc744 \ub2eb\uc73c\uba74 \ub85c\uadf8\uc778\ud558\uac70\ub098 \uc138\uc158 \uc0ac\uc774 \uc218\uc788\ub2e4. \ub2f9\uc2e0 \uc138\uc158\uc774 \ub05d\ub0a0 \ub54c\ub9c8\ub2e4 \uc218\ub3d9\uc73c\ub85c \ub85c\uadf8 \uc544\uc6c3\ud558\ub294 \uacbd\uc6b0, \ubcc0\uc218\ub294 \uc0ad\uc81c\ub429\ub2c8\ub2e4.\n\nGoogle \uacc4\uc815\uc73c\ub85c \ub85c\uadf8\uc778\ud558\uba74 \ud544\uc694\uac00 \uc5c6\uc2b5\ub2c8\ub2e4, \uadf8\ub7ec\ub098 \ub2f9\uc2e0\uc740 \ub2e8\uc9c0 \ubc1c\ud589 \uc2a4\ud504\ub808\ub4dc \uc2dc\ud2b8\uc5d0 \uc561\uc138\uc2a4 \ud560 \uc218\ub429\ub2c8\ub2e4.",
														"\u4e3a\u4e86\u63a5\u53d6\u79c1\u4eba\u8c37\u6b4c\u7535\u5b50\u8868\u683c\u4e0e\u60a8\u7684\u8c37\u6b4c\u9a71\u52a8\u5668\uff0c\u60a8\u5fc5\u987b\u63d0\u4f9b\u8c37\u6b4c\u7528\u6237\u540d\u548c\u5bc6\u7801\u3002\n\u00a0\n\u5b89\u5168\u8b66\u544a\uff1a\u8bc1\u4e66\u4fdd\u5b58\u5728EditorPrefs\uff0c\u8fd9\u662f\u7eaf\u6587\u672c\u3002\u8fd9\u662f\u4e3a\u4e86\u8ba9\u63d2\u4ef6\u53ef\u4ee5\u81ea\u52a8\u5728\u7a97\u53e3\u5173\u95ed\u767b\u5f55\uff0c\u6216\u4f1a\u8bdd\u4e4b\u95f4\u3002\u5982\u679c\u4f60\u6bcf\u6b21\u4f1a\u8bae\u540e\u624b\u52a8\u6ce8\u9500\uff0c\u53d8\u91cf\u5c06\u88ab\u6e05\u9664\u3002\n\n\u6709\u4e00\u4e2a\u8c37\u6b4c\u5e10\u6237\u767b\u5f55\u662f\u6ca1\u6709\u5fc5\u8981\u7684\uff0c\u4f46\u662f\u4f60\u53ea\u88ab\u5141\u8bb8\u8bbf\u95ee\u53d1\u5e03\u7684\u7535\u5b50\u8868\u683c\u3002",
														"Google\u30c9\u30e9\u30a4\u30d6\u306b\u63a5\u7d9a\u3055\u308c\u305f\u6c11\u9593\u306eGoogle\u30b9\u30d7\u30ec\u30c3\u30c9\u30b7\u30fc\u30c8\u3092\u30a2\u30bb\u30b9\u3059\u308b\u305f\u3081\u306b\u306f\u3001Google\u306e\u30e6\u30fc\u30b6\u30fc\u540d\u3068\u30d1\u30b9\u30ef\u30fc\u30c9\u3092\u5165\u529b\u3059\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u3059\u3002\n\u00a0\n\u30bb\u30ad\u30e5\u30ea\u30c6\u30a3\u8b66\u544a\uff1a\u8cc7\u683c\u60c5\u5831\u304c\u30d7\u30ec\u30fc\u30f3\u30c6\u30ad\u30b9\u30c8\u3067\u3042\u308bEditorPrefs\u3001\u306b\u4fdd\u5b58\u3055\u308c\u307e\u3059\u3002\u3053\u308c\u306f\u30d7\u30e9\u30b0\u30a4\u30f3\u304c\u81ea\u52d5\u7684\u306b\u30a6\u30a3\u30f3\u30c9\u30a6\u304c\u9589\u3058\u3089\u308c\u305f\u3068\u304d\u306b\u30ed\u30b0\u30a4\u30f3\u3059\u308b\u304b\u3001\u30bb\u30c3\u30b7\u30e7\u30f3\u9593\u3067\u3067\u304d\u3066\u3044\u308b\u3002\u3042\u306a\u305f\u306f\u3059\u3079\u3066\u306e\u30bb\u30c3\u30b7\u30e7\u30f3\u306e\u5f8c\u3001\u624b\u52d5\u3067\u30ed\u30b0\u30a2\u30a6\u30c8\u3057\u305f\u5834\u5408\u3001\u5909\u6570\u306f\u30af\u30ea\u30a2\u3055\u308c\u307e\u3059\u3002\n\nGoogle\u30a2\u30ab\u30a6\u30f3\u30c8\u3067\u306e\u30ed\u30b0\u30a4\u30f3\u3059\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u305b\u3093\u304c\u3001\u3057\u304b\u3057\u3001\u3042\u306a\u305f\u306f\u552f\u4e00\u306e\u516c\u958b\u3055\u308c\u305f\u30b9\u30d7\u30ec\u30c3\u30c9\u30b7\u30fc\u30c8\u3078\u306e\u30a2\u30af\u30bb\u30b9\u304c\u8a31\u53ef\u3055\u308c\u307e\u3059\u3002",
														"\u0414\u043b\u044f \u0410\u0441\u0435\u0441\u0441 \u043b\u0438\u0447\u043d\u044b\u0435 \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u044b\u0435 \u0442\u0430\u0431\u043b\u0438\u0446\u044b Google, \u043f\u0440\u0438\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0435 \u043a \u0432\u0430\u0448\u0435\u043c\u0443 Google Drive, \u0432\u044b \u0434\u043e\u043b\u0436\u043d\u044b \u0443\u043a\u0430\u0437\u0430\u0442\u044c \u0441\u0432\u043e\u0439 Google \u0438\u043c\u044f \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044f \u0438 \u043f\u0430\u0440\u043e\u043b\u044c.\n\u00a0\n\u041f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u043e \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438: \u0423\u0447\u0435\u0442\u043d\u044b\u0435 \u0434\u0430\u043d\u043d\u044b\u0435 \u0441\u043e\u0445\u0440\u0430\u043d\u044f\u044e\u0442\u0441\u044f \u0432 EditorPrefs, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043e\u0431\u044b\u0447\u043d\u044b\u0439 \u0442\u0435\u043a\u0441\u0442. \u042d\u0442\u043e \u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u043f\u043b\u0430\u0433\u0438\u043d \u043c\u043e\u0436\u0435\u0442 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0432\u043e\u0439\u0442\u0438, \u043a\u043e\u0433\u0434\u0430 \u043e\u043a\u043d\u043e \u0437\u0430\u043a\u0440\u044b\u0432\u0430\u0435\u0442\u0441\u044f, \u0438\u043b\u0438 \u043c\u0435\u0436\u0434\u0443 \u0441\u0435\u0441\u0441\u0438\u044f\u043c\u0438. \u0415\u0441\u043b\u0438 \u0432\u044b \u0412\u044b\u0445\u043e\u0434 \u0432\u0440\u0443\u0447\u043d\u0443\u044e \u043f\u043e\u0441\u043b\u0435 \u043a\u0430\u0436\u0434\u043e\u0439 \u0441\u0435\u0441\u0441\u0438\u0438, \u043f\u0435\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0435 \u043e\u0447\u0438\u0449\u0430\u044e\u0442\u0441\u044f.\n\n\u0412\u0445\u043e\u0434 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0443 \u0441 \u0443\u0447\u0435\u0442\u043d\u043e\u0439 Google \u043d\u0435 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u044b\u043c, \u043e\u0434\u043d\u0430\u043a\u043e \u0432\u0430\u043c \u0431\u0443\u0434\u0435\u0442 \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u043e \u0442\u043e\u043b\u044c\u043a\u043e \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0430 \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u0442\u0430\u0431\u043b\u0438\u0446\u044b.",
														"\u0110\u1ec3 acess Google Spreadsheets tin g\u1eafn li\u1ec1n v\u1edbi Google Drive c\u1ee7a b\u1ea1n, b\u1ea1n ph\u1ea3i cung c\u1ea5p t\u00ean t\u00e0i kho\u1ea3n Google c\u1ee7a b\u1ea1n v\u00e0 m\u1eadt kh\u1ea9u.\n\u00a0\nC\u1ea3nh b\u00e1o an ninh: Gi\u00e2y ch\u1ee9ng nh\u1eadn s\u1ebd \u0111\u01b0\u1ee3c l\u01b0u trong EditorPrefs, \u0111\u00f3 l\u00e0 v\u0103n b\u1ea3n \u0111\u01a1n gi\u1ea3n. \u0110i\u1ec1u n\u00e0y l\u00e0 \u0111\u1ec3 c\u00e1c plugin c\u00f3 th\u1ec3 t\u1ef1 \u0111\u1ed9ng \u0111\u0103ng nh\u1eadp khi c\u1eeda s\u1ed5 \u0111\u01b0\u1ee3c \u0111\u00f3ng l\u1ea1i, ho\u1eb7c gi\u1eefa phi\u00ean. N\u1ebfu b\u1ea1n Log Out tay sau m\u1ed7i phi\u00ean, c\u00e1c bi\u1ebfn s\u1ebd b\u1ecb x\u00f3a.\n\n\u0110\u0103ng nh\u1eadp v\u1edbi m\u1ed9t t\u00e0i kho\u1ea3n Google l\u00e0 kh\u00f4ng c\u1ea7n thi\u1ebft, tuy nhi\u00ean b\u1ea1n s\u1ebd ch\u1ec9 \u0111\u01b0\u1ee3c ph\u00e9p truy c\u1eadp v\u00e0o c\u00e1c b\u1ea3ng t\u00ednh \u0111\u01b0\u1ee3c xu\u1ea5t b\u1ea3n.",
														"Aan particuliere Google Spreadsheets gekoppeld aan uw Google Drive acess, moet u uw Google-gebruikersnaam en wachtwoord te verstrekken.\n\u00a0\nBeveiligingswaarschuwing: Geloofsbrieven worden opgeslagen in de EditorPrefs, die platte tekst zijn. Dit is dus de plugin kan automatisch inloggen wanneer het venster gesloten is, of tussen sessies. Als u handmatig Afmelden na elke sessie, worden de variabelen gewist.\n\nInloggen met een Google-account is niet nodig, maar je zal alleen worden toegestaan \u200b\u200bvoor toegang tot gepubliceerde spreadsheets.",
														"Private Google Spreadsheets gekoppel is aan jou Google Drive te Toegang, moet jy jou Google gebruikers naam en wagwoord verskaf.\n\u00a0\nSekuriteit Waarskuwing: Bewyse word gestoor in die EditorPrefs wat plain text. Dit is so die prop kan outomaties aanmeld wanneer die venster is gesluit, of tussen sessies. As jy 'Teken uit die hand na elke sessie, is die veranderlikes skoongemaak.\n\nTeken met 'n Google-rekening is nie nodig nie, maar jy sal slegs toegelaat word gepubliseer spread om toegang te verkry.",
														"\u0417\u0430 \u0434\u0430 Acess \u0447\u0430\u0441\u0442\u043d\u0438 Spreadsheets Google \u043e\u0431\u0432\u044a\u0440\u0437\u0430\u043d\u0438 \u0441 \u0432\u0430\u0448\u0438\u044f Google Drive, \u0442\u0440\u044f\u0431\u0432\u0430 \u0434\u0430 \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u0435 \u043d\u0430 \u0432\u0430\u0448\u0438\u044f Google \u043f\u043e\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u0441\u043a\u043e \u0438\u043c\u0435 \u0438 \u043f\u0430\u0440\u043e\u043b\u0430.\n\u00a0\n\u041f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u0437\u0430 \u0441\u0438\u0433\u0443\u0440\u043d\u043e\u0441\u0442\u0442\u0430: \u043f\u044a\u043b\u043d\u043e\u043c\u043e\u0449\u0438\u044f \u0441\u0430 \u0437\u0430\u043f\u0438\u0441\u0430\u043d\u0438 \u0432 EditorPrefs, \u043a\u043e\u0438\u0442\u043e \u0441\u0430 \u043e\u0431\u0438\u043a\u043d\u043e\u0432\u0435\u043d \u0442\u0435\u043a\u0441\u0442. \u0422\u043e\u0432\u0430 \u0435 \u0442\u0430\u043a\u0430 \u043f\u043b\u044a\u0433\u0438\u043d\u0430 \u043c\u043e\u0436\u0435 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0434\u0430 \u0432\u043b\u0435\u0437\u0435\u0442\u0435 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0430\u0442\u0430, \u043a\u043e\u0433\u0430\u0442\u043e \u043f\u0440\u043e\u0437\u043e\u0440\u0435\u0446\u044a\u0442 \u0435 \u0437\u0430\u0442\u0432\u043e\u0440\u0435\u043d, \u0438\u043b\u0438 \u043c\u0435\u0436\u0434\u0443 \u0441\u0435\u0441\u0438\u0438. \u0410\u043a\u043e \u0438\u0437\u043b\u0435\u0437\u0435\u0442\u0435 \u0440\u044a\u0447\u043d\u043e \u0441\u043b\u0435\u0434 \u0432\u0441\u044f\u043a\u0430 \u0441\u0435\u0441\u0438\u044f, \u043f\u0440\u043e\u043c\u0435\u043d\u043b\u0438\u0432\u0438\u0442\u0435 \u0441\u0435 \u0438\u0437\u0447\u0438\u0441\u0442\u0432\u0430\u0442.\n\n\u0412\u043b\u0438\u0437\u0430\u043d\u0435 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0430\u0442\u0430 \u0441 \u0430\u043a\u0430\u0443\u043d\u0442 \u043d\u0430 Google \u043d\u0435 \u0435 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e, \u043e\u0431\u0430\u0447\u0435, \u0449\u0435 \u0431\u044a\u0434\u0435 \u043f\u043e\u0437\u0432\u043e\u043b\u0435\u043d\u043e \u0441\u0430\u043c\u043e \u0437\u0430 \u0434\u043e\u0441\u0442\u044a\u043f \u0434\u043e \u043f\u0443\u0431\u043b\u0438\u043a\u0443\u0432\u0430\u043d\u0438 \u0435\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u0438 \u0442\u0430\u0431\u043b\u0438\u0446\u0438.",
														"\u0414\u043b\u044f \u0410\u0441\u0435\u0441\u0441 \u0430\u0441\u0430\u0431\u0456\u0441\u0442\u044b\u044f \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u044b\u044f \u0442\u0430\u0431\u043b\u0456\u0446\u044b Google, \u043f\u0440\u044b\u0432\u044f\u0437\u0430\u043d\u044b\u044f \u0434\u0430 \u0432\u0430\u0448\u0430\u0433\u0430 Google Drive, \u0432\u044b \u043f\u0430\u0432\u0456\u043d\u043d\u044b \u043f\u0430\u0437\u043d\u0430\u0447\u044b\u0446\u044c \u0441\u0432\u043e\u0439 Google \u0456\u043c\u044f \u043a\u0430\u0440\u044b\u0441\u0442\u0430\u043b\u044c\u043d\u0456\u043a\u0430 \u0456 \u043f\u0430\u0440\u043e\u043b\u044c.\n\u00a0\n\u041f\u0430\u043f\u044f\u0440\u044d\u0434\u0436\u0430\u043d\u043d\u0435 \u0430\u0431 \u0431\u044f\u0441\u043f\u0435\u0446\u044b: \u0423\u043b\u0456\u043a\u043e\u0432\u044b\u044f \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u044f \u0437\u0430\u0445\u043e\u045e\u0432\u0430\u044e\u0446\u0446\u0430 \u045e EditorPrefs, \u044f\u043a\u0456\u044f \u0437\u0432\u044b\u0447\u0430\u0439\u043d\u044b \u0442\u044d\u043a\u0441\u0442. \u0413\u044d\u0442\u0430 \u0442\u0430\u043c\u0443 \u0443\u0431\u0443\u0434\u043e\u0432\u0430 \u043c\u043e\u0436\u0430 \u0430\u045e\u0442\u0430\u043c\u0430\u0442\u044b\u0447\u043d\u0430 \u045e\u0432\u0430\u0439\u0441\u0446\u0456, \u043a\u0430\u043b\u0456 \u0430\u043a\u043d\u043e \u0437\u0430\u043a\u0440\u044b\u0432\u0430\u0435\u0446\u0446\u0430, \u0430\u0431\u043e \u043f\u0430\u043c\u0456\u0436 \u0441\u0435\u0441\u0456\u044f\u043c\u0456. \u041a\u0430\u043b\u0456 \u0432\u044b \u0412\u044b\u0445\u0430\u0434 \u045e\u0440\u0443\u0447\u043d\u0443\u044e \u043f\u0430\u0441\u043b\u044f \u043a\u043e\u0436\u043d\u0430\u0439 \u0441\u0435\u0441\u0456\u0456, \u0437\u043c\u0435\u043d\u043d\u044b\u044f \u0447\u044b\u0441\u0446\u044f\u0446\u0446\u0430.\n\n\u0423\u0432\u0430\u0445\u043e\u0434 \u0443 \u0441\u0456\u0441\u0442\u044d\u043c\u0443 \u0437 \u0443\u043b\u0456\u043a\u043e\u0432\u0430\u0439 Google \u043d\u0435 \u0437'\u044f\u045e\u043b\u044f\u0435\u0446\u0446\u0430 \u043d\u0435\u0430\u0431\u0445\u043e\u0434\u043d\u044b\u043c, \u0430\u0434\u043d\u0430\u043a \u0432\u0430\u043c \u0431\u0443\u0434\u0437\u0435 \u0434\u0430\u0437\u0432\u043e\u043b\u0435\u043d\u0430 \u0442\u043e\u043b\u044c\u043a\u0456 \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0430\u043f\u0443\u0431\u043b\u0456\u043a\u0430\u0432\u0430\u043d\u044b\u044f \u0442\u0430\u0431\u043b\u0456\u0446\u044b.",
														"Per acess Fulls de c\u00e0lcul de Google privades vinculades a Google Drive, vost\u00e8 ha de proporcionar el seu nom d'usuari i contrasenya de Google.\n\u00a0\nAdvert\u00e8ncia de seguretat: Les credencials es guarden en els EditorPrefs, que s\u00f3n de text pla. Aix\u00f2 \u00e9s el que el lector pot connectar autom\u00e0ticament quan es tanca la finestra, o entre les sessions. Si es desconnecta de forma manual despr\u00e9s de cada sessi\u00f3, s'esborren les variables.\n\nInici d'una sessi\u00f3 amb un compte de Google, no cal, per\u00f2, tindr\u00e0 nom\u00e9s permetr\u00e0 accedir als fulls de c\u00e0lcul publicades.",
														"Acess soukrom\u00e9 tabulkov\u00e9ho procesoru Google v\u00e1zan\u00e9 na Disku Google, mus\u00edte zadat sv\u016fj Google u\u017eivatelsk\u00e9 jm\u00e9no a heslo.\n\u00a0\nBezpe\u010dnostn\u00ed upozorn\u011bn\u00ed: Pov\u011b\u0159en\u00ed jsou ulo\u017eeny v EditorPrefs, kter\u00e9 jsou prost\u00fd text. To je tak plugin automaticky p\u0159ihl\u00e1sit p\u0159i zav\u0159en\u00e9m okn\u011b, nebo mezi zased\u00e1n\u00edmi. Pokud Odhl\u00e1sit se ru\u010dn\u011b po ka\u017ed\u00e9m zased\u00e1n\u00ed, prom\u011bnn\u00e9 jsou vymaz\u00e1ny.\n\nP\u0159ihl\u00e1\u0161en\u00ed k \u00fa\u010dtu Google nen\u00ed nutn\u00e9, ale budete moci p\u0159istupovat pouze k publikovan\u00e9 tabulky.",
														"I Acess Taenlenni Google preifat ynghlwm wrth eich Google Drive, rhaid i chi ddarparu eich enw defnyddiwr Google a'ch Cyfrinair.\n\u00a0\nRhybudd Diogelwch: Cymwysterau yn cael eu cadw yn y EditorPrefs, sef testun plaen. Mae hyn yn fel y gall y ategyn fewngofnodi yn awtomatig yn pan fydd y ffenestr ar gau, neu rhwng sesiynau. Os byddwch yn Allgofnodi llaw ar \u00f4l pob sesiwn, y newidynnau yn cael eu clirio.\n\nNid fewngofnodi gydag cyfrif Google yn angenrheidiol, fodd bynnag, byddwch yn unig yn cael mynediad taenlenni cyhoeddedig.",
														"Juurdep\u00e4\u00e4su, era Google arvutustabelid seotud teie Google Drive, peate esitama oma Google kasutajanimi ja parool.\n\u00a0\nSecurity Warning: volikirjad salvestatakse EditorPrefs, mis on tavaline teksti. See on nii plugin automaatselt sisse, kui aken on suletud v\u00f5i istungite vahelisel ajal. Kui v\u00e4lja logida k\u00e4sitsi p\u00e4rast iga sessiooni muutujad on kustutatud.\n\nLogides sisse Google'i konto ei ole vaja, aga sa ainult lubada juurdep\u00e4\u00e4s avaldatud tabeleid.",
														"\u0628\u0647 \u0631\u0627\u0647\u06cc\u0627\u0628\u06cc \u06af\u0633\u062a\u0631\u062f\u0647 \u062e\u0635\u0648\u0635\u06cc \u06af\u0648\u06af\u0644 \u06af\u0631\u0647 \u062e\u0648\u0631\u062f\u0647 \u0627\u0633\u062a \u0628\u0647 \u06af\u0648\u06af\u0644 \u062f\u0631\u0627\u06cc\u0648 \u062e\u0648\u062f\u060c \u0634\u0645\u0627 \u0628\u0627\u06cc\u062f \u0646\u0627\u0645 \u06a9\u0627\u0631\u0628\u0631\u06cc \u062e\u0648\u062f \u0631\u0627 \u06af\u0648\u06af\u0644 \u0648 \u0631\u0645\u0632 \u0639\u0628\u0648\u0631 \u0641\u0631\u0627\u0647\u0645 \u0645\u06cc \u06a9\u0646\u062f.\n\u00a0\n\u0627\u0645\u0646\u06cc\u062a \u0647\u0634\u062f\u0627\u0631: \u0627\u0639\u062a\u0628\u0627\u0631 \u0646\u0627\u0645\u0647 \u062f\u0631 EditorPrefs\u060c \u06a9\u0647 \u0645\u062a\u0646 \u0633\u0627\u062f\u0647 \u0630\u062e\u06cc\u0631\u0647 \u0634\u062f\u0647 \u0627\u0633\u062a. \u0627\u06cc\u0646 \u0627\u0633\u062a \u062a\u0627 \u0627\u06cc\u0646 \u0627\u0641\u0632\u0648\u0646\u0647 \u0628\u0647 \u0637\u0648\u0631 \u062e\u0648\u062f\u06a9\u0627\u0631 \u0627\u0632 \u0648\u0631\u0648\u062f \u0647\u0646\u06af\u0627\u0645\u06cc \u06a9\u0647 \u067e\u0646\u062c\u0631\u0647 \u0628\u0633\u062a\u0647 \u0627\u0633\u062a\u060c \u0648 \u06cc\u0627 \u0628\u06cc\u0646 \u062c\u0644\u0633\u0627\u062a. \u0627\u06af\u0631 \u062e\u0631\u0648\u062c \u0627\u0632 \u0633\u06cc\u0633\u062a\u0645 \u062f\u0633\u062a\u06cc \u0628\u0639\u062f \u0627\u0632 \u0647\u0631 \u062c\u0644\u0633\u0647\u060c \u0645\u062a\u063a\u06cc\u0631 \u0647\u0627 \u067e\u0627\u06a9.\n\n\u0648\u0631\u0648\u062f \u0628\u0647 \u0633\u06cc\u0633\u062a\u0645 \u0628\u0627 \u062d\u0633\u0627\u0628 \u06af\u0648\u06af\u0644 \u0644\u0627\u0632\u0645 \u0646\u06cc\u0633\u062a\u060c \u0628\u0627 \u0627\u06cc\u0646 \u062d\u0627\u0644 \u0634\u0645\u0627 \u0641\u0642\u0637 \u0645\u06cc \u062a\u0648\u0627\u0646\u06cc\u062f \u0627\u062c\u0627\u0632\u0647 \u0628\u0631\u0627\u06cc \u062f\u0633\u062a\u0631\u0633\u06cc \u0628\u0647 \u0635\u0641\u062d\u0627\u062a \u06af\u0633\u062a\u0631\u062f\u0647 \u0645\u0646\u062a\u0634\u0631 \u0634\u062f\u0647 \u0627\u0633\u062a.",
														"Saannissa yksityinen Google Spreadsheets sidottu Google Drive, sinun on annettava Google k\u00e4ytt\u00e4j\u00e4tunnus ja salasana.\n\u00a0\nTurvallisuus Varoitus: valtakirjojen tallennetaan EditorPrefs, jotka ovat pelkk\u00e4\u00e4 teksti\u00e4. T\u00e4m\u00e4 on niin plugin voi automaattisesti sis\u00e4\u00e4n, kun ikkuna suljetaan, tai istuntojen v\u00e4lill\u00e4. Jos kirjaudut ulos manuaalisesti joka istunnon j\u00e4lkeen, muuttujat tyhjennet\u00e4\u00e4n.\n\nKirjautumalla sis\u00e4\u00e4n Google-tili ei ole v\u00e4ltt\u00e4m\u00e4t\u00f6n, mutta sinulla on vain p\u00e4\u00e4sev\u00e4t julkaistu taulukoita.",
														"Chun acess Scarbhileoga Google pr\u00edobh\u00e1ideach ceangailte le do Google Drive, n\u00ed m\u00f3r duit a chur ar f\u00e1il d'ainm \u00fas\u00e1ideora agus Pasfhocal Google.\n\u00a0\nSl\u00e1nd\u00e1il Rabhadh: Dinti\u00far a sh\u00e1bh\u00e1il sa EditorPrefs, a bhfuil gn\u00e1th-th\u00e9acs. T\u00e1 s\u00e9 seo ionas gur f\u00e9idir leis an mbreise\u00e1n log\u00e1il go huathoibr\u00edoch sa nuair a bh\u00edonn an fhuinneog d\u00fanta, n\u00f3 idir seisi\u00fain. M\u00e1 t\u00e1 t\u00fa ag Log\u00e1il Amach l\u00e1imh tar \u00e9is gach seisi\u00fan, na hathr\u00f3ga at\u00e1 glanta.\n\nLog\u00e1il isteach le cuntas Google N\u00ed g\u00e1, \u00e1fach, beidh t\u00fa a chead\u00fa ach amh\u00e1in chun rochtain a fh\u00e1il ar scarbhileoga foilsithe.",
														"Para acceder ao Google Spreadsheets privadas vinculadas ao seu Google Drive, ten que proporcionar o seu nome de usuario e contrasinal de Google.\n\u00a0\nAviso de seguridade: As credenciais son gardadas nos EditorPrefs, que son normais. Isto \u00e9 as\u00ed que o plugin pode facer sesi\u00f3n automaticamente cando a fiestra se peche ou entre as sesi\u00f3ns. Se Sa\u00edr manualmente despois de cada sesi\u00f3n, as variables son borradas.\n\nIniciar sesi\u00f3n cunha conta de Google non \u00e9 necesario, con todo, s\u00f3 se permitir\u00e1 o acceso as follas de c\u00e1lculo publicadas.",
														"\u0905\u092a\u0928\u0947 \u0917\u0942\u0917\u0932 \u0921\u094d\u0930\u093e\u0907\u0935 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092c\u0902\u0927\u0947 \u0928\u093f\u091c\u0940 \u0917\u0942\u0917\u0932 \u0938\u094d\u092a\u094d\u0930\u0947\u0921\u0936\u0940\u091f\u094d\u0938 acess \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f, \u0906\u092a\u0915\u094b \u0905\u092a\u0928\u0947 Google \u0909\u092a\u0928\u093e\u092e \u0914\u0930 \u092a\u093e\u0938\u0935\u0930\u094d\u0921 \u092a\u094d\u0930\u0926\u093e\u0928 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u090f.\n\u00a0\n\u0938\u0941\u0930\u0915\u094d\u0937\u093e \u091a\u0947\u0924\u093e\u0935\u0928\u0940: \u0938\u093e\u0916 \u0938\u093e\u0926\u0947 \u092a\u093e\u0920 \u0939\u0948\u0902 \u091c\u094b EditorPrefs \u092e\u0947\u0902 \u092c\u091a \u0930\u0939\u0947 \u0939\u0948\u0902. \u092f\u0939 \u0924\u094b \u092a\u094d\u0932\u0917\u0907\u0928 \u0938\u094d\u0935\u091a\u093e\u0932\u093f\u0924 \u0930\u0942\u092a \u0938\u0947 \u0916\u093f\u0921\u093c\u0915\u0940 \u092c\u0902\u0926 \u0915\u0930 \u0926\u093f\u092f\u093e \u0939\u0948 \u091c\u092c \u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930\u0947\u0902, \u092f\u093e \u0938\u0924\u094d\u0930 \u0915\u0947 \u092c\u0940\u091a \u092e\u0947\u0902 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948. \u0906\u092a \u0939\u0930 \u0938\u0924\u094d\u0930 \u0915\u0947 \u092c\u093e\u0926 \u092e\u0948\u0928\u094d\u092f\u0941\u0905\u0932 \u0932\u0949\u0917 \u0906\u0909\u091f \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u091a\u0930 \u092e\u0902\u091c\u0942\u0930\u0940 \u0926\u0947 \u0926\u0940 \u0939\u0948.\n\n\u090f\u0915 \u0917\u0942\u0917\u0932 \u0916\u093e\u0924\u0947 \u0915\u0947 \u0938\u093e\u0925 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0947 \u0932\u093f\u090f \u0906\u0935\u0936\u094d\u092f\u0915 \u0928\u0939\u0940\u0902 \u0939\u0948, \u0932\u0947\u0915\u093f\u0928 \u0906\u092a \u0915\u0947\u0935\u0932 \u092a\u094d\u0930\u0915\u093e\u0936\u093f\u0924 \u0938\u094d\u092a\u094d\u0930\u0947\u0921\u0936\u0940\u091f \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0915\u0930\u0928\u0947 \u0915\u0940 \u0905\u0928\u0941\u092e\u0924\u093f \u0926\u0940 \u091c\u093e\u090f\u0917\u0940.",
														"Za acess privatne Google prora\u010dunskih tablica je povezana s Google Drive, morate dati svoj Google korisni\u010dkog imena i lozinke.\n\u00a0\nSigurnost Upozorenje: Mandatno spremaju u EditorPrefs, koji su obi\u010dan tekst. To je tako plugin automatski mo\u017ee prijaviti prozor kada je zatvoren, ili izme\u0111u sjednica. Ako se odjavite ru\u010dno nakon svake sjednice, varijable su izbrisani.\n\nPrijavljivanje s Google ra\u010dunom nije potrebno, ali da \u0107e biti dopu\u0161teno samo za pristup objavljene prora\u010dunske tablice.",
														"Acess prive Google tableur mare nan Google Drive ou, ou dwe bay Tinon Google ou ak yon Modpas.\n\u00a0\nAv\u00e8tisman Sekirite: Kredansy\u00e8l yo te sove nan EditorPrefs yo, ki se t\u00e8ks plenn. Sa a se konsa Plugin la ka otomatikman ouvri sesyon an l\u00e8 se fen\u00e8t la f\u00e8men, oswa ant sesyon yo. Si ou F\u00e8men sesyon an many\u00e8lman apre chak sesyon, varyab yo ap otorize.\n\nLogging nan ak yon kont Google pa neses\u00e8, sepandan ou pral s\u00e8lman ka p\u00e8m\u00e8t yo gen aks\u00e8 a pibliye tableur.",
														"Untuk acess Spreadsheets Google swasta terkait dengan Google Drive Anda, Anda harus menyediakan Google User name dan Password.\n\u00a0\nPeringatan Keamanan: Kredensial akan disimpan dalam EditorPrefs, yang teks biasa. Hal ini begitu plugin otomatis dapat log in ketika jendela ditutup, atau antara sesi. Jika Anda Log Out manual setelah setiap sesi, variabel akan dihapus.\n\nLogin dengan akun Google tidak perlu, namun Anda hanya akan diizinkan untuk mengakses spreadsheet diterbitkan.",
														"A\u00f0 Acess einka Google t\u00f6flureiknum bundin vi\u00f0 Google Drive, ver\u00f0ur \u00fe\u00fa a\u00f0 bj\u00f3\u00f0a upp \u00e1 Google inn Notandanafn og Lykilor\u00f0.\n\u00a0\n\u00d6ryggi Vi\u00f0v\u00f6run: Pers\u00f3nuskilr\u00edki eru vistu\u00f0 \u00ed EditorPrefs, sem eru l\u00e1tlaus texti. \u00deetta er svo tappi getur sj\u00e1lfkrafa inn \u00feegar glugganum er loka\u00f0, e\u00f0a \u00e1 milli fundur. Ef \u00fe\u00fa skr\u00e1ir \u00feig \u00fat handvirkt eftir hverja lotu, eru breytur hreinsa\u00f0ar.\n\nSkr\u00e1 \u00feig inn me\u00f0 Google reikningnum er ekki nau\u00f0synlegt, en \u00fe\u00fa ver\u00f0ur bara a\u00f0 f\u00e1 a\u00f0 sj\u00e1 birtar tafla.",
														"\u05dcAcess \u05d2\u05d9\u05dc\u05d9\u05d5\u05e0\u05d5\u05ea \u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05e0\u05d9\u05d9\u05dd Google \u05e4\u05e8\u05d8\u05d9\u05d9\u05dd \u05e7\u05e9\u05d5\u05e8\u05d9\u05dd \u05dc\u05db\u05d5\u05e0\u05df Google \u05e9\u05dc\u05da, \u05e2\u05dc\u05d9\u05da \u05dc\u05e1\u05e4\u05e7 \u05d0\u05ea \u05d4\u05e9\u05dd \u05e9\u05dc\u05da Google \u05d4\u05de\u05e9\u05ea\u05de\u05e9 \u05d5\u05e1\u05d9\u05e1\u05de\u05d0.\n\u00a0\n\u05d0\u05d6\u05d4\u05e8\u05ea \u05d0\u05d1\u05d8\u05d7\u05d4: \u05d0\u05d9\u05e9\u05d5\u05e8\u05d9\u05dd \u05e0\u05e9\u05de\u05e8\u05d9\u05dd \u05d1EditorPrefs, \u05e9\u05d4\u05dd \u05d8\u05e7\u05e1\u05d8 \u05e8\u05d2\u05d9\u05dc. \u05d6\u05d4 \u05db\u05dc \u05db\u05da \u05d4\u05ea\u05d5\u05e1\u05e3 \u05d9\u05db\u05d5\u05dc \u05d1\u05d0\u05d5\u05e4\u05df \u05d0\u05d5\u05d8\u05d5\u05de\u05d8\u05d9 \u05dc\u05d4\u05ea\u05d7\u05d1\u05e8 \u05db\u05d0\u05e9\u05e8 \u05d4\u05d7\u05dc\u05d5\u05df \u05e1\u05d2\u05d5\u05e8, \u05d0\u05d5 \u05d1\u05d9\u05df \u05e4\u05d2\u05d9\u05e9\u05d5\u05ea. \u05d0\u05dd \u05ea\u05ea\u05e0\u05ea\u05e7 \u05d1\u05d0\u05d5\u05e4\u05df \u05d9\u05d3\u05e0\u05d9 \u05dc\u05d0\u05d7\u05e8 \u05db\u05dc \u05e4\u05d2\u05d9\u05e9\u05d4, \u05d4\u05de\u05e9\u05ea\u05e0\u05d9\u05dd \u05e0\u05de\u05d7\u05e7\u05d9\u05dd.\n\n\u05db\u05e0\u05d9\u05e1\u05d4 \u05e2\u05dd \u05d7\u05e9\u05d1\u05d5\u05df Google \u05d4\u05d9\u05d0 \u05dc\u05d0 \u05d4\u05db\u05e8\u05d7\u05d9\u05ea, \u05d0\u05d1\u05dc \u05d0\u05ea\u05d4 \u05d9\u05d4\u05d9\u05d4 \u05e8\u05e7 \u200b\u200b\u05ea\u05d5\u05e8\u05e9\u05d4 \u05dc\u05d2\u05e9\u05ea \u05dc\u05d2\u05d9\u05dc\u05d9\u05d5\u05e0\u05d5\u05ea \u05e9\u05e4\u05d5\u05e8\u05e1\u05de\u05d5.",
														"Nor\u0117dami Prieigos asmeninius \"Google\" skai\u010diuokl\u0117s susieta su \"Google Drive\", j\u016bs turite pateikti savo \"Google\" vartotojo vard\u0105 ir slapta\u017eod\u012f.\n\u00a0\nSaugumo \u012esp\u0117jimas: kvalifikaciniai i\u0161saugomi EditorPrefs, kurios teksto. Tai taip \u012fskiepiai gali automati\u0161kai prisijungti kai langas u\u017edarytas arba tarp sesij\u0173. Jei Atsijungti rankiniu b\u016bdu, po kiekvieno u\u017esi\u0117mimo, kintamieji yra anuliuojami.\n\nPrisijungimas su \"Google\" paskyros n\u0117ra b\u016btina, ta\u010diau jums bus leista naudotis paskelbtas skai\u010diuokles tik.",
														"Acess priv\u0101t\u0101s Google izkl\u0101jlapas piesaist\u012bt\u0101s Google Drive, jums ir j\u0101sniedz savu Google lietot\u0101ja v\u0101rdu un paroli.\n\u00a0\nDro\u0161\u012bba Br\u012bdin\u0101jums: Kvalifik\u0101cijas dati tiek saglab\u0101tas EditorPrefs, kas ir vienk\u0101r\u0161s teksts. Tas ir tik spraudnis autom\u0101tiski var pieteikties, ja logs ir aizv\u0113rts, vai ar\u012b starp sesij\u0101m. Ja j\u016bs Iziet manu\u0101li p\u0113c katras sesijas, main\u012bgie tiek noskaidroti.\n\nPiesakoties ar Google kontu, nav nepiecie\u0161ams, tom\u0113r jums b\u016bs at\u013cauts tikai, lai piek\u013c\u016btu public\u0113tos izkl\u0101jlapas.",
														"\u0414\u0430 acess \u043f\u0440\u0438\u0432\u0430\u0442\u043d\u0438 Google Spreadsheets \u0432\u0440\u0437\u0430\u043d\u0438 \u0437\u0430 \u0432\u0430\u0448\u0438\u043e\u0442 Google Drive, \u043c\u043e\u0440\u0430 \u0434\u0430 \u0441\u0435 \u043e\u0431\u0435\u0437\u0431\u0435\u0434\u0438 \u0432\u0430\u0448\u0438\u043e\u0442 Google \u043a\u043e\u0440\u0438\u0441\u043d\u0438\u0447\u043a\u043e \u0438\u043c\u0435 \u0438 \u043b\u043e\u0437\u0438\u043d\u043a\u0430.\n\u00a0\n\u0411\u0435\u0437\u0431\u0435\u0434\u043d\u043e\u0441\u043d\u043e \u043f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0434\u0443\u0432\u0430\u045a\u0435: \u0430\u043a\u0440\u0435\u0434\u0438\u0442\u0438\u0432\u043d\u0438\u0442\u0435 \u043f\u0438\u0441\u043c\u0430 \u0441\u0435 \u0437\u0430\u0447\u0443\u0432\u0430\u043d\u0438 \u0432\u043e EditorPrefs, \u043a\u043e\u0438 \u0441\u0435 \u043e\u0431\u0438\u0447\u0435\u043d \u0442\u0435\u043a\u0441\u0442. \u041e\u0432\u0430 \u0435 \u0442\u043e\u043b\u043a\u0443 \u043f\u0440\u0438\u043a\u043b\u0443\u0447\u043e\u043a\u043e\u0442 \u043c\u043e\u0436\u0435 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u0434\u0430 \u0441\u0435 \u043b\u043e\u0433\u0438\u0440\u0430\u0442\u0435 \u043a\u043e\u0433\u0430 \u043f\u0440\u043e\u0437\u043e\u0440\u0435\u0446\u043e\u0442 \u0435 \u0437\u0430\u0442\u0432\u043e\u0440\u0435\u043d, \u0438\u043b\u0438 \u043c\u0435\u0453\u0443 \u0441\u0435\u0441\u0438\u0438. \u0410\u043a\u043e \u041e\u0434\u0458\u0430\u0432\u0438 \u0440\u0430\u0447\u043d\u043e \u043f\u043e\u0441\u043b\u0435 \u0441\u0435\u043a\u043e\u0458\u0430 \u0441\u0435\u0441\u0438\u0458\u0430, \u043f\u0440\u043e\u043c\u0435\u043d\u043b\u0438\u0432\u0438 \u0441\u0435 \u0431\u0440\u0438\u0448\u0430\u0442.\n\n\u0412\u043b\u0435\u0437\u0435\u0442\u0435 \u0432\u043e \u0441\u043e \u0441\u043c\u0435\u0442\u043a\u0430 \u043d\u0430 Google \u043d\u0435 \u0435 \u043d\u0435\u043e\u043f\u0445\u043e\u0434\u043d\u043e, \u043d\u043e \u045c\u0435 \u0438\u043c \u0431\u0438\u0434\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u0435\u043d\u043e \u0434\u0430 \u043f\u0440\u0438\u0441\u0442\u0430\u043f\u0438\u0442\u0435 \u043e\u0431\u0458\u0430\u0432\u0435\u043d\u0438 \u0442\u0430\u0431\u0435\u043b\u0430\u0440\u043d\u0438 \u043f\u0440\u0435\u0441\u043c\u0435\u0442\u043a\u0438.",
														"Untuk acess Spreadsheet Google swasta terikat dengan Google Drive anda, anda perlu memberikan nama pengguna Google dan Kata Laluan.\n\u00a0\nKeselamatan Amaran: Bukti kelayakan yang disimpan di dalam EditorPrefs, yang teks biasa. Ini supaya plugin secara automatik boleh log masuk apabila tetingkap ditutup, atau di antara sesi. Jika anda Daftar keluar secara manual selepas setiap sesi, pembolehubah dijelaskan.\n\nLog masuk dengan akaun Google tidak perlu, tetapi anda hanya dibenarkan untuk mengakses spreadsheet diterbitkan.",
														"Biex a\u010b\u010bess g\u0127at Spreadsheets Google privati \u200b\u200bmarbuta ma 'Google Drive tieg\u0127ek, inti trid tipprovdi ismek User Google u Password.\n\u00a0\nTwissija Sigurt\u00e0: Kredenzjali huma salvati fil-EditorPrefs, li huma test sempli\u010bi. Dan huwa sabiex il-plugin jista 'awtomatikament log fil meta l-tieqa huwa mag\u0127luq, jew bejn is-sessjonijiet. Jekk inti log out manwalment wara kull sessjoni, il-varjabbli huma kklerjati.\n\nLogging ma 'kont Google mhuwiex me\u0127tie\u0121, madankollu inti ser jit\u0127allew biss g\u0127all-a\u010b\u010bess spreadsheets ppubblikati.",
														"Acess private Google-regneark knyttet til Google Drive, m\u00e5 du gi din Google-brukernavn og passord.\n\u00a0\nSikkerhetsadvarsel: Legitimasjonen er lagret i EditorPrefs, som er ren tekst. Dette er slik at programtillegget kan automatisk logge inn n\u00e5r vinduet er lukket, eller mellom \u00f8ktene. Hvis du logger ut manuelt etter hver \u00f8kt, er variablene fjernet.\n\nLogge inn med en Google-konto er ikke n\u00f8dvendig, men du vil bare f\u00e5 lov til \u00e5 f\u00e5 tilgang til publiserte regneark.",
														"Acess prywatne Arkusze Google przywi\u0105zane do Dysku Google, musisz poda\u0107 nazw\u0119 u\u017cytkownika Google i has\u0142o.\n\u00a0\nOstrze\u017cenie o zabezpieczeniach: Po\u015bwiadczenia s\u0105 zapisywane w EditorPrefs, kt\u00f3re zwyk\u0142y tekst. To jest tak, wtyczki automatycznie zalogowa\u0107 si\u0119, gdy okno jest zamkni\u0119te, lub mi\u0119dzy sesjami. Je\u015bli Wyloguj r\u0119cznie po ka\u017cdej sesji, zmienne s\u0105 usuwane.\n\nZalogowaniu si\u0119 na konto Google, nie jest konieczne, jednak b\u0119dziesz mie\u0107 prawo do dost\u0119pu do opublikowanych arkuszy kalkulacyjnych.",
														"Para acessar o Google Spreadsheets privadas vinculadas ao seu Google Drive, voc\u00ea deve fornecer seu nome de usu\u00e1rio e senha do Google.\n\u00a0\nAviso de seguran\u00e7a: As credenciais s\u00e3o salvas nos EditorPrefs, que s\u00e3o texto simples. Isto \u00e9 assim que o plugin pode fazer logon automaticamente quando a janela \u00e9 fechada, ou entre as sess\u00f5es. Se voc\u00ea Sair manualmente depois de cada sess\u00e3o, as vari\u00e1veis \u200b\u200bs\u00e3o apagadas.\n\nIniciar sess\u00e3o com uma conta do Google n\u00e3o \u00e9 necess\u00e1rio, no entanto, voc\u00ea s\u00f3 ser\u00e1 permitido o acesso as planilhas publicadas.",
														"Pentru a acess Foi de calcul private de Google legate de Disc Google, trebuie s\u0103 furniza\u021bi numele dvs. de utilizator Google \u0219i parola.\n\u00a0\nAvertisment de securitate: Atest\u0103ri sunt salvate \u00een EditorPrefs, care sunt text simplu. Acest lucru este at\u00e2t de plugin-ul se poate conecta \u00een mod automat \u00een cazul \u00een care fereastra este \u00eenchis\u0103, sau \u00eentre sesiuni. Dac\u0103 v\u0103 deconecta\u021bi manual dup\u0103 fiecare sesiune, variabilele sunt \u0219terse.\n\nConectarea cu un cont Google, nu este necesar, cu toate acestea va fi permis numai pentru a accesa foi de calcul publicate.",
														"Acess s\u00fakromn\u00e9 \u200b\u200btabu\u013ekov\u00e9ho procesora Google viazan\u00e9 na Disk Google, mus\u00edte zada\u0165 svoj Google u\u017e\u00edvate\u013esk\u00e9 meno a heslo.\n\u00a0\nBezpe\u010dnostn\u00e9 upozornenie: Poverenia s\u00fa ulo\u017een\u00e9 v EditorPrefs, ktor\u00e9 s\u00fa oby\u010dajn\u00fd text. To je tak plugin automaticky prihl\u00e1si\u0165 pri zatvorenom okne, alebo medzi zasadnutiami. Ak Odhl\u00e1si\u0165 sa ru\u010dne po ka\u017edom zasadnut\u00ed, premenn\u00e9 s\u00fa vymazan\u00e9.\n\nPrihl\u00e1senie k \u00fa\u010dtu Google nie je nutn\u00e9, ale budete m\u00f4c\u0165 pristupova\u0165 len k publikovanej tabu\u013eky.",
														"\u010ce \u017eelite dostopati zasebnih Google Spreadsheets vezane na va\u0161 Google Drive, morate zagotoviti Googlovega uporabni\u0161kega imena in gesla.\n\u00a0\nVarnostno opozorilo: Mandatno se shranijo v EditorPrefs, ki so golo besedilo. To je tako lahko plugin samodejno prijavili, ko je okno zaprto, ali med zasedanji. \u010ce ste Odjava ro\u010dno po vsaki seji, so spremenljivke izbil.\n\nPrijavo v Google ra\u010duna ni potrebno, vendar pa vam bo dovoljeno le za dostop do objavljenih preglednic.",
														"P\u00ebr t\u00eb acess Spreadsheets private Google t\u00eb lidhura me Google Drive tuaj, ju duhet t\u00eb siguroj\u00eb Google emrin tuaj t\u00eb p\u00ebrdoruesit dhe fjal\u00ebkalimin.\n\u00a0\nKujdes Sigurimit: Kredencialet jan\u00eb ruajtur n\u00eb EditorPrefs, t\u00eb cilat jan\u00eb Tekst i thjesht\u00eb. Kjo \u00ebsht\u00eb k\u00ebshtu plugin automatikisht mund t\u00eb hyni kur dritarja \u00ebsht\u00eb mbyllur, ose n\u00eb mes t\u00eb seancave. N\u00ebse ju Dil me dor\u00eb pas \u00e7do seanc\u00eb, variablat jan\u00eb pastruar.\n\nPrerje-transportim trupash n\u00eb me nj\u00eb llogari Google nuk \u00ebsht\u00eb e nevojshme, por ju do t\u00eb lejohet vet\u00ebm t\u00eb hyni n\u00eb spreadsheets botuar.",
														"\u0422\u043e \u0430\u0446\u0435\u0441\u0441 \u043f\u0440\u0438\u0432\u0430\u0442\u043d\u0435 \u0413\u043e\u043e\u0433\u043b\u0435 \u0442\u0430\u0431\u0435\u043b\u0435 \u0432\u0435\u0437\u0430\u043d\u0435 \u043d\u0430 \u0441\u0432\u043e\u0458 \u0413\u043e\u043e\u0433\u043b\u0435 \u0414\u0440\u0438\u0432\u0435, \u043c\u043e\u0440\u0430\u0442\u0435 \u0434\u0430 \u043e\u0431\u0435\u0437\u0431\u0435\u0434\u0438\u0442\u0435 \u0441\u0432\u043e\u0458 \u0413\u043e\u043e\u0433\u043b\u0435 \u043a\u043e\u0440\u0438\u0441\u043d\u0438\u0447\u043a\u043e \u0438\u043c\u0435 \u0438 \u043b\u043e\u0437\u0438\u043d\u043a\u0443.\n\u00a0\n\u0421\u0438\u0433\u0443\u0440\u043d\u043e\u0441\u0442 \u0423\u043f\u043e\u0437\u043e\u0440\u0435\u045a\u0435: \u0421\u0432\u0435\u0434\u043e\u0447\u0430\u043d\u0441\u0442\u0432\u0430 \u0441\u0435 \u0447\u0443\u0432\u0430\u0458\u0443 \u0443 \u0415\u0434\u0438\u0442\u043e\u0440\u041f\u0440\u0435\u0444\u0441, \u043a\u043e\u0458\u0438 \u0441\u0443 \u043e\u0431\u0438\u0447\u0430\u043d \u0442\u0435\u043a\u0441\u0442. \u0422\u043e \u0458\u0435 \u0442\u043e\u043b\u0438\u043a\u043e \u0458\u0435\u0437\u0438\u0447\u0430\u043a \u043c\u043e\u0436\u0435 \u0430\u0443\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u043f\u0440\u0438\u0458\u0430\u0432\u0438\u043b\u0438 \u043f\u0440\u0438\u043b\u0438\u043a\u043e\u043c \u043f\u0440\u043e\u0437\u043e\u0440 \u0437\u0430\u0442\u0432\u043e\u0440\u0435\u043d, \u0438\u043b\u0438 \u0438\u0437\u043c\u0435\u0452\u0443 \u0441\u0435\u0441\u0438\u0458\u0430. \u0423\u043a\u043e\u043b\u0438\u043a\u043e \u0441\u0435 \u043e\u0434\u0458\u0430\u0432\u0438\u0442\u0435 \u0440\u0443\u0447\u043d\u043e \u043f\u043e\u0441\u043b\u0435 \u0441\u0432\u0430\u043a\u043e\u0433 \u0437\u0430\u0441\u0435\u0434\u0430\u045a\u0430, \u043f\u0440\u043e\u043c\u0435\u043d\u0459\u0438\u0432\u0435 \u0441\u0435 \u0431\u0440\u0438\u0448\u0443.\n\n\u041b\u043e\u0433\u043e\u0432\u0430\u045a\u0430 \u0441\u0430 \u0413\u043e\u043e\u0433\u043b\u0435 \u043d\u0430\u043b\u043e\u0433\u043e\u043c \u043d\u0438\u0458\u0435 \u043f\u043e\u0442\u0440\u0435\u0431\u043d\u043e, \u043c\u0435\u0452\u0443\u0442\u0438\u043c, \u043e\u0434 \u0432\u0430\u0441 \u045b\u0435 \u0431\u0438\u0442\u0438 \u0434\u043e\u0437\u0432\u043e\u0459\u0435\u043d\u043e \u0434\u0430 \u043f\u0440\u0438\u0441\u0442\u0443\u043f\u0435 \u043e\u0431\u0458\u0430\u0432\u0459\u0435\u043d\u0438\u0445 \u0442\u0430\u0431\u0435\u043b\u0430.",
														"Att acess privata Google Spreadsheets kopplade till Google Drive, m\u00e5ste du ange ditt Google anv\u00e4ndarnamn och l\u00f6senord.\n\u00a0\nS\u00e4kerhetsvarning: Referenser sparas i EditorPrefs, som \u00e4r vanlig text. Detta \u00e4r s\u00e5 plugin kan automatiskt logga in n\u00e4r f\u00f6nstret \u00e4r st\u00e4ngt, eller mellan sessionerna. Om du loggar ut manuellt efter varje session, \u00e4r variablerna raderas.\n\nAtt logga in med ett Google-konto \u00e4r inte n\u00f6dv\u00e4ndigt, men du kommer bara att till\u00e5tas att komma \u00e5t publicerade kalkylblad.",
														"Kwa acess Spreadsheets binafsi Google amefungwa kwa Google Drive yako, lazima kutoa jina lako mtumiaji Google na Password.\n\u00a0\nUsalama Tahadhari: sifa ni kuokolewa katika EditorPrefs, ambayo ni Nakala wazi. Hii ni hivyo Plugin inaweza moja kwa moja kuingia katika wakati dirisha ni kufungwa, au kati ya vikao. Ukitoka kwa manually baada ya kila kikao, vigezo ni akalipa.\n\nMagogo na akaunti ya Google ni si lazima, hata hivyo utakuwa tu kuruhusiwa kupata spreadsheets kuchapishwa.",
														"\u0e40\u0e1e\u0e37\u0e48\u0e2d acess Google \u0e2a\u0e40\u0e1b\u0e23\u0e14\u0e0a\u0e35\u0e15\u0e2a\u0e48\u0e27\u0e19\u0e15\u0e31\u0e27\u0e40\u0e0a\u0e37\u0e48\u0e2d\u0e21\u0e42\u0e22\u0e07\u0e44\u0e1b\u0e22\u0e31\u0e07 Google \u0e44\u0e14\u0e23\u0e1f\u0e4c\u0e02\u0e2d\u0e07\u0e04\u0e38\u0e13\u0e04\u0e38\u0e13\u0e15\u0e49\u0e2d\u0e07\u0e43\u0e2a\u0e48\u0e0a\u0e37\u0e48\u0e2d\u0e1c\u0e39\u0e49\u0e43\u0e0a\u0e49\u0e02\u0e2d\u0e07\u0e04\u0e38\u0e13 Google \u0e41\u0e25\u0e30\u0e23\u0e2b\u0e31\u0e2a\u0e1c\u0e48\u0e32\u0e19\n\u00a0\n\u0e04\u0e33\u0e40\u0e15\u0e37\u0e2d\u0e19\u0e01\u0e32\u0e23\u0e23\u0e31\u0e01\u0e29\u0e32\u0e04\u0e27\u0e32\u0e21\u0e1b\u0e25\u0e2d\u0e14\u0e20\u0e31\u0e22\u0e02\u0e49\u0e2d\u0e21\u0e39\u0e25\u0e1b\u0e23\u0e30\u0e08\u0e33\u0e15\u0e31\u0e27\u0e08\u0e30\u0e16\u0e39\u0e01\u0e1a\u0e31\u0e19\u0e17\u0e36\u0e01\u0e44\u0e27\u0e49\u0e43\u0e19 EditorPrefs \u0e0b\u0e36\u0e48\u0e07\u0e40\u0e1b\u0e47\u0e19\u0e02\u0e49\u0e2d\u0e04\u0e27\u0e32\u0e21\u0e18\u0e23\u0e23\u0e21\u0e14\u0e32 \u0e19\u0e35\u0e49\u0e40\u0e1e\u0e37\u0e48\u0e2d\u0e43\u0e2b\u0e49\u0e1b\u0e25\u0e31\u0e4a\u0e01\u0e2d\u0e34\u0e19\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e40\u0e02\u0e49\u0e32\u0e2a\u0e39\u0e48\u0e23\u0e30\u0e1a\u0e1a\u0e42\u0e14\u0e22\u0e2d\u0e31\u0e15\u0e42\u0e19\u0e21\u0e31\u0e15\u0e34\u0e40\u0e21\u0e37\u0e48\u0e2d\u0e2b\u0e19\u0e49\u0e32\u0e15\u0e48\u0e32\u0e07\u0e16\u0e39\u0e01\u0e1b\u0e34\u0e14\u0e2b\u0e23\u0e37\u0e2d\u0e23\u0e30\u0e2b\u0e27\u0e48\u0e32\u0e07\u0e01\u0e32\u0e23\u0e1b\u0e23\u0e30\u0e0a\u0e38\u0e21 \u0e16\u0e49\u0e32\u0e04\u0e38\u0e13\u0e2d\u0e2d\u0e01\u0e08\u0e32\u0e01\u0e23\u0e30\u0e1a\u0e1a\u0e14\u0e49\u0e27\u0e22\u0e15\u0e19\u0e40\u0e2d\u0e07\u0e2b\u0e25\u0e31\u0e07\u0e08\u0e32\u0e01\u0e40\u0e0b\u0e2a\u0e0a\u0e31\u0e48\u0e19\u0e17\u0e38\u0e01\u0e15\u0e31\u0e27\u0e41\u0e1b\u0e23\u0e17\u0e35\u0e48\u0e08\u0e30\u0e16\u0e39\u0e01\u0e25\u0e49\u0e32\u0e07\n\n\u0e40\u0e02\u0e49\u0e32\u0e2a\u0e39\u0e48\u0e23\u0e30\u0e1a\u0e1a\u0e14\u0e49\u0e27\u0e22