			Rows.Add( new LocalizationRow("When you select a Google Spreadsheet to be Active, it becomes the Active Workbook. \n\nWhen there is an Active Workbook, the Tools menu will allow you to select individual worksheets from within the Active Workbook to be exported, as well as the Export Type.\n\nYou may Open the Workbook in a Browser Window by clicking the \"Open URL\" button.\n\nYou may Deactivate the Active Workbook by clicking the \"Deactivate\" button. ",
														"Lorsque vous s\u00e9lectionnez une feuille de calcul Google d'\u00eatre actif, il devient le classeur actif.\n\nQuand il ya un classeur actif, dans le menu Outils vous permettra de s\u00e9lectionner des feuilles de calcul individuelles \u00e0 l'int\u00e9rieur du classeur actif \u00e0 l'exportation, ainsi que le type d'exportation.\n\nVous pouvez ouvrir le classeur dans une fen\u00eatre du navigateur en cliquant sur le bouton \"Ouvrir URL\".\n\nVous pouvez d\u00e9sactiver le classeur actif en cliquant sur le bouton \"D\u00e9sactiver\".",
														"Quando si seleziona un foglio di calcolo di Google di essere attivo, diventa la cartella di lavoro attiva.\n\nQuando vi \u00e8 una cartella di lavoro attiva, il menu Strumenti vi permetter\u00e0 di selezionare i singoli fogli di lavoro all'interno della cartella di lavoro attiva da esportare, nonch\u00e9 il tipo di esportazione.\n\n\u00c8 possibile aprire la cartella di lavoro in una finestra del browser facendo clic sul pulsante \"Apri URL\".\n\n\u00c8 possibile disattivare la cartella di lavoro attiva facendo clic sul pulsante \"Disattiva\".",
														"Wenn Sie w\u00e4hlen ein Google Spreadsheet, aktiv zu sein, wird es der aktiven Arbeitsmappe.\n\nWenn es eine aktive Arbeitsmappe wird das Men\u00fc Extras k\u00f6nnen Sie einzelne Arbeitsbl\u00e4tter aus der aktiven Arbeitsmappe ausw\u00e4hlen, die exportiert werden, sowie die Exporttyp.\n\nSie k\u00f6nnen die Arbeitsmappe in einem Browser-Fenster, indem Sie auf die \"Open URL\"-Taste.\n\nSie k\u00f6nnen die aktive Arbeitsmappe durch Klicken auf die Schaltfl\u00e4che \"Deaktivieren\" klicken deaktivieren.",
														"Cuando se selecciona una hoja de c\u00e1lculo de Google para estar activo, se convierte en el libro activo.\n\nCuando hay un libro activo, el men\u00fa Herramientas le permite seleccionar las hojas de trabajo individuales desde dentro del libro activo a la exportaci\u00f3n, as\u00ed como el tipo de exportaci\u00f3n.\n\nUsted puede abrir el libro en una ventana del navegador, haga clic en el bot\u00f3n \"Abrir URL\".\n\nUsted puede desactivar el libro activo haciendo clic en el bot\u00f3n \"Desactivar\".",
														"\u0639\u0646\u062f \u062a\u062d\u062f\u064a\u062f \u062c\u062f\u0648\u0644 \u062c\u0648\u062c\u0644 \u0644\u062a\u0643\u0648\u0646 \u0646\u0634\u0637\u0629\u060c \u064a\u0635\u0628\u062d \u0627\u0644\u0645\u0635\u0646\u0641 \u0627\u0644\u0646\u0634\u0637.\n\n\u0639\u0646\u062f \u0648\u062c\u0648\u062f \u0627\u0644\u0645\u0635\u0646\u0641 \u0627\u0644\u0646\u0634\u0637\u060c \u0641\u0625\u0646 \u0627\u0644\u0642\u0627\u0626\u0645\u0629 \u0623\u062f\u0648\u0627\u062a \u062a\u0633\u0645\u062d \u0644\u0643 \u0644\u0627\u062e\u062a\u064a\u0627\u0631 \u0623\u0648\u0631\u0627\u0642 \u0627\u0644\u0639\u0645\u0644 \u0627\u0644\u0641\u0631\u062f\u064a\u0629 \u0645\u0646 \u0636\u0645\u0646 \u0627\u0644\u0645\u0635\u0646\u0641 \u0627\u0644\u0646\u0634\u0637 \u0627\u0644\u0645\u0631\u0627\u062f \u062a\u0635\u062f\u064a\u0631\u0647\u0627\u060c \u0648\u0643\u0630\u0644\u0643 \u0646\u0648\u0639 \u0627\u0644\u062a\u0635\u062f\u064a\u0631.\n\n\u064a\u0645\u0643\u0646\u0643 \u0641\u062a\u062d \u0627\u0644\u0645\u0635\u0646\u0641 \u0641\u064a \u0646\u0627\u0641\u0630\u0629 \u0627\u0644\u0645\u062a\u0635\u0641\u062d \u0639\u0646 \u0637\u0631\u064a\u0642 \u0627\u0644\u0646\u0642\u0631 \u0639\u0644\u0649 \u0632\u0631 \"\u0641\u062a\u062d URL\".\n\n\u064a\u0645\u0643\u0646\u0643 \u0625\u0644\u063a\u0627\u0621 \u062a\u0646\u0634\u064a\u0637 \u0627\u0644\u0645\u0635\u0646\u0641 \u0627\u0644\u0646\u0634\u0637 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0627\u0644\u0646\u0642\u0631 \u0639\u0644\u0649 \u0632\u0631 \"\u0625\u0644\u063a\u0627\u0621 \u062a\u0646\u0634\u064a\u0637\".",
														"\ub2f9\uc2e0\uc774 \uad6c\uae00 \uc2a4\ud504\ub808\ub4dc \uc2dc\ud2b8\uac00 \ud65c\uc131\uc73c\ub85c \uc120\ud0dd\ud558\uba74 \ud604\uc7ac \ud1b5\ud569 \ubb38\uc11c\uac00\ub429\ub2c8\ub2e4.\n\n\ud604\uc7ac \ud1b5\ud569 \ubb38\uc11c\uac00\uc788\ub294 \uacbd\uc6b0, \ub3c4\uad6c \uba54\ub274\ub97c \uc0ac\uc6a9\ud558\uba74 \ub0b4\ubcf4\ub0b4\uae30 \uc720\ud615\ubfd0\ub9cc \uc544\ub2c8\ub77c \ub0b4\ubcf4\ub0bc \ud604\uc7ac \ud1b5\ud569 \ubb38\uc11c \ub0b4\uc5d0\uc11c \uac1c\ubcc4 \uc6cc\ud06c \uc2dc\ud2b8\ub97c \uc120\ud0dd\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n\ub2f9\uc2e0\uc740 \"URL \uc5f4\uae30\"\ubc84\ud2bc\uc744 \ud074\ub9ad\ud558\uc5ec \ube0c\ub77c\uc6b0\uc800 \ucc3d\uc5d0\uc11c \ud1b5\ud569 \ubb38\uc11c\ub97c \uc5f4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n\ub2f9\uc2e0\uc740 \"\ube44\ud65c\uc131\ud654\"\ubc84\ud2bc\uc744 \ud074\ub9ad\ud558\uc5ec \ud604\uc7ac \ud1b5\ud569 \ubb38\uc11c\ub97c \ube44\ud65c\uc131\ud654 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
														"\u5f53\u60a8\u9009\u62e9\u8c37\u6b4c\u7535\u5b50\u8868\u683c\u6d3b\u8dc3\uff0c\u6210\u4e3a\u6d3b\u52a8\u5de5\u4f5c\u7c3f\u3002\n\n\u5f53\u6709\u6d3b\u52a8\u5de5\u4f5c\u7c3f\uff0c\u5728\u5de5\u5177\u83dc\u5355\u53ef\u4ee5\u8ba9\u4f60\u4ece\u6d3b\u52a8\u5de5\u4f5c\u7c3f\u4e2d\u9009\u62e9\u5355\u4e2a\u5de5\u4f5c\u8868\u5bfc\u51fa\uff0c\u4ee5\u53ca\u5bfc\u51fa\u7c7b\u578b\u3002\n\n\u60a8\u53ef\u4ee5\u901a\u8fc7\u70b9\u51fb\u201c\u6253\u5f00URL\u201d\u6309\u94ae\uff0c\u5728\u6d4f\u89c8\u5668\u7a97\u53e3\u4e2d\u6253\u5f00\u8be5\u5de5\u4f5c\u7c3f\u3002\n\n\u60a8\u53ef\u4ee5\u901a\u8fc7\u5355\u51fb\u201c\u505c\u7528\u201d\u6309\u94ae\uff0c\u5173\u95ed\u5f53\u524d\u5de5\u4f5c\u7c3f\u3002",
														"\u3042\u306a\u305f\u304c\u30a2\u30af\u30c6\u30a3\u30d6\u3067\u3042\u308b\u3068Google\u30b9\u30d7\u30ec\u30c3\u30c9\u30b7\u30fc\u30c8\u3092\u9078\u629e\u3059\u308b\u3068\u3001\u30a2\u30af\u30c6\u30a3\u30d6\u306a\u30d6\u30c3\u30af\u306b\u306a\u308a\u307e\u3059\u3002\n\n\u30a2\u30af\u30c6\u30a3\u30d6\u306a\u30d6\u30c3\u30af\u304c\u3042\u308b\u5834\u5408\u306f\u3001[\u30c4\u30fc\u30eb]\u30e1\u30cb\u30e5\u30fc\u306e[\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u306e\u7a2e\u985e\u3060\u3051\u3067\u306a\u304f\u3001\u8f38\u51fa\u3055\u308c\u308b\u30a2\u30af\u30c6\u30a3\u30d6\u306a\u30d6\u30c3\u30af\u5185\u304b\u3089\u500b\u5225\u306e\u30ef\u30fc\u30af\u30b7\u30fc\u30c8\u3092\u9078\u629e\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\n\n\u3042\u306a\u305f\u306f\u3001\u300cURL\u3092\u958b\u304f\u300d\u30dc\u30bf\u30f3\u3092\u30af\u30ea\u30c3\u30af\u3059\u308b\u3068\u3001\u30d6\u30e9\u30a6\u30b6\u30a6\u30a3\u30f3\u30c9\u30a6\u3067\u30d6\u30c3\u30af\u3092\u958b\u304f\u3053\u3068\u304c\u3042\u308a\u307e\u3059\u3002\n\n\u3042\u306a\u305f\u306f\u3001\u300c\u7121\u52b9\u5316\u300d\u30dc\u30bf\u30f3\u3092\u30af\u30ea\u30c3\u30af\u3059\u308b\u3053\u3068\u3067\u30a2\u30af\u30c6\u30a3\u30d6\u306a\u30d6\u30c3\u30af\u3092\u975e\u30a2\u30af\u30c6\u30a3\u30d6\u306b\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u308b\u3002",
														"\u041f\u0440\u0438 \u0432\u044b\u0431\u043e\u0440\u0435 \u0442\u0430\u0431\u043b\u0438\u0446\u044b Google, \u0447\u0442\u043e\u0431\u044b \u0431\u044b\u0442\u044c \u0430\u043a\u0442\u0438\u0432\u043d\u044b\u043c, \u043e\u043d \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0438.\n\n\u041a\u043e\u0433\u0434\u0430 \u0435\u0441\u0442\u044c \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0438, \u043c\u0435\u043d\u044e \u0418\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u044b \u043f\u043e\u0437\u0432\u043e\u043b\u0438\u0442 \u0432\u0430\u043c \u0432\u044b\u0431\u0440\u0430\u0442\u044c \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u044b\u0435 \u043b\u0438\u0441\u0442\u044b \u0432\u043d\u0443\u0442\u0440\u0438 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0438 \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0430, \u0430 \u0442\u0430\u043a\u0436\u0435 \u042d\u043a\u0441\u043f\u043e\u0440\u0442\u043d\u043e Type.\n\n\u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u043e\u0442\u043a\u0440\u044b\u0442\u044c \u043a\u043d\u0438\u0433\u0443 \u0432 \u043e\u043a\u043d\u0435 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430, \u043d\u0430\u0436\u0430\u0432 \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u041e\u0442\u043a\u0440\u044b\u0442\u044c URL\".\n\n\u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u041e\u0442\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0438, \u043d\u0430\u0436\u0430\u0432 \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u041e\u0442\u043a\u043b\u044e\u0447\u0438\u0442\u044c\".",
														"Khi b\u1ea1n ch\u1ecdn m\u1ed9t b\u1ea3ng t\u00ednh Google \u0111\u1ec3 \u0111\u01b0\u1ee3c ho\u1ea1t \u0111\u1ed9ng, n\u00f3 s\u1ebd tr\u1edf th\u00e0nh Workbook \u0111\u0103ng nh\u1eadp.\n\nKhi c\u00f3 m\u1ed9t Workbook ho\u1ea1t \u0111\u1ed9ng, tr\u00ecnh \u0111\u01a1n Tools s\u1ebd cho ph\u00e9p b\u1ea1n ch\u1ecdn c\u00e1c b\u1ea3ng c\u00e1 nh\u00e2n t\u1eeb b\u00ean trong Workbook \u0111\u0103ng nh\u1eadp \u0111\u1ec3 \u0111\u01b0\u1ee3c xu\u1ea5t kh\u1ea9u, c\u0169ng nh\u01b0 c\u00e1c lo\u1ea1i xu\u1ea5t kh\u1ea9u.\n\nB\u1ea1n c\u00f3 th\u1ec3 M\u1edf Workbook trong m\u1ed9t c\u1eeda s\u1ed5 tr\u00ecnh duy\u1ec7t b\u1eb1ng c\u00e1ch nh\u1ea5n v\u00e0o n\u00fat \"Open URL\".\n\nB\u1ea1n c\u00f3 th\u1ec3 T\u1eaft Workbook \u0111\u0103ng nh\u1eadp b\u1eb1ng c\u00e1ch nh\u1ea5n v\u00e0o n\u00fat \"T\u1eaft\".",
														"Wanneer u een Google-spreadsheet om actief te zijn, wordt de actieve werkmap.\n\nWanneer er sprake is van een actieve werkmap, zal het menu Extra kunt u afzonderlijke werkbladen selecteren vanuit de actieve werkmap worden ge\u00ebxporteerd, evenals de Export Type.\n\nU kunt de werkmap opent in een browservenster door te klikken op de \"Open URL\" knop.\n\nU kunt de actieve werkmap uitschakelen door te klikken op de knop \"uitschakelen\".",
														"As jy 'n Google spreiblad om aktief te wees, word die aktiewe Werkboek.\n\nWanneer daar is 'n aktiewe Werkboek, sal die kieslys kan jy afsonderlike werkblaaie te kies uit die aktiewe Werkboek uitgevoer word, sowel as die uitvoer Tipe.\n\nJy kan Maak die Werkboek in 'n leser venster deur op die \"Open URL\" knoppie.\n\nJy kan die aktiewe Werkboek deaktiveer deur op die \"deaktiveer\" knoppie.",
														"\u041a\u043e\u0433\u0430\u0442\u043e \u0438\u0437\u0431\u0435\u0440\u0435\u0442\u0435 Spreadsheet Google \u0434\u0430 \u0431\u044a\u0434\u0435 \u0430\u043a\u0442\u0438\u0432\u0435\u043d, \u0442\u043e\u0439 \u0441\u0435 \u043f\u0440\u0435\u0432\u0440\u044a\u0449\u0430 \u0432 \u0430\u043a\u0442\u0438\u0432\u0435\u043d \u0440\u0430\u0431\u043e\u0442\u043d\u0430 \u043a\u043d\u0438\u0433\u0430.\n\n\u041a\u043e\u0433\u0430\u0442\u043e \u0438\u043c\u0430 \u0430\u043a\u0442\u0438\u0432\u043d\u0430 \u0440\u0430\u0431\u043e\u0442\u043d\u0430 \u043a\u043d\u0438\u0433\u0430, \u0432 \u043c\u0435\u043d\u044e\u0442\u043e Tools \u0449\u0435 \u0432\u0438 \u043f\u043e\u0437\u0432\u043e\u043b\u0438 \u0434\u0430 \u0438\u0437\u0431\u0435\u0440\u0435\u0442\u0435 \u043e\u0442\u0434\u0435\u043b\u043d\u0438 \u043b\u0438\u0441\u0442\u043e\u0432\u0435 \u043e\u0442 \u0440\u0430\u043c\u043a\u0438\u0442\u0435 \u043d\u0430 Active \u0440\u0430\u0431\u043e\u0442\u043d\u0430 \u043a\u043d\u0438\u0433\u0430 \u0434\u0430 \u0431\u044a\u0434\u0430\u0442 \u0438\u0437\u043d\u0430\u0441\u044f\u043d\u0438, \u043a\u0430\u043a\u0442\u043e \u0438 \u0437\u0430 \u0438\u0437\u043d\u043e\u0441 \u0442\u0438\u043f.\n\n\u041c\u043e\u0436\u0435 \u0434\u0430 \u0441\u0435 \u043e\u0442\u0432\u0430\u0440\u044f \u0440\u0430\u0431\u043e\u0442\u043d\u0430 \u043a\u043d\u0438\u0433\u0430 \u0432 \u043f\u0440\u043e\u0437\u043e\u0440\u0435\u0446 \u043d\u0430 \u0431\u0440\u0430\u0443\u0437\u044a\u0440\u0430, \u043a\u0430\u0442\u043e \u0449\u0440\u0430\u043a\u043d\u0435\u0442\u0435 \u0432\u044a\u0440\u0445\u0443 \u0431\u0443\u0442\u043e\u043d\u0430 \"Open URL\".\n\n\u041c\u043e\u0436\u0435 \u0414\u0435\u0430\u043a\u0442\u0438\u0432\u0438\u0440\u0430\u0439\u0442\u0435 Active \u0440\u0430\u0431\u043e\u0442\u043d\u0430 \u043a\u043d\u0438\u0433\u0430, \u043a\u0430\u0442\u043e \u0449\u0440\u0430\u043a\u043d\u0435\u0442\u0435 \u0432\u044a\u0440\u0445\u0443 \u0431\u0443\u0442\u043e\u043d\u0430 \"\u0414\u0435\u0430\u043a\u0442\u0438\u0432\u0438\u0440\u0430\u043d\u0435\".",
														"\u041f\u0440\u044b \u0432\u044b\u0431\u0430\u0440\u044b \u0442\u0430\u0431\u043b\u0456\u0446\u044b Google, \u043a\u0430\u0431 \u0431\u044b\u0446\u044c \u0430\u043a\u0442\u044b\u045e\u043d\u044b\u043c, \u0451\u043d \u0441\u0442\u0430\u043d\u043e\u0432\u0456\u0446\u0446\u0430 \u0430\u043a\u0442\u044b\u045e\u043d\u0430\u0439 \u043a\u043d\u0456\u0433\u0456.\n\n\u041a\u0430\u043b\u0456 \u0451\u0441\u0446\u044c \u0430\u043a\u0442\u044b\u045e\u043d\u0430\u0439 \u043a\u043d\u0456\u0433\u0456, \u043c\u0435\u043d\u044e \u0406\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u044b \u0434\u0430\u0437\u0432\u043e\u043b\u0456\u0446\u044c \u0432\u0430\u043c \u0432\u044b\u0431\u0440\u0430\u0446\u044c \u0430\u0441\u043e\u0431\u043d\u044b\u044f \u043b\u0456\u0441\u0442\u044b \u045e\u043d\u0443\u0442\u0440\u044b \u0430\u043a\u0442\u044b\u045e\u043d\u0430\u0439 \u043a\u043d\u0456\u0433\u0456 \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u0443, \u0430 \u0442\u0430\u043a\u0441\u0430\u043c\u0430 \u042d\u043a\u0441\u043f\u0430\u0440\u0442\u043d\u0430 Type.\n\n\u0412\u044b \u043c\u043e\u0436\u0430\u0446\u0435 \u0430\u0434\u043a\u0440\u044b\u0446\u044c \u043a\u043d\u0456\u0433\u0443 \u045e \u0430\u043a\u043d\u0435 \u0431\u0440\u0430\u045e\u0437\u044d\u0440\u0430, \u043d\u0430\u0446\u0456\u0441\u043d\u0443\u045e\u0448\u044b \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u0410\u0434\u043a\u0440\u044b\u0446\u044c URL\".\n\n\u0412\u044b \u043c\u043e\u0436\u0430\u0446\u0435 \u0410\u0434\u043a\u043b\u044e\u0447\u044d\u043d\u043d\u0435 \u0430\u043a\u0442\u044b\u045e\u043d\u0430\u0439 \u043a\u043d\u0456\u0433\u0456, \u043d\u0430\u0446\u0456\u0441\u043d\u0443\u045e\u0448\u044b \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u0410\u0434\u043a\u043b\u044e\u0447\u044b\u0446\u044c\".",
														"Quan se selecciona un full de c\u00e0lcul de Google per estar actiu, es converteix en el llibre actiu.\n\nQuan hi ha un llibre actiu, el men\u00fa Eines li permet seleccionar els fulls de treball individuals des de dins del llibre actiu a l'exportaci\u00f3, aix\u00ed com el tipus d'exportaci\u00f3.\n\nVost\u00e8 pot obrir el llibre en una finestra del navegador, feu clic al bot\u00f3 \"Obre URL\".\n\nVost\u00e8 pot desactivar el llibre actiu fent clic al bot\u00f3 \"Desactivar\".",
														"Kdy\u017e vyberete Spreadsheet Google b\u00fdt aktivn\u00ed, to se stane aktivn\u00edm se\u0161itu.\n\nKdy\u017e je aktivn\u00ed se\u0161it, bude v nab\u00eddce N\u00e1stroje v\u00e1m umo\u017en\u00ed vybrat jednotliv\u00e9 listy v r\u00e1mci aktivn\u00edho se\u0161itu kter\u00e9 m\u00e1 b\u00fdt vyvezeno, stejn\u011b jako export typu.\n\nM\u016f\u017eete otev\u0159\u00edt se\u0161it v okn\u011b prohl\u00ed\u017ee\u010de po kliknut\u00ed na tla\u010d\u00edtko \"Otev\u0159\u00edt URL\".\n\nM\u016f\u017eete vypnout aktivn\u00ed se\u0161it kliknut\u00edm na tla\u010d\u00edtko \"Deaktivovat\".",
														"Pan fyddwch yn dewis Taenlen Google i fod yn Weithgar, mae'n dod yn y Llyfr Gwaith Active.\n\nPan fo Llyfr Gwaith Active, bydd y ddewislen Tools eich galluogi i ddewis taflenni unigol o'r tu mewn i'r Llyfr Gwaith Egn\u00efol i gael ei allforio, yn ogystal \u00e2'r Math Allforio.\n\nEfallai y byddwch yn Agor y Llyfr Gwaith mewn Ffenestr Browser drwy glicio ar y botwm \"Open URL\".\n\nEfallai y byddwch Deactivate y Llyfr Gwaith Active drwy glicio ar y botwm \"Deactivate\".",
														"Kui valite Google t\u00f6\u00f6vihik olla aktiivne, see muutub aktiivseks t\u00f6\u00f6vihik.\n\nKui on olemas aktiivne t\u00f6\u00f6vihik Tools men\u00fc\u00fc v\u00f5imaldab teil valida \u00fcksikuid t\u00f6\u00f6lehti seest Active t\u00f6\u00f6vihik, mida eksporditakse, samuti Ekspordi t\u00fc\u00fcp.\n\nAvada v\u00f5ib t\u00f6\u00f6vihiku brauseriaknas kl\u00f5psake \"Open URL\" nuppu.\n\nV\u00f5ite L\u00fclitan Active t\u00f6\u00f6vihik kl\u00f5psates \"l\u00fclitada\" nuppu.",
