														"Kun valitset Google-laskentataulukkoon olla aktiivinen, siit\u00e4 tulee aktiivinen ty\u00f6kirja.\n\nKun on aktiivinen ty\u00f6kirja, Ty\u00f6kalut-valikosta voit valita yksitt\u00e4isi\u00e4 laskentataulukoita sis\u00e4ll\u00e4 Active ty\u00f6kirja viet\u00e4v\u00e4 sek\u00e4 vienti tyyppi.\n\nVoit Avaa ty\u00f6kirjan selainikkunassa napsauttamalla \"Avaa URL\"-painiketta.\n\nVoit Poista Active ty\u00f6kirja klikkaamalla \"Poista\"-painiketta.",
														"Nuair a roghna\u00edonn t\u00fa Scarbhileog Google a bheith Gn\u00edomhacha, b\u00edonn s\u00e9 an Workbook Gn\u00edomhacha.\n\nNuair a bhfuil Workbook Gn\u00edomhacha, beidh an roghchl\u00e1r Uirlis\u00ed deis a thabhairt duit a roghn\u00fa bileoga oibre aonair \u00f3 laistigh den Workbook Gn\u00edomhacha le honnmhairi\u00fa, chomh maith leis an Cine\u00e1l Easp\u00f3rt\u00e1la.\n\nIs f\u00e9idir leat Oscail an Leabhar Saothair i Fuinneog Brabhs\u00e1la\u00ed tr\u00ed chlice\u00e1il ar an \"Oscail URL\" a bhr\u00fa.\n\nIs f\u00e9idir leat D\u00edghn\u00edomhachtaigh an Workbook Gn\u00edomhacha tr\u00ed chlice\u00e1il ar an gcnaipe \"D\u00edghn\u00edomhachtaigh\".",
														"Cando vostede selecciona unha folla de c\u00e1lculo de Google para ser activo, torna-se o cartafol de traballo activa.\n\nCando hai un libro activo, no men\u00fa Ferramentas permitir\u00e1 que escolla follas de c\u00e1lculo individuais dentro do cartafol de traballo activa a ser exportado, as\u00ed como o tipo de exportaci\u00f3n.\n\nPode abrir o libro nunha vent\u00e1 do explorador, prema no bot\u00f3n \"Abrir URL\".\n\nP\u00f3dense desactivar o cartafol de traballo activa, facendo clic no bot\u00f3n \"Desactivar\".",
