														"Kada odaberete Google prora\u010dunske tablice da bude aktivan, on postaje aktivni radne knjige.\n\nKada je aktivni \u010ditanka, izbornik Tools \u0107e vam omogu\u0107iti da odaberete pojedina\u010dne radne listove iz Active radne knjige koja se izvozi, kao i izvoza tipa.\n\nMo\u017eda Otvaranje radne knjige u prozoru preglednika tako da kliknete na gumb \"Open URL\".\n\nMo\u017eda deaktivirali na\u010din radne knjige klikom na \"deaktivirati\" gumb.",
														"L\u00e8 ou chwazi yon feuy Google yo dwe aktif, li vin kaye a aktif.\n\nL\u00e8 gen yon kaye aktif, meni an Zouti pral p\u00e8m\u00e8t ou chwazi fich moun ki soti nan ki nan kaye la aktif yo dwe eksp\u00f2te, osi byen ke Kalite a Export.\n\nOu ka Louvri kaye a nan yon navigat\u00e8 Window, klike sou bouton nan \"Open URL\".\n\nOu ka Dezaktive kaye la aktif, klike sou bouton nan \"Dezaktive\".",
