														"Pasirinkus \"Google\" skai\u010diuokl\u0117s b\u016bti aktyvus, jis tampa aktyvus darbaknyg\u0117.\n\nKai yra aktyvus darbaknyg\u0117, meniu \u012erankiai leis jums pasirinkti atskirus lapus i\u0161 vidaus Active darbaknyg\u0117 turi b\u016bti eksportuojama, taip pat eksporto r\u016b\u0161is.\n\nGalite Atidarykite darbaknyg\u0119 nar\u0161ykl\u0117s lange paspaud\u0119 \"Atidaryti URL\" mygtuk\u0105.\n\nGalite I\u0161jungti Active Segtuvas paspaud\u0119 \"Deaktyvuoti\" mygtuk\u0105.",
														"Kad j\u016bs izv\u0113laties Google izkl\u0101jlapu b\u016bt akt\u012bvs, tas k\u013c\u016bst Active burtn\u012bca.\n\nKad ir Active Workbook, izv\u0113lnes Tools \u013caus jums izv\u0113l\u0113ties atsevi\u0161\u0137us darblapas no iek\u0161puses Active Workbook var\u0113tu eksport\u0113t, k\u0101 ar\u012b eksporta Type.\n\nJ\u016bs varat Atveriet darbgr\u0101matu p\u0101rl\u016bka log\u0101, noklik\u0161\u0137inot uz \"Atv\u0113rt URL\" pogu.\n\nJ\u016bs varat deaktiviz\u0113tu akt\u012bvo darbgr\u0101matu, noklik\u0161\u0137inot uz pogas \"atsl\u0113gt\".",
