														"Apabila anda memilih Google Spreadsheet untuk menjadi aktif, ia menjadi Buku Kerja yang aktif.\n\nApabila terdapat Buku Kerja Aktif, menu Alat akan membolehkan anda untuk memilih lembaran kerja individu dari dalam Buku Kerja Aktif yang akan dieksport, serta Jenis Eksport.\n\nAnda boleh Buka Buku Kerja dalam Window Browser dengan mengklik butang \"URL Terbuka\".\n\nAnda boleh Nyahaktifkan Buku Kerja Aktif dengan mengklik butang \"Nyahaktifkan\".",
														"Meta inti tag\u0127\u017cel Spreadsheet Google li tkun Attiva, din issir l-Workbook Attiva.\n\nMeta jkun hemm Workbook Attiva, il-menu Tools se jippermetti li inti tag\u0127\u017cel worksheets individwali minn \u0121ewwa l-Workbook Active ji\u0121u esportati, kif ukoll tat-Tip Esportazzjoni.\n\nInti tista Ifta\u0127 il-Workbook fi browser billi tikklikkja l-\"URL Open\" buttuna.\n\nInti tista deattivat Workbook Active billi tikklikkja l-\"Di\u017cattivazzjoni\" buttuna.",
														"N\u00e5r du velger et Google-regneark til \u00e5 v\u00e6re aktiv, blir det aktive arbeidsboken.\n\nN\u00e5r det er en aktiv arbeidsbok, vil Verkt\u00f8y-menyen lar deg velge individuelle regneark innenfra Active arbeidsbok som skal eksporteres, samt eksporttype.\n\nDu kan \u00e5pne arbeidsboken i et nettleservindu ved \u00e5 klikke p\u00e5 \"\u00c5pne URL\" knappen.\n\nDu kan deaktivere den aktive arbeidsboken ved \u00e5 klikke p\u00e5 \"Deaktiver\" knappen.",
														"Po wybraniu arkusza kalkulacyjnego Google do aktywno\u015bci, staje si\u0119 aktywnym skoroszycie.\n\nKiedy jest aktywny skoroszyt, menu Narz\u0119dzia pozwoli wybra\u0107 poszczeg\u00f3lne arkusze od wewn\u0105trz aktywnym skoroszycie zosta\u0107 wywiezione, jak r\u00f3wnie\u017c typ eksportu.\n\nMo\u017cna otworzy\u0107 skoroszyt w oknie przegl\u0105darki, klikaj\u0105c na przycisk \"Otw\u00f3rz URL\".\n\nMo\u017cesz wy\u0142\u0105czy\u0107 aktywny skoroszyt, klikaj\u0105c przycisk \"deaktywacja\".",
														"Quando voc\u00ea seleciona uma planilha do Google para ser ativo, torna-se a pasta de trabalho ativa.\n\nQuando h\u00e1 um livro activo, no menu Ferramentas ir\u00e1 permitir que voc\u00ea selecione planilhas individuais de dentro da pasta de trabalho ativa a ser exportado, bem como o tipo de exporta\u00e7\u00e3o.\n\nVoc\u00ea pode abrir o livro em uma janela do navegador, clique no bot\u00e3o \"Abrir URL\".\n\nVoc\u00ea poder\u00e1 desativar a pasta de trabalho ativa, clicando no bot\u00e3o \"Desativar\".",
														"C\u00e2nd selecta\u021bi o foaie de calcul Google pentru a fi activ, acesta devine Workbook activ.\n\nAtunci c\u00e2nd exist\u0103 un registru de lucru activ, meniul Tools va permite s\u0103 selecta\u021bi foile de lucru individuale din cadrul Workbook activ\u0103 a fi exportate, precum \u0219i tipul de export.\n\nPute\u021bi deschide\u021bi registrul de lucru \u00eentr-o fereastr\u0103 de browser, f\u0103c\u00e2nd clic pe butonul \"Open URL\".\n\nPute\u021bi Dezactiva\u021bi Workbook activ, f\u0103c\u00e2nd clic pe butonul \"Dezactiva\u021bi\".",
														"Ke\u010f vyberiete Spreadsheet Google by\u0165 akt\u00edvny, to sa stane akt\u00edvnym zo\u0161ita.\n\nKe\u010f je akt\u00edvny zo\u0161it, bude v ponuke N\u00e1stroje v\u00e1m umo\u017en\u00ed vybra\u0165 jednotliv\u00e9 listy v r\u00e1mci akt\u00edvneho zo\u0161ita ktor\u00fd m\u00e1 by\u0165 vyvezen\u00fd, rovnako ako export typu.\n\nM\u00f4\u017eete otvori\u0165 zo\u0161it v okne prehliada\u010da po kliknut\u00ed na tla\u010didlo \"Otvori\u0165 URL\".\n\nM\u00f4\u017eete vypn\u00fa\u0165 akt\u00edvny zo\u0161it kliknut\u00edm na tla\u010didlo \"Deaktivova\u0165\".",
														"Ko izberete Google preglednic biti aktiven, da postane aktiven delovni zvezek.\n\nKo je aktiven delovni zvezek, se bo menu Tools vam omogo\u010dajo, da izberete posamezne liste iz notranjosti aktivnega delovni zvezek za izvoz, kot tudi izvozno tipa.\n\nLahko odprete delovni zvezek v okno brskalnika s klikom na gumb \u00bbOdpri URL\u00ab.\n\nMorda boste Izklopite Active delovni zvezek s klikom na gumb \"Izklju\u010di\".",
														"Kur ju zgjidhni nj\u00eb Spreadsheet Google q\u00eb t\u00eb jet\u00eb aktive, ajo b\u00ebhet Lib\u00ebr pune aktive.\n\nKur ka nj\u00eb Lib\u00ebr pune aktive, menu Tools do t\u00eb ju lejojn\u00eb t\u00eb zgjidhni pune individuale nga brenda lib\u00ebr pune aktive p\u00ebr t\u00eb eksportuar, si dhe Lloji Eksport.\n\nJu mund Hapni manual n\u00eb nj\u00eb dritare t\u00eb shfletuesit duke klikuar \"Open URL\" button.\n\nJu mund t\u00eb \u00e7aktivizoni manual Active duke klikuar butonin \"\u00e7aktivizuar\".",
														"\u041a\u0430\u0434\u0430 \u0438\u0437\u0430\u0431\u0435\u0440\u0435\u0442\u0435 \u0413\u043e\u043e\u0433\u043b\u0435 \u0442\u0430\u0431\u0435\u043b\u0435 \u0434\u0430 \u0431\u0443\u0434\u0435 \u0430\u043a\u0442\u0438\u0432\u043d\u0430, \u043e\u043d\u0430 \u043f\u043e\u0441\u0442\u0430\u0458\u0435 \u0410\u043a\u0442\u0438\u0432\u043d\u043e \u0412\u043e\u0440\u043a\u0431\u043e\u043e\u043a.\n\n\u041a\u0430\u0434\u0430 \u043f\u043e\u0441\u0442\u043e\u0458\u0438 \u0430\u043a\u0442\u0438\u0432\u043d\u0430 \u0440\u0430\u0434\u043d\u0430 \u0441\u0432\u0435\u0441\u043a\u0430, \u043c\u0435\u043d\u0438 \u0410\u043b\u0430\u0442\u043a\u0435 \u045b\u0435 \u0432\u0430\u043c \u043e\u043c\u043e\u0433\u0443\u045b\u0438\u0442\u0438 \u0434\u0430 \u0438\u0437\u0430\u0431\u0435\u0440\u0435\u0442\u0435 \u043f\u043e\u0458\u0435\u0434\u0438\u043d\u0430\u0447\u043d\u0435 \u043b\u0438\u0441\u0442\u043e\u0432\u0435 \u0443 \u043e\u043a\u0432\u0438\u0440\u0443 \u0410\u0446\u0442\u0438\u0432\u0435 \u0440\u0430\u0434\u043d\u0435 \u0441\u0432\u0435\u0441\u043a\u0435 \u043a\u043e\u0458\u0430 \u0441\u0435 \u0438\u0437\u0432\u043e\u0437\u0438, \u043a\u0430\u043e \u0438 \u0438\u0437\u0432\u043e\u0437\u0430 \u0422\u0438\u043f\u0435.\n\n\u041c\u043e\u0436\u0435\u0442\u0435 \u041e\u0442\u0432\u043e\u0440\u0438\u0442\u0435 \u0440\u0430\u0434\u043d\u0443 \u0441\u0432\u0435\u0441\u043a\u0443 \u0443 \u043f\u0440\u043e\u0437\u043e\u0440\u0443 \u043f\u0440\u0435\u0433\u043b\u0435\u0434\u0430\u0447\u0430 \u0442\u0430\u043a\u043e \u0448\u0442\u043e \u045b\u0435\u0442\u0435 \u043a\u043b\u0438\u043a\u043d\u0443\u0442\u0438 \u043d\u0430 \u0434\u0443\u0433\u043c\u0435 \"\u041e\u0442\u0432\u043e\u0440\u0438 \u0423\u0420\u041b\".\n\n\u041c\u043e\u0436\u0435\u0442\u0435 \u0414\u0435\u0430\u043a\u0442\u0438\u0432\u0438\u0440\u0430\u0458\u0442\u0435 \u0410\u0446\u0442\u0438\u0432\u0435 \u0412\u043e\u0440\u043a\u0431\u043e\u043e\u043a \u043a\u043b\u0438\u043a\u043e\u043c \u043d\u0430 \u0434\u0443\u0433\u043c\u0435 \"\u0434\u0430 \u0434\u0435\u0430\u043a\u0442\u0438\u0432\u0438\u0440\u0430\u0442\u0435\".",
														"N\u00e4r du v\u00e4ljer ett Google-kalkylark f\u00f6r att vara aktiv, det blir Active arbetsbok.\n\nN\u00e4r det finns en aktiv arbetsbok, kommer menyn Verktyg kan du v\u00e4lja enskilda kalkylblad inifr\u00e5n Active arbetsbok som skall exporteras, liksom Export Type.\n\nDu kan \u00f6ppna arbetsboken i ett webbl\u00e4sarf\u00f6nster genom att klicka p\u00e5 \"\u00d6ppna URL\"-knappen.\n\nDu kanske Inaktivera Active arbetsbok genom att klicka p\u00e5 knappen \"Inaktivera\".",
														"Wakati kuchagua Spreadsheet Google kuwa Active, inakuwa Kitabu cha Active.\n\nWakati kuna Kitabu cha Active, Vyombo vya menu itawawezesha kuchagua karatasi ya mtu binafsi kutoka ndani ya Kitabu cha Active kwa kuwa nje, kama vile Aina Export.\n\nUnaweza Fungua katika Dirisha Kitabu cha Browser kwa kubonyeza \"Open URL\" kifungo.\n\nUnaweza Deactivate Kitabu cha Active kwa kubonyeza \"Deactivate\" button.",
														"\u0e40\u0e21\u0e37\u0e48\u0e2d\u0e04\u0e38\u0e13\u0e40\u0e25\u0e37\u0e2d\u0e01\u0e2a\u0e40\u0e1b\u0e23\u0e14\u0e0a\u0e35\u0e15\u0e02\u0e2d\u0e07 Google \u0e08\u0e30\u0e43\u0e0a\u0e49\u0e07\u0e32\u0e19\u0e21\u0e31\u0e19\u0e08\u0e30\u0e01\u0e25\u0e32\u0e22\u0e40\u0e1b\u0e47\u0e19\u0e2a\u0e21\u0e38\u0e14\u0e07\u0e32\u0e19\u0e17\u200b\u200b\u0e35\u0e48\u0e43\u0e0a\u0e49\u0e07\u0e32\u0e19\n\n\u0e40\u0e21\u0e37\u0e48\u0e2d\u0e21\u0e35\u0e2a\u0e21\u0e38\u0e14\u0e07\u0e32\u0e19\u0e17\u200b\u200b\u0e35\u0e48\u0e43\u0e0a\u0e49\u0e07\u0e32\u0e19\u0e40\u0e21\u0e19\u0e39\u0e40\u0e04\u0e23\u0e37\u0e48\u0e2d\u0e07\u0e21\u0e37\u0e2d\u0e08\u0e30\u0e0a\u0e48\u0e27\u0e22\u0e43\u0e2b\u0e49\u0e04\u0e38\u0e13\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e40\u0e25\u0e37\u0e2d\u0e01\u0e41\u0e1c\u0e48\u0e19\u0e07\u0e32\u0e19\u0e1a\u0e38\u0e04\u0e04\u0e25\u0e08\u0e32\u0e01\u0e20\u0e32\u0e22\u0e43\u0e19\u0e2a\u0e21\u0e38\u0e14\u0e07\u0e32\u0e19\u0e17\u200b\u200b\u0e35\u0e48\u0e08\u0e30\u0e2a\u0e48\u0e07\u0e2d\u0e2d\u0e01\u0e40\u0e0a\u0e48\u0e19\u0e40\u0e14\u0e35\u0e22\u0e27\u0e01\u0e31\u0e1a\u0e01\u0e32\u0e23\u0e2a\u0e48\u0e07\u0e2d\u0e2d\u0e01\u0e1b\u0e23\u0e30\u0e40\u0e20\u0e17\n\n\u0e04\u0e38\u0e13\u0e2d\u0e32\u0e08\u0e08\u0e30\u0e40\u0e1b\u0e34\u0e14\u0e2a\u0e21\u0e38\u0e14\u0e07\u0e32\u0e19\u0e43\u0e19\u0e2b\u0e19\u0e49\u0e32\u0e15\u0e48\u0e32\u0e07\u0e40\u0e1a\u0e23\u0e32\u0e27\u0e4c\u0e40\u0e0b\u0e2d\u0e23\u0e4c\u0e42\u0e14\u0e22\u0e04\u0e25\u0e34\u0e01\u0e17\u0e35\u0e48\u0e1b\u0e38\u0e48\u0e21 \"Open URL\"\n\n\u0e04\u0e38\u0e13\u0e2d\u0e32\u0e08\u0e08\u0e30\u0e22\u0e01\u0e40\u0e25\u0e34\u0e01\u0e01\u0e32\u0e23\u0e43\u0e0a\u0e49\u0e2a\u0e21\u0e38\u0e14\u0e07\u0e32\u0e19\u0e17\u200b\u200b\u0e35\u0e48\u0e43\u0e0a\u0e49\u0e07\u0e32\u0e19\u0e42\u0e14\u0e22\u0e04\u0e25\u0e34\u0e01\u0e17\u0e35\u0e48\u0e1b\u0e38\u0e48\u0e21 \"\u0e22\u0e01\u0e40\u0e25\u0e34\u0e01\"",
														"Kapag pumili ka ng isang Google Spreadsheet na maging Aktibo, ito ay nagiging ang Aktibong Workbook.\n\nKapag mayroong isang Aktibo Workbook, ang menu ng Mga Tool ay magbibigay-daan sa iyo upang piliin ang mga indibidwal na mga worksheet mula sa loob ng Aktibong Workbook upang i-export, pati na rin ang Uri ng Pag-export.\n\nMaaari mong Buksan ang Workbook sa isang Window ng Browser sa pamamagitan ng pag-click sa pindutan na \"Buksan ang URL\".\n\nMaaari mong I-deactivate ang Aktibong Workbook sa pamamagitan ng pag-click sa pindutan ng \"I-deactivate\".",
														"Bir Google elektronik tablo Etkin olmak i\u00e7in se\u00e7ti\u011finizde, Etkin \u00c7al\u0131\u015fma Kitab\u0131 olur.\n\nActive \u00c7al\u0131\u015fma Kitab\u0131 oldu\u011funda, Ara\u00e7lar men\u00fcs\u00fc \u0130hracat T\u00fcr\u00fc yan\u0131 s\u0131ra, ihra\u00e7 edilecek Aktif \u00c7al\u0131\u015fma Kitab\u0131 i\u00e7inde bireysel \u00e7al\u0131\u015fma sayfalar\u0131 se\u00e7mek i\u00e7in izin verecektir.\n\nSen \"Open URL\" butonuna t\u0131klayarak bir taray\u0131c\u0131 penceresinde Kitab\u0131n\u0131 a\u00e7\u0131n olabilir.\n\nSen \"Devre D\u0131\u015f\u0131 B\u0131rak\" butonuna t\u0131klayarak Aktif \u00e7al\u0131\u015fma kitab\u0131 devre d\u0131\u015f\u0131 b\u0131rak\u0131n olabilir.",
														"\u041f\u0440\u0438 \u0432\u0438\u0431\u043e\u0440\u0456 \u0442\u0430\u0431\u043b\u0438\u0446\u0456 Google, \u0449\u043e\u0431 \u0431\u0443\u0442\u0438 \u0430\u043a\u0442\u0438\u0432\u043d\u0438\u043c, \u0432\u0456\u043d \u0441\u0442\u0430\u0454 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u044e \u043a\u043d\u0438\u0433\u0438.\n\n\u041a\u043e\u043b\u0438 \u0454 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u044e \u043a\u043d\u0438\u0433\u0438, \u043c\u0435\u043d\u044e \u0406\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u0438 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u044c \u0432\u0430\u043c \u0432\u0438\u0431\u0440\u0430\u0442\u0438 \u043e\u043a\u0440\u0435\u043c\u0456 \u0430\u0440\u043a\u0443\u0448\u0456 \u0432\u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0456 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0457 \u043a\u043d\u0438\u0433\u0438 \u0434\u043b\u044f \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u0443, \u0430 \u0442\u0430\u043a\u043e\u0436 \u0415\u043a\u0441\u043f\u043e\u0440\u0442\u043d\u043e Type.\n\n\u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u0438 \u043a\u043d\u0438\u0433\u0443 \u0443 \u0432\u0456\u043a\u043d\u0456 \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430, \u043d\u0430\u0442\u0438\u0441\u043d\u0443\u0432\u0448\u0438 \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u0412\u0456\u0434\u043a\u0440\u0438\u0442\u0438 URL\".\n\n\u0412\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0412\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0457 \u043a\u043d\u0438\u0433\u0438, \u043d\u0430\u0442\u0438\u0441\u043d\u0443\u0432\u0448\u0438 \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \"\u0412\u0438\u043c\u043a\u043d\u0443\u0442\u0438\".",
														"\u05d5\u05d5\u05e2\u05df \u05d0\u05d9\u05e8 \u05d0\u05d5\u05d9\u05e1\u05e7\u05dc\u05d9\u05d9\u05b7\u05d1\u05df \u05d0\u05b7 Google \u05e1\u05e4\u05bc\u05e8\u05e2\u05d3\u05e9\u05d9\u05d8 \u05e6\u05d5 \u05d6\u05d9\u05d9\u05df \u05d0\u05b7\u05e7\u05d8\u05d9\u05d5\u05d5, \u05e2\u05e1 \u05d5\u05d5\u05e2\u05e8\u05d8 \u05d3\u05d9 \u05d0\u05b7\u05e7\u05d8\u05d9\u05d5\u05d5\u05e2 \u05d5\u05d5\u05d0\u05b8\u05e8\u05e7\u05d1\u05d0\u05b8\u05d0\u05b8\u05e7.\n\n\u05d5\u05d5\u05e2\u05df \u05e2\u05e1 \u05d0\u05d9\u05d6 \u05d0\u05b7 \u05d0\u05b7\u05e7\u05d8\u05d9\u05d5\u05d5 \u05d5\u05d5\u05d0\u05b8\u05e8\u05e7\u05d1\u05d0\u05b8\u05d0\u05b8\u05e7, \u05d3\u05d9 \u05de\u05db\u05e9\u05d9\u05e8\u05d9\u05dd \u05de\u05e2\u05e0\u05d9\u05d5 \u05d5\u05d5\u05e2\u05d8 \u05dc\u05d0\u05b8\u05d6\u05df \u05d0\u05d9\u05e8 \u05e6\u05d5 \u05d0\u05d5\u05d9\u05e1\u05e7\u05dc\u05d9\u05d9\u05b7\u05d1\u05df \u05d9\u05d7\u05d9\u05d3 \u05d5\u05d5\u05e2\u05e8\u05e7\u05e9\u05d9\u05e5 \u05e4\u05d5\u05df \u05d9\u05df \u05d3\u05e2\u05e8 \u05d0\u05b7\u05e7\u05d8\u05d9\u05d5\u05d5 \u05d5\u05d5\u05d0\u05b8\u05e8\u05e7\u05d1\u05d0\u05b8\u05d0\u05b8\u05e7 \u05e6\u05d5 \u05d6\u05d9\u05d9\u05df \u05d9\u05e7\u05e1\u05e4\u05bc\u05d0\u05b8\u05e8\u05d8\u05d0\u05b7\u05d3, \u05d5\u05d5\u05d9 \u05d2\u05e2\u05d6\u05d5\u05e0\u05d8 \u05d5\u05d5\u05d9 \u05d3\u05d9 \u05d0\u05b7\u05e8\u05d5\u05d9\u05e1\u05e4\u05d9\u05e8\u05df \u05d8\u05d9\u05e4\u05bc.\n\n\u05d0\u05d9\u05e8 \u05d6\u05d0\u05dc \u05e2\u05e4\u05e2\u05e0\u05e2\u05df \u05d3\u05d9 \u05d5\u05d5\u05d0\u05b8\u05e8\u05e7\u05d1\u05d0\u05b8\u05d0\u05b8\u05e7 \u05d0\u05d9\u05df \u05d0\u05b7 \u05d1\u05dc\u05e2\u05d8\u05e2\u05e8\u05e2\u05e8 \u05e4\u05bf\u05e2\u05e0\u05e6\u05d8\u05e2\u05e8 \u05d3\u05d5\u05e8\u05da \u05d2\u05e2\u05d1\u05df \u05d0\u05b7 \u05e7\u05dc\u05d9\u05e7 \u05d3\u05e2\u05dd \"\u05e2\u05e4\u05bf\u05df URL\" \u05e7\u05e0\u05e2\u05e4\u05bc\u05dc.\n\n\u05d0\u05d9\u05e8 \u05d6\u05d0\u05dc \u05d3\u05d9\u05d0\u05b7\u05e7\u05d8\u05d9\u05d5\u05d5\u05d9\u05