			Rows.Add( new LocalizationRow("Your Google User Name and Password can be stored locally, so that you do not need to log in every time. \n\nHowever, keep in mind these values are saved in PLAIN TEXT form and can be accessed if your computer is compromised.\n \nIf you use the Log out button, your User Name and Password are cleared as well. ",
														"Votre Google nom d'utilisateur et mot de passe peuvent \u00eatre stock\u00e9s localement, de sorte que vous n'avez pas besoin de vous connecter \u00e0 chaque fois.\n\nCependant, gardez \u00e0 l'esprit ces valeurs sont enregistr\u00e9es sous forme de texte en clair et peuvent \u00eatre accessibles que si votre ordinateur est compromise.\n\u00a0\nSi vous utilisez le bouton D\u00e9connexion, votre nom d'utilisateur et mot de passe sont effac\u00e9s aussi.",
														"Il tuo nome utente Google e la password possono essere memorizzati in locale, in modo che non \u00e8 necessario effettuare il login ogni volta.\n\nTuttavia, tenere a mente questi valori vengono salvati in formato testo normale e si pu\u00f2 accedere se il computer \u00e8 compromesso.\n\u00a0\nSe si utilizza il pulsante Esci, il tuo nome utente e password vengono cancellate pure.",
														"Ihr Google-Benutzernamen und Passwort k\u00f6nnen lokal gespeichert werden, so dass Sie nicht brauchen, um jedes Mal einloggen.\n\nJedoch im Auge behalten, diese Werte werden im Klartext Form gespeichert und k\u00f6nnen abgerufen werden, wenn Ihr Computer ist gef\u00e4hrdet.\n\u00a0\nWenn Sie die Schaltfl\u00e4che Abmelden verwenden, werden Sie Ihren Benutzernamen und das Kennwort als auch gel\u00f6scht.",
														"Su Google Nombre de usuario y contrase\u00f1a pueden ser almacenados localmente, por lo que no es necesario que iniciar sesi\u00f3n cada vez.\n\nSin embargo, tenga en cuenta estos valores se guardan en forma de texto sin formato y se puede acceder si su equipo est\u00e1 en peligro.\n\u00a0\nSi utiliza el bot\u00f3n Desconectar, su nombre de usuario y contrase\u00f1a se borran tambi\u00e9n.",
														"\u062c\u0648\u062c\u0644 \u0644\u062f\u064a\u0643 \u0627\u0633\u0645 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0648\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0648\u064a\u0645\u0643\u0646 \u062a\u062e\u0632\u064a\u0646 \u0645\u062d\u0644\u064a\u0627\u060c \u0628\u062d\u064a\u062b \u0644\u0627 \u062a\u062d\u062a\u0627\u062c \u0625\u0644\u0649 \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644 \u0641\u064a \u0643\u0644 \u0645\u0631\u0629.\n\n\u0648\u0645\u0639 \u0630\u0644\u0643\u060c \u0646\u0636\u0639 \u0641\u064a \u0627\u0639\u062a\u0628\u0627\u0631\u0646\u0627 \u064a\u062a\u0645 \u062d\u0641\u0638 \u0647\u0630\u0647 \u0627\u0644\u0642\u064a\u0645 \u0641\u064a \u0634\u0643\u0644 \u0646\u0635 \u0639\u0627\u062f\u064a \u0648\u064a\u0645\u0643\u0646 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u064a\u0647\u0627 \u0625\u0630\u0627 \u062a\u0645 \u0627\u0644\u0645\u0633\u0627\u0633 \u062c\u0647\u0627\u0632 \u0627\u0644\u0643\u0645\u0628\u064a\u0648\u062a\u0631 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.\n\u00a0\n\u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0633\u062a\u062e\u062f\u0645 \u0632\u0631 \u062e\u0631\u0648\u062c\u060c \u064a\u062a\u0645 \u0645\u0633\u062d \u0627\u0633\u0645 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0648\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0623\u064a\u0636\u0627.",
