														"Va\u0161 Google uporabni\u0161ko ime in geslo, se lahko shranjujejo lokalno, tako da vam ni treba, da se prijavite v vsakem letnem \u010dasu.\n\nVendar ne pozabite, se te vrednosti shranijo v preprostem besedilni obliki in so dosegljivi, \u010de je ra\u010dunalnik ogro\u017een.\n\u00a0\n\u010ce uporabite gumb Odjava, so va\u0161e uporabni\u0161ko ime in geslo izbil kot dobro.",
