														"\u0412\u0430\u0448 \u0413\u043e\u043e\u0433\u043b\u0435 \u043a\u043e\u0440\u0438\u0441\u043d\u0438\u0447\u043a\u043e \u0438\u043c\u0435 \u0438 \u043b\u043e\u0437\u0438\u043d\u043a\u0443 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0441\u0435 \u0441\u043a\u043b\u0430\u0434\u0438\u0448\u0442\u0438 \u043b\u043e\u043a\u0430\u043b\u043d\u043e, \u0442\u0430\u043a\u043e \u0434\u0430 \u043d\u0435 \u043c\u043e\u0440\u0430\u0442\u0435 \u0434\u0430 \u0441\u0435 \u043f\u0440\u0438\u0458\u0430\u0432\u0438\u0442\u0435 \u0443 \u0441\u0432\u0430\u043a\u043e\u043c \u0432\u0440\u0435\u043c\u0435\u043d\u0443.\n\n\u041c\u0435\u0452\u0443\u0442\u0438\u043c, \u0438\u043c\u0430\u0458\u0442\u0435 \u043d\u0430 \u0443\u043c\u0443 \u043e\u0432\u0435 \u0432\u0440\u0435\u0434\u043d\u043e\u0441\u0442\u0438 \u0441\u0435 \u0447\u0443\u0432\u0430\u0458\u0443 \u0443 \u043e\u0431\u043b\u0438\u043a\u0443 \u0447\u0438\u0441\u0442\u043e\u0433 \u0442\u0435\u043a\u0441\u0442\u0430 \u043e\u0431\u043b\u0438\u043a\u0443 \u0438 \u043c\u043e\u0436\u0435 \u0441\u0435 \u043f\u0440\u0438\u0441\u0442\u0443\u043f\u0438\u0442\u0438 \u0430\u043a\u043e \u0458\u0435 \u0443\u0433\u0440\u043e\u0436\u0435\u043d \u0432\u0430\u0448 \u0440\u0430\u0447\u0443\u043d\u0430\u0440.\n\u00a0\n\u0410\u043a\u043e \u043a\u043e\u0440\u0438\u0441\u0442\u0438\u0442\u0435 \u0434\u0443\u0433\u043c\u0435 \u0437\u0430 \u043e\u0434\u0458\u0430\u0432\u0443, \u0441\u0432\u043e\u0458\u0435 \u043a\u043e\u0440\u0438\u0441\u043d\u0438\u0447\u043a\u043e \u0438\u043c\u0435 \u0438 \u043b\u043e\u0437\u0438\u043d\u043a\u0443 \u0441\u0435 \u0431\u0440\u0438\u0448\u0443 \u043a\u0430\u043e \u0434\u043e\u0431\u0440\u043e.",
														"Din Google anv\u00e4ndarnamn och l\u00f6senord kan lagras lokalt, s\u00e5 att du inte beh\u00f6ver logga in varje g\u00e5ng.\n\nMen kom ih\u00e5g dessa v\u00e4rden sparas i klartext formen och kan n\u00e5s om datorn \u00e4ventyras.\n\u00a0\nOm du anv\u00e4nder knappen Logga ut \u00e4r ditt anv\u00e4ndarnamn och l\u00f6senord rensas ocks\u00e5.",
														"Google yako Jina la mtumiaji na Password inaweza kuhifadhiwa ndani ya nchi, hivyo kwamba huna haja ya kuingia katika kila wakati.\n\nHata hivyo, kukumbuka maadili haya ni kuokolewa katika PLAIN TEXT aina na kulipata kama kompyuta yako ni kuathirika.\n\u00a0\nKama matumizi ya Log nje button, mtumiaji jina na password yako ni akalipa kama vizuri.",
