														"Ang iyong Google User Name at Password ay maaaring ma-imbak nang lokal, upang hindi mo na kailangang mag-log in sa bawat oras.\n\nGayunpaman, tandaan ang mga halagang ito ay naka-save sa simpleng form na TEXT at maaaring ma-access kung ang iyong computer ay nakompromiso.\n\u00a0\nKung gagamitin mo ang log out button, ang iyong User Name at Password ay clear pati na rin.",
														"Her zaman giri\u015f gerekmez b\u00f6ylece Google Kullan\u0131c\u0131 Ad\u0131 ve \u015eifre, yerel saklanabilir.\n\nAncak, ak\u0131lda bu de\u011ferler D\u00dcZ MET\u0130N \u015feklinde kaydedilir ve bilgisayar\u0131n\u0131z\u0131 tehlikeye ise eri\u015filebilir tutun.\n\u00a0\nE\u011fer Log d\u0131\u015far\u0131 d\u00fc\u011fmesini kullan\u0131rsan\u0131z, Kullan\u0131c\u0131 Ad\u0131 ve \u015eifre de silinir.",
														"\u0412\u0430\u0448 Google \u0406\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430 \u0456 \u043f\u0430\u0440\u043e\u043b\u044c \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0456 \u043b\u043e\u043a\u0430\u043b\u044c\u043d\u043e, \u0442\u0430\u043a \u0449\u043e \u0432\u0430\u043c \u043d\u0435 \u043f\u043e\u0442\u0440\u0456\u0431\u043d\u043e, \u0449\u043e\u0431 \u0443\u0432\u0456\u0439\u0442\u0438 \u043a\u043e\u0436\u0435\u043d \u0440\u0430\u0437.\n\n\u041e\u0434\u043d\u0430\u043a, \u043c\u0430\u0439\u0442\u0435 \u043d\u0430 \u0443\u0432\u0430\u0437\u0456, \u0446\u0456 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0443 \u0432\u0438\u0433\u043b\u044f\u0434\u0456 \u043f\u043e\u0441\u043b\u0456\u0434\u043e\u0432\u043d\u043e\u0433\u043e \u0442\u0435\u043a\u0441\u0442\u0443 \u0456 \u043c\u043e\u0436\u0443\u0442\u044c \u0431\u0443\u0442\u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456, \u044f\u043a\u0449\u043e \u0432\u0430\u0448 \u043a\u043e\u043c\u043f'\u044e\u0442\u0435\u0440 \u0437\u043d\u0430\u0445\u043e\u0434\u0438\u0442\u044c\u0441\u044f \u043f\u0456\u0434 \u0437\u0430\u0433\u0440\u043e\u0437\u043e\u044e.\n\u00a0\n\u042f\u043a\u0449\u043e \u0432\u0438 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u0435 \u043a\u043d\u043e\u043f\u043a\u0443 \u0412\u0438\u0439\u0442\u0438, \u0412\u0430\u0448\u0435 \u0456\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430 \u0456 \u043f\u0430\u0440\u043e\u043b\u044c \u0431\u0443\u0434\u0443\u0442\u044c \u043e\u0447\u0438\u0449\u0435\u043d\u0456, \u0430 \u0442\u0430\u043a\u043e\u0436.",
														"\u05d3\u05d9\u05d9\u05df Google \u05d1\u05d0\u05b7\u05e0\u05d9\u05e6\u05e2\u05e8 \u05e0\u05d0\u05b8\u05de\u05e2\u05df \u05d0\u05d5\u05df \u05e4\u05bc\u05d0\u05b7\u05e8\u05d0\u05b8\u05dc \u05e7\u05e2\u05e0\u05e2\u05df \u05d6\u05d9\u05d9\u05df \u05e1\u05d8\u05d0\u05b8\u05e8\u05d3 \u05dc\u05d0\u05b8\u05d5\u05e7\u05d0\u05b7\u05dc\u05d9, \u05d0\u05b7\u05d6\u05d5\u05d9 \u05d0\u05b7\u05d6 \u05d0\u05d9\u05e8 \u05d8\u05d0\u05b8\u05df \u05e0\u05d9\u05d8 \u05d3\u05d0\u05b7\u05e8\u05e4\u05bf\u05df \u05e6\u05d5 \u05e7\u05dc\u05d0\u05b8\u05e5 \u05d0\u05d9\u05df \u05d9\u05e2\u05d3\u05e2\u05e8 \u05e6\u05d9\u05d9\u05b7\u05d8.\n\n\u05d0\u05d1\u05e2\u05e8, \u05d4\u05d0\u05b7\u05dc\u05d8\u05df \u05d0\u05d9\u05df \u05d2\u05d9\u05d9\u05b7\u05e1\u05d8 \u05d3\u05d9 \u05d5\u05d5\u05d0\u05b7\u05dc\u05d5\u05e2\u05e1 \u05d6\u05e2\u05e0\u05e2\u05df \u05e0\u05d9\u05e6\u05d5\u05dc \u05d0\u05d9\u05df \u05e7\u05dc\u05d0\u05b8\u05e8 \u05d8\u05e2\u05e7\u05e1\u05d8 \u05e4\u05d0\u05b8\u05e8\u05e2\u05dd \u05d0\u05d5\u05df \u05e7\u05e2\u05e0\u05e2\u05df \u05d5\u05d5\u05e2\u05e8\u05df \u05d2\u05e2\u05dc\u05d9\u05d9\u05e0\u05d8 \u05d0\u05d5\u05d9\u05d1 \u05d3\u05d9\u05d9\u05df \u05e7\u05d0\u05b8\u05de\u05e4\u05bc\u05d9\u05d5\u05d8\u05e2\u05e8 \u05d0\u05d9\u05d6 \u05e7\u05d0\u05b7\u05de\u05e4\u05bc\u05e8\u05d0\u05b7\u05de\u05d9\u05d9\u05d6\u05d3.\n\u00a0\n\u05d0\u05d5\u05d9\u05d1 \u05d0\u05d9\u05e8 \u05e0\u05d5\u05e6\u05df \u05d3\u05e2\u05dd \u05e7\u05dc\u05d0\u05b8\u05e5 \u05d0\u05d5\u05d9\u05e1 \u05e7\u05e0\u05e2\u05e4\u05bc\u05dc, \u05d3\u05d9\u05d9\u05df \u05d1\u05d0\u05b7\u05e0\u05d9\u05e6\u05e2\u05e8 \u05e0\u05d0\u05b8\u05de\u05e2\u05df \u05d0\u05d5\u05df \u05e4\u05bc\u05d0\u05b7\u05e8\u05d0\u05b8\u05dc \u05d6\u05e2\u05e0\u05e2\u05df \u05e7\u05dc\u05d9\u05e8\u05d3 \u05d5\u05d5\u05d9 \u05d2\u05e2\u05d6\u05d5\u05e0\u05d8.",
