														"\u0e01\u0e32\u0e23\u0e2a\u0e48\u0e07\u0e2d\u0e2d\u0e01 NGUI \u0e23\u0e2d\u0e07\u0e23\u0e31\u0e1a\u0e2b\u0e25\u0e32\u0e22\u0e20\u0e32\u0e29\u0e32",
														"Panluwas na Kalakal NGUI lokalisasyon",
														"\u0130hracat Ngui Yerelle\u015ftirme",
														"\u0415\u043a\u0441\u043f\u043e\u0440\u0442 NGUI \u041b\u043e\u043a\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u044f",
														"\u05e2\u05e7\u05e1\u05e4\u05bc\u05d0\u05b8\u05e8\u05d8\u05d9\u05e0\u05d2 \u05e0\u05d2\u05d5\u05d9 \u05dc\u05d0\u05b8\u05e7\u05d0\u05b7\u05dc\u05d9\u05d6\u05d0\u05b7\u05d8\u05d9\u05d0\u05b8\u05df",
														"\u51fa\u53e3NGUI\u672c\u5730\u5316"));
			Rows.Add( new LocalizationRow("If GoogleFu has detected that NGUI is present in the project, it will allow you to set an NGUI export path.\n\nEnabling NGUI Export and setting the NGUI export path will allow GoogleFu to save localization files in a format that NGUI is able to process natively. \n\nThe Google Spreadsheet must be set up correctly for NGUI to be able to process these files. See the sample for a demonstration.  ",
														"Si GoogleFu a d\u00e9tect\u00e9 que Ngui est pr\u00e9sent dans le projet, il vous permettra de d\u00e9finir un chemin d'exportation Ngui.\n\nActivation Ngui exportation et la d\u00e9finition du chemin d'exportation Ngui permettra GoogleFu pour enregistrer les fichiers de localisation dans un format qui Ngui est capable de traiter nativement.\n\nLa feuille de calcul Google doit \u00eatre configur\u00e9 correctement pour Ngui pour \u00eatre en mesure de traiter ces fichiers. Voir l'exemple pour une d\u00e9monstration.",
														"Se GoogleFu ha rilevato che Ngui \u00e8 presente nel progetto, vi permetter\u00e0 di impostare un percorso di esportazione Ngui.\n\nAbilitazione Ngui Export e impostare il percorso di esportazione Ngui permetter\u00e0 GoogleFu per salvare i file di localizzazione in un formato che Ngui \u00e8 in grado di elaborare in modo nativo.\n\nIl foglio di calcolo di Google deve essere impostato correttamente per Ngui per essere in grado di elaborare questi file. Vedere l'esempio per una dimostrazione.",
														"Wenn GoogleFu hat erkannt, dass Ngui im \u200b\u200bProjekt vorhanden ist, wird er Ihnen eine Ngui Exportpfad festlegen.\n\nAktivieren Ngui Export und Einstellung der Ngui Exportpfad erm\u00f6glicht GoogleFu zu Lokalisierungsdateien in einem Format, das in der Lage ist Ngui nativ verarbeiten zu speichern.\n\nDas Google-Spreadsheet muss korrekt eingerichtet f\u00fcr Ngui in der Lage, diese Dateien zu verarbeiten sein. Siehe das Beispiel f\u00fcr eine Demonstration.",
														"Si googleFU ha detectado que ngui est\u00e1 presente en el proyecto, que permitir\u00e1 establecer una ruta de exportaci\u00f3n ngui.\n\nHabilitaci\u00f3n ngui exportaci\u00f3n y el establecimiento de la ruta de exportaci\u00f3n ngui permitir\u00e1 googleFU para guardar los archivos de localizaci\u00f3n en un formato que ngui es capaz de procesar de forma nativa.\n\nLa hoja de c\u00e1lculo de Google debe estar configurado correctamente para ngui para poder procesar estos archivos. Vea el ejemplo para una demostraci\u00f3n.",
														"\u0625\u0630\u0627 \u0643\u0634\u0641 GoogleFu \u0623\u0646 NGUI \u0645\u0648\u062c\u0648\u062f \u0641\u064a \u0627\u0644\u0645\u0634\u0631\u0648\u0639\u060c \u0648\u0633\u0648\u0641 \u062a\u0633\u0645\u062d \u0644\u0643 \u0644\u062a\u062d\u062f\u064a\u062f \u0645\u0633\u0627\u0631 \u0627\u0644\u062a\u0635\u062f\u064a\u0631 NGUI.\n\n\u0633\u0648\u0641 \u062a\u0645\u0643\u0646 NGUI \u0627\u0644\u062a\u0635\u062f\u064a\u0631 \u0648\u062a\u062d\u062f\u064a\u062f \u0645\u0633\u0627\u0631 \u0627\u0644\u062a\u0635\u062f\u064a\u0631 NGUI \u062a\u0633\u0645\u062d GoogleFu \u0644\u062d\u0641\u0638 \u0645\u0644\u0641\u0627\u062a \u0627\u0644\u062a\u0631\u062c\u0645\u0629 \u0641\u064a \u0634\u0643\u0644 NGUI \u063a\u064a\u0631 \u0642\u0627\u062f\u0631\u0629 \u0639\u0644\u0649 \u0645\u0639\u0627\u0644\u062c\u0629 \u0623\u0635\u0644\u0627.\n\n\u064a\u062c\u0628 \u062a\u0639\u064a\u064a\u0646 \u0628\u064a\u0627\u0646\u0627\u062a Google \u0628\u0634\u0643\u0644 \u0635\u062d\u064a\u062d \u0644NGUI \u0644\u062a\u0643\u0648\u0646 \u0642\u0627\u062f\u0631\u0629 \u0639\u0644\u0649 \u0645\u0639\u0627\u0644\u062c\u0629 \u0647\u0630\u0647 \u0627\u0644\u0645\u0644\u0641\u0627\u062a. \u0631\u0624\u064a\u0629 \u0639\u064a\u0646\u0629 \u0644\u0644\u0645\u0638\u0627\u0647\u0631\u0629.",
														"GoogleFu\uac00 NGUI \ud504\ub85c\uc81d\ud2b8\uc5d0 \uc788\ub294\uc9c0 \uac10\uc9c0\ud558\ub294 \uacbd\uc6b0, \uadf8\uac83\uc740 \ub2f9\uc2e0\uc774 NGUI \uc218\ucd9c \uacbd\ub85c\ub97c \uc124\uc815 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\nNGUI \uc218\ucd9c \uacbd\ub85c\ub97c NGUI \uc218\ucd9c\uc744 \ud65c\uc131\ud654\ud558\uace0 \uc124\uc815\ud558\uba74 GoogleFu\ub294 NGUI\uac00 \uae30\ubcf8\uc801\uc73c\ub85c \ucc98\ub9ac \ud560 \uc218\u200b\u200b\uc788\ub294 \ud615\uc2dd\uc73c\ub85c \ud604\uc9c0\ud654 \ud30c\uc77c\uc744 \uc800\uc7a5\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\nNGUI\uc774 \ud30c\uc77c\uc744 \ucc98\ub9ac \ud560 \uc218\u200b\u200b\uc788\uac8c\ud558\ub294 \uad6c\uae00 \uc2a4\ud504\ub808\ub4dc \uc2dc\ud2b8\uac00 \uc62c\ubc14\ub974\uac8c \uc124\uc815\ud574\uc57c\ud569\ub2c8\ub2e4. \ub370\ubaa8 \uc0d8\ud50c\uc744 \ucc38\uc870\ud558\uc2ed\uc2dc\uc624.",
														"\u5982\u679cGoogleFu\u68c0\u6d4b\u5230NGUI\u5b58\u5728\u7684\u9879\u76ee\uff0c\u5b83\u53ef\u4ee5\u8ba9\u4f60\u8bbe\u7f6e\u4e00\u4e2aNGUI\u5bfc\u51fa\u8def\u5f84\u3002\n\n\u542f\u7528NGUI\u51fa\u53e3\u548c\u8bbe\u7f6eNGUI\u51fa\u53e3\u8def\u5f84\u5c06\u5141\u8bb8GoogleFu\u4fdd\u5b58\u7684\u683c\u5f0fNGUI\u80fd\u591f\u5728\u672c\u5730\u5904\u7406\u672c\u5730\u5316\u6587\u4ef6\u3002\n\n\u5728\u8c37\u6b4c\u7535\u5b50\u8868\u683c\uff0c\u5fc5\u987b\u6b63\u786e\u8bbe\u7f6eNGUI\u8981\u80fd\u591f\u5904\u7406\u8fd9\u4e9b\u6587\u4ef6\u3002\u67e5\u770b\u793a\u4f8b\u6f14\u793a\u3002",
														"GoogleFu\u306fNGUI\u306f\u3001\u30d7\u30ed\u30b8\u30a7\u30af\u30c8\u5185\u306b\u5b58\u5728\u3059\u308b\u3053\u3068\u3092\u691c\u51fa\u3057\u305f\u5834\u5408\u306b\u306f\u3001\u305d\u308c\u306f\u3042\u306a\u305f\u304cNGUI\u306e\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u30d1\u30b9\u3092\u8a2d\u5b9a\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u308b\u3088\u3046\u306b\u306a\u308a\u307e\u3059\u3002\n\nNGUI\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u306e\u6709\u52b9\u5316\u3068NGUI\u306e\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u30d1\u30b9\u3092\u8a2d\u5b9a\u3059\u308bGoogleFu\u306fNGUI\u30cd\u30a4\u30c6\u30a3\u30d6\u51e6\u7406\u3067\u304d\u308b\u5f62\u5f0f\u3067\u30ed\u30fc\u30ab\u30e9\u30a4\u30ba\u30d5\u30a1\u30a4\u30eb\u3092\u4fdd\u5b58\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\n\nNGUI\u3053\u308c\u3089\u306e\u30d5\u30a1\u30a4\u30eb\u3092\u51e6\u7406\u3067\u304d\u308b\u3088\u3046\u306b\u3059\u308b\u305f\u3081\u306eGoogle\u30b9\u30d7\u30ec\u30c3\u30c9\u30b7\u30fc\u30c8\u3092\u6b63\u3057\u304f\u8a2d\u5b9a\u3059\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u3059\u3002\u30c7\u30e2\u7528\u306e\u30b5\u30f3\u30d7\u30eb\u3092\u53c2\u7167\u3057\u3066\u304f\u3060\u3055\u3044\u3002",
														"\u0415\u0441\u043b\u0438 GoogleFu \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0438\u043b, \u0447\u0442\u043e NGUI \u043f\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \u0432 \u043f\u0440\u043e\u0435\u043a\u0442\u0435, \u044d\u0442\u043e \u043f\u043e\u0437\u0432\u043e\u043b\u0438\u0442 \u0432\u0430\u043c \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u043f\u0443\u0442\u044c \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0430 NGUI.\n\n\u0412\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 NGUI \u042d\u043a\u0441\u043f\u043e\u0440\u0442 \u0438 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0430 \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u043d\u044b\u0439 \u043f\u0443\u0442\u044c NGUI \u043f\u043e\u0437\u0432\u043e\u043b\u0438\u0442 GoogleFu \u0441\u043e\u0445\u0440\u0430\u043d\u0438\u0442\u044c \u0444\u0430\u0439\u043b\u044b \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0438 \u0432 \u0444\u043e\u0440\u043c\u0430\u0442\u0435, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 NGUI \u0441\u043f\u043e\u0441\u043e\u0431\u0435\u043d \u043e\u0431\u0440\u0430\u0431\u0430\u0442\u044b\u0432\u0430\u0442\u044c \u0438\u0437\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e.\n\n\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u044b\u0435 \u0442\u0430\u0431\u043b\u0438\u0446\u044b Google \u0434\u043e\u043b\u0436\u0435\u043d \u0431\u044b\u0442\u044c \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043d \u043d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u043e \u0434\u043b\u044f NGUI, \u0447\u0442\u043e\u0431\u044b \u0438\u043c\u0435\u0442\u044c \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u043e\u0431\u0440\u0430\u0431\u0430\u0442\u044b\u0432\u0430\u0442\u044c \u044d\u0442\u0438 \u0444\u0430\u0439\u043b\u044b. \u0421\u043c\u043e\u0442\u0440\u0438\u0442\u0435 \u043f\u0440\u0438\u043c\u0435\u0440 \u0434\u043b\u044f \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u0438.",
														"N\u1ebfu GoogleFu \u0111\u00e3 ph\u00e1t hi\u1ec7n ra r\u1eb1ng NGUI c\u00f3 m\u1eb7t trong d\u1ef1 \u00e1n, n\u00f3 s\u1ebd cho ph\u00e9p b\u1ea1n thi\u1ebft l\u1eadp m\u1ed9t con \u0111\u01b0\u1eddng xu\u1ea5t kh\u1ea9u NGUI.\n\nCho ph\u00e9p NGUI xu\u1ea5t kh\u1ea9u v\u00e0 thi\u1ebft l\u1eadp c\u00e1c con \u0111\u01b0\u1eddng xu\u1ea5t kh\u1ea9u NGUI s\u1ebd cho ph\u00e9p GoogleFu \u0111\u1ec3 l\u01b0u c\u00e1c t\u1eadp tin n\u1ed9i \u0111\u1ecba h\u00f3a trong m\u1ed9t \u0111\u1ecbnh d\u1ea1ng NGUI c\u00f3 th\u1ec3 x\u1eed l\u00fd t\u1ef1 nhi\u00ean.\n\nB\u1ea3ng t\u00ednh Google ph\u1ea3i \u0111\u01b0\u1ee3c thi\u1ebft l\u1eadp m\u1ed9t c\u00e1ch ch\u00ednh x\u00e1c cho NGUI \u0111\u1ec3 c\u00f3 th\u1ec3 x\u1eed l\u00fd nh\u1eefng t\u1eadp tin n\u00e0y. Xem m\u1eabu cho m\u1ed9t cu\u1ed9c bi\u1ec3u t\u00ecnh.",
														"Als GoogleFu heeft gedetecteerd dat Ngui aanwezig is in het project is, zal het u toestaan \u200b\u200bom een \u200b\u200bNgui export pad te zetten.\n\nEnabling Ngui Export en het instellen van de Ngui exportpad zal toestaan \u200b\u200bGoogleFu localisatie bestanden op te slaan in een formaat dat Ngui in staat is om native verwerken.\n\nDe Google-spreadsheet moet correct zijn ingesteld voor Ngui in staat om deze bestanden te verwerken. Zie het voorbeeld voor een demonstratie.",
														"As GoogleFu het ontdek dat Ngui teenwoordig is in die projek, sal dit jou toelaat om 'n Ngui uitvoer pad te stel.\n\nStaat te stel Ngui Uitvoer en die opstel van die Ngui uitvoer pad sal toelaat GoogleFu lokalisering l\u00eaers te red in 'n formaat wat Ngui kan native verwerk.\n\nDie Google-sigblad moet opgestel word korrek vir Ngui in staat wees om hierdie l\u00eaers te verwerk. Sien die voorbeeld vir 'n demonstrasie.",
														"\u0410\u043a\u043e GoogleFu \u0435 \u043e\u0442\u043a\u0440\u0438\u043b, \u0447\u0435 NGUI \u043f\u0440\u0438\u0441\u044a\u0441\u0442\u0432\u0430 \u0432 \u043f\u0440\u043e\u0435\u043a\u0442\u0430, \u0442\u044f \u0449\u0435 \u0432\u0438 \u043f\u043e\u0437\u0432\u043e\u043b\u0438 \u0434\u0430 \u0437\u0430\u0434\u0430\u0434\u0435\u0442\u0435 NGUI \u0438\u0437\u043d\u043e\u0441 \u043f\u044a\u0442.\n\n\u0420\u0430\u0437\u0440\u0435\u0448\u0430\u0432\u0430\u043d\u0435\u0442\u043e NGUI \u0438\u0437\u043d\u043e\u0441 \u0438 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u043d\u0435 \u043d\u0430 \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u043d\u0430\u0442\u0430 \u043f\u044a\u0442\u044f NGUI \u0449\u0435 \u043f\u043e\u0437\u0432\u043e\u043b\u0438 GoogleFu \u0434\u0430 \u0441\u043f\u0430\u0441\u0438 \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u043e\u043d\u043d\u0438 \u0444\u0430\u0439\u043b\u043e\u0432\u0435 \u0432\u044a\u0432 \u0444\u043e\u0440\u043c\u0430\u0442, \u043a\u043e\u0439\u0442\u043e NGUI \u0435 \u0432 \u0441\u044a\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u0434\u0430 \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u0432\u0430 \u0440\u043e\u0434\u0435\u043d.\n\n\u0415\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u0430\u0442\u0430 \u0442\u0430\u0431\u043b\u0438\u0446\u0430 Google \u0442\u0440\u044f\u0431\u0432\u0430 \u0434\u0430 \u0431\u044a\u0434\u0435 \u043a\u043e\u043d\u0444\u0438\u0433\u0443\u0440\u0438\u0440\u0430\u043d \u043f\u0440\u0430\u0432\u0438\u043b\u043d\u043e \u0437\u0430 NGUI \u0434\u0430 \u0431\u044a\u0434\u0435 \u0432 \u0441\u044a\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u0434\u0430 \u043e\u0431\u0440\u0430\u0431\u043e\u0442\u0432\u0430 \u0442\u0435\u0437\u0438 \u0444\u0430\u0439\u043b\u043e\u0432\u0435. \u0412\u0438\u0436\u0442\u0435 \u043f\u0440\u043e\u0431\u0430\u0442\u0430 \u0437\u0430 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u044f.",
														"\u041a\u0430\u043b\u0456 GoogleFu \u0432\u044b\u044f\u0432\u0456\u045e, \u0448\u0442\u043e NGUI \u043f\u0440\u044b\u0441\u0443\u0442\u043d\u0456\u0447\u0430\u0435 \u045e \u043f\u0440\u0430\u0435\u043a\u0446\u0435, \u0433\u044d\u0442\u0430 \u0434\u0430\u0437\u0432\u043e\u043b\u0456\u0446\u044c \u0432\u0430\u043c \u0443\u0441\u0442\u0430\u043b\u044f\u0432\u0430\u0446\u044c \u0448\u043b\u044f\u0445 \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u0443 NGUI.\n\n\u040e\u043a\u043b\u044e\u0447\u044d\u043d\u043d\u0435 NGUI \u042d\u043a\u0441\u043f\u0430\u0440\u0442 \u0456 \u045e\u0441\u0442\u0430\u043d\u043e\u045e\u043a\u0430 \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u043d\u044b \u0448\u043b\u044f\u0445 NGUI \u0434\u0430\u0437\u0432\u043e\u043b\u0456\u0446\u044c GoogleFu \u0437\u0430\u0445\u0430\u0432\u0430\u0446\u044c \u0444\u0430\u0439\u043b\u044b \u043b\u0430\u043a\u0430\u043b\u0456\u0437\u0430\u0446\u044b\u0456 \u045e \u0444\u0430\u0440\u043c\u0430\u0446\u0435, \u044f\u043a\u0456 NGUI \u0437\u0434\u043e\u043b\u044c\u043d\u044b \u0430\u043f\u0440\u0430\u0446\u043e\u045e\u0432\u0430\u0446\u044c \u043f\u0435\u0440\u0448\u0430\u043f\u0430\u0447\u0430\u0442\u043a\u043e\u0432\u0430.\n\n\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u044b\u044f \u0442\u0430\u0431\u043b\u0456\u0446\u044b Google \u043f\u0430\u0432\u0456\u043d\u0435\u043d \u0431\u044b\u0446\u044c \u043d\u0430\u043b\u0430\u0434\u0436\u0430\u043d\u044b \u043d\u044f\u043f\u0440\u0430\u0432\u0456\u043b\u044c\u043d\u0430 \u0434\u043b\u044f NGUI, \u043a\u0430\u0431 \u043c\u0435\u0446\u044c \u043c\u0430\u0433\u0447\u044b\u043c\u0430\u0441\u0446\u044c \u0430\u043f\u0440\u0430\u0446\u043e\u045e\u0432\u0430\u0446\u044c \u0433\u044d\u0442\u044b\u044f \u0444\u0430\u0439\u043b\u044b. \u0413\u043b\u044f\u0434\u0437\u0456\u0446\u0435 \u043f\u0440\u044b\u043a\u043b\u0430\u0434 \u0434\u043b\u044f \u0434\u044d\u043c\u0430\u043d\u0441\u0442\u0440\u0430\u0446\u044b\u0456.",
														"Si googleFU ha detectat que Ngui est\u00e0 present en el projecte, que permetr\u00e0 establir una ruta d'exportaci\u00f3 Ngui.\n\nHabilitaci\u00f3 Ngui exportaci\u00f3 i l'establiment de la ruta d'exportaci\u00f3 Ngui permetr\u00e0 googleFU per guardar els arxius de localitzaci\u00f3 en un format que Ngui \u00e9s capa\u00e7 de processar de forma nativa.\n\nEl full de c\u00e0lcul de Google ha d'estar configurat correctament per Ngui per poder processar aquests fitxers. Vegeu l'exemple per a una demostraci\u00f3.",
														"Pokud GoogleFu zjistil, \u017ee NGUI je p\u0159\u00edtomen v projektu, umo\u017en\u00ed v\u00e1m nastavit NGUI export PATH.\n\nPovolen\u00ed NGUI Export a kter\u00fdm se stanov\u00ed v\u00fdvozn\u00ed cestu NGUI umo\u017en\u00ed GoogleFu ukl\u00e1dat lokaliza\u010dn\u00ed soubory ve form\u00e1tu, kter\u00fd NGUI je schopen zpracovat nativn\u011b.\n\nTabulkov\u00fd Google mus\u00ed b\u00fdt spr\u00e1vn\u011b nastavena pro NGUI b\u00fdt schopen zpracovat tyto soubory. Pod\u00edvejte se na uk\u00e1zku pro demonstraci.",
														"Os GoogleFu wedi canfod fod NGUI yn bresennol yn y prosiect, bydd yn caniat\u00e1u i chi i osod llwybr allforio NGUI.\n\nBydd Galluogi NGUI Allforio a gosod y llwybr allforio NGUI caniat\u00e1u GoogleFu i arbed ffeiliau lleoleiddio mewn fformat sy'n NGUI yn gallu prosesu frodorol.\n\nRhaid i'r Taenlen Google yn cael ei osod yn gywir ar gyfer NGUI i yn gallu prosesu ffeiliau hyn. Gweler y sampl ar gyfer arddangosiad.",
														"Kui GoogleFu on avastanud, et NGUI esineb projekti, see v\u00f5imaldab teil m\u00e4\u00e4rata NGUI ekspordi tee.\n\nSoodustavad NGUI Ekspordi ja millega NGUI ekspordi tee v\u00f5imaldab GoogleFu s\u00e4\u00e4sta lokaliseerimine faili formaat, mis NGUI on v\u00f5imalik t\u00f6\u00f6delda algup\u00e4raselt.\n\nGoogle t\u00f6\u00f6vihik tuleb luua korrektselt NGUI suutma t\u00f6\u00f6delda neid faile. Vaata proov demonstratsioon.",
														"\u0627\u06af\u0631 GoogleFu \u0634\u0646\u0627\u0633\u0627\u06cc\u06cc \u06a9\u0631\u062f\u0647 \u0627\u0633\u062a \u06a9\u0647 NGUI \u062d\u0627\u0636\u0631 \u062f\u0631 \u0627\u06cc\u0646 \u067e\u0631\u0648\u0698\u0647 \u0627\u0633\u062a\u060c \u0622\u0646 \u0631\u0627 \u0627\u062c\u0627\u0632\u0647 \u062e\u0648\u0627\u0647\u062f \u062f\u0627\u062f \u06a9\u0647 \u0634\u0645\u0627 \u0631\u0627 \u0628\u0647 \u0645\u062c\u0645\u0648\u0639\u0647 \u0631\u0627\u0647 \u0635\u0627\u062f\u0631\u0627\u062a NGUI.\n\n\u0641\u0639\u0627\u0644 \u06a9\u0631\u062f\u0646 NGUI \u0635\u0627\u062f\u0631\u0627\u062a \u0648 \u062a\u0646\u0638\u06cc\u0645 \u0645\u0633\u06cc\u0631 \u0635\u0627\u062f\u0631\u0627\u062a NGUI \u0627\u062c\u0627\u0632\u0647 \u062e\u0648\u0627\u0647\u062f \u062f\u0627\u062f \u06a9\u0647 GoogleFu \u0628\u0631\u0627\u06cc \u0630\u062e\u06cc\u0631\u0647 \u0641\u0627\u06cc\u0644 \u0647\u0627\u06cc \u0645\u062d\u0644\u06cc \u062f\u0631 \u06cc\u06a9 \u0641\u0631\u0645\u062a \u0627\u0633\u062a \u06a9\u0647 NGUI \u0642\u0627\u062f\u0631 \u0628\u0647 \u067e\u0631\u062f\u0627\u0632\u0634 \u0628\u0648\u0645\u06cc \u0627\u0633\u062a.\n\n\u0635\u0641\u062d\u0647 \u06af\u0633\u062a\u0631\u062f\u0647 \u06af\u0648\u06af\u0644 \u0628\u0627\u06cc\u062f \u0631\u0627\u0647 \u0627\u0646\u062f\u0627\u0632\u06cc \u0628\u0647 \u062f\u0631\u0633\u062a\u06cc \u0628\u0631\u0627\u06cc NGUI \u0642\u0627\u062f\u0631 \u0628\u0647 \u067e\u0631\u062f\u0627\u0632\u0634 \u0627\u06cc\u0646 \u0641\u0627\u06cc\u0644 \u0647\u0627. \u0646\u0645\u0648\u0646\u0647 \u0628\u0631\u0627\u06cc \u06cc\u06a9 \u062a\u0638\u0627\u0647\u0631\u0627\u062a \u0631\u0627 \u0645\u0634\u0627\u0647\u062f\u0647 \u06a9\u0646\u06cc\u062f.",
														"Jos GoogleFu on havainnut NGUI on l\u00e4sn\u00e4 hankkeeseen, sen avulla voit asettaa NGUI vienti polku.\n\nMahdollistaa NGUI Vienti ja asettamalla NGUI vienti polku mahdollistaa GoogleFu s\u00e4\u00e4st\u00e4\u00e4 lokalisointitiedostot muodossa, joka NGUI pystyy k\u00e4sittelem\u00e4\u00e4n natiivisti.\n\nGoogle-laskentataulukko on m\u00e4\u00e4ritetty oikein NGUI pysty\u00e4 k\u00e4sittelem\u00e4\u00e4n n\u00e4it\u00e4 tiedostoja. Katso n\u00e4yte esittelyn.",
														"M\u00e1 t\u00e1 GoogleFu braitheadh \u200b\u200bgo bhfuil NGUI i l\u00e1thair sa tionscadal, beidh s\u00e9 deis duit a chur ar cos\u00e1n onnmhairithe NGUI.\n\nBeidh Cumas\u00fa NGUI Onnmhairi\u00fa agus a leagan s\u00edos an cos\u00e1n ar onnmhair\u00ed NGUI chumas GoogleFu a sh\u00e1bh\u00e1il comhaid log\u00e1naithe i bhform\u00e1id at\u00e1 NGUI in ann a phr\u00f3ise\u00e1il natively.\n\nN\u00ed m\u00f3r an Scarbhileog Google a chur ar bun i gceart do NGUI a bheith in ann na comhaid seo a phr\u00f3ise\u00e1il. F\u00e9ach ar an sampla le haghaidh taispe\u00e1ntais.",
														"Se GoogleFu detectou que Ngui est\u00e1 presente no proxecto, que permitir\u00e1 que estableza un cami\u00f1o de exportaci\u00f3n Ngui.\n\nActivando Ngui Exportaci\u00f3n e definir o cami\u00f1o de exportaci\u00f3n Ngui permitir\u00e1 GoogleFu para gardar arquivos de localizaci\u00f3n nun formato que Ngui \u00e9 capaz de procesar nativamente.\n\nA folla de c\u00e1lculo de Google debe ser configurado correctamente para Ngui para poder procesar estes arquivos. Vexa o exemplo para unha demostraci\u00f3n.",
														"GoogleFu NGUI \u092a\u0930\u093f\u092f\u094b\u091c\u0928\u093e \u092e\u0947\u0902 \u092e\u094c\u091c\u0942\u0926 \u0939\u0948 \u0915\u093f \u092a\u0924\u093e \u0932\u0917\u093e\u092f\u093e \u0917\u092f\u093e \u0939\u0948, \u0924\u094b \u092f\u0939 \u0906\u092a\u0915\u094b \u090f\u0915 NGUI \u0928\u093f\u0930\u094d\u092f\u093e\u0924 \u092a\u0925 \u0938\u0947\u091f \u0915\u0930\u0928\u0947 \u0915\u0940 \u0905\u0928\u0941\u092e\u0924\u093f \u0926\u0947\u0917\u093e.\n\nNGUI \u0928\u093f\u0930\u094d\u092f\u093e\u0924 \u092a\u0925 NGUI \u0928\u093f\u0930\u094d\u092f\u093e\u0924 \u0915\u094b \u0938\u0915\u094d\u0937\u092e \u0915\u0930\u0928\u0947 \u0914\u0930 \u0938\u094d\u0925\u093e\u092a\u093f\u0924 \u0915\u0930\u0928\u0947 GoogleFu NGUI natively \u092a\u094d\u0930\u0915\u094d\u0930\u093f\u092f\u093e \u092e\u0947\u0902 \u0938\u0915\u094d\u0937\u092e \u0939\u0948 \u0915\u093f \u090f\u0915 \u092a\u094d\u0930\u093e\u0930\u0942\u092a \u092e\u0947\u0902 \u0938\u094d\u0925\u093e\u0928\u0940\u092f\u0915\u0930\u0923 \u092b\u093e\u0907\u0932\u094b\u0902 \u0915\u094b \u092c\u091a\u093e\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0905\u0928\u0941\u092e\u0924\u093f \u0926\u0947\u0917\u093e.\n\nNGUI \u0907\u0928 \u092b\u093e\u0907\u0932\u094b\u0902 \u092a\u0930 \u0915\u093e\u0930\u094d\u0930\u0935\u093e\u0908 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0938\u0915\u094d\u0937\u092e \u0939\u094b\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0917\u0942\u0917\u0932 \u0938\u094d\u092a\u094d\u0930\u0947\u0921\u0936\u0940\u091f \u0938\u0939\u0940 \u0922\u0902\u0917 \u0938\u0947 \u0938\u094d\u0925\u093e\u092a\u093f\u0924 \u0915\u093f\u092f\u093e \u091c\u093e\u0928\u093e \u091a\u093e\u0939\u093f\u090f. \u090f\u0915 \u092a\u094d\u0930\u0926\u0930\u094d\u0936\u0928 \u0915\u0947 \u0932\u093f\u090f \u0928\u092e\u0942\u0928\u093e \u0926\u0947\u0916\u0947\u0902.",
														"Ako GoogleFu je otkrio da NGUI je prisutna u projektu, to \u0107e vam omogu\u0107iti da postavite izvoznu put NGUI.\n\nOmogu\u0107avanje NGUI izvoz i postavljanja izvoznih put NGUI \u0107e omogu\u0107iti GoogleFu spasiti lokalizacije datoteke u formatu koji NGUI je u stanju obraditi nativno.\n\nGoogle prora\u010dunske tablice mora biti pravilno postavljen za NGUI da bi mogli obraditi ove datoteke. Pogledajte uzorak za demonstraciju.",
														"Si GoogleFu te detekte ki NGUI se prezan nan pwoj\u00e8 a, li pral p\u00e8m\u00e8t ou yo mete yon chemen eksp\u00f2tasyon NGUI.\n\nP\u00e8m\u00e8t NGUI Export ak anviw\u00f2nman chemen an eksp\u00f2tasyon NGUI pral p\u00e8m\u00e8t GoogleFu pou kons\u00e8ve pou dosye lokalizasyon nan yon f\u00f2ma ki NGUI se kapab nan pwosesis natif.\n\nDwe feuy nan Google dwe mete kanpe k\u00f2r\u00e8kteman pou NGUI pou kapab travay sou dosye sa yo. Al gade nan echantiyon an pou yon demonstrasyon.",
														"Jika GoogleFu telah mendeteksi bahwa NGUI hadir dalam proyek, itu akan memungkinkan Anda untuk mengatur jalur ekspor NGUI.\n\nMengaktifkan NGUI Ekspor dan pengaturan jalur ekspor NGUI akan memungkinkan GoogleFu untuk menyimpan file lokalisasi dalam format yang NGUI mampu memproses native.\n\nGoogle Spreadsheet harus diatur dengan benar untuk NGUI untuk dapat memproses file-file ini. Lihat sampel untuk demonstrasi.",
														"Ef GoogleFu hefur sj\u00e1um a\u00f0 NGUI er til sta\u00f0ar \u00ed verkefninu, \u00fea\u00f0 mun leyfa \u00fe\u00e9r a\u00f0 setja NGUI \u00fatflutningur lei\u00f0.\n\nVirkjun NGUI Flytja og setja NGUI \u00fatflutning lei\u00f0 mun leyfa GoogleFu a\u00f0 spara sta\u00f0setning skr\u00e1r \u00e1 sni\u00f0i sem NGUI er f\u00e6r um a\u00f0 vinna innf\u00e6ddur.\n\nGoogle t\u00f6flureiknir ver\u00f0ur a\u00f0 setja upp r\u00e9tt fyrir NGUI a\u00f0 vera f\u00e6r um a\u00f0 vinna \u00feessar skr\u00e1r. Sj\u00e1 s\u00fdnishorn fyrir kynningu.",
														"\u05d0\u05dd GoogleFu \u05d6\u05d9\u05d4\u05d4 \u05e9NGUI \u05e0\u05d5\u05db\u05d7 \u05d1\u05e4\u05e8\u05d5\u05d9\u05e7\u05d8, \u05d6\u05d4 \u05d9\u05d0\u05e4\u05e9\u05e8 \u05dc\u05da \u05dc\u05d4\u05d2\u05d3\u05d9\u05e8 \u05e0\u05ea\u05d9\u05d1 \u05d9\u05e6\u05d5\u05d0 NGUI.\n\n\u05de\u05d0\u05e4\u05e9\u05e8 NGUI \u05d9\u05e6\u05d5\u05d0 \u05d5\u05e7\u05d1\u05d9\u05e2\u05ea \u05e0\u05ea\u05d9\u05d1 \u05d9\u05e6\u05d5\u05d0 NGUI \u05ea\u05d0\u05e4\u05e9\u05e8 GoogleFu \u05dc\u05e9\u05de\u05d5\u05e8 \u05e7\u05d1\u05e6\u05d9 \u05dc\u05d5\u05e7\u05dc\u05d9\u05d6\u05e6\u05d9\u05d4 \u05d1\u05e4\u05d5\u05e8\u05de\u05d8 \u05e9NGUI \u05d4\u05d5\u05d0 \u05de\u05e1\u05d5\u05d2\u05dc \u05dc\u05e2\u05d1\u05d3 \u05d1\u05d0\u05d5\u05e4\u05df \u05de\u05e7\u05d5\u05e8\u05d9.\n\n\u05d4\u05d2\u05d9\u05dc\u05d9\u05d5\u05df \u05d4\u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05e0\u05d9 \u05e9\u05dc \u05d2\u05d5\u05d2\u05dc \u05d9\u05e9 \u05dc\u05d4\u05d2\u05d3\u05d9\u05e8 \u05d1\u05e6\u05d5\u05e8\u05d4 \u05e0\u05db\u05d5\u05e0\u05d4 \u05dcNGUI \u05dc\u05d4\u05d9\u05d5\u05ea \u05de\u05e1\u05d5\u05d2\u05dc \u05dc\u05e2\u05d1\u05d3 \u05d0\u05ea \u05d4\u05e7\u05d1\u05e6\u05d9\u05dd \u05d4\u05d0\u05dc\u05d5. \u05e8\u05d0\u05d4 \u05dc\u05d3\u05d5\u05d2\u05de\u05d4 \u05e2\u05d1\u05d5\u05e8 \u05d4\u05e4\u05d2\u05e0\u05d4.",
														"Jei GoogleFu aptiko, kad NGUI yra pateikti projekto, tai leis jums nustatyti NGUI eksporto keli\u0105.\n\n\u012ejungus NGUI Eksportuoti ir nustatant NGUI eksporto keliu leis GoogleFu sutaupyti lokalizacijos failus tokiu formatu, kad NGUI gali apdoroti gimtoji.\n\n\"Google\" skai\u010diuokl\u0117s turi b\u016bti teisingai nustatytas u\u017e NGUI geb\u0117ti apdoroti \u0161iuos failus. \u017dr demonstracijoje m\u0117gin\u012f.",
														"Ja GoogleFu ir konstat\u0113ts, ka NGUI ir kl\u0101t \u0161aj\u0101 projekt\u0101, tas \u013caus jums noteikt NGUI eksporta ce\u013cu.\n\nIesp\u0113jojot NGUI Eksporta un nosakot NGUI eksporta ce\u013cu \u013caus GoogleFu ietaup\u012bt lokaliz\u0101cijas failus form\u0101t\u0101, kas NGUI sp\u0113j apstr\u0101d\u0101t natively.\n\nGoogle Izkl\u0101jlapas j\u0101izveido pareizi NGUI var\u0113tu apstr\u0101d\u0101t \u0161os failus. Skat\u012bt paraugu demonstr\u0101ciju.",
														"\u0410\u043a\u043e GoogleFu \u043e\u0442\u043a\u0440\u0438 \u0434\u0435\u043a\u0430 NGUI \u0435 \u043f\u0440\u0438\u0441\u0443\u0442\u043d\u0430 \u0432\u043e \u043f\u0440\u043e\u0435\u043a\u0442\u043e\u0442, \u0442\u043e\u0430 \u045c\u0435 \u0432\u0438 \u043e\u0432\u043e\u0437\u043c\u043e\u0436\u0438 \u0434\u0430 \u0433\u043e \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u0435 \u043d\u0430 NGUI \u0438\u0437\u0432\u043e\u0437 \u043f\u0430\u0442.\n\n\u041e\u0432\u043e\u0437\u043c\u043e\u0436\u0443\u0432\u0430\u0458\u045c\u0438 NGUI \u0438\u0437\u0432\u043e\u0437 \u0438 \u0443\u0442\u0432\u0440\u0434\u0443\u0432\u0430\u045a\u0435 \u043d\u0430 \u0438\u0437\u0432\u043e\u0437\u043e\u0442 \u043f\u0430\u0442 NGUI \u045c\u0435 \u0432\u0438 \u043e\u0432\u043e\u0437\u043c\u043e\u0436\u0438 \u0434\u0430 \u0441\u0435 \u0441\u043f\u0430\u0441\u0438 GoogleFu \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0458\u0430 \u0434\u0430\u0442\u043e\u0442\u0435\u043a\u0438 \u0432\u043e \u0444\u043e\u0440\u043c\u0430\u0442 \u043a\u043e\u0458 NGUI \u0435 \u0432\u043e \u043c\u043e\u0436\u043d\u043e\u0441\u0442 \u0434\u0430 \u043f\u0440\u043e\u0446\u0435\u0441\u043e\u0442 \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u043e.\n\n\u041d\u0430 Google \u0442\u0430\u0431\u0435\u043b\u0430 \u043c\u043e\u0440\u0430 \u0434\u0430 \u0441\u0435 \u043f\u043e\u0441\u0442\u0430\u0432\u0438 \u043f\u0440\u0430\u0432\u0438\u043b\u043d\u043e \u0437\u0430 NGUI \u0434\u0430 \u0431\u0438\u0434\u0435 \u0432\u043e \u043c\u043e\u0436\u043d\u043e\u0441\u0442 \u0434\u0430 \u043f\u0440\u043e\u0446\u0435\u0441\u043e\u0442 \u043d\u0430 \u043e\u0432\u0438\u0435 \u0434\u0430\u0442\u043e\u0442\u0435\u043a\u0438. \u0412\u0438\u0434\u0438 \u043f\u0440\u0438\u043c\u0435\u0440\u043e\u043a \u0437\u0430 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u0458\u0430.",
														"Jika GoogleFu telah mengesan bahawa Ngui hadir dalam projek itu, ia akan membolehkan anda untuk menetapkan laluan eksport Ngui.\n\nMembolehkan Ngui Eksport dan menetapkan jalan eksport Ngui akan membolehkan GoogleFu untuk menyimpan fail tempatan dalam format yang Ngui mampu memproses Asli.\n\nGoogle Spreadsheet mesti ditetapkan dengan betul untuk Ngui dapat memproses fail-fail ini. Lihat sampel untuk demonstrasi.",
														"Jekk GoogleFu sabet li NGUI huwa pre\u017centi fil-pro\u0121ett, li se jippermetti li inti stabbiliti triq esportazzjoni NGUI.\n\nAbilitazzjoni NGUI Esportazzjoni u l-istabbiliment l-passa\u0121\u0121 esportazzjoni NGUI se tippermetti GoogleFu biex jiffrankaw fajls lokalizzazzjoni f'format li NGUI huwa f'po\u017cizzjoni li jippro\u010bessaw natively.\n\nIl Spreadsheet Google trid ti\u0121i mwaqqfa b'mod korrett g\u0127all NGUI biex ikunu jistg\u0127u jippro\u010bessaw dawn il-fajls. Ara l-kampjun g\u0127al dimostrazzjoni.",
														"Hvis GoogleFu har oppdaget at NGUI er til stede i prosjektet, det vil tillate deg \u00e5 sette en NGUI eksport banen.\n\nAktivere NGUI Eksport og sette NGUI eksport banen vil tillate GoogleFu \u00e5 lagre lokaliseringsfiler i et format som NGUI er i stand til \u00e5 behandle problemfritt.\n\nGoogles regneark m\u00e5 settes opp riktig for NGUI \u00e5 kunne behandle disse filene. Se utvalget for en demonstrasjon.",
														"Je\u015bli GoogleFu wykry\u0142, \u017ce NGUI wyst\u0119puje w projekcie, pozwoli Ci ustawi\u0107 \u015bcie\u017ck\u0119 eksportu NGUI.\n\nW\u0142\u0105czanie NGUI Eksportuj i ustawienie \u015bcie\u017cki eksportu NGUI pozwoli GoogleFu zapisa\u0107 pliki lokalizacyjne w formacie NGUI jest w stanie przetworzy\u0107 natywnie.\n\nArkusz kalkulacyjny Google musi by\u0107 poprawnie skonfigurowany dla NGUI aby m\u00f3c przetwarza\u0107 te pliki. Zobacz pr\u00f3bk\u0119 do demonstracji.",
														"Se GoogleFu detectou que Ngui est\u00e1 presente no projeto, que vai permitir que voc\u00ea defina um caminho de exporta\u00e7\u00e3o Ngui.\n\nAtivando Ngui Exporta\u00e7\u00e3o e definir o caminho de exporta\u00e7\u00e3o Ngui permitir\u00e1 GoogleFu para salvar arquivos de localiza\u00e7\u00e3o em um formato que Ngui \u00e9 capaz de processar nativamente.\n\nA planilha do Google deve ser configurado corretamente para Ngui para ser capaz de processar estes arquivos. Veja o exemplo para uma demonstra\u00e7\u00e3o.",
														"Dac\u0103 GoogleFu a detectat c\u0103 NGUI este prezent \u00een cadrul proiectului, se va permite s\u0103 seta\u021bi o cale export NGUI.\n\nActivarea NGUI Export \u0219i stabilirea calea de export NGUI va permite GoogleFu pentru a salva fi\u0219ierele de localizare \u00eentr-un format care NGUI este capabil s\u0103 proceseze nativ.\n\nFoaia de calcul Google trebuie s\u0103 fie configurat corect pentru NGUI a putea procesa aceste fi\u0219iere. Vezi proba pentru o demonstra\u021bie.",
														"Ak GoogleFu zistil, \u017ee NGUI je pr\u00edtomn\u00fd v projekte, umo\u017en\u00ed v\u00e1m nastavi\u0165 NGUI export PATH.\n\nPovolenie NGUI Export a ktor\u00fdm sa ustanovuj\u00fa v\u00fdvozn\u00e9 cestu NGUI umo\u017en\u00ed GoogleFu uklada\u0165 lokaliza\u010dn\u00e9 s\u00fabory vo form\u00e1te, ktor\u00fd NGUI je schopn\u00fd spracova\u0165 nat\u00edvne.\n\nTabu\u013ekov\u00fd Google mus\u00ed by\u0165 spr\u00e1vne nastaven\u00e1 pre NGUI by\u0165 schopn\u00fd spracova\u0165 tieto s\u00fabory. Pozrite sa na uk\u00e1\u017eku pre demon\u0161tr\u00e1ciu.",
														"\u010ce je GoogleFu zaznal, da je NGUI prisotna v projektu, bo to omogo\u010dilo, da dolo\u010di izvozno pot NGUI.\n\nOmogo\u010danje NGUI Izvoz in dolo\u010ditev izvozne poti NGUI bo GoogleFu shraniti lokalizacije datoteke v obliki, ki je NGUI lahko izvorno obdelati.\n\nGoogle preglednic mora biti pravilno nastavljen za NGUI, da bi lahko za obdelavo teh datotek. Oglejte si vzorec za demonstracijo.",
														"N\u00ebse GoogleFu ka zbuluar se NGUI \u00ebsht\u00eb i pranish\u00ebm n\u00eb projekt, ajo do t\u00eb ju lejojn\u00eb p\u00ebr t\u00eb vendosur nj\u00eb rrug\u00eb NGUI eksportit.\n\nMund\u00ebsimi NGUI Eksport dhe vendosjen rrug\u00ebn NGUI eksportit do t\u00eb lejoj\u00eb GoogleFu t\u00eb ruani fotografi lokalizimin n\u00eb nj\u00eb format q\u00eb NGUI \u00ebsht\u00eb n\u00eb gjendje t\u00eb procesit vetvetiu.\n\nGoogle Spreadsheet duhet t\u00eb jet\u00eb konfiguruar si duhet p\u00ebr NGUI t\u00eb jet\u00eb n\u00eb gjendje t\u00eb procesit k\u00ebto fotografi. Shih mostr\u00ebn p\u00ebr nj\u00eb demonstrim.",
														"\u0410\u043a\u043e \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u0458\u0435 \u043e\u0442\u043a\u0440\u0438\u043e \u0434\u0430 \u041d\u0413\u0423\u0418 \u0458\u0435 \u043f\u0440\u0438\u0441\u0443\u0442\u043d\u0430 \u0443 \u043f\u0440\u043e\u0458\u0435\u043a\u0442\u0443, \u043e\u043d \u045b\u0435 \u0432\u0430\u043c \u043e\u043c\u043e\u0433\u0443\u045b\u0438\u0442\u0438 \u0434\u0430 \u043f\u043e\u0434\u0435\u0441\u0438\u0442\u0435 \u041d\u0413\u0423\u0418 \u0435\u043a\u043f\u043e\u0440\u0442 \u041f\u0410\u0422\u0425.\n\n\u041e\u043c\u043e\u0433\u0443\u045b\u0430\u0432\u0430\u045a\u0435 \u041d\u0413\u0423\u0418 \u0438\u0437\u0432\u043e\u0437 \u0438 \u043f\u043e\u0434\u0435\u0448\u0430\u0432\u0430\u045a\u0435 \u041d\u0413\u0423\u0418 \u0435\u043a\u043f\u043e\u0440\u0442 \u041f\u0410\u0422\u0425 \u045b\u0435 \u043e\u043c\u043e\u0433\u0443\u045b\u0438\u0442\u0438 \u0434\u0430 \u0441\u0430\u0447\u0443\u0432\u0430\u0442\u0435 \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0458\u0435 \u0434\u0430\u0442\u043e\u0442\u0435\u043a\u0435 \u0443 \u0444\u043e\u0440\u043c\u0430\u0442\u0443 \u043a\u043e\u0458\u0438 \u0458\u0435 \u0443 \u0441\u0442\u0430\u045a\u0443 \u0434\u0430 \u041d\u0413\u0423\u0418 \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u043e \u043e\u0431\u0440\u0430\u0434\u0438.\n\n\u0413\u043e\u043e\u0433\u043b\u0435 \u0442\u0430\u0431\u0435\u043b\u0435 \u043c\u043e\u0440\u0430 \u0431\u0438\u0442\u0438 \u043f\u043e\u0434\u0435\u0448\u0435\u043d \u0437\u0430 \u041d\u0413\u0423\u0418 \u0434\u0430 \u0431\u0438\u0441\u0442\u0435 \u043c\u043e\u0433\u043b\u0438 \u0434\u0430 \u043e\u0431\u0440\u0430\u0434\u0438\u043c\u043e \u043e\u0432\u0435 \u0434\u0430\u0442\u043e\u0442\u0435\u043a\u0435. \u041f\u043e\u0433\u043b\u0435\u0434\u0430\u0458\u0442\u0435 \u0443\u0437\u043e\u0440\u0430\u043a \u0437\u0430 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u0458\u0430.",
														"Om GoogleFu har uppt\u00e4ckt att NGUI finns i projektet, kommer det att du kan st\u00e4lla in en NGUI exportbana.\n\nAktivera NGUI Export och st\u00e4lla in NGUI exportv\u00e4gen till\u00e5ter GoogleFu spara lokaliseringsfiler i ett format som NGUI kan bearbeta inf\u00f6ding.\n\nGoogle Spreadsheet m\u00e5ste st\u00e4llas in korrekt f\u00f6r NGUI att kunna behandla dessa filer. Se provet f\u00f6r en demonstration.",
														"Kama GoogleFu imegundua kwamba NGUI ni ya sasa katika mradi huo, itakuwa kuruhusu wewe kuweka NGUI nje njia.\n\nKuwezesha NGUI Export na kuweka NGUI nje njia itaruhusu GoogleFu kuokoa files ujanibishaji katika format kwamba NGUI ni uwezo wa mchakato wa natively.\n\nSpreadsheet Google lazima kuanzisha usahihi kwa NGUI kuwa na uwezo wa mchakato wa files haya. Angalia sampuli kwa ajili ya maandamano.",
														"\u0e16\u0e49\u0e32 GoogleFu \u0e15\u0e23\u0e27\u0e08\u0e1e\u0e1a\u0e27\u0e48\u0e32 NGUI \u0e21\u0e35\u0e2d\u0e22\u0e39\u0e48\u0e43\u0e19\u0e42\u0e04\u0e23\u0e07\u0e01\u0e32\u0e23\u0e17\u0e35\u0e48\u0e08\u0e30\u0e0a\u0e48\u0e27\u0e22\u0e43\u0e2b\u0e49\u0e04\u0e38\u0e13\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e01\u0e33\u0e2b\u0e19\u0e14\u0e40\u0e2a\u0e49\u0e19\u0e17\u0e32\u0e07\u0e01\u0e32\u0e23\u0e2a\u0e48\u0e07\u0e2d\u0e2d\u0e01 NGUI\n\n\u0e17\u0e33\u0e43\u0e2b\u0e49 NGUI \u0e01\u0e32\u0e23\u0e2a\u0e48\u0e07\u0e2d\u0e2d\u0e01\u0e41\u0e25\u0e30\u0e01\u0e32\u0e23\u0e15\u0e31\u0e49\u0e07\u0e04\u0e48\u0e32\u0e40\u0e2a\u0e49\u0e19\u0e17\u0e32\u0e07\u0e01\u0e32\u0e23\u0e2a\u0e48\u0e07\u0e2d\u0e2d\u0e01 NGUI \u0e08\u0e30\u0e0a\u0e48\u0e27\u0e22\u0e43\u0e2b\u0e49 GoogleFu \u0e1a\u0e31\u0e19\u0e17\u0e36\u0e01\u0e44\u0e1f\u0e25\u0e4c\u0e17\u0e49\u0e2d\u0e07\u0e16\u0e34\u0e48\u0e19\u0e43\u0e19\u0e23\u0e39\u0e1b\u0e41\u0e1a\u0e1a\u0e17\u0e35\u0e48 NGUI \u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e17\u0e35\u0e48\u0e08\u0e30\u0e1b\u0e23\u0e30\u0e21\u0e27\u0e25\u0e1c\u0e25\u0e42\u0e14\u0e22\u0e01\u0e33\u0e40\u0e19\u0e34\u0e14\n\n\u0e2a\u0e40\u0e1b\u0e23\u0e14\u0e0a\u0e35\u0e15\u0e02\u0e2d\u0e07 Google \u0e08\u0e30\u0e15\u0e49\u0e2d\u0e07\u0e15\u0e31\u0e49\u0e07\u0e04\u0e48\u0e32\u0e2d\u0e22\u0e48\u0e32\u0e07\u0e16\u0e39\u0e01\u0e15\u0e49\u0e2d\u0e07\u0e2a\u0e33\u0e2b\u0e23\u0e31\u0e1a NGUI \u0e40\u0e1e\u0e37\u0e48\u0e2d\u0e43\u0e2b\u0e49\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e1b\u0e23\u0e30\u0e21\u0e27\u0e25\u0e1c\u0e25\u0e44\u0e1f\u0e25\u0e4c\u0e40\u0e2b\u0e25\u0e48\u0e32\u0e19\u0e35\u0e49 \u0e14\u0e39\u0e15\u0e31\u0e27\u0e2d\u0e22\u0e48\u0e32\u0e07\u0e2a\u0e33\u0e2b\u0e23\u0e31\u0e1a\u0e01\u0e32\u0e23\u0e2a\u0e32\u0e18\u0e34\u0e15",
														"Kung GoogleFu Nakakita na NGUI ay naroroon sa proyekto, ito ay magpapahintulot sa inyo na magtakda ng isang landas sa pag-export NGUI.\n\nAng pagpapagana NGUI I-export at pag-set ang path sa pag-export NGUI ay magbibigay-daan GoogleFu upang i-save lokalisasyon mga file sa isang format na NGUI ay magagawang maproseso natively.\n\nDapat na-set up ang Google Spreadsheet tama para sa NGUI upang magagawang maiproseso mga file na ito. Tingnan ang sample para sa isang demonstration.",
														"GoogleFu Ngui projede mevcut oldu\u011funu tespit etti, bu bir Ngui verme yolunu ayarlamak i\u00e7in izin verecektir.\n\nNgui verme yolunu Ngui \u0130hracat etkinle\u015ftirme ve ayarlama GoogleFu Ngui do\u011fal i\u015fleyebilir bir bi\u00e7imde yerelle\u015ftirme dosyalar\u0131n\u0131 kaydetmek i\u00e7in izin verecek.\n\nNgui bu dosyalar\u0131 i\u015flemek edebilmek i\u00e7in Google E-Tablo do\u011fru ayarlanm\u0131\u015f olmas\u0131 gerekir. Bir g\u00f6steri i\u00e7in \u00f6rne\u011fe bak\u0131n.",
														"\u042f\u043a\u0449\u043e GoogleFu \u0432\u0438\u044f\u0432\u0438\u0432, \u0449\u043e NGUI \u043f\u0440\u0438\u0441\u0443\u0442\u043d\u0456\u0439 \u0432 \u043f\u0440\u043e\u0435\u043a\u0442\u0456, \u0446\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u044c \u0432\u0430\u043c \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u0448\u043b\u044f\u0445 \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u0443 NGUI.\n\n\u0412\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f NGUI \u0415\u043a\u0441\u043f\u043e\u0440\u0442 \u0456 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0430 \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u043d\u0438\u0439 \u0448\u043b\u044f\u0445 NGUI \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u044c GoogleFu \u0437\u0431\u0435\u0440\u0435\u0433\u0442\u0438 \u0444\u0430\u0439\u043b\u0438 \u043b\u043e\u043a\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u0457 \u0432 \u0444\u043e\u0440\u043c\u0430\u0442\u0456, \u044f\u043a\u0438\u0439 NGUI \u0437\u0434\u0430\u0442\u043d\u0438\u0439 \u043e\u0431\u0440\u043e\u0431\u043b\u044f\u0442\u0438 \u0441\u043f\u043e\u0447\u0430\u0442\u043a\u0443.\n\n\u0415\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u043d\u0456 \u0442\u0430\u0431\u043b\u0438\u0446\u0456 Google \u043f\u043e\u0432\u0438\u043d\u0435\u043d \u0431\u0443\u0442\u0438 \u043d\u0430\u043b\u0430\u0448\u0442\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u043e \u0434\u043b\u044f NGUI, \u0449\u043e\u0431 \u043c\u0430\u0442\u0438 \u043c\u043e\u0436\u043b\u0438\u0432\u0456\u0441\u0442\u044c \u043e\u0431\u0440\u043e\u0431\u043b\u044f\u0442\u0438 \u0446\u0456 \u0444\u0430\u0439\u043b\u0438. \u0414\u0438\u0432\u0456\u0442\u044c\u0441\u044f \u043f\u0440\u0438\u043a\u043b\u0430\u0434 \u0434\u043b\u044f \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0456\u0457.",
														"\u05d0\u05d5\u05d9\u05d1 \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d4\u05d0\u05d8 \u05d3\u05d9\u05d8\u05e2\u05e7\u05d8\u05d0\u05b7\u05d3 \u05d0\u05b7\u05d6 \u05e0\u05d2\u05d5\u05d9 \u05d0\u05d9\u05d6 \u05e4\u05d0\u05b8\u05e8\u05e9\u05d8\u05e2\u05dc\u05df \u05d0\u05d9\u05df \u05d3\u05d9 \u05e4\u05bc\u05e8\u05d5\u05d9\u05e2\u05e7\u05d8, \u05e2\u05e1 \u05d5\u05d5\u05e2\u05d8 \u05dc\u05d0\u05b8\u05d6\u05df \u05d0\u05d9\u05e8 \u05e6\u05d5 \u05e9\u05d8\u05e2\u05dc\u05df \u05d0\u05b7 \u05e0\u05d2\u05d5\u05d9 \u05d0\u05b7\u05e8\u05d5\u05d9\u05e1\u05e4\u05d9\u05e8\u05df \u05d3\u05e8\u05da.\n\n\u05e2\u05e0\u05d9\u05d9\u05d1\u05d0\u05b7\u05dc\u05d9\u05e0\u05d2 \u05e0\u05d2\u05d5\u05d9 \u05e2\u05e7\u05e1\u05e4\u05bc\u05d0\u05b8\u05e8\u05d8 \u05d0\u05d5\u05df \u05d1\u05d0\u05b7\u05e9\u05d8\u05e2\u05d8\u05d9\u05e7\u05df \u05d3\u05d9 \u05e0\u05d2\u05d5\u05d9 \u05d0\u05b7\u05e8\u05d5\u05d9\u05e1\u05e4\u05d9\u05e8\u05df \u05d3\u05e8\u05da \u05d5\u05d5\u05e2\u05d8 \u05dc\u05d0\u05b8\u05d6\u05df \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05e6\u05d5 \u05e8\u05d0\u05b7\u05d8\u05e2\u05d5\u05d5\u05e2\u05df \u05dc\u05d0\u05b8\u05d5\u05e7\u05d0\u05b7\u05dc\u05d0\u05b7\u05d6\u05d9\u05d9\u05e9\u05d0\u05b7\u05df \u05d8\u05e2\u05e7\u05e2\u05e1 \u05d0\u05d9\u05df \u05d0\u05b7 \u05e4\u05bf\u05d0\u05b8\u05e8\u05de\u05d0\u05b7\u05d8 \u05d0\u05b7\u05d6 \u05e0\u05d2\u05d5\u05d9 \u05d0\u05d9\u05d6 \u05d1\u05d9\u05db\u05d5\u05dc\u05ea \u05e6\u05d5 \u05e4\u05bc\u05e8\u05d0\u05b8\u05e6\u05e2\u05e1 \u05e0\u05d0\u05b7\u05d8\u05d9\u05d5\u05d5\u05e2\u05dc\u05d9.\n\n\u05d3\u05d9 \u05d2\u05d5\u05d2\u05dc \u05e1\u05e4\u05bc\u05e8\u05e2\u05d3\u05e9\u05d9\u05d8 \u05de\u05d5\u05d6\u05df \u05d6\u05d9\u05d9\u05df \u05e9\u05d8\u05e2\u05dc\u05df \u05d0\u05b7\u05e8\u05d5\u05d9\u05e3 \u05e8\u05d9\u05db\u05d8\u05d9\u05e7 \u05e4\u05bf\u05d0\u05b7\u05e8 \u05e0\u05d2\u05d5\u05d9 \u05e6\u05d5 \u05e7\u05e2\u05e0\u05e2\u05df \u05e6\u05d5 \u05e4\u05bc\u05e8\u05d0\u05b8\u