			Rows.Add( new LocalizationRow("If GoogleFu has detected that Playmaker is present in the project, it will allow you to set a Playmaker Actions path.\n\nEnabling the Playmaker Actions generation for the Object Database export will allow GoogleFu to create Playmaker Actions automatically. ",
														"Si GoogleFu a d\u00e9tect\u00e9 que le meneur de jeu est pr\u00e9sent dans le projet, il vous permettra de d\u00e9finir un chemin Playmaker Actions.\n\nActivation de la g\u00e9n\u00e9ration Actions meneur de jeu pour la base de donn\u00e9es \u00e0 l'exportation d'objets permettra GoogleFu pour cr\u00e9er Playmaker Actions automatiquement.",
														"Se GoogleFu ha rilevato che Playmaker \u00e8 presente nel progetto, vi permetter\u00e0 di impostare un percorso di Playmaker azioni.\n\nAbilitazione Azioni generazione Playmaker per l'esportazione Object Database permetter\u00e0 GoogleFu per creare automaticamente Playmaker azioni.",
														"Wenn GoogleFu hat erkannt, dass Spielmacher im Projekt vorhanden ist, wird er Ihnen einen Spielmacher Aktionen Weg zu bringen.\n\nAktivieren der Spielmacher Aktionen Generation f\u00fcr die Objektdatenbank erm\u00f6glicht den Export GoogleFu um Spielmacher Aktionen automatisch erstellen.",
