														"Jika GoogleFu telah mendeteksi bahwa Playmaker hadir dalam proyek, itu akan memungkinkan Anda untuk mengatur jalur Playmaker Actions.\n\nMengaktifkan Tindakan Playmaker generasi untuk mengekspor Database Object akan memungkinkan GoogleFu untuk membuat Playmaker Tindakan otomatis.",
														"Ef GoogleFu hefur sj\u00e1um a\u00f0 snillinginn er til sta\u00f0ar \u00ed verkefninu, \u00fea\u00f0 mun leyfa \u00fe\u00e9r a\u00f0 setja upp snillinginn A\u00f0ger\u00f0ir lei\u00f0.\n\nVirkjun \u00e1 snillinginn A\u00f0ger\u00f0ir kynsl\u00f3\u00f0 fyrir Object Database \u00fatflutnings mun leyfa GoogleFu a\u00f0 b\u00faa snillinginn Actions sj\u00e1lfkrafa.",
														"\u05d0\u05dd GoogleFu \u05d6\u05d9\u05d4\u05d4 \u05e9\u05d4\u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05e7\u05d9\u05d9\u05de\u05ea \u05d1\u05e4\u05e8\u05d5\u05d9\u05e7\u05d8, \u05d6\u05d4 \u05d9\u05d0\u05e4\u05e9\u05e8 \u05dc\u05da \u05dc\u05d4\u05d2\u05d3\u05d9\u05e8 \u05d0\u05ea \u05d3\u05e8\u05da \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea.\n\n\u05de\u05d4 \u05e9\u05de\u05d0\u05e4\u05e9\u05e8 \u05d0\u05ea \u05d3\u05d5\u05e8 \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05dc\u05d9\u05e6\u05d5\u05d0 \u05d0\u05d5\u05d1\u05d9\u05d9\u05e7\u05d8 \u05de\u05e1\u05d3 \u05e0\u05ea\u05d5\u05e0\u05d9\u05dd \u05d9\u05d0\u05e4\u05e9\u05e8 GoogleFu \u05dc\u05d9\u05e6\u05d5\u05e8 \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d1\u05d0\u05d5\u05e4\u05df \u05d0\u05d5\u05d8\u05d5\u05de\u05d8\u05d9.",
														"Jei GoogleFu aptiko, kad \u012f\u017eaid\u0117jas yra pateikti projekto, tai leis jums nustatyti \u012f\u017eaid\u0117jas Veiksmai keli\u0105.\n\n\u012ejungus \u012f\u017eaid\u0117jas Veiksmai kartos u\u017e objekto duomen\u0173 baz\u0117je eksporto leis GoogleFu sukurti \u012f\u017eaid\u0117jas Veiksmai automati\u0161kai.",
														"Ja GoogleFu ir konstat\u0113ts, ka playmaker ir kl\u0101t \u0161aj\u0101 projekt\u0101, tas \u013caus jums noteikt playmaker Darb\u012bbas ce\u013cu.\n\n\u013baujot playmaker Darb\u012bbas paaudzi Object Database eksports \u013caus GoogleFu izveidot playmaker Darb\u012bbas autom\u0101tiski.",
														"\u0410\u043a\u043e GoogleFu \u043e\u0442\u043a\u0440\u0438 \u0434\u0435\u043a\u0430 \u043f\u043b\u0435\u0458\u043c\u0435\u0458\u043a\u0435\u0440 \u0435 \u043f\u0440\u0438\u0441\u0443\u0442\u043d\u0430 \u0432\u043e \u043f\u0440\u043e\u0435\u043a\u0442\u043e\u0442, \u0442\u043e\u0430 \u045c\u0435 \u0432\u0438 \u043e\u0432\u043e\u0437\u043c\u043e\u0436\u0438 \u0434\u0430 \u0433\u043e \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u0435 \u043f\u043b\u0435\u0458\u043c\u0435\u0458\u043a\u0435\u0440 \u041e\u043f\u0446\u0438\u0438 \u043f\u0430\u0442.\n\n\u041e\u0432\u043e\u0437\u043c\u043e\u0436\u0443\u0432\u0430\u045a\u0435 \u043d\u0430 \u043f\u043b\u0435\u0458\u043c\u0435\u0458\u043a\u0435\u0440\u043e\u0442 \u041e\u043f\u0446\u0438\u0438 \u0433\u0435\u043d\u0435\u0440\u0430\u0446\u0438\u0458\u0430 \u043d\u0430 \u043e\u0431\u0458\u0435\u043a\u0442\u043e\u0442 \u0411\u0430\u0437\u0430 \u043d\u0430 \u043f\u043e\u0434\u0430\u0442\u043e\u0446\u0438 \u0437\u0430 \u0438\u0437\u0432\u043e\u0437 \u045c\u0435 \u0432\u0438 \u043e\u0432\u043e\u0437\u043c\u043e\u0436\u0438 \u0434\u0430 \u0441\u0435 \u0441\u043e\u0437\u0434\u0430\u0434\u0435 GoogleFu \u043f\u043b\u0435\u0458\u043c\u0435\u0458\u043a\u0435\u0440 \u041e\u043f\u0446\u0438\u0438 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438.",
														"Jika GoogleFu telah mengesan bahawa perancang hadir dalam projek itu, ia akan membolehkan anda untuk menetapkan laluan Tindakan perancang.\n\nMembolehkan perancang generasi Tindakan untuk Objek Pangkalan Data eksport akan membolehkan GoogleFu untuk mewujudkan perancang Tindakan secara automatik.",
														"Jekk GoogleFu sabet li playmaker huwa pre\u017centi fil-pro\u0121ett, li se jippermetti li inti stabbiliti triq Azzjonijiet playmaker.\n\nJippermetti l-\u0121enerazzjoni Azzjonijiet playmaker g\u0127all-esportazzjoni Database Object se jippermetti GoogleFu biex jo\u0127olqu Azzjonijiet playmaker awtomatikament.",
														"Hvis GoogleFu har oppdaget at Playmaker er til stede i prosjektet, det vil tillate deg \u00e5 sette en playmaker Handlinger bane.\n\nAktivere playmakeren Handlinger generasjon for objektet Database eksport vil tillate GoogleFu \u00e5 lage playmaker Handlinger automatisk.",
														"Je\u015bli GoogleFu wykry\u0142, \u017ce rozgrywaj\u0105cy jest obecny w projekcie, pozwoli Ci ustawi\u0107 \u015bcie\u017ck\u0119 rozgrywaj\u0105cy Akcje.\n\nW\u0142\u0105czenie dzia\u0142a\u0144 generacji rozgrywaj\u0105cy na wyw\u00f3z obiektu bazy danych pozwoli GoogleFu stworzy\u0107 rozgrywaj\u0105cy Akcje automatycznie.",
														"Se GoogleFu detectou que Playmaker est\u00e1 presente no projeto, que lhe permitir\u00e1 definir um caminho A\u00e7\u00f5es organizador de jogo.\n\nAtivando a gera\u00e7\u00e3o A\u00e7\u00f5es Playmaker para a exporta\u00e7\u00e3o do banco de dados de objetos permitir\u00e1 GoogleFu para criar a\u00e7\u00f5es Playmaker automaticamente.",
														"Dac\u0103 GoogleFu a detectat c\u0103 Playmaker este prezent \u00een cadrul proiectului, se va permite s\u0103 seta\u021bi o cale playmaker ac\u021biuni.\n\nActivarea genera\u021bie Ac\u021biuni Playmaker de obiect exportul Baza de date va permite GoogleFu pentru a crea automat playmaker Ac\u021biuni.",
														"Ak GoogleFu zistil, \u017ee Playmaker je pr\u00edtomn\u00fd v projekte, umo\u017en\u00ed v\u00e1m nastavi\u0165 Tvorca hry Akcia cestu.\n\nPovolenie Playmaker Akcia gener\u00e1cie na objekte export datab\u00e1zy umo\u017enia GoogleFu automaticky vytvori\u0165 Playmaker akcie.",
														"\u010ce je GoogleFu zaznal, da je Playmaker prisotna v projektu, bo vam omogo\u010dajo, da nastavite Playmaker Dejanja pot je.\n\nOmogo\u010danje Dejanja generacijo Playmaker za izvoz baze podatkov Objekt bo GoogleFu ustvariti Playmaker Dejanja samodejno.",
														"N\u00ebse GoogleFu ka zbuluar se Playmaker \u00ebsht\u00eb i pranish\u00ebm n\u00eb projekt, ajo do t\u00eb ju lejojn\u00eb p\u00ebr t\u00eb vendosur nj\u00eb rrug\u00eb playmaker Veprimet.\n\nDuke b\u00ebr\u00eb t\u00eb mundur playmaker Veprimet brez p\u00ebr Object Database eksport do t\u00eb lejoj\u00eb GoogleFu t\u00eb krijoni playmaker Veprimet automatikisht.",
														"\u0410\u043a\u043e \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u0458\u0435 \u043e\u0442\u043a\u0440\u0438\u043e \u0434\u0430 \u041f\u043b\u0435\u0458\u043c\u0435\u0458\u043a\u0435\u0440 \u0458\u0435 \u043f\u0440\u0438\u0441\u0443\u0442\u043d\u0430 \u0443 \u043f\u0440\u043e\u0458\u0435\u043a\u0442\u0443, \u043e\u043d \u045b\u0435 \u0432\u0430\u043c \u043e\u043c\u043e\u0433\u0443\u045b\u0438\u0442\u0438 \u0434\u0430 \u043f\u043e\u0434\u0435\u0441\u0438\u0442\u0435 \u043f\u043b\u0435\u0458\u043c\u0435\u0458\u043a\u0435\u0440 \u0410\u0446\u0442\u0438\u043e\u043d\u0441 \u043f\u0443\u0442.\n\n\u041e\u043c\u043e\u0433\u0443\u045b\u0430\u0432\u0430\u045a\u0435 \u043f\u043b\u0435\u0458\u043c\u0435\u0458\u043a\u0435\u0440 \u0410\u0446\u0442\u0438\u043e\u043d\u0441 \u0433\u0435\u043d\u0435\u0440\u0430\u0446\u0438\u0458\u0443 \u0437\u0430 \u043e\u0431\u0458\u0435\u043a\u0430\u0442 \u0414\u0430\u0442\u0430\u0431\u0430\u0441\u0435 \u0438\u0437\u0432\u043e\u0437 \u045b\u0435 \u043e\u043c\u043e\u0433\u0443\u045b\u0438\u0442\u0438 \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u0430\u0443\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u043e \u043a\u0440\u0435\u0438\u0440\u0430\u045a\u0435 \u043f\u043b\u0430\u0438\u043c\u0430\u043a\u0435\u0440 \u0410\u0446\u0442\u0438\u043e\u043d\u0441.",
														"Om GoogleFu har uppt\u00e4ckt att Playmaker \u00e4r n\u00e4rvarande i projektet, kommer det att du kan st\u00e4lla in en Playmaker \u00c5tg\u00e4rder v\u00e4g.\n\nAktivera Playmaker \u00c5tg\u00e4rder generation f\u00f6r objektet Database export g\u00f6r att GoogleFu skapa Playmaker \u00c5tg\u00e4rder automatiskt.",
														"Kama GoogleFu imegundua kwamba mchezaji ni ya sasa katika mradi huo, itakuwa kuruhusu wewe kuweka Hatua mchezaji njia.\n\nKuwezesha mchezaji Vitendo kizazi kwa Object Database nje itaruhusu GoogleFu kujenga Vitendo mchezaji moja kwa moja.",
														"\u0e16\u0e49\u0e32 GoogleFu \u0e15\u0e23\u0e27\u0e08\u0e1e\u0e1a\u0e27\u0e48\u0e32 Playmaker \u0e21\u0e35\u0e2d\u0e22\u0e39\u0e48\u0e43\u0e19\u0e42\u0e04\u0e23\u0e07\u0e01\u0e32\u0e23\u0e17\u0e35\u0e48\u0e08\u0e30\u0e0a\u0e48\u0e27\u0e22\u0e43\u0e2b\u0e49\u0e04\u0e38\u0e13\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e01\u0e33\u0e2b\u0e19\u0e14\u0e40\u0e2a\u0e49\u0e19\u0e17\u0e32\u0e07\u0e01\u0e32\u0e23\u0e14\u0e33\u0e40\u0e19\u0e34\u0e19\u0e01\u0e32\u0e23 Playmaker\n\n\u0e17\u0e33\u0e43\u0e2b\u0e49 Playmaker \u0e23\u0e38\u0e48\u0e19\u0e2a\u0e33\u0e2b\u0e23\u0e31\u0e1a\u0e01\u0e32\u0e23\u0e14\u0e33\u0e40\u0e19\u0e34\u0e19\u0e01\u0e32\u0e23\u0e2a\u0e48\u0e07\u0e2d\u0e2d\u0e01\u0e27\u0e31\u0e15\u0e16\u200b\u200b\u0e38\u0e10\u0e32\u0e19\u0e02\u0e49\u0e2d\u0e21\u0e39\u0e25\u0e08\u0e30\u0e0a\u0e48\u0e27\u0e22\u0e43\u0e2b\u0e49 GoogleFu \u0e43\u0e19\u0e01\u0e32\u0e23\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e01\u0e32\u0e23\u0e14\u0e33\u0e40\u0e19\u0e34\u0e19\u0e01\u0e32\u0e23 Playmaker \u0e42\u0e14\u0e22\u0e2d\u0e31\u0e15\u0e42\u0e19\u0e21\u0e31\u0e15\u0e34",
														"Kung GoogleFu Nakakita na Playmaker ay naroroon sa proyekto, ito ay magpapahintulot sa inyo na magtakda ng isang landas Playmaker Mga Pagkilos.\n\nAng pagpapagana ng Playmaker henerasyon Pagkilos para sa Bagay Database pag-export ay magbibigay-daan GoogleFu upang awtomatikong lumikha Playmaker Mga Pagkilos.",
														"GoogleFu Oyun kurucu projede mevcut oldu\u011funu tespit etti, bu bir Oyun kurucu Eylemleri yolunu ayarlamak i\u00e7in izin verecektir.\n\nNesne Veritaban\u0131 ihracat i\u00e7in Oyun kurucu Eylemler nesil etkinle\u015ftirilmesi GoogleFu otomatik Oyun kurucu Eylemleri olu\u015fturmak i\u00e7in izin verecek.",
														"\u042f\u043a\u0449\u043e GoogleFu \u0432\u0438\u044f\u0432\u0438\u0432, \u0449\u043e \u0420\u043e\u0437\u0456\u0433\u0440\u0443\u044e\u0447\u0438\u0439 \u043f\u0440\u0438\u0441\u0443\u0442\u043d\u0456\u0439 \u0432 \u043f\u0440\u043e\u0435\u043a\u0442\u0456, \u0446\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u044c \u0432\u0430\u043c \u0432\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0438 \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440\u0430 \u0434\u0456\u0457 \u0448\u043b\u044f\u0445.\n\n\u0412\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0434\u0456\u0457 \u043f\u043e\u043a\u043e\u043b\u0456\u043d\u043d\u044f \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0434\u043b\u044f \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u0443 \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u0438\u0445 \u043e\u0431'\u0454\u043a\u0442\u0456\u0432 \u0434\u043e\u0437\u0432\u043e\u043b\u0438\u0442\u044c GoogleFu \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0434\u0456\u0457 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e.",
														"\u05d0\u05d5\u05d9\u05d1 \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d4\u05d0\u05d8 \u05d3\u05d9\u05d8\u05e2\u05e7\u05d8\u05d0\u05b7\u05d3 \u05d0\u05b7\u05d6 \u05e4\u05bc\u05dc\u05d9\u05d9\u05b7\u05de\u05d0\u05b7\u05e7\u05e2\u05e8 \u05d0\u05d9\u05d6 \u05e4\u05d0\u05b8\u05e8\u05e9\u05d8\u05e2\u05dc\u05df \u05d0\u05d9\u05df \u05d3\u05d9 \u05e4\u05bc\u05e8\u05d5\u05d9\u05e2\u05e7\u05d8, \u05e2\u05e1 \u05d5\u05d5\u05e2\u05d8 \u05dc\u05d0\u05b8\u05d6\u05df \u05d0\u05d9\u05e8 \u05e6\u05d5 \u05e9\u05d8\u05e2\u05dc\u05df \u05d0\u05b7 \u05e4\u05bc\u05dc\u05d9\u05d9\u05b7\u05de\u05d0\u05b7\u05e7\u05e2\u05e8 \u05d0\u05b7\u05e7\u05d8\u05d9\u05d0\u05b8\u05e0\u05e1 \u05d3\u05e8\u05da.\n\n\u05e2\u05e0\u05d9\u05d9\u05d1\u05d0\u05b7\u05dc\u05d9\u05e0\u05d2 \u05d3\u05d9 \u05e4\u05bc\u05dc\u05d9\u05d9\u05b7\u05de\u05d0\u05b7\u05e7\u05e2\u05e8 \u05d0\u05b7\u05e7\u05d8\u05d9\u05d0\u05b8\u05e0\u05e1 \u05d3\u05d5\u05e8 \u05e4\u05bf\u05d0\u05b7\u05e8 \u05d3\u05d9 \u05d0\u05b8\u05d1\u05d3\u05d6\u05e9\u05e2\u05e7\u05d8 \u05d3\u05d0\u05b7\u05d8\u05d0\u05b7\u05d1\u05d0\u05b7\u05e1\u05e2 \u05d0\u05b7\u05e8\u05d5\u05d9\u05e1\u05e4\u05d9\u05e8\u05df \u05d5\u05d5\u05e2\u05d8 \u05dc\u05d0\u05b8\u05d6\u05df \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05e6\u05d5 \u05e9\u05d0\u05b7\u05e4\u05bf\u05df \u05e4\u05bc\u05dc\u05d9\u05d9\u05b7\u05de\u05d0\u05b7\u05e7\u05e2\u05e8 \u05d0\u05b7\u05e7\u05d8\u05d9\u05d0\u05b8\u05e0\u05e1 \u05d0\u05d5\u05d9\u05d8\u05d0\u05b8\u05de\u05d0\u05b7\u05d8\u05d9\u05e9.",
														"\u5982\u679cGoogleFu\u6aa2\u6e2c\u5230\u7b56\u52d5\u9032\u653b\u5b58\u5728\u7684\u9805\u76ee\uff0c\u5b83\u53ef\u4ee5\u8b93\u4f60\u8a2d\u7f6e\u4e00\u500b\u4e2d\u5834\u7d44\u7e54\u8005\u7684\u884c\u52d5\u8def\u5f91\u3002\n\n\u555f\u7528\u7b56\u52d5\u9032\u653b\u52d5\u4f5c\u7522\u751f\u7684\u5c0d\u8c61\u6578\u64da\u5eab\u5c0e\u51fa\u5c07\u8b93GoogleFu\u81ea\u52d5\u5275\u5efa\u7b56\u52d5\u9032\u653b\u884c\u52d5\u3002"));
			Rows.Add( new LocalizationRow("The Google account that GoogleFu will be allowed to access. Private workbooks associated with this account will be available for export if you log in.  Otherwise only publically published workbooks will be available.",
