														"Das Google-Konto, das GoogleFu erlaubt sein wird, zugegriffen werden. Private Arbeitsmappen mit diesem Konto verbunden sind, werden f\u00fcr den Export zur Verf\u00fcgung, wenn Sie sich einloggen. Ansonsten werden nur \u00f6ffentlich ver\u00f6ffentlichten Arbeitsmappen verf\u00fcgbar sein wird.",
														"La cuenta de Google que googleFU se le permitir\u00e1 acceder. Libros de trabajo privados asociados a esta cuenta estar\u00e1n disponibles para la exportaci\u00f3n si inicia sesi\u00f3n en. Si no, solamente libros publicados p\u00fablicamente estar\u00e1n disponibles.",
														"\u062d\u0633\u0627\u0628 Google \u0627\u0644\u0630\u064a \u0633\u064a\u0633\u0645\u062d GoogleFu \u0644\u0644\u0648\u0635\u0648\u0644. \u0633\u0648\u0641 \u0645\u0635\u0646\u0641\u0627\u062a \u062e\u0627\u0635\u0629 \u0627\u0644\u0645\u0631\u062a\u0628\u0637\u0629 \u0645\u0639 \u0647\u0630\u0627 \u0627\u0644\u062d\u0633\u0627\u0628 \u0633\u064a\u0643\u0648\u0646 \u0645\u062a\u0627\u062d\u0627 \u0644\u0644\u062a\u0635\u062f\u064a\u0631 \u0625\u0630\u0627 \u0642\u0645\u062a \u0628\u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644\u060c \u0648\u0625\u0644\u0627 \u0641\u0642\u0637 \u0627\u0644\u0645\u0635\u0646\u0641\u0627\u062a \u0627\u0644\u0645\u0646\u0634\u0648\u0631\u0629 \u0639\u0644\u0646\u0627 \u200b\u200b\u0633\u0648\u0641 \u062a\u0643\u0648\u0646 \u0645\u062a\u0627\u062d\u0629.",
														"GoogleFu\uac00 \uc561\uc138\uc2a4 \ud560 \uc218\uc788\uc744 \uac83\uc785\ub2c8\ub2e4 \uad6c\uae00 \uacc4\uc815. \ub85c\uadf8\uc778 \ud560 \uacbd\uc6b0\uc774 \uacc4\uc815\uacfc \uc5f0\uacb0\ub41c \uac1c\uc778 \ud1b5\ud569 \ubb38\uc11c\ub294 \uadf8\ub807\uc9c0 \ub9cc \uacf5\uac1c\uc801\uc73c\ub85c \uac8c\uc2dc \ub41c \ud1b5\ud569 \ubb38\uc11c\ub97c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ub0b4\ubcf4\ub0b4\uae30 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
														"\u8fd9GoogleFu\u5c06\u88ab\u5141\u8bb8\u8bbf\u95ee\u7684\u8c37\u6b4c\u5e10\u6237\u3002\u4e0e\u6b64\u5e10\u6237\u5173\u8054\u7684\u79c1\u4eba\u5de5\u4f5c\u7c3f\u5c06\u7528\u4e8e\u51fa\u53e3\uff0c\u5982\u679c\u4f60\u767b\u5f55\uff0c\u5426\u5219\u53ea\u80fd\u516c\u5f00\u53d1\u5e03\u7684\u5de5\u4f5c\u7c3f\u5c06\u53ef\u7528\u3002",
														"GoogleFu\u304c\u30a2\u30af\u30bb\u30b9\u3092\u8a31\u53ef\u3055\u308c\u308bGoogle\u30a2\u30ab\u30a6\u30f3\u30c8\u3002\u30ed\u30b0\u30a4\u30f3\u3059\u308b\u5834\u5408\u306f\u3001\u3053\u306e\u30a2\u30ab\u30a6\u30f3\u30c8\u306b\u95a2\u9023\u4ed8\u3051\u3089\u308c\u305f\u30d7\u30e9\u30a4\u30d9\u30fc\u30c8\u30d6\u30c3\u30af\u304c\u8f38\u51fa\u3067\u304d\u308b\u3088\u3046\u306b\u306a\u308a\u307e\u3059\u3002\u305d\u3046\u3067\u306a\u3044\u5834\u5408\u306e\u307f\u516c\u306b\u516c\u958b\u3055\u30d6\u30c3\u30af\u304c\u5229\u7528\u3067\u304d\u308b\u3088\u3046\u306b\u306a\u308a\u307e\u3059\u3002",
														"\u0423\u0447\u0435\u0442\u043d\u0430\u044f \u0437\u0430\u043f\u0438\u0441\u044c Google, \u0447\u0442\u043e GoogleFu \u0431\u0443\u0434\u0435\u0442 \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d \u0434\u043e\u0441\u0442\u0443\u043f. \u0427\u0430\u0441\u0442\u043d\u044b\u0435 \u0443\u0447\u0435\u0431\u043d\u044b\u0435 \u043f\u043e\u0441\u043e\u0431\u0438\u044f, \u0441\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0435 \u0441 \u044d\u0442\u043e\u0439 \u0443\u0447\u0435\u0442\u043d\u043e\u0439 \u0437\u0430\u043f\u0438\u0441\u0438 \u0431\u0443\u0434\u0443\u0442 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u044b \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0430, \u0435\u0441\u043b\u0438 \u0432\u044b \u0432\u043e\u0439\u0442\u0438. \u0418\u043d\u0430\u0447\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u043e \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u043d\u044b\u0435 \u0440\u0430\u0431\u043e\u0447\u0438\u0435 \u0442\u0435\u0442\u0440\u0430\u0434\u0438 \u0431\u0443\u0434\u0443\u0442 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u044b.",
														"C\u00e1c t\u00e0i kho\u1ea3n Google GoogleFu s\u1ebd \u0111\u01b0\u1ee3c ph\u00e9p truy c\u1eadp. S\u00e1ch b\u00e0i t\u1eadp tin li\u00ean k\u1ebft v\u1edbi t\u00e0i kho\u1ea3n n\u00e0y s\u1ebd \u0111\u01b0\u1ee3c d\u00e0nh cho xu\u1ea5t kh\u1ea9u n\u1ebfu b\u1ea1n \u0111\u0103ng nh\u1eadp. N\u1ebfu kh\u00f4ng ch\u1ec9 c\u00f3 s\u00e1ch b\u00e0i t\u1eadp \u0111\u01b0\u1ee3c c\u00f4ng b\u1ed1 c\u00f4ng khai s\u1ebd c\u00f3 s\u1eb5n.",
														"De Google-account die GoogleFu zal worden toegestaan \u200b\u200bom toegang te krijgen. Private werkboeken in verband met deze account zal beschikbaar zijn voor de export zijn als u inlogt. Anders alleen publiekelijk gepubliceerd werkboeken beschikbaar zal zijn.",
														"Die Google-rekening wat GoogleFu sal toegelaat word om toegang te verkry. Private werkboeke wat verband hou met hierdie rekening sal beskikbaar wees vir uitvoer as jy inteken. Andersins net die publiek gepubliseer werkboeke sal beskikbaar wees.",
														"\u0421\u043c\u0435\u0442\u043a\u0430\u0442\u0430 \u043d\u0430 Google, \u0447\u0435 GoogleFu \u0449\u0435 \u0431\u044a\u0434\u0435 \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u043e \u0434\u0430 \u043e\u0441\u044a\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435 \u0434\u043e\u0441\u0442\u044a\u043f. \u0427\u0430\u0441\u0442\u043d\u0438 \u0440\u0430\u0431\u043e\u0442\u043d\u0438 \u043a\u043d\u0438\u0433\u0438, \u0441\u0432\u044a\u0440\u0437\u0430\u043d\u0438 \u0441 \u0442\u0430\u0437\u0438 \u0441\u043c\u0435\u0442\u043a\u0430 \u0449\u0435 \u0431\u044a\u0434\u0430\u0442 \u043d\u0430 \u0440\u0430\u0437\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u0437\u0430 \u0438\u0437\u043d\u043e\u0441, \u0430\u043a\u043e \u0432\u043b\u0435\u0437\u0435\u0442\u0435. \u0412 \u043f\u0440\u043e\u0442\u0438\u0432\u0435\u043d \u0441\u043b\u0443\u0447\u0430\u0439 \u0441\u0430\u043c\u043e \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u043e \u043f\u0443\u0431\u043b\u0438\u043a\u0443\u0432\u0430\u043d\u0438 \u0440\u0430\u0431\u043e\u0442\u043d\u0438 \u043a\u043d\u0438\u0433\u0438 \u0449\u0435 \u0431\u044a\u0434\u0430\u0442 \u043d\u0430 \u0440\u0430\u0437\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435.",
														"\u0423\u043b\u0456\u043a\u043e\u0432\u044b \u0437\u0430\u043f\u0456\u0441 Google, \u0448\u0442\u043e GoogleFu \u0431\u0443\u0434\u0437\u0435 \u0434\u0430\u0437\u0432\u043e\u043b\u0435\u043d\u044b \u0434\u043e\u0441\u0442\u0443\u043f. \u041f\u0440\u044b\u0432\u0430\u0442\u043d\u044b\u044f \u043d\u0430\u0432\u0443\u0447\u0430\u043b\u044c\u043d\u044b\u044f \u0434\u0430\u043f\u0430\u043c\u043e\u0436\u043d\u0456\u043a\u0456, \u0437\u0432\u044f\u0437\u0430\u043d\u044b\u044f \u0437 \u0433\u044d\u0442\u0430\u0439 \u045e\u043b\u0456\u043a\u043e\u0432\u0430\u0433\u0430 \u0437\u0430\u043f\u0456\u0441\u0443 \u0431\u0443\u0434\u0443\u0446\u044c \u0434\u0430\u0441\u0442\u0443\u043f\u043d\u044b\u044f \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u0443, \u043a\u0430\u043b\u0456 \u0432\u044b \u0443\u0432\u0430\u0439\u0441\u0446\u0456. \u0406\u043d\u0430\u043a\u0448 \u0442\u043e\u043b\u044c\u043a\u0456 \u043f\u0443\u0431\u043b\u0456\u0447\u043d\u0430 \u0430\u043f\u0443\u0431\u043b\u0456\u043a\u0430\u0432\u0430\u043d\u044b\u044f \u043f\u0440\u0430\u0446\u043e\u045e\u043d\u044b\u044f \u0441\u0448\u044b\u0442\u043a\u0456 \u0431\u0443\u0434\u0443\u0446\u044c \u0434\u0430\u0441\u0442\u0443\u043f\u043d\u044b\u044f.",
														"El compte de Google que googleFU se li permetr\u00e0 accedir. Llibres de treball privats associats a aquest compte estaran disponibles per a l'exportaci\u00f3 si inicieu una sessi\u00f3 amb. Si no, nom\u00e9s llibres publicats p\u00fablicament estaran disponibles.",
														"\u00da\u010det Google, kter\u00fd GoogleFu bude povolen p\u0159\u00edstup. Soukrom\u00e9 se\u0161ity spojen\u00e9 s t\u00edmto \u00fa\u010dtem bude k dispozici pro v\u00fdvoz, pokud se p\u0159ihl\u00e1s\u00edte. Jinak bude k dispozici pouze ve\u0159ejn\u011b publikovan\u00e9 se\u0161ity.",
														"Mae'r cyfrif Google y bydd GoogleFu yn cael ei ganiat\u00e1u i gael mynediad. Bydd llyfrau gwaith preifat sy'n gysylltiedig \u00e2'r cyfrif hwn ar gael ar gyfer allforio os byddwch yn logio i mewn. Fel arall, dim ond llyfrau gwaith a gyhoeddir yn gyhoeddus fod ar gael.",
														"Google konto, GoogleFu lubatakse p\u00e4\u00e4seda. Private t\u00f6\u00f6vihikud selle kontoga seotud on saadaval ekspordiks kui logite. Muidu ainult avalikult avaldatud t\u00f6\u00f6vihikuid on saadaval.",
														"\u0627\u06cc\u0646 \u062d\u0633\u0627\u0628 Google \u06a9\u0647 GoogleFu \u062e\u0648\u0627\u0647\u062f \u0634\u062f \u0645\u062c\u0627\u0632 \u0628\u0647 \u062f\u0633\u062a\u0631\u0633\u06cc \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u06cc\u062f. \u06a9\u062a\u0627\u0628\u0647\u0627\u06cc \u062e\u0635\u0648\u0635\u06cc \u062f\u0631 \u0627\u0631\u062a\u0628\u0627\u0637 \u0628\u0627 \u0627\u06cc\u0646 \u062d\u0633\u0627\u0628 \u0645\u0648\u062c\u0648\u062f \u0628\u0631\u0627\u06cc \u0635\u0627\u062f\u0631\u0627\u062a \u062e\u0648\u0627\u0647\u062f \u0628\u0648\u062f \u0627\u06af\u0631 \u0634\u0645\u0627 \u0648\u0627\u0631\u062f \u0634\u0648\u06cc\u062f. \u062f\u0631 \u063a\u06cc\u0631 \u0627\u06cc\u0646 \u0635\u0648\u0631\u062a \u0641\u0642\u0637 \u06a9\u062a\u0627\u0628\u0647\u0627\u06cc \u0639\u0644\u0646\u06cc \u0645\u0646\u062a\u0634\u0631 \u0634\u062f\u0647 \u062f\u0631 \u062f\u0633\u062a\u0631\u0633 \u062e\u0648\u0627\u0647\u062f \u0628\u0648\u062f.",
														"Google huomioon, ett\u00e4 GoogleFu sallitaan p\u00e4\u00e4sy. Yksityinen ty\u00f6kirjoja liittyv\u00e4 Tilin voidaan vied\u00e4 jos olet kirjautunut sis\u00e4\u00e4n. Muutoin vain julkisesti julkaistu ty\u00f6kirjoja on saatavilla.",
														"An cuntas Google go mbeidh GoogleFu go mbeadh cead a rochtain. Beidh leabhair shaothair phr\u00edobh\u00e1ideacha a bhaineann leis an gcuntas seo ar f\u00e1il le haghaidh onnmhairi\u00fa m\u00e1 t\u00e1 t\u00fa log\u00e1il isteach. Seachas sin beidh ach leabhair oibre foilsithe go poibl\u00ed a bheith ar f\u00e1il.",
														"A conta de Google que GoogleFu ser\u00e1 permitido o acceso. Libros privados asociados a esta conta est\u00e1 dispo\u00f1ible para exportaci\u00f3n, se iniciar sesi\u00f3n. Se non, soamente os libros publicamente publicados estar\u00e1n dispo\u00f1ibles.",
														"GoogleFu \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0915\u0930\u0928\u0947 \u0915\u0940 \u0905\u0928\u0941\u092e\u0924\u093f \u0926\u0940 \u091c\u093e\u090f\u0917\u0940 \u0915\u093f \u0917\u0942\u0917\u0932 \u0916\u093e\u0924\u0947. \u0905\u0917\u0930 \u0924\u0941\u092e \u092e\u0947\u0902 \u0932\u0949\u0917 \u0907\u0938 \u0916\u093e\u0924\u0947 \u0938\u0947 \u0938\u0902\u092c\u0926\u094d\u0927 \u0928\u093f\u091c\u0940 \u0915\u093e\u0930\u094d\u092f\u092a\u0941\u0938\u094d\u0924\u093f\u0915\u093e \u0905\u0928\u094d\u092f\u0925\u093e \u0915\u0947\u0935\u0932 \u0938\u093e\u0930\u094d\u0935\u091c\u0928\u093f\u0915 \u0930\u0942\u092a \u0938\u0947 \u092a\u094d\u0930\u0915\u093e\u0936\u093f\u0924 \u0915\u093e\u0930\u094d\u092f\u092a\u0941\u0938\u094d\u0924\u093f\u0915\u093e \u0909\u092a\u0932\u092c\u094d\u0927 \u0939\u094b \u091c\u093e\u090f\u0917\u093e. \u0928\u093f\u0930\u094d\u092f\u093e\u0924 \u0915\u0947 \u0932\u093f\u090f \u0909\u092a\u0932\u092c\u094d\u0927 \u0939\u094b \u091c\u093e\u090f\u0917\u093e.",
														"Google ra\u010dun koji GoogleFu \u0107e biti dopu\u0161ten pristup. Privatne radne bilje\u017enice povezani s tog ra\u010duna bit \u0107e dostupni za izvoz, ako se prijavite. Ina\u010de samo javno objavljeni radne knjige \u0107e biti na raspolaganju.",
														"Kont la Google ki GoogleFu pral p\u00e8m\u00e8t yo gen aks\u00e8 a. Manu\u00e8l Prive ki asosye ak kont sa a yo ap disponib pou eksp\u00f2tasyon si ou ouvri sesyon an. Sinon s\u00e8lman piblikman pibliye manu\u00e8l ap disponib.",
														"Akun Google yang GoogleFu akan diizinkan untuk mengakses. Workbook pribadi terkait dengan akun ini akan tersedia untuk ekspor jika Anda masuk. Jika hanya workbook publik diterbitkan akan tersedia.",
														"Google reikningur sem GoogleFu ver\u00f0ur leyft a\u00f0 opna. Einka Vinnub\u00e6kur tengjast \u00feessum reikningi ver\u00f0ur a\u00f0 vera \u00ed bo\u00f0i fyrir \u00fatflutning ef \u00fe\u00fa skr\u00e1ir \u00feig inn. Annars bara opinberlega birt Vinnub\u00e6kur ver\u00f0a \u00ed bo\u00f0i.",
														"\u05d7\u05e9\u05d1\u05d5\u05df Google \u05e9\u05d9\u05ea\u05d0\u05e4\u05e9\u05e8 GoogleFu \u05dc\u05d2\u05e9\u05ea. \u05d7\u05d5\u05d1\u05e8\u05d5\u05ea \u05e2\u05d1\u05d5\u05d3\u05d4 \u05e4\u05e8\u05d8\u05d9\u05d5\u05ea \u05de\u05e9\u05d5\u05d9\u05db\u05d5\u05ea \u05dc\u05d7\u05e9\u05d1\u05d5\u05df \u05d6\u05d4 \u05ea\u05d4\u05d9\u05d4 \u05d6\u05de\u05d9\u05e0\u05d4 \u05dc\u05d9\u05e6\u05d5\u05d0, \u05d0\u05dd \u05d0\u05ea\u05d4 \u05de\u05ea\u05d7\u05d1\u05e8. \u05d0\u05d7\u05e8\u05ea \u05e8\u05e7 \u05d7\u05d5\u05d1\u05e8\u05d5\u05ea \u05e2\u05d1\u05d5\u05d3\u05d4 \u05e9\u05e4\u05d5\u05e8\u05e1\u05de\u05d4 \u05d1\u05e4\u05d5\u05de\u05d1\u05d9 \u05ea\u05d4\u05d9\u05d4 \u05d6\u05de\u05d9\u05e0\u05d5\u05ea.",
														"\"Google\" paskyros, GoogleFu bus leista naudotis. Priva\u010dios darbaknyges, susijusios su \u0161io s\u0105skait\u0105 bus galima eksportuoti, jei j\u016bs prisijungti. Prie\u0161ingu atveju tik vie\u0161ai paskelbti darbaknyges bus galima gauti.",
														"Google konts, kas GoogleFu tiks at\u013cauts piek\u013c\u016bt. Priv\u0101t\u0101s darbgr\u0101matas, kas saist\u012btas ar \u0161o kontu b\u016bs pieejami eksportam, ja j\u016bs piesak\u0101ties. Pret\u0113j\u0101 tikai publiski public\u0113tie darba burtn\u012bcas b\u016bs pieejami.",
														"\u0413\u0443\u0433\u043b \u043f\u0440\u0435\u0434\u0432\u0438\u0434 \u0434\u0435\u043a\u0430 GoogleFu \u045c\u0435 \u0438\u043c \u0431\u0438\u0434\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u0435\u043d\u043e \u0434\u0430 \u043f\u0440\u0438\u0441\u0442\u0430\u043f\u0438\u0442\u0435. \u041f\u0440\u0438\u0432\u0430\u0442\u043d\u0438 \u0440\u0430\u0431\u043e\u0442\u043d\u0438 \u043a\u043d\u0438\u0433\u0438 \u043f\u043e\u0432\u0440\u0437\u0430\u043d\u0438 \u0441\u043e \u043e\u0432\u0430\u0430 \u0441\u043c\u0435\u0442\u043a\u0430 \u045c\u0435 \u0431\u0438\u0434\u0430\u0442 \u0434\u043e\u0441\u0442\u0430\u043f\u043d\u0438 \u0437\u0430 \u0438\u0437\u0432\u043e\u0437 \u0430\u043a\u043e \u0441\u0435 \u043d\u0430\u0458\u0430\u0432\u0438\u0442\u0435. \u0412\u043e \u0441\u043f\u0440\u043e\u0442\u0438\u0432\u043d\u043e \u0441\u0430\u043c\u043e \u0458\u0430\u0432\u043d\u043e \u043e\u0431\u0458\u0430\u0432\u0435\u043d\u0438 \u0440\u0430\u0431\u043e\u0442\u043d\u0438 \u043a\u043d\u0438\u0433\u0438 \u045c\u0435 \u0431\u0438\u0434\u0430\u0442 \u0434\u043e\u0441\u0442\u0430\u043f\u043d\u0438.",
														"Akaun Google yang GoogleFu akan dibenarkan untuk mengakses. Buku kerja swasta yang berkaitan dengan akaun ini akan tersedia untuk dieksport jika anda log masuk. Jika tidak hanya buku kerja umum diterbitkan akan disediakan.",
														"Il-kont Google li GoogleFu se jit\u0127allew a\u010b\u010bess. Workbooks privati \u200b\u200basso\u010bjati ma 'dan il-kont se jkun disponibbli g\u0127all-esportazzjoni jekk tilloggja. Inkella biss workbooks pubblikament ppubblikati se jkun disponibbli.",
														"Google-kontoen som GoogleFu vil f\u00e5 lov til \u00e5 f\u00e5 tilgang. Private arbeidsb\u00f8ker knyttet til denne kontoen vil v\u00e6re tilgjengelig for eksport hvis du logger inn. Ellers bare offentlig publiserte arbeidsb\u00f8ker vil v\u00e6re tilgjengelig.",
														"Konto Google, kt\u00f3re GoogleFu b\u0119dzie m\u00f3g\u0142 uzyska\u0107 dost\u0119p. Prywatne skoroszyty zwi\u0105zane z tym kontem b\u0119dzie dost\u0119pna na wyw\u00f3z, je\u015bli zalogowa\u0107. Przeciwnym razie tylko publicznie opublikowanych skoroszyt\u00f3w b\u0119dzie dost\u0119pna.",
														"A conta do Google que GoogleFu ser\u00e1 permitido o acesso. Livros privados associados a esta conta estar\u00e1 dispon\u00edvel para exporta\u00e7\u00e3o, se voc\u00ea efetuar login. Caso contr\u00e1rio, somente os livros publicamente publicados estar\u00e3o dispon\u00edveis.",
														"Contul Google pe care GoogleFu va fi permis accesul. Registre de lucru private asociate cu acest cont va fi disponibil pentru export, dac\u0103 v\u0103 conecta\u021bi. \u00cen caz contrar, numai registre de lucru publicate public vor fi disponibile.",
														"\u00da\u010det Google, ktor\u00fd GoogleFu bude povolen\u00fd pr\u00edstup. S\u00fakromn\u00e9 \u200b\u200bzo\u0161ity spojen\u00e9 s t\u00fdmto \u00fa\u010dtom bude k dispoz\u00edcii pre v\u00fdvoz, ak sa prihl\u00e1site. Inak bude k dispoz\u00edcii len verejne publikovanej zo\u0161ity.",
														"Google ra\u010duna, da se bo GoogleFu dovoljen dostop. Zasebni delovni zvezki, povezana s tem ra\u010dunom, bodo na voljo za izvoz, \u010de se prijavite. Druga\u010de bo le javno objavljene delovne zvezke bodo na voljo.",
														"Llogaria Google q\u00eb GoogleFu do t\u00eb lejohet p\u00ebr t\u00eb hyr\u00eb. Workbooks private q\u00eb lidhen me k\u00ebt\u00eb llogari do t\u00eb jet\u00eb n\u00eb dispozicion p\u00ebr eksport n\u00eb qoft\u00eb se ju hyni n\u00eb. P\u00ebrndryshe vet\u00ebm tekste t\u00eb botuara publikisht do t\u00eb jen\u00eb n\u00eb dispozicion.",
														"\u0413\u043e\u043e\u0433\u043b\u0435 \u043d\u0430\u043b\u043e\u0433 \u043a\u043e\u0458\u0438 \u045b\u0435 \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u0431\u0438\u0442\u0438 \u0434\u043e\u0437\u0432\u043e\u0459\u0435\u043d \u043f\u0440\u0438\u0441\u0442\u0443\u043f. \u041f\u0440\u0438\u0432\u0430\u0442\u043d\u0438 \u0440\u0430\u0434\u043d\u0435 \u0441\u0432\u0435\u0441\u043a\u0435 \u043f\u043e\u0432\u0435\u0437\u0430\u043d\u0435 \u0441\u0430 \u043e\u0432\u0438\u043c \u043d\u0430\u043b\u043e\u0433\u043e\u043c \u045b\u0435 \u0431\u0438\u0442\u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u0430\u043d \u0437\u0430 \u0438\u0437\u0432\u043e\u0437, \u0430\u043a\u043e \u0441\u0435 \u043f\u0440\u0438\u0458\u0430\u0432\u0438\u0442\u0435. \u0421\u0443\u043f\u0440\u043e\u0442\u043d\u043e\u043c \u0441\u0430\u043c\u043e \u0458\u0430\u0432\u043d\u043e \u043e\u0431\u0458\u0430\u0432\u0459\u0435\u043d\u0435 \u0440\u0430\u0434\u043d\u0435 \u0441\u0432\u0435\u0441\u043a\u0435 \u045b\u0435 \u0431\u0438\u0442\u0438 \u043d\u0430 \u0440\u0430\u0441\u043f\u043e\u043b\u0430\u0433\u0430\u045a\u0443.",
														"Google-konto som GoogleFu kommer att till\u00e5tas att komma \u00e5t. Privata arbetsb\u00f6cker som \u00e4r f\u00f6rknippade med detta konto kommer att vara tillg\u00e4nglig f\u00f6r export om du loggar in. Annars bara offentligt publicerade arbetsb\u00f6cker kommer att finnas tillg\u00e4ngliga.",
														"Akaunti ya Google ambayo GoogleFu wataruhusiwa kupata. Vitabu binafsi zinazohusiana na akaunti hii itakuwa inapatikana kwa mauzo ya nje kama wewe kuingia katika. Vinginevyo tu publically kuchapishwa vitabu itakuwa inapatikana.",
														"\u0e1a\u0e31\u0e0d\u0e0a\u0e35 Google \u0e17\u0e35\u0e48 GoogleFu \u0e08\u0e30\u0e44\u0e14\u0e49\u0e23\u0e31\u0e1a\u0e2d\u0e19\u0e38\u0e0d\u0e32\u0e15\u0e43\u0e2b\u0e49\u0e40\u0e02\u0e49\u0e32\u0e16\u0e36\u0e07 \u0e2a\u0e21\u0e38\u0e14\u0e07\u0e32\u0e19\u0e20\u0e32\u0e04\u0e40\u0e2d\u0e01\u0e0a\u0e19\u0e17\u0e35\u0e48\u0e40\u0e01\u0e35\u0e48\u0e22\u0e27\u0e02\u0e49\u0e2d\u0e07\u0e01\u0e31\u0e1a\u0e1a\u0e31\u0e0d\u0e0a\u0e35\u0e19\u0e35\u0e49\u0e08\u0e30\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e43\u0e0a\u0e49\u0e44\u0e14\u0e49\u0e2a\u0e33\u0e2b\u0e23\u0e31\u0e1a\u0e01\u0e32\u0e23\u0e2a\u0e48\u0e07\u0e2d\u0e2d\u0e01\u0e16\u0e49\u0e32\u0e04\u0e38\u0e13\u0e40\u0e02\u0e49\u0e32\u0e2a\u0e39\u0e48\u0e23\u0e30\u0e1a\u0e1a\u0e43\u0e19. \u0e21\u0e34\u0e09\u0e30\u0e19\u0e31\u0e49\u0e19\u0e40\u0e1e\u0e35\u0e22\u0e07\u0e2a\u0e21\u0e38\u0e14\u0e07\u0e32\u0e19\u0e40\u0e1c\u0e22\u0e41\u0e1e\u0e23\u0e48\u0e2a\u0e39\u0e48\u0e2a\u0e32\u0e18\u0e32\u0e23\u0e13\u0e30\u0e08\u0e30\u0e21\u0e35",
														"Ang Google account na papayagan GoogleFu upang ma-access. Pribadong workbooks na nauugnay sa account na ito ay magiging available para ma-export kung mag-log ka sa. Kung hindi man lamang sa publiko publish workbooks ay magiging available.",
														"GoogleFu eri\u015fmek i\u00e7in izin verilecektir Google hesab\u0131. Oturum halinde bu hesap ile ili\u015fkilendirilmi\u015f \u00f6zel \u00e7al\u0131\u015fma kitaplar\u0131n\u0131 Aksi halde sadece kamuya yay\u0131nlanm\u0131\u015f kitaplar\u0131n\u0131 sunulacak. Ihracat i\u00e7in haz\u0131r olacakt\u0131r.",
														"\u041e\u0431\u043b\u0456\u043a\u043e\u0432\u0438\u0439 \u0437\u0430\u043f\u0438\u0441 Google, \u0449\u043e GoogleFu \u0431\u0443\u0434\u0435 \u0434\u043e\u0437\u0432\u043e\u043b\u0435\u043d\u0438\u0439 \u0434\u043e\u0441\u0442\u0443\u043f. \u041f\u0440\u0438\u0432\u0430\u0442\u043d\u0456 \u043d\u0430\u0432\u0447\u0430\u043b\u044c\u043d\u0456 \u043f\u043e\u0441\u0456\u0431\u043d\u0438\u043a\u0438, \u043f\u043e\u0432'\u044f\u0437\u0430\u043d\u0456 \u0437 \u0446\u044c\u043e\u0433\u043e \u043e\u0431\u043b\u0456\u043a\u043e\u0432\u043e\u0433\u043e \u0437\u0430\u043f\u0438\u0441\u0443 \u0431\u0443\u0434\u0443\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456 \u0434\u043b\u044f \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u0443, \u044f\u043a\u0449\u043e \u0432\u0438 \u0443\u0432\u0456\u0439\u0442\u0438. \u0406\u043d\u0430\u043a\u0448\u0435 \u0442\u0456\u043b\u044c\u043a\u0438 \u043f\u0443\u0431\u043b\u0456\u0447\u043d\u043e \u043e\u043f\u0443\u0431\u043b\u0456\u043a\u043e\u0432\u0430\u043d\u0456 \u0440\u043e\u0431\u043e\u0447\u0456 \u0437\u043e\u0448\u0438\u0442\u0438 \u0431\u0443\u0434\u0443\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456.",
														"\u05d3\u05e2\u05e8 Google \u05d7\u05e9\u05d1\u05d5\u05df \u05d0\u05b7\u05d6 \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d5\u05d5\u05e2\u05d8 \u05d6\u05d9\u05d9\u05df \u05e2\u05e8\u05dc\u05d5\u05d9\u05d1\u05d8 \u05e6\u05d5 \u05e6\u05d5\u05d8\u05e8\u05d9\u05d8. \u05e4\u05bc\u05e8\u05d9\u05d5\u05d5\u05d0\u05b7\u05d8 \u05d5\u05d5\u05d0\u05b8\u05e8\u05e7\u05d1\u05d0\u05b8\u05d0\u05b8\u05e7\u05e1 \u05e4\u05d0\u05e8\u05d1\u05d5\u05e0\u05d3\u05df \u05de\u05d9\u05d8 \u05d3\u05e2\u05dd \u05d7\u05e9\u05d1\u05d5\u05df \u05d5\u05d5\u05e2\u05d8 \u05d6\u05d9\u05d9\u05df \u05d1\u05e0\u05d9\u05de\u05e6\u05d0 \u05e4\u05bf\u05d0\u05b7\u05e8 \u05d0\u05b7\u05e8\u05d5\u05d9\u05e1\u05e4\u05d9\u05e8\u05df \u05d0\u05d5\u05d9\u05d1 \u05d0\u05d9\u05e8 \u05e7\u05dc\u05d0\u05b8\u05e5 \u05d0\u05d9\u05df. \u05d0\u05b7\u05e0\u05d3\u05e2\u05e8\u05e9 \u05e0\u05d0\u05b8\u05e8 \u05e4\u05bc\u05d5\u05d1\u05dc\u05d9\u05e7\u05d0\u05b7\u05dc\u05dc\u05d9 \u05d0\u05e8\u05d5\u05d9\u05e1 \u05d5\u05d5\u05d0\u05b8\u05e8\u05e7\u05d1\u05d0\u05b8\u05d0\u05b8\u05e7\u05e1 \u05d5\u05d5\u05e2\u05d8 \u05d6\u05d9\u05d9\u05df \u05d1\u05e0\u05d9\u05de\u05e6\u05d0.",
														"\u9019GoogleFu\u5c07\u88ab\u5141\u8a31\u8a2a\u554f\u7684\u8c37\u6b4c\u5e33\u6236\u3002\u8207\u6b64\u5e33\u6236\u95dc\u806f\u7684\u79c1\u4eba\u5de5\u4f5c\u7c3f\u5c07\u7528\u65bc\u51fa\u53e3\uff0c\u5982\u679c\u4f60\u767b\u9304\uff0c\u5426\u5247\u53ea\u80fd\u516c\u958b\u767c\u5e03\u7684\u5de5\u4f5c\u7c3f\u5c07\u53ef\u7528\u3002"));
			Rows.Add( new LocalizationRow("The Google account that is currently logged in.  All workbooks associated with this account will be available for export.",
														"Le compte Google qui est actuellement connect\u00e9. Toutes les classeurs associ\u00e9s \u00e0 ce compte sera disponible pour l'exportation.",
														"L'account Google che \u00e8 attualmente connesso. Tutte le cartelle di lavoro associati a questo account sar\u00e0 disponibile per l'esportazione.",
														"Das Google-Konto, das zur Zeit angemeldet ist. Alle Arbeitsmappen mit diesem Konto verbunden sind, werden f\u00fcr den Export zur Verf\u00fcgung.",
														"La cuenta de Google que se registra actualmente en. Todos los libros de trabajo asociados a esta cuenta estar\u00e1 disponible para la exportaci\u00f3n.",
														"\u062d\u0633\u0627\u0628 Google \u0627\u0644\u0630\u064a \u062a\u0645 \u062a\u0633\u062c\u064a\u0644 \u062f\u062e\u0648\u0644\u0647 \u062d\u0627\u0644\u064a\u0627 \u0641\u064a. \u0633\u0648\u0641 \u062c\u0645\u064a\u0639 \u0627\u0644\u0645\u0635\u0646\u0641\u0627\u062a \u0627\u0644\u0645\u0631\u062a\u0628\u0637\u0629 \u0628\u0647\u0630\u0627 \u0627\u0644\u062d\u0633\u0627\u0628 \u0633\u064a\u0643\u0648\u0646 \u0645\u062a\u0627\u062d\u0627 \u0644\u0644\u062a\u0635\u062f\u064a\u0631.",
														"\ud604\uc7ac \ub85c\uadf8\uc778 \uad6c\uae00 \uacc4\uc815.\uc774 \uacc4\uc815\uacfc \uad00\ub828\ub41c \ubaa8\ub4e0 \ud1b5\ud569 \ubb38\uc11c\ub97c \ub0b4\ubcf4\ub0b4\uae30 \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
														"\u5f53\u524d\u767b\u5f55\u7684\u8c37\u6b4c\u5e10\u6237\u3002\u4e0e\u6b64\u5e10\u6237\u76f8\u5173\u8054\u7684\u6240\u6709\u5de5\u4f5c\u7c3f\u5c06\u7528\u4e8e\u51fa\u53e3\u3002",
														"\u73fe\u5728\u30ed\u30b0\u30a4\u30f3\u3057\u3066\u3044\u308bGoogle\u30a2\u30ab\u30a6\u30f3\u30c8\u306f\u3001\u3053\u306e\u30a2\u30ab\u30a6\u30f3\u30c8\u306b\u95a2\u9023\u4ed8\u3051\u3089\u308c\u3066\u3044\u308b\u3059\u3079\u3066\u306e\u30ef\u30fc\u30af\u30d6\u30c3\u30af\u306f\u3001\u8f38\u51fa\u306e\u305f\u3081\u306b\u5229\u7528\u3067\u304d\u308b\u3088\u3046\u306b\u306a\u308a\u307e\u3059\u3002",
														"\u0423\u0447\u0435\u0442\u043d\u0430\u044f \u0437\u0430\u043f\u0438\u0441\u044c Google, \u0447\u0442\u043e \u0432 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0435 \u0432\u0440\u0435\u043c\u044f \u0432\u043e\u0448\u043b\u0438 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0443. \u0412\u0441\u0435 \u0440\u0430\u0431\u043e\u0447\u0438\u0435 \u0442\u0435\u0442\u0440\u0430\u0434\u0438, \u0441\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0435 \u0441 \u044d\u0442\u043e\u0439 \u0443\u0447\u0435\u0442\u043d\u043e\u0439 \u0437\u0430\u043f\u0438\u0441\u0438 \u0431\u0443\u0434\u0443\u0442 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u044b \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0430.",
														"C\u00e1c t\u00e0i kho\u1ea3n Google hi\u1ec7n \u0111ang \u0111\u0103ng nh\u1eadp. T\u1ea5t c\u1ea3 c\u00e1c b\u00e0i t\u1eadp li\u00ean quan \u0111\u1ebfn t\u00e0i kho\u1ea3n n\u00e0y s\u1ebd \u0111\u01b0\u1ee3c d\u00e0nh cho xu\u1ea5t kh\u1ea9u.",
														"De Google-account die op dat moment is ingelogd. Alle werkboeken in verband met deze account beschikbaar voor de export zijn.",
														"Die Google-rekening wat tans aangemeld. Alle werkboeke wat verband hou met hierdie rekening sal beskikbaar wees vir uitvoer.",
														"\u0421\u043c\u0435\u0442\u043a\u0430\u0442\u0430 \u043d\u0430 Google, \u0447\u0435 \u0432 \u043c\u043e\u043c\u0435\u043d\u0442\u0430 \u0435 \u0432\u043b\u044f\u0437\u044a\u043b \u0432\u044a\u0442\u0440\u0435. \u0412\u0441\u0438\u0447\u043a\u0438 \u0440\u0430\u0431\u043e\u0442\u043d\u0438 \u043a\u043d\u0438\u0433\u0438, \u0441\u0432\u044a\u0440\u0437\u0430\u043d\u0438 \u0441 \u0442\u0430\u0437\u0438 \u0441\u043c\u0435\u0442\u043a\u0430 \u0449\u0435 \u0431\u044a\u0434\u0430\u0442 \u043d\u0430 \u0440\u0430\u0437\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u0437\u0430 \u0438\u0437\u043d\u043e\u0441.",
														"\u0423\u043b\u0456\u043a\u043e\u0432\u044b \u0437\u0430\u043f\u0456\u0441 Google, \u0448\u0442\u043e \u045e \u0446\u044f\u043f\u0435\u0440\u0430\u0448\u043d\u0456 \u0447\u0430\u0441 \u045e\u0432\u0430\u0439\u0448\u043b\u0456 \u045e \u0441\u0456\u0441\u0442\u044d\u043c\u0443. \u0423\u0441\u0435 \u0440\u0430\u0431\u043e\u0447\u044b\u044f \u0441\u0448\u044b\u0442\u043a\u0456, \u0437\u0432\u044f\u0437\u0430\u043d\u044b\u044f \u0437 \u0433\u044d\u0442\u0430\u0439 \u045e\u043b\u0456\u043a\u043e\u0432\u0430\u0433\u0430 \u0437\u0430\u043f\u0456\u0441\u0443 \u0431\u0443\u0434\u0443\u0446\u044c \u0434\u0430\u0441\u0442\u0443\u043f\u043d\u044b\u044f \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u0443.",
														"El compte de Google que es registra actualment en. Tots els llibres de treball associats a aquest compte estar\u00e0 disponible per a l'exportaci\u00f3.",
														"\u00da\u010det Google, kter\u00fd je aktu\u00e1ln\u011b p\u0159ihl\u00e1\u0161en. V\u0161echny se\u0161ity spojen\u00e9 s t\u00edmto \u00fa\u010dtem bude k dispozici pro v\u00fdvoz.",
														"Mae'r cyfrif Google a mewngofnodi ar hyn o bryd. Bydd yr holl lyfrau gwaith sy'n gysylltiedig \u00e2'r cyfrif hwn fod ar gael ar gyfer allforio.",
														"Google konto, mida praegu sisse logitud. K\u00f5ik t\u00f6\u00f6vihikud selle kontoga seotud on saadaval ekspordiks.",
														"\u062d\u0633\u0627\u0628 \u06af\u0648\u06af\u0644 \u0627\u0633\u062a \u06a9\u0647 \u062f\u0631 \u062d\u0627\u0644 \u062d\u0627\u0636\u0631 \u0648\u0627\u0631\u062f \u0633\u0627\u06cc\u062a \u0634\u0648\u06cc\u062f. \u062a\u0645\u0627\u0645 \u06a9\u062a\u0627\u0628\u0647\u0627\u06cc \u0645\u0631\u062a\u0628\u0637 \u0628\u0627 \u0627\u06cc\u0646 \u062d\u0633\u0627\u0628 \u0645\u0648\u062c\u0648\u062f \u0628\u0631\u0627\u06cc \u0635\u0627\u062f\u0631\u0627\u062a \u062e\u0648\u0627\u0647\u062f \u0628\u0648\u062f.",
														"Google huomioon, ett\u00e4 t\u00e4ll\u00e4 hetkell\u00e4 kirjautunut sis\u00e4\u00e4n. Kaikkien ty\u00f6kirjoja t\u00e4h\u00e4n tiliin on k\u00e4ytett\u00e4viss\u00e4 vientiin.",
														"An cuntas Google at\u00e1 log\u00e1ilte isteach faoi l\u00e1thair. Beidh gach leabhair oibre a bhaineann leis an gcuntas seo ar f\u00e1il le haghaidh onnmhairi\u00fa.",
														"A conta de Google que est\u00e1 conectado neste momento. Todas as carpetas de traballo asociados a esta conta est\u00e1 dispo\u00f1ible para exportaci\u00f3n.",
														"\u0935\u0930\u094d\u0924\u092e\u093e\u0928 \u092e\u0947\u0902 \u0932\u0949\u0917 \u0907\u0928 \u0915\u093f\u092f\u093e \u0939\u0948 \u0915\u093f \u0917\u0942\u0917\u0932 \u0916\u093e\u0924\u0947. \u0907\u0938 \u0916\u093e\u0924\u0947 \u0938\u0947 \u0938\u0902\u092c\u0926\u094d\u0927 \u0938\u092d\u0940 \u0915\u093e\u0930\u094d\u092f\u092a\u0941\u0938\u094d\u0924\u093f\u0915\u093e\u0913\u0902 \u0928\u093f\u0930\u094d\u092f\u093e\u0924 \u0915\u0947 \u0932\u093f\u090f \u0909\u092a\u0932\u092c\u094d\u0927 \u0939\u094b \u091c\u093e\u090f\u0917\u093e.",
														"Google ra\u010dun koji je trenutno prijavljeni. Sve radne knjige vezane uz ovaj ra\u010dun \u0107e biti na raspolaganju za izvoz.",
														"Kont la Google ki se kounye a louvri sesyon an. Tout manu\u00e8l ki asosye ak kont sa a yo ap disponib pou eksp\u00f2tasyon.",
														"Akun Google yang saat ini login. Semua buku kerja yang terkait dengan akun ini akan tersedia untuk ekspor.",
														"Google reikningur sem er skr\u00e1\u00f0ur \u00ed. \u00d6ll Vinnub\u00e6kur \u00ed tengslum vi\u00f0 \u00feennan reikning ver\u00f0ur \u00ed bo\u00f0i til \u00fatflutnings.",
														"\u05d7\u05e9\u05d1\u05d5\u05df Google \u05e9\u05de\u05d7\u05d5\u05d1\u05e8 \u05db\u05e2\u05ea \u05d1. \u05db\u05dc \u05d7\u05d5\u05d1\u05e8\u05d5\u05ea \u05d4\u05e2\u05d1\u05d5\u05d3\u05d4 \u05de\u05e9\u05d5\u05d9\u05db\u05d5\u05ea \u05dc\u05d7\u05e9\u05d1\u05d5\u05df \u05d6\u05d4 \u05d9\u05d4\u05d9\u05d4 \u05d6\u05de\u05d9\u05df \u05dc\u05d9\u05e6\u05d5\u05d0.",
														"\"Google\" paskyra, kad \u0161iuo metu prisijung\u0119s. Visi darbaknyges, susijusios su \u0161io s\u0105skait\u0105 bus galima eksportuoti.",
														"Google konts, kas pa\u0161laik pieteicies. Visas darba burtn\u012bcas, kas saist\u012btas ar \u0161o kontu b\u016bs pieejami eksportam.",
														"\u0413\u0443\u0433\u043b \u043f\u0440\u0435\u0434\u0432\u0438\u0434 \u0434\u0435\u043a\u0430 \u0432\u043e \u043c\u043e\u043c\u0435\u043d\u0442\u043e\u0432 \u043d\u0430\u0458\u0430\u0432\u0435\u043d\u0438. \u0421\u0438\u0442\u0435 \u0440\u0430\u0431\u043e\u0442\u043d\u0438 \u043a\u043d\u0438\u0433\u0438 \u043f\u043e\u0432\u0440\u0437\u0430\u043d\u0438 \u0441\u043e \u043e\u0432\u0430\u0430 \u0441\u043c\u0435\u0442\u043a\u0430 \u045c\u0435 \u0431\u0438\u0434\u0430\u0442 \u0434\u043e\u0441\u0442\u0430\u043f\u043d\u0438 \u0437\u0430 \u0438\u0437\u0432\u043e\u0437.",
														"Akaun Google yang login. Semua buku kerja yang berkaitan dengan akaun ini akan tersedia untuk dieksport.",
														"Il-kont Google li b\u0127alissa qed illoggjat. Workbooks kollha asso\u010bjati ma 'dan il-kont se jkun disponibbli g\u0127all-esportazzjoni.",
														"Google-kontoen som er logget p\u00e5. Alle arbeidsb\u00f8ker knyttet til denne kontoen v\u00e6re tilgjengelig for eksport.",
														"Konto Google, kt\u00f3ry jest aktualnie zalogowany. Wszystkie skoroszyty zwi\u0105zane z tego tytu\u0142u b\u0119d\u0105 dost\u0119pne na eksport.",
														"A conta do Google que est\u00e1 conectado no momento. Todas as pastas de trabalho associados a esta conta estar\u00e1 dispon\u00edvel para exporta\u00e7\u00e3o.",
														"Contul Google, care este \u00een prezent autentificat. Toate registrele de lucru asociate cu acest cont va fi disponibil pentru export.",
														"\u00da\u010det Google, ktor\u00fd je aktu\u00e1lne prihl\u00e1sen\u00fd. V\u0161etky zo\u0161ity spojen\u00e9 s t\u00fdmto \u00fa\u010dtom bude k dispoz\u00edcii na v\u00fdvoz.",
														"Google Ra\u010dun, ki je trenutno prijavljeni. Bodo vsi delovni zvezki, povezana s tem ra\u010dunom na razpolago za izvoz.",
														"Llogaria Google q\u00eb \u00ebsht\u00eb regjistruar aktualisht n\u00eb. T\u00eb gjitha workbooks t\u00eb lidhura me k\u00ebt\u00eb llogari do t\u00eb jen\u00eb n\u00eb dispozicion p\u00ebr eksport.",
														"\u0413\u043e\u043e\u0433\u043b\u0435 \u043d\u0430\u043b\u043e\u0433 \u043a\u043e\u0458\u0438 \u0458\u0435 \u0442\u0440\u0435\u043d\u0443\u0442\u043d\u043e \u043f\u0440\u0438\u0458\u0430\u0432\u0459\u0435\u043d. \u0421\u0432\u0435 \u0440\u0430\u0434\u043d\u0435 \u0441\u0432\u0435\u0441\u043a\u0435 \u0443 \u0432\u0435\u0437\u0438 \u0441\u0430 \u043e\u0432\u0438\u043c \u043d\u0430\u043b\u043e\u0433\u043e\u043c \u045b\u0435 \u0431\u0438\u0442\u0438 \u043d\u0430 \u0440\u0430\u0441\u043f\u043e\u043b\u0430\u0433\u0430\u045a\u0443 \u0437\u0430 \u0438\u0437\u0432\u043e\u0437.",
														"Google-konto som f\u00f6r tillf\u00e4llet \u00e4r inloggad. Samtliga arbetsb\u00f6cker som \u00e4r f\u00f6rknippade med detta konto kommer att vara tillg\u00e4nglig f\u00f6r export.",
														"Akaunti ya Google ambayo kwa sasa ni watumiaji katika. Vitabu wote kuhusishwa na akaunti hii itakuwa inapatikana kwa mauzo ya nje.",
														"\u0e1a\u0e31\u0e0d\u0e0a\u0e35 Google \u0e17\u0e35\u0e48\u0e16\u0e39\u0e01\u0e1a\u0e31\u0e19\u0e17\u0e36\u0e01\u0e44\u0e27\u0e49\u0e43\u0e19\u0e02\u0e13\u0e30\u0e19\u0e35\u0e49. \u0e2a\u0e21\u0e38\u0e14\u0e07\u0e32\u0e19\u0e17\u200b\u200b\u0e31\u0e49\u0e07\u0e2b\u0e21\u0e14\u0e17\u0e35\u0e48\u0e40\u0e01\u0e35\u0e48\u0e22\u0e27\u0e02\u0e49\u0e2d\u0e07\u0e01\u0e31\u0e1a\u0e1a\u0e31\u0e0d\u0e0a\u0e35\u0e19\u0e35\u0e49\u0e08\u0e30\u0e2a\u0e32\u0e21\u0e32\u0e23\u0e16\u0e43\u0e0a\u0e49\u0e44\u0e14\u0e49\u0e2a\u0e33\u0e2b\u0e23\u0e31\u0e1a\u0e01\u0e32\u0e23\u0e2a\u0e48\u0e07\u0e2d\u0e2d\u0e01",
														"Ang Google account na kasalukuyang naka-log in. Ang lahat ng mga workbooks na nauugnay sa account na ito ay magiging available para ma-export.",
														"\u015eu anda oturum Google hesab\u0131. Bu hesap ile ilgili t\u00fcm kitaplar\u0131n\u0131 ihracat i\u00e7in haz\u0131r olacakt\u0131r.",
														"\u041e\u0431\u043b\u0456\u043a\u043e\u0432\u0438\u0439 \u0437\u0430\u043f\u0438\u0441 Google, \u0449\u043e \u0432 \u0434\u0430\u043d\u0438\u0439 \u0447\u0430\u0441 \u0443\u0432\u0456\u0439\u0448\u043b\u0438 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0443. \u0412\u0441\u0456 \u0440\u043e\u0431\u043e\u0447\u0456 \u0437\u043e\u0448\u0438\u0442\u0438, \u043f\u043e\u0432'\u044f\u0437\u0430\u043d\u0456 \u0437 \u0446\u044c\u043e\u0433\u043e \u043e\u0431\u043b\u0456\u043a\u043e\u0432\u043e\u0433\u043e \u0437\u0430\u043f\u0438\u0441\u0443 \u0431\u0443\u0434\u0443\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u0456 \u0434\u043b\u044f \u0435\u043a\u0441\u043f\u043e\u0440\u0442\u0443.",
														"\u05d3\u05e2\u05e8 Google \u05d7\u05e9\u05d1\u05d5\u05df \u05d0\u05b7\u05d6 \u05d0\u05d9\u05d6 \u05d3\u05e2\u05e8\u05d5\u05d5\u05d9\u05d9\u05b7\u05dc \u05dc\u05d0\u05b8\u05d2\u05d3 \u05d0\u05d9\u05df. \u05db\u05dc \u05d5\u05d5\u05d0\u05b8\u05e8\u05e7\u05d1\u05d0\u05b8\u05d0\u05b8\u05e7\u05e1 \u05e4\u05d0\u05e8\u05d1\u05d5\u05e0\u05d3\u05df \u05de\u05d9\u05d8 \u05d3\u05e2\u05dd \u05d7\u05e9\u05d1\u05d5\u05df \u05d5\u05d5\u05e2\u05d8 \u05d6\u05d9\u05d9\u05df \u05d1\u05e0\u05d9\u05de\u05e6\u05d0 \u05e4\u05bf\u05d0\u05b7\u05e8 \u05d0\u05b7\u05e8\u05d5\u05d9\u05e1\u05e4\u05d9\u05e8\u05df.",
