														"\u041f\u0430\u0440\u043e\u043b\u044c, \u043f\u043e\u0432'\u044f\u0437\u0430\u043d\u0438\u0439 \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e \u0434\u043e\u0434\u0430\u043d\u043e\u0433\u043e Google \u0456\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430.",
														"\u05d3\u05d9 \u05e4\u05bc\u05d0\u05b7\u05e8\u05d0\u05b8\u05dc \u05e4\u05d0\u05e8\u05d1\u05d5\u05e0\u05d3\u05df \u05de\u05d9\u05d8 \u05d3\u05d9 \u05e1\u05d0\u05b7\u05e4\u05bc\u05dc\u05d9\u05d9\u05d3 Google \u05e0\u05d0\u05de\u05e2\u05df.",
