			Rows.Add( new LocalizationRow("By checking this box, the Username and Password are stored and automatically retrieved when GoogleFu is reopened. \n\nSECURITY RISK - The Username and Password are stored in the registry in PLAIN TEXT format. Only use this option if you are comfortable with this. ",
														"En cochant cette case, le nom d'utilisateur et mot de passe sont stock\u00e9s et r\u00e9cup\u00e9r\u00e9s automatiquement lorsque GoogleFu est rouvert.\n\nRISQUE DE S\u00c9CURIT\u00c9 - Le Nom d'utilisateur et mot de passe sont stock\u00e9s dans la base de registre en format texte brut. Utilisez cette option uniquement si vous \u00eates \u00e0 l'aise avec cela.",
														"Selezionando questa casella, il nome utente e la password vengono memorizzate e recuperate automaticamente quando GoogleFu viene riaperto.\n\nRischio per la sicurezza - Il nome utente e la password sono memorizzate nel Registro di sistema in formato testo normale. Utilizzare questa opzione solo se hai dimestichezza con questo.",
														"Durch die \u00dcberpr\u00fcfung dieser Box, der Benutzername und das Passwort gespeichert und automatisch abgerufen, wenn GoogleFu wieder ge\u00f6ffnet.\n\nSicherheitsrisiko - Der Benutzername und das Passwort in der Registry im Klartext gespeichert. Verwenden Sie diese Option nur, wenn Sie mit dieser sind.",
														"Al marcar esta casilla, el nombre de usuario y contrase\u00f1a se almacenan y recuperan autom\u00e1ticamente cuando se vuelve a abrir googleFU.\n\nRIESGO DE SEGURIDAD - El nombre de usuario y contrase\u00f1a se almacenan en el registro en formato de texto plano. Utilice esta opci\u00f3n s\u00f3lo si se siente c\u00f3modo con esto.",
														"\u0639\u0646 \u0637\u0631\u064a\u0642 \u0641\u062d\u0635 \u0647\u0630\u0627 \u0627\u0644\u0625\u0637\u0627\u0631\u060c \u064a\u062a\u0645 \u062a\u062e\u0632\u064a\u0646 \u0627\u0633\u0645 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0648\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0648\u0627\u0633\u062a\u0631\u062c\u0627\u0639\u0647\u0627 \u062a\u0644\u0642\u0627\u0626\u064a\u0627 \u0639\u0646\u062f\u0645\u0627 \u064a\u062a\u0645 \u0625\u0639\u0627\u062f\u0629 \u0641\u062a\u062d GoogleFu.\n\n\u064a\u062a\u0645 \u062a\u062e\u0632\u064a\u0646 \u0627\u0633\u0645 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0648\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0641\u064a \u0627\u0644\u062a\u0633\u062c\u064a\u0644 \u0628\u062a\u0646\u0633\u064a\u0642 \u0627\u0644\u0646\u0635 \u0627\u0644\u0639\u0627\u062f\u064a - \u0645\u062e\u0627\u0637\u0631 \u0623\u0645\u0646\u064a\u0629. \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0647\u0630\u0627 \u0627\u0644\u062e\u064a\u0627\u0631 \u0641\u0642\u0637 \u0625\u0630\u0627 \u0643\u0646\u062a \u0645\u0631\u062a\u0627\u062d\u0627 \u0645\u0639 \u0647\u0630\u0627.",
														"\uc774 \uc0c1\uc790\ub97c \uc120\ud0dd\ud568\uc73c\ub85c\uc368, \uc0ac\uc6a9\uc790 \uc774\ub984 \ubc0f \uc554\ud638 \uc800\uc7a5 \ubc0f GoogleFu \ub2e4\uc2dc \uc5f4 \ub54c \uc790\ub3d9\uc73c\ub85c \uac80\uc0c9\ub429\ub2c8\ub2e4.\n\n\ubcf4\uc548 \uc704\ud5d8 - \uc0ac\uc6a9\uc790 \uc774\ub984\uacfc \uc554\ud638\ub294 \uc77c\ubc18 \ud14d\uc2a4\ud2b8 \ud615\uc2dd\uc73c\ub85c \ub808\uc9c0\uc2a4\ud2b8\ub9ac\uc5d0 \uc800\uc7a5\ub429\ub2c8\ub2e4. \ub2f9\uc2e0\uc774 \ud3b8\uc548\ud558\uac8c\ud558\ub294 \uacbd\uc6b0\uc5d0\ub9cc\uc774 \uc635\uc158\uc744 \uc0ac\uc6a9\ud558\uc2ed\uc2dc\uc624.",
														"\u9009\u4e2d\u6b64\u6846\uff0c\u7528\u6237\u540d\u548c\u5bc6\u7801\u5b58\u50a8\u800c\u5f53GoogleFu\u91cd\u65b0\u6253\u5f00\u81ea\u52a8\u68c0\u7d22\u3002\n\n\u5b89\u5168\u98ce\u9669 - \u7528\u6237\u540d\u548c\u5bc6\u7801\u5b58\u50a8\u5728\u6ce8\u518c\u8868\u4e2d\u4ee5\u7eaf\u6587\u672c\u683c\u5f0f\u3002\u53ea\u6709\u5f53\u4f60\u4e60\u60ef\u4f7f\u7528\u8fd9\u79cd\u4f7f\u7528\u6b64\u9009\u9879\u3002",
														"\u3053\u306e\u30dc\u30c3\u30af\u30b9\u3092\u30c1\u30a7\u30c3\u30af\u3059\u308b\u3068\u3001\u30e6\u30fc\u30b6\u30fc\u540d\u3068\u30d1\u30b9\u30ef\u30fc\u30c9\u304c\u4fdd\u5b58\u3055\u308c\u3001GoogleFu\u518d\u30aa\u30fc\u30d7\u30f3\u3055\u308c\u305f\u3068\u304d\u306b\u81ea\u52d5\u7684\u306b\u53d6\u5f97\u3055\u308c\u307e\u3059\u3002\n\n\u30bb\u30ad\u30e5\u30ea\u30c6\u30a3\u4e0a\u306e\u30ea\u30b9\u30af - \u30e6\u30fc\u30b6\u30fc\u540d\u3068\u30d1\u30b9\u30ef\u30fc\u30c9\u304c\u30d7\u30ec\u30fc\u30f3\u30c6\u30ad\u30b9\u30c8\u5f62\u5f0f\u3067\u30ec\u30b8\u30b9\u30c8\u30ea\u306b\u4fdd\u5b58\u3055\u308c\u307e\u3059\u3002\u3042\u306a\u305f\u304c\u3053\u306e\u306b\u6163\u308c\u3066\u3044\u308b\u5834\u5408\u306b\u306e\u307f\u3001\u3053\u306e\u30aa\u30d7\u30b7\u30e7\u30f3\u3092\u4f7f\u7528\u3057\u307e\u3059\u3002",
														"\u0423\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432 \u044d\u0442\u043e\u0442 \u0444\u043b\u0430\u0436\u043e\u043a, \u0418\u043c\u044f \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044f \u0438 \u043f\u0430\u0440\u043e\u043b\u044c \u0445\u0440\u0430\u043d\u044f\u0442\u0441\u044f \u0438 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0438\u0437\u0432\u043b\u0435\u043a\u0430\u044e\u0442\u0441\u044f, \u043a\u043e\u0433\u0434\u0430 GoogleFu \u0431\u0443\u0434\u0435\u0442 \u0432\u043d\u043e\u0432\u044c \u043e\u0442\u043a\u0440\u044b\u0442.\n\n\u0423\u0433\u0440\u043e\u0437\u0430 \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 - \u0418\u043c\u044f \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044f \u0438 \u043f\u0430\u0440\u043e\u043b\u044c \u0445\u0440\u0430\u043d\u044f\u0442\u0441\u044f \u0432 \u0440\u0435\u0435\u0441\u0442\u0440\u0435 \u0432 \u043e\u0431\u044b\u0447\u043d\u044b\u0439 \u0442\u0435\u043a\u0441\u0442. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u044d\u0442\u0443 \u043e\u043f\u0446\u0438\u044e \u0442\u043e\u043b\u044c\u043a\u043e \u0435\u0441\u043b\u0438 \u0432\u044b \u0437\u043d\u0430\u043a\u043e\u043c\u044b \u0441 \u044d\u0442\u0438\u043c.",
														"B\u1eb1ng c\u00e1ch ki\u1ec3m tra h\u1ed9p n\u00e0y, Username v\u00e0 Password \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef v\u00e0 t\u1ef1 \u0111\u1ed9ng l\u1ea5y ra khi GoogleFu \u0111\u01b0\u1ee3c m\u1edf c\u1eeda tr\u1edf l\u1ea1i.\n\nAN NINH R\u1ee6I RO - C\u00e1c T\u00ean \u0111\u0103ng nh\u1eadp v\u00e0 m\u1eadt kh\u1ea9u \u0111\u01b0\u1ee3c l\u01b0u tr\u1eef trong registry trong \u0111\u1ecbnh d\u1ea1ng v\u0103n b\u1ea3n \u0111\u1ed3ng b\u1eb1ng. Ch\u1ec9 s\u1eed d\u1ee5ng t\u00f9y ch\u1ecdn n\u00e0y n\u1ebfu b\u1ea1n c\u1ea3m th\u1ea5y tho\u1ea3i m\u00e1i v\u1edbi \u0111i\u1ec1u n\u00e0y.",
														"Door het aanvinken van dit vakje, de gebruikersnaam en het wachtwoord worden opgeslagen en automatisch opgehaald wanneer GoogleFu wordt heropend.\n\nVeiligheidsrisico - De gebruikersnaam en het wachtwoord worden opgeslagen in het register in tekst zonder opmaak. Gebruik deze optie alleen als u vertrouwd bent met deze zijn.",
														"Deur die nagaan van die boks, is die gebruikersnaam en wagwoord gestoor en outomaties opgespoor wanneer GoogleFu is heropen.\n\nRisiko - die gebruikersnaam en wagwoord in die register in teks formaat gestoor. Gebruik slegs hierdie opsie as jy is gemaklik met hierdie.",
