														"Duke kontrolluar k\u00ebt\u00eb kuti, Username dhe Password jan\u00eb t\u00eb ruajtura dhe t\u00eb marr\u00eb automatikisht kur GoogleFu \u00ebsht\u00eb rihapur.\n\nRREZIKU I SIGURIS\u00cb - Username dhe Password jan\u00eb t\u00eb depozituara n\u00eb regjist\u00ebr n\u00eb format t\u00eb thjesht\u00eb teksti. Vet\u00ebm t\u00eb p\u00ebrdorni k\u00ebt\u00eb opsion, n\u00ebse ju jeni t\u00eb k\u00ebnaqur me k\u00ebt\u00eb.",
														"\u0422\u0430\u043a\u043e \u0448\u0442\u043e \u045b\u0435\u0442\u0435 \u0443 \u043e\u0432\u043e\u043c \u043f\u043e\u0459\u0443, \u043a\u043e\u0440\u0438\u0441\u043d\u0438\u0447\u043a\u043e \u0438\u043c\u0435 \u0438 \u043b\u043e\u0437\u0438\u043d\u043a\u0430 \u0441\u043a\u043b\u0430\u0434\u0438\u0448\u0442\u0438 \u0438 \u0430\u0443\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u043f\u0440\u0435\u0443\u0437\u0438\u043c\u0430\u0458\u0443 \u043a\u0430\u0434\u0430 \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u0458\u0435 \u043f\u043e\u043d\u043e\u0432\u043e \u043e\u0442\u0432\u043e\u0440\u0435\u043d.\n\n\u0411\u0435\u0437\u0431\u0435\u0434\u043d\u043e\u0441\u043d\u0438 \u0440\u0438\u0437\u0438\u043a - \u041a\u043e\u0440\u0438\u0441\u043d\u0438\u0447\u043a\u043e \u0438\u043c\u0435 \u0438 \u043b\u043e\u0437\u0438\u043d\u043a\u0430 \u0441\u0435 \u0447\u0443\u0432\u0430\u0458\u0443 \u0443 \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0443 \u0443 \u043f\u043b\u0430\u0438\u043d \u0442\u0435\u043a\u0442 \u0444\u043e\u0440\u043c\u0430\u0442\u0443. \u041a\u043e\u0440\u0438\u0441\u0442\u0438\u0442\u0438 \u0441\u0430\u043c\u043e \u043e\u0432\u0443 \u043e\u043f\u0446\u0438\u0458\u0443 \u0430\u043a\u043e \u0441\u0442\u0435 \u0437\u0430\u0434\u043e\u0432\u043e\u0459\u043d\u0438 \u043e\u0432\u0438\u043c.",
														"Genom att markera den h\u00e4r rutan \u00e4r det anv\u00e4ndarnamn och l\u00f6senord lagras och h\u00e4mtas automatiskt n\u00e4r GoogleFu \u00f6ppnas p\u00e5 nytt.\n\nS\u00e4kerhetsrisk - Det anv\u00e4ndarnamn och l\u00f6senord lagras i registret oformaterad text. Anv\u00e4nd bara det h\u00e4r alternativet om du \u00e4r bekv\u00e4m med det h\u00e4r.",
														"By kuangalia sanduku hili, Jina la mtumiaji na Password ni kuhifadhiwa na moja kwa moja retrieved wakati GoogleFu ni ilifunguliwa.\n\nHatari kwa usalama - Username Password na ni kuhifadhiwa katika usajili katika PLAIN TEXT format. Tu kutumia fursa hii kama wewe ni starehe na hii.",
														"\u0e42\u0e14\u0e22\u0e01\u0e32\u0e23\u0e15\u0e23\u0e27\u0e08\u0e2a\u0e2d\u0e1a\u0e01\u0e25\u0e48\u0e2d\u0e07\u0e19\u0e35\u0e49\u0e0a\u0e37\u0e48\u0e2d\u0e1c\u0e39\u0e49\u0e43\u0e0a\u0e49\u0e07\u0e32\u0e19\u0e41\u0e25\u0e30\u0e23\u0e2b\u0e31\u0e2a\u0e1c\u0e48\u0e32\u0e19\u0e08\u0e30\u0e16\u0e39\u0e01\u0e40\u0e01\u0e47\u0e1a\u0e44\u0e27\u0e49\u0e42\u0e14\u0e22\u0e2d\u0e31\u0e15\u0e42\u0e19\u0e21\u0e31\u0e15\u0e34\u0e41\u0e25\u0e30\u0e40\u0e23\u0e35\u0e22\u0e01\u0e40\u0e21\u0e37\u0e48\u0e2d GoogleFu \u0e08\u0e30\u0e40\u0e1b\u0e34\u0e14\n\n\u0e04\u0e27\u0e32\u0e21\u0e40\u0e2a\u0e35\u0e48\u0e22\u0e07\u0e08\u0e32\u0e01\u0e01\u0e32\u0e23\u0e23\u0e31\u0e01\u0e29\u0e32\u0e04\u0e27\u0e32\u0e21\u0e1b\u0e25\u0e2d\u0e14\u0e20\u0e31\u0e22 - \u0e0a\u0e37\u0e48\u0e2d\u0e1c\u0e39\u0e49\u0e43\u0e0a\u0e49\u0e41\u0e25\u0e30\u0e23\u0e2b\u0e31\u0e2a\u0e1c\u0e48\u0e32\u0e19\u0e17\u0e35\u0e48\u0e16\u0e39\u0e01\u0e40\u0e01\u0e47\u0e1a\u0e44\u0e27\u0e49\u0e43\u0e19\u0e23\u0e35\u0e08\u0e34\u0e2a\u0e17\u0e23\u0e35\u0e43\u0e19\u0e23\u0e39\u0e1b\u0e41\u0e1a\u0e1a\u0e02\u0e49\u0e2d\u0e04\u0e27\u0e32\u0e21\u0e18\u0e23\u0e23\u0e21\u0e14\u0e32 \u0e40\u0e1e\u0e35\u0e22\u0e07\u0e43\u0e0a\u0e49\u0e15\u0e31\u0e27\u0e40\u0e25\u0e37\u0e2d\u0e01\u0e19\u0e35\u0e49\u0e16\u0e49\u0e32\u0e04\u0e38\u0e13\u0e21\u0e35\u0e04\u0e27\u0e32\u0e21\u0e2a\u0e30\u0e14\u0e27\u0e01\u0e2a\u0e1a\u0e32\u0e22\u0e01\u0e31\u0e1a",
														"Sa pamamagitan ng pagsuri sa kahon na ito, ang Username at password ay naka-imbak at awtomatikong nakuha kapag GoogleFu ay muling bubuksan.\n\nSEGURIDAD PELIGRO - Ang Username at Password ay naka-imbak sa registry sa plain text format. Gamitin lamang ang opsyon na ito kung ikaw ay komportable na ito.",
														"Bu kutuyu i\u015faretleyerek, Kullan\u0131c\u0131 Ad\u0131 ve \u015eifre depolan\u0131r ve GoogleFu yeniden a\u00e7\u0131ld\u0131\u011f\u0131nda otomatik olarak al\u0131n\u0131r.\n\nG\u00dcVENL\u0130K R\u0130SK\u0130 - Kullan\u0131c\u0131 Ad\u0131 ve \u015eifre d\u00fcz metin bi\u00e7iminde kay\u0131t defterinde depolan\u0131r. Bu, rahat de\u011filseniz, yaln\u0131zca bu se\u00e7ene\u011fi kullan\u0131n.",
														"\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432\u0448\u0438 \u0446\u0435\u0439 \u043f\u0440\u0430\u043f\u043e\u0440\u0435\u0446\u044c, \u0406\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430 \u0456 \u043f\u0430\u0440\u043e\u043b\u044c \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0456 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0432\u0438\u0442\u044f\u0433\u0443\u044e\u0442\u044c\u0441\u044f, \u043a\u043e\u043b\u0438 GoogleFu \u0431\u0443\u0434\u0435 \u0437\u043d\u043e\u0432\u0443 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u0438\u0439.\n\n\u0417\u0430\u0433\u0440\u043e\u0437\u0430 \u0431\u0435\u0437\u043f\u0435\u043a\u0438 - \u0406\u043c'\u044f \u043a\u043e\u0440\u0438\u0441\u0442\u0443\u0432\u0430\u0447\u0430 \u0456 \u043f\u0430\u0440\u043e\u043b\u044c \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0432 \u0440\u0435\u0454\u0441\u0442\u0440\u0456 \u0432 \u0437\u0432\u0438\u0447\u0430\u0439\u043d\u0438\u0439 \u0442\u0435\u043a\u0441\u0442. \u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u0446\u044e \u043e\u043f\u0446\u0456\u044e \u0442\u0456\u043b\u044c\u043a\u0438 \u044f\u043a\u0449\u043e \u0432\u0438 \u0437\u043d\u0430\u0439\u043e\u043c\u0456 \u0437 \u0446\u0438\u043c.",
														"\u05d3\u05d5\u05e8\u05da \u05e7\u05d0\u05b8\u05e0\u05d8\u05e8\u05d0\u05b8\u05dc\u05d9\u05e8\u05d5\u05e0\u05d2 \u05d3\u05e2\u05dd \u05e7\u05e2\u05e1\u05d8\u05dc, \u05d3\u05d9 \u05e0\u05d0\u05de\u05e2\u05df \u05d0\u05d5\u05df \u05e4\u05bc\u05d0\u05b7\u05e8\u05d0\u05b8\u05dc \u05d6\u05e2\u05e0\u05e2\u05df \u05e1\u05d8\u05d0\u05b8\u05e8\u05d3 \u05d0\u05d5\u05df \u05d0\u05d5\u05d9\u05d8\u05d0\u05b8\u05de\u05d0\u05b7\u05d8\u05d9\u05e9 \u05e8\u05d9\u05d8\u05e8\u05d9\u05d5\u05d5\u05d3 \u05d5\u05d5\u05e2\u05df \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d0\u05d9\u05d6 \u05e8\u05d9\u05d0\u05b8\u05d5\u05e4\u05bc\u05d0\u05b7\u05e0\u05d3.\n\n\u05d6\u05d9\u05db\u05e2\u05e8\u05d4\u05d9\u05d9\u05d8 \u05e8\u05d9\u05d6\u05d9\u05e7\u05d9\u05e8\u05df - \u05d3\u05d9 \u05e0\u05d0\u05de\u05e2\u05df \u05d0\u05d5\u05df \u05e4\u05bc\u05d0\u05b7\u05e8\u05d0\u05b8\u05dc \u05d6\u05e2\u05e0\u05e2\u05df \u05e1\u05d8\u05d0\u05b8\u05e8\u05d3 \u05d0\u05d9\u05df \u05d3\u05d9 \u05e8\u05e2\u05d2\u05d9\u05e1\u05d8\u05e8\u05d9 \u05d0\u05d9\u05df \u05e7\u05dc\u05d0\u05b8\u05e8 \u05d8\u05e2\u05e7\u05e1\u05d8 \u05e4\u05bf\u05d0\u05b8\u05e8\u05de\u05d0\u05b7\u05d8. \u05e0\u05d0\u05b8\u05e8 \u05e0\u05d5\u05e6\u05df \u05d3\u05e2\u05dd \u05d0\u05b8\u05e4\u05bc\u05e6\u05d9\u05e2 \u05d0\u05d5\u05d9\u05d1 \u05d0\u05d9\u05e8 \u05d6\u05e2\u05e0\u05e2\u05df \u05d1\u05d0\u05b7\u05e7\u05d5\u05d5\u05e2\u05dd \u05de\u05d9\u05d8 \u05d3\u05e2\u05dd.",
														"\u9078\u4e2d\u6b64\u6846\uff0c\u7528\u6236\u540d\u548c\u5bc6\u78bc\u5b58\u5132\u800c\u7576GoogleFu\u91cd\u65b0\u6253\u958b\u81ea\u52d5\u6aa2\u7d22\u3002\n\n\u5b89\u5168\u98a8\u96aa - \u7528\u6236\u540d\u548c\u5bc6\u78bc\u5b58\u5132\u5728\u8a3b\u518a\u8868\u4e2d\u4ee5\u7d14\u6587\u672c\u683c\u5f0f\u3002\u53ea\u6709\u7576\u4f60\u7fd2\u6163\u4f7f\u7528\u9019\u7a2e\u4f7f\u7528\u6b64\u9078\u9805\u3002"));
			Rows.Add( new LocalizationRow("By checking this box, GoogleFu will automatically attempt to log in to the account when it opens.  Understand that the login process blocks all functionality until it is complete, so it may seem to freeze Unity while logging in, and make starting up slower.",
														"En cochant cette case, GoogleFu tentera automatiquement de se connecter au compte quand il s'ouvre. Comprendre que les blocs de processus de connexion tout de fonctionnalit\u00e9 jusqu'\u00e0 ce qu'il soit complet, il peut sembler \u00e0 geler l'unit\u00e9 lors de la connexion, et faire partir plus lentement.",
														"Selezionando questa casella, GoogleFu tenter\u00e0 automaticamente di accedere al conto quando si apre. Capire che i blocchi di processo di login tutto la funzionalit\u00e0 fino a quando non \u00e8 completa, quindi pu\u00f2 sembrare di congelare l'Unit\u00e0 durante l'accesso a, e rendere l'avvio pi\u00f9 lento.",
														"Wenn dieses Feld markiert, werden GoogleFu automatisch versuchen, melden Sie sich an, um das Konto, wenn sie sich \u00f6ffnet. Verstehen, dass die Login-Prozess blockiert alle Funktionen, bis er abgeschlossen ist, so mag es scheinen, zur Einheit einfrieren w\u00e4hrend der Anmeldung, und stellen Inbetriebnahme langsamer.",
														"Al marcar esta casilla, googleFU autom\u00e1ticamente intentar\u00e1 iniciar sesi\u00f3n en la cuenta cuando se abre. Entender que los bloques de proceso de inicio de sesi\u00f3n Todas las funciones hasta que se haya completado, por lo que puede parecer a congelar la Unidad mientras que iniciar sesi\u00f3n, y hacer la puesta en marcha m\u00e1s lenta.",
														"\u0639\u0646 \u0637\u0631\u064a\u0642 \u0641\u062d\u0635 \u0647\u0630\u0627 \u0627\u0644\u0625\u0637\u0627\u0631\u060c \u0633\u0648\u0641 GoogleFu \u0645\u062d\u0627\u0648\u0644\u0629 \u062a\u0644\u0642\u0627\u0626\u064a\u0627 \u0644\u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644 \u0625\u0644\u0649 \u0627\u0644\u062d\u0633\u0627\u0628 \u0639\u0646\u062f \u0641\u062a\u062d\u0647. \u0646\u0641\u0647\u0645 \u0623\u0646 \u0639\u0645\u0644\u064a\u0629 \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644 \u0643\u062a\u0644 \u062c\u0645\u064a\u0639 \u0648\u0638\u0627\u0626\u0641 \u062d\u062a\u0649 \u0623\u0646\u0647\u0627 \u0643\u0627\u0645\u0644\u0629\u060c \u0644\u0630\u0644\u0643 \u0642\u062f \u064a\u0628\u062f\u0648 \u0644\u062a\u062c\u0645\u064a\u062f \u0627\u0644\u0648\u062d\u062f\u0629 \u0623\u062b\u0646\u0627\u0621 \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644\u060c \u0648\u062c\u0639\u0644 \u0628\u062f\u0621 \u0623\u0628\u0637\u0623.",
														"\uc774 \uc0c1\uc790\ub97c \uc120\ud0dd\ud568\uc73c\ub85c\uc368, GoogleFu\uac00 \uc790\ub3d9\uc73c\ub85c \uc5f4\ub9ac\uba74 \uacc4\uc815\uc73c\ub85c \ub85c\uadf8\uc778\uc744 \uc2dc\ub3c4\ud569\ub2c8\ub2e4. \uc774\ud574 \ub85c\uadf8\uc778 \ud504\ub85c\uc138\uc2a4 \ube14\ub85d\uc740 \ub85c\uadf8\uc778 \ub3d9\uc548 \ud654\ud569\uc744 \ub3d9\uacb0\ud558\ub294 \uac83, \ub290\ub9b0 \uc2dc\uc791 \ub9cc\ub4e4 \uc218 \uc788\ub3c4\ub85d\uc774 \uc644\ub8cc \ub420 \ub54c\uae4c\uc9c0 \ubaa8\ub4e0 \uae30\ub2a5\uc744 \uc81c\uacf5\ud569\ub2c8\ub2e4.",
														"\u9009\u4e2d\u6b64\u6846\uff0cGoogleFu\u4f1a\u81ea\u52a8\u5c1d\u8bd5\u5728\u6253\u5f00\u65f6\u767b\u5f55\u5230\u8be5\u5e10\u6237\u3002\u8bb0\u8005\u4e86\u89e3\u5230\uff0c\u5728\u767b\u5f55\u8fc7\u7a0b\u4e2d\u963b\u6b62\u6240\u6709\u529f\u80fd\uff0c\u76f4\u5230\u5b83\u662f\u5b8c\u6574\u7684\uff0c\u6240\u4ee5\u5b83\u53ef\u80fd\u770b\u8d77\u6765\u51bb\u7ed3\u56e2\u7ed3\uff0c\u540c\u65f6\u767b\u5f55\uff0c\u5e76\u542f\u52a8\u8f83\u6162\u3002",
														"\u3053\u306e\u30dc\u30c3\u30af\u30b9\u3092\u30c1\u30a7\u30c3\u30af\u3059\u308b\u3068\u3001GoogleFu\u304c\u81ea\u52d5\u7684\u306b\u958b\u3044\u305f\u3068\u304d\u306e\u30a2\u30ab\u30a6\u30f3\u30c8\u306b\u30ed\u30b0\u30a4\u30f3\u3057\u3088\u3046\u3068\u3057\u307e\u3059\u3002\u305d\u308c\u306f\u30ed\u30b0\u30a4\u30f3\u6642Unity\u3092\u51cd\u7d50\u3059\u308b\u3088\u3046\u306b\u898b\u3048\u308b\u3001\u3068\u9045\u3044\u8d77\u52d5\u3059\u308b\u3053\u3068\u3042\u308a\u307e\u3059\u306e\u3067\u3001\u305d\u308c\u304c\u5b8c\u4e86\u3059\u308b\u307e\u3067\u3001\u30ed\u30b0\u30a4\u30f3\u30d7\u30ed\u30bb\u30b9\u3092\u30d6\u30ed\u30c3\u30af\u3059\u308b\u3059\u3079\u3066\u306e\u6a5f\u80fd\u3092\u7406\u89e3\u3059\u308b\u3002",
														"\u0423\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432 \u044d\u0442\u043e\u0442 \u0444\u043b\u0430\u0436\u043e\u043a, GoogleFu \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u043f\u043e\u043f\u044b\u0442\u0430\u0435\u0442\u0441\u044f \u0432\u043e\u0439\u0442\u0438 \u043d\u0430 \u0441\u0447\u0435\u0442, \u043a\u043e\u0433\u0434\u0430 \u043e\u043d \u043e\u0442\u043a\u0440\u043e\u0435\u0442\u0441\u044f. \u041f\u043e\u0439\u043c\u0438\u0442\u0435, \u0447\u0442\u043e \u0412\u043e\u0439\u0442\u0438 \u043f\u0440\u043e\u0446\u0435\u0441\u0441 \u0431\u043b\u043e\u043a\u0438\u0440\u0443\u0435\u0442\u0441\u044f \u0432\u0441\u044f \u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u044c, \u043f\u043e\u043a\u0430 \u043d\u0435 \u0431\u0443\u0434\u0435\u0442 \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u0430, \u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u043c\u043e\u0436\u0435\u0442 \u043a\u0430\u0437\u0430\u0442\u044c\u0441\u044f \u0437\u0430\u043c\u043e\u0440\u043e\u0437\u0438\u0442\u044c \u0415\u0434\u0438\u043d\u0441\u0442\u0432\u043e \u0430 \u0432\u0445\u043e\u0434\u0430 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0443, \u0438 \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0437\u0430\u043f\u0443\u0441\u043a \u043c\u0435\u0434\u043b\u0435\u043d\u043d\u0435\u0435.",
														"B\u1eb1ng c\u00e1ch ki\u1ec3m tra h\u1ed9p n\u00e0y, GoogleFu s\u1ebd t\u1ef1 \u0111\u1ed9ng c\u1ed1 g\u1eafng \u0111\u0103ng nh\u1eadp v\u00e0o t\u00e0i kho\u1ea3n khi n\u00f3 s\u1ebd m\u1edf ra. Hi\u1ec3u r\u1eb1ng c\u00e1c kh\u1ed1i qu\u00e1 tr\u00ecnh \u0111\u0103ng nh\u1eadp t\u1ea5t c\u1ea3 c\u00e1c ch\u1ee9c n\u0103ng cho \u0111\u1ebfn khi n\u00f3 \u0111\u01b0\u1ee3c ho\u00e0n th\u00e0nh, v\u00ec v\u1eady n\u00f3 c\u00f3 th\u1ec3 d\u01b0\u1eddng nh\u01b0 \u0111\u00f3ng b\u0103ng Unity khi \u0111\u0103ng nh\u1eadp, v\u00e0 l\u00e0m cho kh\u1edfi \u0111\u1ed9ng ch\u1eadm h\u01a1n.",
														"Door het aanvinken van dit vakje, zal GoogleFu automatisch proberen in te loggen op de rekening wanneer het wordt geopend. Begrijp dat het login proces blokkeert alle functionaliteit tot deze is voltooid, dus het kan lijken te Unity bevriezen tijdens het inloggen, en maak het opstarten langzamer.",
														"Deur die nagaan van die boks, GoogleFu sal outomaties probeer om aan te meld by die rekening wanneer dit oopmaak. Verstaan \u200b\u200bdat die aanmelding proses blokke al die funksies totdat dit voltooi is, so dit mag lyk Eenheid te vries terwyl aan te meld, en maak die begin tot stadiger.",
														"\u0427\u0440\u0435\u0437 \u043f\u0440\u043e\u0432\u0435\u0440\u043a\u0430 \u043d\u0430 \u0442\u043e\u0432\u0430 \u043f\u043e\u043b\u0435, GoogleFu \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0449\u0435 \u0441\u0435 \u043e\u043f\u0438\u0442\u0430 \u0434\u0430 \u0432\u043b\u0435\u0437\u0435\u0442\u0435 \u0432 \u0441\u043c\u0435\u0442\u043a\u0430\u0442\u0430, \u043a\u043e\u0433\u0430\u0442\u043e \u0442\u044f \u0441\u0435 \u043e\u0442\u0432\u0430\u0440\u044f. \u0420\u0430\u0437\u0431\u0435\u0440\u0435\u0442\u0435, \u0447\u0435 \u043f\u0440\u043e\u0446\u0435\u0441\u044a\u0442 \u0432\u0445\u043e\u0434 \u0431\u043b\u043e\u043a\u0438\u0440\u0430 \u0432\u0441\u0438\u0447\u043a\u0438 \u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0430\u043b\u043d\u043e\u0441\u0442, \u0434\u043e\u043a\u0430\u0442\u043e \u0442\u044f \u0435 \u043f\u044a\u043b\u043d\u0430, \u0442\u0430\u043a\u0430 \u0447\u0435 \u0442\u044f \u043c\u043e\u0436\u0435 \u0434\u0430 \u0438\u0437\u0433\u043b\u0435\u0436\u0434\u0430 \u0434\u0430 \u0437\u0430\u043c\u0440\u0430\u0437\u0438 Unity \u0434\u043e\u043a\u0430\u0442\u043e \u0432\u043b\u0435\u0437\u0435\u0442\u0435 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0430\u0442\u0430 \u0438 \u0434\u0430 \u0441\u0435 \u0437\u0430\u043f\u043e\u0447\u043d\u0435 \u043f\u043e-\u0431\u0430\u0432\u043d\u043e.",
														"\u0423\u0441\u0442\u0430\u043b\u044f\u0432\u0430\u045e\u0448\u044b \u0433\u044d\u0442\u044b \u0441\u0446\u044f\u0436\u043e\u043a, GoogleFu \u0430\u045e\u0442\u0430\u043c\u0430\u0442\u044b\u0447\u043d\u0430 \u043f\u0430\u0441\u043f\u0440\u0430\u0431\u0443\u0435 \u045e\u0432\u0430\u0439\u0441\u0446\u0456 \u043d\u0430 \u0440\u0430\u0445\u0443\u043d\u0430\u043a, \u043a\u0430\u043b\u0456 \u0451\u043d \u0430\u0434\u043a\u0440\u044b\u0435\u0446\u0446\u0430. \u0417\u0440\u0430\u0437\u0443\u043c\u0435\u0439\u0446\u0435, \u0448\u0442\u043e \u0423\u0432\u0430\u0439\u0441\u0446\u0456 \u043f\u0440\u0430\u0446\u044d\u0441 \u0431\u043b\u0430\u043a\u0443\u0435\u0446\u0446\u0430 \u045e\u0441\u044f \u0444\u0443\u043d\u043a\u0446\u044b\u044f\u043d\u0430\u043b\u044c\u043d\u0430\u0441\u0446\u044c, \u043f\u0430\u043a\u0443\u043b\u044c \u043d\u0435 \u0431\u0443\u0434\u0437\u0435 \u0437\u0430\u0432\u0435\u0440\u0448\u0430\u043d\u0430, \u0442\u0430\u043c\u0443 \u043c\u043e\u0436\u0430 \u0437\u0434\u0430\u0432\u0430\u0446\u0446\u0430 \u0437\u0430\u043c\u0430\u0440\u043e\u0437\u0456\u0446\u044c \u0410\u0434\u0437\u0456\u043d\u0441\u0442\u0432\u0430 \u0430 \u0443\u0432\u0430\u0445\u043e\u0434\u0443 \u045e \u0441\u0456\u0441\u0442\u044d\u043c\u0443, \u0456 \u0437\u0440\u0430\u0431\u0456\u0446\u044c \u0437\u0430\u043f\u0443\u0441\u043a \u043f\u0430\u0432\u043e\u043b\u044c\u043d\u0435\u0439.",
														"En marcar aquesta casella, googleFU autom\u00e0ticament intentar\u00e0 iniciar sessi\u00f3 al compte quan s'obre. Entendre que els blocs de proc\u00e9s d'inici de sessi\u00f3 Totes les funcions fins que s'hagi completat, pel que pot semblar a congelar la Unitat mentre iniciar sessi\u00f3, i fer la posada en marxa m\u00e9s lenta.",
														"Za\u0161krtnut\u00edm tohoto pol\u00ed\u010dka se GoogleFu automaticky pokus\u00ed p\u0159ihl\u00e1sit k \u00fa\u010dtu, kdy\u017e se otev\u0159e. Pochopte, \u017ee proces p\u0159ihl\u00e1\u0161en\u00ed blokuje v\u0161echny funkce, dokud nen\u00ed kompletn\u00ed, tak\u017ee se m\u016f\u017ee zd\u00e1t, \u017ee zmrazit jednotu p\u0159i p\u0159ihl\u00e1\u0161en\u00ed, a aby spou\u0161t\u011bn\u00ed pomalej\u0161\u00ed.",
														"Drwy edrych ar y blwch, bydd GoogleFu ceisio yn awtomatig i fewngofnodi i'r cyfrif pan fydd yn agor. Deall bod y broses mewngofnodi blociau holl functionality nes ei fod yn gyflawn, felly gall ymddangos i rewi Undod wrth fewngofnodi, a gwneud cychwyn arafach.",
														"Selle kasti, GoogleFu automaatselt \u00fcritavad sisse v\u00f5tta, kui see avaneb. Aru, et login protsessi blokeerib igasuguse funktsionaalsuse, kuni see on l\u00f5pule viidud, nii et see v\u00f5ib tunduda k\u00fclmutada Unity sisselogimisel ning teha k\u00e4ivitamise aeglasem.",
														"\u0628\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0631\u062f\u0646 \u0627\u06cc\u0646 \u06af\u0632\u06cc\u0646\u0647\u060c GoogleFu \u0628\u0647 \u0637\u0648\u0631 \u062e\u0648\u062f\u06a9\u0627\u0631 \u0628\u0647 \u0648\u0631\u0648\u062f \u0628\u0647 \u062d\u0633\u0627\u0628 \u06a9\u0627\u0631\u0628\u0631\u06cc \u0647\u0646\u06af\u0627\u0645\u06cc \u06a9\u0647 \u0622\u0646 \u0631\u0627 \u0628\u0627\u0632 \u0645\u06cc \u06a9\u0646\u062f \u062a\u0644\u0627\u0634. \u0628\u062f\u0627\u0646\u06cc\u062f \u06a9\u0647 \u0628\u0644\u0648\u06a9 \u0641\u0631\u0622\u06cc\u0646\u062f \u0648\u0631\u0648\u062f \u062a\u0645\u0627\u0645 \u0642\u0627\u0628\u0644\u06cc\u062a \u0647\u0627 \u062a\u0627 \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u06a9\u0627\u0645\u0644 \u0627\u0633\u062a\u060c \u067e\u0633 \u0627\u0632 \u0622\u0646 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0628\u0647 \u0646\u0638\u0631 \u0645\u06cc \u0631\u0633\u062f \u062a\u0648\u0642\u0641 \u0648\u062d\u062f\u062a \u062f\u0631 \u062d\u0627\u0644\u06cc \u06a9\u0647 \u0648\u0631\u0648\u062f \u0628\u0647 \u0633\u06cc\u0633\u062a\u0645\u060c \u0648 \u0631\u0627\u0647 \u0627\u0646\u062f\u0627\u0632\u06cc \u06a9\u0646\u062f\u062a\u0631 \u0627\u0633\u062a.",
														"Valitsemalla t\u00e4m\u00e4n valintaruudun, GoogleFu yritt\u00e4\u00e4 automaattisesti kirjautua tilille, kun se avautuu. Ymm\u00e4rr\u00e4, ett\u00e4 kirjautuminen prosessi est\u00e4\u00e4 kaikki toiminnot, kunnes se on valmis, niin se voi tuntua j\u00e4\u00e4ty\u00e4 Unity kun kirjaudut sis\u00e4\u00e4n, ja tee k\u00e4ynnistyksen hitaammin.",
														"De r\u00e9ir a sheice\u00e1il sa bhosca seo, beidh GoogleFu iarracht huathoibr\u00edoch log\u00e1il isteach leis an gcuntas nuair a oscla\u00edonn s\u00e9. A thuiscint go bhfuil na bloic pr\u00f3iseas log\u00e1la gach feidhmi\u00falacht dt\u00ed go bhfuil s\u00e9 cr\u00edochnaithe, mar sin d'fh\u00e9adfadh s\u00e9 a bhfuil cuma a Gn\u00edomhacha Unity fad log\u00e1il isteach, agus a dh\u00e9anamh ag tos\u00fa suas n\u00edos moille.",
														"Marcando esta caixa, GoogleFu tentar\u00e1 automaticamente iniciar sesi\u00f3n na conta cando se abre. Entender que os bloques proceso de login toda funci\u00f3n ata que estea completa, polo que pode parecer conxelar Unity mentres a sesi\u00f3n, e facer o arranque m\u00e1is lento.",
														"\u0907\u0938 \u092c\u0949\u0915\u094d\u0938 \u0915\u094b \u091a\u0947\u0915 \u0915\u0930\u0915\u0947, GoogleFu \u0938\u094d\u0935\u0924\u0903 \u092f\u0939 \u0916\u0941\u0932\u0924\u093e \u0939\u0948 \u091c\u092c \u0916\u093e\u0924\u0947 \u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930\u0928\u0947 \u0915\u093e \u092a\u094d\u0930\u092f\u093e\u0938 \u0915\u0930\u0947\u0902\u0917\u0947. \u0938\u092e\u091d\u0947\u0902 \u0915\u093f \u092a\u094d\u0930\u0935\u0947\u0936 \u092a\u094d\u0930\u0915\u094d\u0930\u093f\u092f\u093e \u092c\u094d\u0932\u0949\u0915\u094b\u0902 \u0907\u0938\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930\u0928\u0947, \u091c\u092c\u0915\u093f \u090f\u0915\u0924\u093e \u092b\u094d\u0930\u0940\u091c \u0915\u0930\u0928\u0947 \u0932\u0917\u0924\u0947 \u0939\u0948\u0902, \u0914\u0930 \u0927\u0940\u092e\u0940 \u0936\u0941\u0930\u0942 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u0924\u094b \u092f\u0939 \u092a\u0942\u0930\u093e \u0939\u094b \u0917\u092f\u093e \u0939\u0948 \u091c\u092c \u0924\u0915 \u0938\u092d\u0940 \u0915\u093e\u0930\u094d\u092f\u0915\u094d\u0937\u092e\u0924\u093e.",
														"Odabirom ove opcije, GoogleFu \u0107e automatski poku\u0161ati prijaviti na ra\u010dun kada se otvara. Shvatite da su prijavu proces blokira sve funkcionalnosti dok se ne zavr\u0161i, pa se mo\u017ee \u010diniti da zamrzne Jedinstvo, dok prijave, i u\u010diniti pokretanje sporije.",
														"L\u00e8 w tcheke bwat sa a, GoogleFu pral otomatikman eseye ouvri sesyon an nan kont lan l\u00e8 li ouv\u00e8. Konprann ke pwosesis login bl\u00f2k yo tout fonksyonalite jiskaske li se konpl\u00e8, se konsa li pouvwa sanble yo friz Inite pandan y ap antre nan, epi f\u00e8 k\u00f2manse moute pi dousman.",
														"Dengan mencentang kotak ini, GoogleFu otomatis akan mencoba untuk login ke account ketika terbuka. Memahami bahwa blok proses login semua fungsi sampai selesai, sehingga mungkin tampak membekukan Persatuan saat log in, dan membuat memulai lambat.",
														"Me\u00f0 \u00fev\u00ed a\u00f0 merkja \u00ed \u00feennan reit GoogleFu sj\u00e1lfkrafa reyna a\u00f0 skr\u00e1 \u00feig inn \u00e1 reikninginn \u00feegar \u00fea\u00f0 opnar. Skilja a\u00f0 tenging ferli blokkir allt virkni fyrr en \u00fea\u00f0 er heill, svo \u00fea\u00f0 kann a\u00f0 vir\u00f0ast a\u00f0 frysta Unity me\u00f0an a\u00f0 skr\u00e1 \u00feig inn, og gera a\u00f0 byrja upp h\u00e6gar.",
														"\u05e2\u05dc \u05d9\u05d3\u05d9 \u05e1\u05d9\u05de\u05d5\u05df \u05ea\u05d9\u05d1\u05d4 \u05d6\u05d5, GoogleFu \u05d1\u05d0\u05d5\u05e4\u05df \u05d0\u05d5\u05d8\u05d5\u05de\u05d8\u05d9 \u05de\u05e0\u05e1\u05d4 \u05dc\u05d4\u05ea\u05d7\u05d1\u05e8 \u05dc\u05d7\u05e9\u05d1\u05d5\u05df \u05d1\u05e2\u05ea \u200b\u200b\u05e9\u05d4\u05d5\u05d0 \u05e4\u05d5\u05ea\u05d7. \u05dc\u05d4\u05d1\u05d9\u05df \u05e9\u05dc\u05d5\u05e7\u05d9 \u05ea\u05d4\u05dc\u05d9\u05da \u05d4\u05d4\u05ea\u05d7\u05d1\u05e8\u05d5\u05ea \u05db\u05dc \u05d4\u05e4\u05d5\u05e0\u05e7\u05e6\u05d9\u05d5\u05e0\u05dc\u05d9\u05d5\u05ea \u05e2\u05d3 \u05e9\u05d4\u05d5\u05d0 \u05de\u05dc\u05d0, \u05db\u05da \u05e9\u05d6\u05d4 \u05d0\u05d5\u05dc\u05d9 \u05e0\u05e8\u05d0\u05d4 \u05dc\u05d4\u05e7\u05e4\u05d9\u05d0 \u05d0\u05d7\u05d3\u05d5\u05ea \u05ea\u05d5\u05da \u05db\u05e0\u05d9\u05e1\u05d4, \u05d5\u05dc\u05d4\u05e4\u05d5\u05da \u05d0\u05ea \u05de\u05ea\u05d7\u05d9\u05dc \u05d0\u05d9\u05d8\u05d9 \u05d9\u05d5\u05ea\u05e8.",
														"Pa\u017eym\u0117damas \u0161\u012f langel\u012f, GoogleFu automati\u0161kai bando prisijungti prie paskyros, kai ji atveria. Suprasti, kad proceso prisijungimo blokai Visos funkcijos, kol jis bus baigtas, tod\u0117l gali atrodyti, kad u\u017e\u0161aldyti vienov\u0119 prisijungti ir padaryti paleisti l\u0117\u010diau.",
														"Atz\u012bm\u0113jot \u0161o lodzi\u0146u, GoogleFu autom\u0101tiski m\u0113\u0123in\u0101s, lai pieteiktos kont\u0101, kad t\u0101 tiek atv\u0113rta. Saprast, ka pieteik\u0161an\u0101s process blo\u0137\u0113 visu funkcionalit\u0101ti, l\u012bdz t\u0101 ir pabeigta, t\u0101p\u0113c tas var likties iesald\u0113t Vienot\u012bbu, bet piesakoties, un padar\u012bt s\u0101kt l\u0113n\u0101k.",
														"\u0421\u043e \u043f\u0440\u043e\u0432\u0435\u0440\u043a\u0430 \u043d\u0430 \u043e\u0432\u0430 \u043f\u043e\u043b\u0435, GoogleFu \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u045c\u0435 \u0441\u0435 \u043e\u0431\u0438\u0434\u0435 \u0434\u0430 \u0441\u0435 \u043b\u043e\u0433\u0438\u0440\u0430\u0442\u0435 \u0437\u0430 \u0434\u0430 \u043d\u0430 \u0441\u043c\u0435\u0442\u043a\u0430 \u043a\u043e\u0433\u0430 \u0441\u0435 \u043e\u0442\u0432\u043e\u0440\u0430. \u0421\u0435 \u0440\u0430\u0437\u0431\u0435\u0440\u0435 \u0434\u0435\u043a\u0430 \u0412\u043b\u0435\u0437\u043e\u0442 \u043f\u0440\u043e\u0446\u0435\u0441 \u0431\u043b\u043e\u043a\u043e\u0432\u0438 \u0441\u0438\u0442\u0435 \u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0430\u043b\u043d\u043e\u0441\u0442 \u0434\u043e\u0434\u0435\u043a\u0430 \u043d\u0435 \u0435 \u0437\u0430\u0432\u0440\u0448\u0435\u043d\u0430, \u043f\u0430 \u0442\u043e\u0430 \u043c\u043e\u0436\u0435 \u0434\u0430 \u0438\u0437\u0433\u043b\u0435\u0434\u0430 \u0434\u0430 \u0441\u0435 \u0437\u0430\u043c\u0440\u0437\u043d\u0435 \u0415\u0434\u0438\u043d\u0441\u0442\u0432\u043e \u0434\u043e\u0434\u0435\u043a\u0430 \u0432\u043b\u0435\u0437\u0435\u0442\u0435 \u0432\u043e, \u0438 \u0431\u0438\u0434\u0435\u0442\u0435 \u0441\u0442\u0430\u0440\u0442\u0443\u0432\u0430\u045a\u0435 \u043f\u043e\u0431\u0430\u0432\u043d\u043e.",
														"Dengan menandakan kotak ini, GoogleFu secara automatik akan cuba untuk log masuk ke dalam akaun apabila ia dibuka. Memahami bahawa blok proses login semua fungsi sehingga ia selesai, jadi ia mungkin kelihatan untuk membekukan Perpaduan manakala log masuk, dan membuat memulakan lebih perlahan.",
														"Permezz ta 'verifika din il-kaxxa, GoogleFu awtomatikament se tipprova log fil-kont meta tifta\u0127. Jifhmu li l-blokki pro\u010bess login kollha funzjonalit\u00e0 sakemm huwa komplet, u g\u0127alhekk jista 'jidher li jiffri\u017caw Unit\u00e0 waqt qtug\u0127 fil, u jag\u0127mlu bidu kajman.",
														"Ved \u00e5 krysse av i denne boksen, vil GoogleFu automatisk fors\u00f8ke \u00e5 logge inn p\u00e5 kontoen n\u00e5r den \u00e5pnes. Forst\u00e5 at p\u00e5loggingsprosessen blokkerer all funksjonalitet til den er ferdig, s\u00e5 det kan synes \u00e5 fryse Unity mens du logger inn, og gj\u00f8re oppstart tregere.",
														"Zaznaczaj\u0105c to pole, GoogleFu automatycznie spr\u00f3buje zalogowa\u0107 si\u0119 do konta, kiedy otwiera. Rozumiemy, \u017ce proces logowania blokuje wszystkie funkcje, dop\u00f3ki nie jest pe\u0142na, wi\u0119c mo\u017ce si\u0119 wydawa\u0107, aby zamrozi\u0107 Jedno\u015b\u0107 podczas logowania, a dokona\u0107 rozruchu wolniej.",
														"Ao marcar esta caixa, GoogleFu tentar\u00e1 automaticamente efetuar login na conta quando se abre. Entenda que os blocos processo de login toda funcionalidade at\u00e9 que esteja completo, por isso pode parecer congelar Unity enquanto o login, e fazer o arranque mais lento.",
														"Bif\u00e2nd aceast\u0103 caset\u0103, GoogleFu va \u00eencerca automat s\u0103 v\u0103 conecta\u021bi la contul de c\u00e2nd se deschide. \u00cen\u021belege\u021bi c\u0103 blocurile procesul de conectare toate functionalitatile pana cand este complet, deci s-ar p\u0103rea s\u0103 \u00eenghe\u021be unitate \u00een timp ce v\u0103 autentifica\u021bi, \u0219i face pornirea mai lent.",
														"Za\u0161krtnut\u00edm tohto pol\u00ed\u010dka sa GoogleFu automaticky pok\u00fasi prihl\u00e1si\u0165 k \u00fa\u010dtu, ke\u010f sa otvor\u00ed. Pochopte, \u017ee proces prihl\u00e1senie blokuje v\u0161etky funkcie, k\u00fdm nie je kompletn\u00e1, tak\u017ee sa m\u00f4\u017ee zda\u0165, \u017ee zmrazi\u0165 jednotu pri prihl\u00e1sen\u00ed, a aby sp\u00fa\u0161\u0165anie pomal\u0161\u00ed.",
														"S potrditvijo tega polja, bo GoogleFu samodejno poskusi, da se prijavite v ra\u010dun, ko se odpre. Razumemo, da je proces prijave blokira vse funkcionalnosti, dokler ni kon\u010dana, zato se zdi, da zamrzne enotnosti, medtem ko se prijavite, in da se za\u010dnejo po\u010dasneje.",
														"Duke kontrolluar k\u00ebt\u00eb kuti, GoogleFu automatikisht do t\u00eb p\u00ebrpiqet t\u00eb hyni n\u00eb llogarin\u00eb kur ajo hapet. Kuptoni se blloqet e procesit login t\u00eb gjitha funksionet deri sa ajo \u00ebsht\u00eb e plot\u00eb, k\u00ebshtu q\u00eb kjo mund t\u00eb duket p\u00ebr t\u00eb ngrir\u00eb Unitetit nd\u00ebrsa logging in, dhe t\u00eb b\u00ebj\u00eb duke u nisur ngadalshme.",
														"\u0422\u0430\u043a\u043e \u0448\u0442\u043e \u045b\u0435\u0442\u0435 \u0443 \u043e\u0432\u043e\u043c \u043f\u043e\u0459\u0443, \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u045b\u0435 \u0430\u0443\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u043f\u043e\u043a\u0443\u0448\u0430\u0442\u0438 \u0434\u0430 \u0441\u0435 \u043f\u0440\u0438\u0458\u0430\u0432\u0438\u0442\u0435 \u043d\u0430 \u0440\u0430\u0447\u0443\u043d \u043a\u0430\u0434\u0430 \u0441\u0435 \u043e\u0442\u0432\u043e\u0440\u0438. \u0420\u0430\u0437\u0443\u043c\u0435\u043c \u0434\u0430 \u0441\u0443 \u043f\u0440\u0438\u0458\u0430\u0432\u0459\u0438\u0432\u0430\u045a\u0435 \u043f\u0440\u043e\u0446\u0435\u0441 \u0431\u043b\u043e\u043a\u0438\u0440\u0430 \u0441\u0432\u0435 \u0444\u0443\u043d\u043a\u0446\u0438\u043e\u043d\u0430\u043b\u043d\u043e\u0441\u0442\u0438 \u0434\u043e\u043a \u0441\u0435 \u043d\u0435 \u0437\u0430\u0432\u0440\u0448\u0438, \u0442\u0430\u043a\u043e \u0434\u0430 \u043c\u043e\u0436\u0435 \u0438\u0437\u0433\u043b\u0435\u0434\u0430\u0442\u0438 \u0434\u0430 \u0437\u0430\u043c\u0440\u0437\u043d\u0435 \u0458\u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0430, \u0434\u043e\u043a \u043b\u043e\u0433\u043e\u0432\u0430\u045a\u0430, \u0438 \u0434\u0430 \u043f\u0443\u0448\u0442\u0430\u045a\u0435 \u0443 \u0440\u0430\u0434 \u0441\u043f\u043e\u0440\u0438\u0458\u0435.",
														"Genom att markera den h\u00e4r rutan kommer GoogleFu automatiskt att f\u00f6rs\u00f6ka logga in p\u00e5 kontot n\u00e4r det \u00f6ppnas. F\u00f6rst\u00e5 att inloggningsprocessen blockerar all funktionalitet tills den \u00e4r klar, s\u00e5 det kan tyckas att frysa Unity n\u00e4r du loggar in, och g\u00f6r startar l\u00e5ngsammare.",
														"By kuangalia sanduku hili, GoogleFu moja kwa moja jaribio la kuingia kwenye akaunti wakati kuufungua. Kuelewa kwamba mchakato login vitalu utendaji wote mpaka ni kamili, hivyo inaweza kuonekana kufungia Unity wakati magogo katika, na kufanya kuanzia juu polepole.",
														"\u0e42\u0e14\u0e22\u0e01\u0e32\u0e23\u0e15\u0e23\u0e27\u0e08\u0e2a\u0e2d\u0e1a\u0e01\u0e25\u0e48\u0e2d\u0e07\u0e19\u0e35\u0e49 GoogleFu \u0e08\u0e30\u0e1e\u0e22\u0e32\u0e22\u0e32\u0e21\u0e42\u0e14\u0e22\u0e2d\u0e31\u0e15\u0e42\u0e19\u0e21\u0e31\u0e15\u0e34\u0e40\u0e1e\u0e37\u0e48\u0e2d\u0e43\u0e2b\u0e49\u0e40\u0e02\u0e49\u0e32\u0e2a\u0e39\u0e48\u0e1a\u0e31\u0e0d\u0e0a\u0e35\u0e40\u0e21\u0e37\u0e48\u0e2d\u0e40\u0e1b\u0e34\u0e14 \u0e40\u0e02\u0e49\u0e32\u0e43\u0e08\u0e27\u0e48\u0e32\u0e1a\u0e25\u0e47\u0e2d\u0e01\u0e01\u0e32\u0e23\u0e40\u0e02\u0e49\u0e32\u0e2a\u0e39\u0e48\u0e23\u0e30\u0e1a\u0e1a\u0e01\u0e32\u0e23\u0e17\u0e33\u0e07\u0e32\u0e19\u0e17\u0e31\u0e49\u0e07\u0e2b\u0e21\u0e14\u0e08\u0e19\u0e01\u0e27\u0e48\u0e32\u0e08\u0e30\u0e40\u0e2a\u0e23\u0e47\u0e08\u0e2a\u0e21\u0e1a\u0e39\u0e23\u0e13\u0e4c\u0e14\u0e31\u0e07\u0e19\u0e31\u0e49\u0e19\u0e08\u0e36\u0e07\u0e2d\u0e32\u0e08\u0e14\u0e39\u0e40\u0e2b\u0e21\u0e37\u0e2d\u0e19\u0e08\u0e30\u0e2b\u0e22\u0e38\u0e14\u0e04\u0e27\u0e32\u0e21\u0e2a\u0e32\u0e21\u0e31\u0e04\u0e04\u0e35\u0e43\u0e19\u0e02\u0e13\u0e30\u0e17\u0e35\u0e48\u0e01\u0e32\u0e23\u0e40\u0e02\u0e49\u0e32\u0e2a\u0e39\u0e48\u0e23\u0e30\u0e1a\u0e1a\u0e41\u0e25\u0e30\u0e43\u0e2b\u0e49\u0e40\u0e23\u0e34\u0e48\u0e21\u0e15\u0e49\u0e19\u0e02\u0e36\u0e49\u0e19\u0e0a\u0e49\u0e32\u0e25\u0e07",
														"Sa pamamagitan ng pagsuri sa kahon na ito, awtomatikong susubukan ng GoogleFu upang mag-log in sa account kapag ito ay bubukas. Unawain na ang proseso ng pag-login bloke ang lahat ng pagpapagana hanggang sa ito ay kumpleto, kaya maaaring mukhang ito upang mag-freeze ng Unity habang nagla-log in, at gumawa ng simula up mas mabagal.",
														"Bu kutuyu i\u015faretleyerek, GoogleFu otomatik olarak a\u00e7\u0131ld\u0131\u011f\u0131nda hesab\u0131n\u0131za giri\u015f \u00e7al\u0131\u015facakt\u0131r. Anlamak oturum a\u00e7ma i\u015flemi bloklar\u0131 bu oturum a\u00e7arken Birlik dondurmak gibi g\u00f6r\u00fcn\u00fcyor, ve yava\u015f devreye yapabilir bu y\u00fczden, tamamlan\u0131ncaya kadar t\u00fcm i\u015flevselli\u011fi.",
														"\u0412\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432\u0448\u0438 \u0446\u0435\u0439 \u043f\u0440\u0430\u043f\u043e\u0440\u0435\u0446\u044c, GoogleFu \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0441\u043f\u0440\u043e\u0431\u0443\u0454 \u0443\u0432\u0456\u0439\u0442\u0438 \u043d\u0430 \u0440\u0430\u0445\u0443\u043d\u043e\u043a, \u043a\u043e\u043b\u0438 \u0432\u0456\u043d \u0432\u0456\u0434\u043a\u0440\u0438\u0454\u0442\u044c\u0441\u044f. \u0417\u0440\u043e\u0437\u0443\u043c\u0456\u0439\u0442\u0435, \u0449\u043e \u0423\u0432\u0456\u0439\u0442\u0438 \u043f\u0440\u043e\u0446\u0435\u0441 \u0431\u043b\u043e\u043a\u0443\u0454\u0442\u044c\u0441\u044f \u0432\u0441\u044f \u0444\u0443\u043d\u043a\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0456\u0441\u0442\u044c, \u043f\u043e\u043a\u0438 \u043d\u0435 \u0431\u0443\u0434\u0435 \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u0430, \u0442\u043e\u043c\u0443 \u043c\u043e\u0436\u0435 \u0437\u0434\u0430\u0432\u0430\u0442\u0438\u0441\u044f \u0437\u0430\u043c\u043e\u0440\u043e\u0437\u0438\u0442\u0438 \u0404\u0434\u043d\u0456\u0441\u0442\u044c \u0430 \u0432\u0445\u043e\u0434\u0443 \u0432 \u0441\u0438\u0441\u0442\u0435\u043c\u0443, \u0456 \u0437\u0440\u043e\u0431\u0438\u0442\u0438 \u0437\u0430\u043f\u0443\u0441\u043a \u043f\u043e\u0432\u0456\u043b\u044c\u043d\u0456\u0448\u0435.",
														"\u05d3\u05d5\u05e8\u05da \u05e7\u05d0\u05b8\u05e0\u05d8\u05e8\u05d0\u05b8\u05dc\u05d9\u05e8\u05d5\u05e0\u05d2 \u05d3\u05e2\u05dd \u05e7\u05e2\u05e1\u05d8\u05dc, \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d5\u05d5\u05e2\u05d8 \u05d0\u05d5\u05d9\u05d8\u05d0\u05b8\u05de\u05d0\u05b7\u05d8\u05d9\u05e9 \u05e4\u05bc\u05e8\u05d5\u05d5\u05d5\u05df \u05e6\u05d5 \u05e7\u05dc\u05d0\u05b8\u05e5 \u05d0\u05d9\u05df \u05e6\u05d5 \u05d3\u05e2\u05dd \u05d7\u05e9\u05d1\u05d5\u05df \u05d5\u05d5\u05e2\u05df \u05e2\u05e1 \u05d0\u05b8\u05e4\u05bc\u05e2\u05e0\u05e1. \u05e4\u05bf\u05d0\u05b7\u05e8\u05e9\u05d8\u05d9\u05d9\u05df \u05d0\u05b7\u05d6 \u05d3\u05d9 \u05dc\u05d0\u05b8\u05d2\u05d9\u05df \u05e4\u05bc\u05e8\u05d0\u05b8\u05e6\u05e2\u05e1 \u05d1\u05dc\u05d0\u05b7\u05e7\u05e1 \u05d0\u05b7\u05dc\u05e2 \u05e4\u05d0\u05b7\u05e0\u05d2\u05e7\u05e9\u05d0\u05b7\u05e0\u05d0\u05b7\u05dc\u05d9\u05d8\u05d9 \u05d1\u05d9\u05d6 \u05e2\u05e1 \u05d0\u05d9\u05d6 \u05d2\u05d0\u05b7\u05e0\u05e5, \u05d0\u05b7\u05d6\u05d5\u05d9 \u05e2\u05e1 \u05d6\u05d0\u05dc \u05d5\u05d9\u05e1\u05e7\u05d5\u05de\u05e2\u05df \u05e6\u05d5 \u05e4\u05e8\u05d9\u05e8\u05df \u05d5\u05e0\u05d9\u05d8\u05d9 \u05d1\u05e9\u05e2\u05ea \u05dc\u05d0\u05b8\u05d2\u05d9\u05e0\u05d2 \u05d0\u05d9\u05df, \u05d0\u05d5\u05df \u05de\u05d0\u05b7\u05db\u05df \u05e1\u05d8\u05d0\u05b7\u05e8\u05d8\u05d9\u05e0\u05d2 \u05d0\u05b7\u05e8\u05d5\u05d9\u05e3 \u05e1\u05dc\u05d0\u05b8\u05d5\u05e2\u05e8.",
														"\u9078\u4e2d\u6b64\u6846\uff0cGoogleFu\u6703\u81ea\u52d5\u5617\u8a66\u5728\u6253\u958b\u6642\u767b\u9304\u5230\u8a72\u5e33\u6236\u3002\u8a18\u8005\u4e86\u89e3\u5230\uff0c\u5728\u767b\u9304\u904e\u7a0b\u4e2d\u963b\u6b62\u6240\u6709\u529f\u80fd\uff0c\u76f4\u5230\u5b83\u662f\u5b8c\u6574\u7684\uff0c\u6240\u4ee5\u5b83\u53ef\u80fd\u770b\u8d77\u4f86\u51cd\u7d50\u5718\u7d50\uff0c\u540c\u6642\u767b\u9304\uff0c\u4e26\u555f\u52d5\u8f03\u6162\u3002"));
			Rows.Add( new LocalizationRow("The GoogleFu GUI has been localized using Google Translation.  Understand this is not a perfect localization, but if English is not your native language, you may be better off with the translation.",
														"Le GoogleFu interface graphique a \u00e9t\u00e9 localis\u00e9e \u00e0 l'aide de Google Traduction. Comprendre ce n'est pas une localisation parfaite, mais si l'anglais n'est pas votre langue maternelle, vous peut-\u00eatre mieux avec la traduction.",
														"Il GoogleFu GUI \u00e8 stato localizzato con Google Traduttore. Capire questa non \u00e8 una localizzazione perfetta, ma se l'inglese non \u00e8 la tua lingua madre, si potrebbe essere meglio con la traduzione.",
														"Die GoogleFu GUI wurde mit Google \u00fcbersetzen lokalisiert. Verstehen, das ist nicht eine perfekte Lokalisierung, aber wenn Englisch nicht Ihre Muttersprache, k\u00f6nnen Sie besser dran mit der \u00dcbersetzung sein.",
														"La GUI googleFU se ha localizado a trav\u00e9s de Google Traductor. Entender esto no es una localizaci\u00f3n perfecta, pero si el Ingl\u00e9s no es su lengua materna, es posible que sea mejor con la traducci\u00f3n.",
														"\u0648\u062a\u0645 \u062d\u0635\u0631 GoogleFu \u0648\u0627\u062c\u0647\u0629 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0627\u0644\u0631\u0633\u0648\u0645\u064a\u0629 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u062a\u0631\u062c\u0645\u0629 \u062c\u0648\u062c\u0644. \u0641\u0647\u0645 \u0647\u0630\u0627 \u0644\u064a\u0633 \u062a\u0648\u0637\u064a\u0646 \u0627\u0644\u0643\u0645\u0627\u0644\u060c \u0648\u0644\u0643\u0646 \u0625\u0630\u0627 \u0644\u0645 \u062a\u0643\u0646 \u0627\u0644\u0625\u0646\u062c\u0644\u064a\u0632\u064a\u0629 \u0644\u063a\u062a\u0643 \u0627\u0644\u0623\u0645\u060c \u0642\u062f \u062a\u0643\u0648\u0646 \u0623\u0641\u0636\u0644 \u062d\u0627\u0644\u0627 \u0645\u0639 \u0627\u0644\u062a\u0631\u062c\u0645\u0629.",
														"GoogleFu GUI\ub294 \uad6c\uae00 \ubc88\uc5ed\uc744 \uc0ac\uc6a9\ud558\uc5ec \ubc88\uc5ed\ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc774 \uc644\ubcbd\ud55c \ud604\uc9c0\ud654 \uc544\ub2c8\ub77c, \uc601\uc5b4\uac00 \ubaa8\uad6d\uc5b4\uac00 \uc544\ub2cc \uacbd\uc6b0, \ub2f9\uc2e0\uc774 \ubc88\uc5ed \ub354 \ub098\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4 \uc774\ud574\ud569\ub2c8\ub2e4.",
														"\u8be5GoogleFu\u754c\u9762\u4e00\u76f4\u4f7f\u7528\u8c37\u6b4c\u7ffb\u8bd1\u7684\u672c\u5730\u5316\u3002\u660e\u767d\u8fd9\u4e0d\u662f\u4e00\u4e2a\u5b8c\u7f8e\u7684\u672c\u5730\u5316\uff0c\u4f46\u662f\u5982\u679c\u82f1\u8bed\u4e0d\u662f\u4f60\u7684\u6bcd\u8bed\uff0c\u4f60\u53ef\u80fd\u4f1a\u66f4\u597d\u7684\u7ffb\u8bd1\u3002",
														"GoogleFu GUI\u306fGoogle\u7ffb\u8a33\u3092\u4f7f\u7528\u3057\u3066\u30ed\u30fc\u30ab\u30e9\u30a4\u30ba\u3055\u308c\u3066\u3044\u307e\u3059\u3002\u3053\u308c\u306f\u5b8c\u74a7\u306a\u30ed\u30fc\u30ab\u30e9\u30a4\u30ba\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u304c\u3001\u82f1\u8a9e\u304c\u6bcd\u56fd\u8a9e\u3067\u306f\u306a\u3044\u5834\u5408\u3001\u3042\u306a\u305f\u304c\u7ffb\u8a33\u3057\u305f\u65b9\u304c\u826f\u3044\u304b\u3082\u3057\u308c\u7406\u89e3\u3059\u308b\u3002",
														"GoogleFu GUI \u0431\u044b\u043b \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u043e\u0432\u0430\u043d \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u043d\u0430\u043f\u0438\u0441\u0430\u043d. \u041f\u043e\u0439\u043c\u0438\u0442\u0435, \u0447\u0442\u043e \u044d\u0442\u043e \u043d\u0435 \u0438\u0434\u0435\u0430\u043b\u044c\u043d\u044b\u0439 \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0438, \u043d\u043e \u0435\u0441\u043b\u0438 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u043d\u0435 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0432\u0430\u0448\u0438\u043c \u0440\u043e\u0434\u043d\u044b\u043c \u044f\u0437\u044b\u043a\u043e\u043c, \u0432\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u0431\u044b\u0442\u044c \u043b\u0443\u0447\u0448\u0435 \u0441 \u043f\u0435\u0440\u0435\u0432\u043e\u0434\u043e\u043c.",
														"C\u00e1c GoogleFu giao di\u1ec7n \u0111\u00e3 \u0111\u01b0\u1ee3c \u0111\u1ecba ph\u01b0\u01a1ng s\u1eed d\u1ee5ng Google d\u1ecbch. Hi\u1ec3u \u0111\u01b0\u1ee3c \u0111i\u1ec1u n\u00e0y kh\u00f4ng ph\u1ea3i l\u00e0 m\u1ed9t n\u1ed9i \u0111\u1ecba h\u00f3a ho\u00e0n h\u1ea3o, nh\u01b0ng n\u1ebfu ti\u1ebfng Anh kh\u00f4ng ph\u1ea3i l\u00e0 ng\u00f4n ng\u1eef m\u1eb9 \u0111\u1ebb c\u1ee7a b\u1ea1n, b\u1ea1n c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c t\u1ed1t h\u01a1n v\u1edbi b\u1ea3n d\u1ecbch.",
														"De GoogleFu GUI is vertaald met behulp van Google-vertaling. Begrijpen dat dit niet een perfecte lokalisatie, maar als Engels niet je moedertaal, kan je beter af met de vertaling te zijn.",
														"Die GoogleFu GUI is gelokaliseerde met behulp van Google vertaal. Verstaan \u200b\u200bdit is nie 'n perfekte lokalisering, maar as Engels nie jou moedertaal is, kan jy beter af met die vertaling wees.",
														"The GoogleFu GUI \u0435 \u0431\u0438\u043b \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0438\u0440\u0430\u043d \u0441 \u043f\u043e\u043c\u043e\u0449\u0442\u0430 \u043d\u0430 Google Translation. \u0420\u0430\u0437\u0431\u0435\u0440\u0435\u0442\u0435, \u0442\u043e\u0432\u0430 \u043d\u0435 \u0435 \u043f\u0435\u0440\u0444\u0435\u043a\u0442\u0435\u043d \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u044f, \u043d\u043e \u0430\u043a\u043e \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u044f\u0442 \u043d\u0435 \u0435 \u0440\u043e\u0434\u0435\u043d \u0435\u0437\u0438\u043a, \u043c\u043e\u0436\u0435 \u0434\u0430 \u0431\u044a\u0434\u0435 \u043f\u043e-\u0434\u043e\u0431\u0440\u0435 \u0441 \u043f\u0440\u0435\u0432\u043e\u0434\u0430.",
														"GoogleFu GUI \u0431\u044b\u045e \u043b\u0430\u043a\u0430\u043b\u0456\u0437\u0430\u0432\u0430\u043d\u044b \u0437 \u0434\u0430\u043f\u0430\u043c\u043e\u0433\u0430\u0439 \u043d\u0430\u043f\u0456\u0441\u0430\u043d\u044b. \u0417\u0440\u0430\u0437\u0443\u043c\u0435\u0439\u0446\u0435, \u0448\u0442\u043e \u0433\u044d\u0442\u0430 \u043d\u0435 \u0456\u0434\u044d\u0430\u043b\u044c\u043d\u044b \u043b\u0430\u043a\u0430\u043b\u0456\u0437\u0430\u0446\u044b\u0456, \u0430\u043b\u0435 \u043a\u0430\u043b\u0456 \u0430\u043d\u0433\u043b\u0456\u0439\u0441\u043a\u0430\u044f \u043d\u0435 \u0437'\u044f\u045e\u043b\u044f\u0435\u0446\u0446\u0430 \u0432\u0430\u0448\u044b\u043c \u0440\u043e\u0434\u043d\u044b\u043c \u043c\u043e\u0432\u0430\u0439, \u0432\u044b \u043c\u043e\u0436\u0430\u0446\u0435 \u0431\u044b\u0446\u044c \u043b\u0435\u043f\u0448 \u0437 \u043f\u0435\u0440\u0430\u043a\u043b\u0430\u0434\u0430\u043c.",
														"La GUI googleFU s'ha localitzat a trav\u00e9s de Google Traductor. Entendre aix\u00f2 no \u00e9s una localitzaci\u00f3 perfecta, per\u00f2 si l'angl\u00e8s no \u00e9s la seva llengua materna, \u00e9s possible que sigui millor amb la traducci\u00f3.",
														"GoogleFu GUI byl lokalizov\u00e1n pomoc\u00ed Google Translation. Pochopte, \u017ee to nen\u00ed perfektn\u00ed lokalizace, ale pokud angli\u010dtina nen\u00ed va\u0161\u00edm rodn\u00fdm jazykem, m\u016f\u017eete b\u00fdt l\u00e9pe s p\u0159ekladem.",
														"Mae'r GoogleFu GUI wedi ei lleol gan ddefnyddio Google Cyfieithu. Deall nid yw hwn yn lleoleiddio berffaith, ond os nad Saesneg yw eich iaith frodorol, efallai y byddwch yn well eich byd gyda'r cyfieithiad.",
														"GoogleFu GUI on lokaliseeritud Google Translation. Aru ei ole t\u00e4iuslik lokaliseerimine, aga kui inglise keel ei ole teie emakeel, siis v\u00f5ib olla parem t\u00f5lge.",
														"GoogleFu GUI \u0628\u0627 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0627\u0632 \u062a\u0631\u062c\u0645\u0647 \u06af\u0648\u06af\u0644 \u062a\u0631\u062c\u0645\u0647 \u0634\u062f\u0647 \u0627\u0646\u062f. \u062f\u0631\u06a9 \u0627\u06cc\u0646 \u0627\u0633\u062a \u06a9\u0647 \u0645\u062d\u0644\u06cc \u0633\u0627\u0632\u06cc \u06a9\u0627\u0645\u0644 \u0646\u06cc\u0633\u062a\u060c \u0627\u0645\u0627 \u0627\u06af\u0631 \u0632\u0628\u0627\u0646 \u0627\u0646\u06af\u0644\u06cc\u0633\u06cc \u0632\u0628\u0627\u0646 \u0645\u0627\u062f\u0631\u06cc \u0634\u0645\u0627 \u0646\u06cc\u0633\u062a\u060c \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u0628\u0647\u062a\u0631 \u0627\u0633\u062a \u0628\u0627 \u062a\u0631\u062c\u0645\u0647.",
														"GoogleFu GUI on lokalisoitu Google Translation. Ymm\u00e4rr\u00e4 t\u00e4m\u00e4 ei ole t\u00e4ydellinen lokalisointi, mutta jos Englanti ei ole \u00e4idinkieli, saatat olla parempi, k\u00e4\u00e4nn\u00f6ksen.",
														"T\u00e1 an GUI GoogleFu T\u00e1 log\u00e1naithe baint \u00fas\u00e1ide as Google Aistri\u00fach\u00e1n. Tuig nach bhfuil s\u00e9 seo le log\u00e1n\u00fa foirfe, ach m\u00e1s rud \u00e9 nach \u00e9 an B\u00e9arla do theanga dh\u00fachais, f\u00e9adfaidh t\u00fa a bheith n\u00edos fearr as leis an aistri\u00fach\u00e1n.",
														"A GUI GoogleFu foi localizado usando Google Tradutor. Comprender isto non \u00e9 unha situaci\u00f3n perfecta, pero si o ingl\u00e9s non \u00e9 a s\u00faa lingua nativa, pode ser mellor f\u00f3ra coa traduci\u00f3n.",
														"GoogleFu \u091c\u0940\u092f\u0942\u0906\u0908 Google \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u093e \u0909\u092a\u092f\u094b\u0917 \u0938\u094d\u0925\u093e\u0928\u0940\u092f\u0915\u0943\u0924 \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948. \u092f\u0939 \u090f\u0915 \u0938\u0902\u092a\u0942\u0930\u094d\u0923 \u0938\u094d\u0925\u093e\u0928\u0940\u092f\u0915\u0930\u0923 \u0928\u0939\u0940\u0902 \u0939\u0948, \u0932\u0947\u0915\u093f\u0928 \u0905\u0902\u0917\u094d\u0930\u0947\u091c\u0940 \u0905\u092a\u0928\u0940 \u092e\u0942\u0932 \u092d\u093e\u0937\u093e \u0928\u0939\u0940\u0902 \u0939\u0948, \u0924\u094b \u0906\u092a \u0905\u0928\u0941\u0935\u093e\u0926 \u0915\u0947 \u0938\u093e\u0925 \u092c\u0947\u0939\u0924\u0930 \u0939\u094b \u0938\u0915\u0924\u093e \u0939\u0948 \u0938\u092e\u091d\u0947.",
														"GoogleFu GUI je lokaliziran pomo\u0107u Google Translation. Shvatite ovo nije savr\u0161ena lokalizacija, ali ako engleski nije va\u0161 materinji jezik, \u0161to mo\u017ee biti bolje s prijevodom.",
														"GoogleFu ent\u00e8fas a ki te lokalize l\u00e8 l s\u00e8vi av\u00e8k Google Tradiksyon. Konprann sa a se pa yon lokalizasyon paf\u00e8, men si angle se pa lang natif natal ou an, ou ka pi bon koupe ak tradiksyon an.",
														"The GoogleFu GUI telah diterjemahkan menggunakan Google Terjemahan. Memahami ini bukan lokalisasi sempurna, tetapi jika bahasa Inggris bukan bahasa asli Anda, Anda mungkin akan lebih baik dengan terjemahan.",
														"The GoogleFu GUI hefur veri\u00f0 sta\u00f0f\u00e6rt a\u00f0 nota Google \u00de\u00fd\u00f0ing. Skilja \u00feetta er ekki fullkomin sta\u00f0setning, en ef enska er ekki m\u00f3\u00f0urm\u00e1l \u00feitt, \u00fe\u00fa mega vera betri burt me\u00f0 \u00fe\u00fd\u00f0ingunni.",
														"GoogleFu GUI \u05db\u05d1\u05e8 \u05de\u05e7\u05d5\u05de\u05d9 \u05d1\u05d0\u05de\u05e6\u05e2\u05d5\u05ea \u05ea\u05e8\u05d2\u05d5\u05dd \u05e9\u05dc Google. \u05de\u05d1\u05d9\u05df \u05d0\u05ea \u05d6\u05d4 \u05d4\u05d5\u05d0 \u05dc\u05d0 \u05dc\u05d5\u05e7\u05dc\u05d9\u05d6\u05e6\u05d9\u05d4 \u05de\u05d5\u05e9\u05dc\u05de\u05ea, \u05d0\u05d1\u05dc \u05d0\u05dd \u05d0\u05e0\u05d2\u05dc\u05d9\u05ea \u05d4\u05d9\u05d0 \u05dc\u05d0 \u05d4\u05e9\u05e4\u05d4 \u05d4\u05d0\u05dd \u05e9\u05dc\u05da, \u05d0\u05ea\u05d4 \u05d9\u05db\u05d5\u05dc \u05dc\u05d4\u05d9\u05d5\u05ea \u05d9\u05d5\u05ea\u05e8 \u05d8\u05d5\u05d1 \u05e2\u05dd \u05d4\u05ea\u05e8\u05d2\u05d5\u05dd.",
														"GoogleFu GUI buvo lokalizuota naudojant \"Google\" vertimas. Suprasti tai n\u0117ra tobula lokalizacija, bet jei angl\u0173 kalba n\u0117ra j\u016bs\u0173 gimtoji kalba, jums gali b\u016bti geriau su vertimu.",
														"GoogleFu GUI ir lokaliz\u0113ts, izmantojot Google Translation. Saprast, tas nav ide\u0101ls lokaliz\u0101cija, bet, ja ang\u013cu valoda nav j\u016bsu dzimt\u0101 valoda, jums var b\u016bt lab\u0101k ar tulkojumu.",
														"\u041d\u0430 GoogleFu GUI \u0435 \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0438\u0440\u0430\u043d \u0441\u043e \u043f\u043e\u043c\u043e\u0448 \u043d\u0430 Google \u043f\u0440\u0435\u0432\u043e\u0434. \u0421\u0435 \u0440\u0430\u0437\u0431\u0435\u0440\u0435 \u0442\u043e\u0430 \u043d\u0435 \u0435 \u0441\u043e\u0432\u0440\u0448\u0435\u043d \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0458\u0430, \u043d\u043e \u0430\u043a\u043e \u0430\u043d\u0433\u043b\u0438\u0441\u043a\u0438 \u043d\u0435 \u0435 \u043c\u0430\u0458\u0447\u0438\u043d \u0458\u0430\u0437\u0438\u043a, \u043c\u043e\u0436\u0435 \u0434\u0430 \u0431\u0438\u0434\u0435 \u043f\u043e\u0434\u043e\u0431\u0440\u043e \u0441\u043e \u043f\u0440\u0435\u0432\u043e\u0434\u043e\u0442.",
														"Yang GoogleFu GUI telah setempat menggunakan Terjemahan Google. Memahami ini tidak penyetempatan yang sempurna, tetapi jika Bahasa Inggeris bukan bahasa ibunda anda, anda boleh menjadi lebih baik dengan terjemahan.",
														"Il GUI GoogleFu \u0121ie lokalizzat bil-Google Traduzzjoni. Jifhmu dan mhuwiex lokalizzazzjoni perfetta, imma jekk l-Ingli\u017c mhux lingwa nattiva tieg\u0127ek, inti tista 'tkun f'qag\u0127da a\u0127jar ma' l-traduzzjoni.",
														"Den GoogleFu GUI har blitt lokalisert ved hjelp av Google Translation. Forst\u00e5r at dette er ikke en perfekt lokalisering, men hvis engelsk ikke er morsm\u00e5let ditt, kan du bli bedre med oversettelsen.",
														"GoogleFu GUI zosta\u0142 zlokalizowany przy u\u017cyciu pomocn\u0105. Rozumiem, nie jest to idealne lokalizacja, ale je\u015bli angielski nie jest j\u0119zykiem ojczystym, mo\u017ce by\u0107 lepiej z t\u0142umaczeniem.",
														"A GUI GoogleFu foi localizado usando Google Tradutor. Compreender isso n\u00e3o \u00e9 uma localiza\u00e7\u00e3o perfeita, mas se o Ingl\u00eas n\u00e3o \u00e9 sua l\u00edngua nativa, voc\u00ea pode ser melhor fora com a tradu\u00e7\u00e3o.",
														"GoogleFu GUI a fost localizat cu ajutorul Google Traducere. \u00cen\u021belege\u021bi acest lucru nu este o localizare perfecta, dar \u00een cazul \u00een care engleza nu este limba ta matern\u0103, s-ar putea fi mai bine cu traducerea.",
														"GoogleFu GUI bol lokalizovan\u00fd pomocou Google Translation. Pochopte, \u017ee to nie je perfektn\u00e1 lokaliz\u00e1cia, ale ak angli\u010dtina nie je va\u0161im rodn\u00fdm jazykom, m\u00f4\u017eete by\u0165 lep\u0161ie s prekladom.",
														"GoogleFu GUI je lokalizirana pomo\u010djo Google Translation. Razumem, to ni popolna lokalizacija, vendar, \u010de angle\u0161\u010dina ni va\u0161 materni jezik, boste morda bolje s prevodom.",
														"GoogleFu GUI \u00ebsht\u00eb lokalizuar p\u00ebrdorur Translation Google. Kuptojn\u00eb kjo nuk \u00ebsht\u00eb nj\u00eb lokalizimi i p\u00ebrsosur, por n\u00eb qoft\u00eb se anglishtja nuk \u00ebsht\u00eb gjuha juaj amtare, ju mund t\u00eb jet\u00eb m\u00eb mir\u00eb me p\u00ebrkthimin.",
														"\u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u0413\u0423\u0418 \u0458\u0435 \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u043e\u0432\u0430\u043d\u0430 \u043f\u043e\u043c\u043e\u045b\u0443 \u0413\u043e\u043e\u0433\u043b\u0435 \u0422\u0440\u0430\u043d\u0441\u043b\u0430\u0442\u0438\u043e\u043d. \u0420\u0430\u0437\u0443\u043c\u0435\u043c\u043e \u043e\u0432\u043e \u043d\u0438\u0458\u0435 \u0441\u0430\u0432\u0440\u0448\u0435\u043d \u043b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0458\u0430, \u0430\u043b\u0438 \u0430\u043a\u043e \u0435\u043d\u0433\u043b\u0435\u0441\u043a\u0438 \u043d\u0438\u0458\u0435 \u0432\u0430\u0448 \u043c\u0430\u0442\u0435\u0440\u045a\u0438 \u0458\u0435\u0437\u0438\u043a, \u043c\u043e\u0436\u0434\u0430 \u045b\u0435\u0442\u0435 \u0431\u0438\u0442\u0438 \u0431\u043e\u0459\u0435 \u0441\u0430 \u043f\u0440\u0435\u0432\u043e\u0434\u043e\u043c.",
														"Den GoogleFu GUI har lokaliserats med hj\u00e4lp av Google-\u00f6vers\u00e4ttning. F\u00f6rst\u00e5 detta inte \u00e4r en perfekt lokalisering, men om engelska inte \u00e4r ditt modersm\u00e5l, kan du vara b\u00e4ttre med \u00f6vers\u00e4ttningen.",
														"GoogleFu GUI imekuwa localized kwa kutumia Google Tafsiri. Kuelewa hili ni si ujanibishaji kamili, lakini kama Kiingereza sio lugha yako ya asili, unaweza kuwa bora zaidi na tafsiri.",
														"GoogleFu GUI \u0e44\u0e14\u0e49\u0e23\u0e31\u0e1a\u0e01\u0e32\u0e23\u0e41\u0e1b\u0e25\u0e40\u0e1b\u0e47\u200b\u200b\u0e19\u0e20\u0e32\u0e29\u0e32\u0e17\u0e49\u0e2d\u0e07\u0e16\u0e34\u0e48\u0e19\u0e42\u0e14\u0e22\u0e43\u0e0a\u0e49 Google \u0e41\u0e1b\u0e25 \u0e40\u0e02\u0e49\u0e32\u0e43\u0e08\u0e43\u0e19\u0e40\u0e23\u0e37\u0e48\u0e2d\u0e07\u0e19\u0e35\u0e49\u0e44\u0e21\u0e48\u0e44\u0e14\u0e49\u0e41\u0e1b\u0e25\u0e17\u0e35\u0e48\u0e2a\u0e21\u0e1a\u0e39\u0e23\u0e13\u0e4c\u0e41\u0e1a\u0e1a \u0e41\u0e15\u0e48\u0e16\u0e49\u0e32\u0e20\u0e32\u0e29\u0e32\u0e2d\u0e31\u0e07\u0e01\u0e24\u0e29\u0e44\u0e21\u0e48\u0e43\u0e0a\u0e48\u0e20\u0e32\u0e29\u0e32\u0e1e\u0e37\u0e49\u0e19\u0e40\u0e21\u0e37\u0e2d\u0e07\u0e02\u0e2d\u0e07\u0e04\u0e38\u0e13\u0e04\u0e38\u0e13\u0e2d\u0e32\u0e08\u0e08\u0e30\u0e14\u0e35\u0e01\u0e27\u0e48\u0e32\u0e17\u0e35\u0e48\u0e21\u0e35\u0e01\u0e32\u0e23\u0e41\u0e1b\u0e25",
														"Ang GoogleFu GUI ay na-localize na gamit ang Google Translation. Intindihin na ito ay hindi isang perpektong localization, subalit kung Ingles ay hindi ang iyong sariling wika, maaari kang maging mas mahusay na off gamit ang pagsasalin.",
														"GoogleFu GUI hakk\u0131nda yorum yapt\u0131 kullan\u0131larak lokalize olmu\u015ftur. Bu m\u00fckemmel bir yerelle\u015ftirme de\u011fil, \u0130ngilizce ana diliniz de\u011filse, size \u00e7eviri ile daha iyi olabilir anlay\u0131n.",
														"GoogleFu GUI \u0431\u0443\u043b\u0430 \u043b\u043e\u043a\u0430\u043b\u0456\u0437\u043e\u0432\u0430\u043d\u0430 \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u0438\u0439. \u0417\u0440\u043e\u0437\u0443\u043c\u0456\u0439\u0442\u0435, \u0449\u043e \u0446\u0435 \u043d\u0435 \u0456\u0434\u0435\u0430\u043b\u044c\u043d\u0438\u0439 \u043b\u043e\u043a\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u0457, \u0430\u043b\u0435 \u044f\u043a\u0449\u043e \u0430\u043d\u0433\u043b\u0456\u0439\u0441\u044c\u043a\u0430 \u043d\u0435 \u0454 \u0432\u0430\u0448\u043e\u044e \u0440\u0456\u0434\u043d\u043e\u044e \u043c\u043e\u0432\u043e\u044e, \u0432\u0438 \u043c\u043e\u0436\u0435\u0442\u0435 \u0431\u0443\u0442\u0438 \u043a\u0440\u0430\u0449\u0435 \u0437 \u043f\u0435\u0440\u0435\u043a\u043b\u0430\u0434\u043e\u043c.",
														"\u05d3\u05d9 \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d2\u05d5\u05d9 \u05d4\u05d0\u05d8 \u05e9\u05d5\u05d9\u05df \u05dc\u05d0\u05b8\u05d5\u05e7\u05d0\u05b7\u05dc\u05d9\u05d9\u05d6\u05d3 \u05e0\u05d9\u05e6\u05df Google \u05d8\u05e8\u05d0\u05b7\u05e0\u05e1\u05dc\u05d0\u05b7\u05d8\u05d9\u05d0\u05b8\u05df. \u05e4\u05bf\u05d0\u05b7\u05e8\u05e9\u05d8\u05d9\u05d9\u05df \u05d3\u05e2\u05dd \u05d0\u05d9\u05d6 \u05e0\u05d9\u05d8 \u05d0\u05b7 \u05d2\u05d0\u05e0\u05e5 \u05dc\u05d0\u05b8\u05d5\u05e7\u05d0\u05b7\u05dc\u05d0\u05b7\u05d6\u05d9\u05d9\u05e9\u05d0\u05b7\u05df, \u05d0\u05b8\u05d1\u05e2\u05e8 \u05d0\u05d5\u05d9\u05d1 \u05e2\u05e0\u05d2\u05dc\u05d9\u05e9 \u05d0\u05d9\u05d6 \u05e0\u05d9\u05e9\u05d8 \u05d3\u05d9\u05d9\u05df \u05d2\u05e2\u05d1\u05d5\u05d9\u05e8\u05df \u05e9\u05e4\u05bc\u05e8\u05d0\u05b7\u05da, \u05d0\u05d9\u05e8 \u05d6\u05d0\u05dc\u05d8 \u200b\u200b\u05d6\u05d9\u05d9\u05df \u05d1\u05e2\u05e1\u05e2\u05e8 \u05d0\u05b7\u05d5\u05d5\u05e2\u05e7 \u05de\u05d9\u05d8 \u05d3\u05e2\u05e8 \u05d0\u05d9\u05d1\u05e2\u05e8\u05d6\u05e2\u05e6\u05d5\u05e0\u05d2.",
														"\u8a72GoogleFu\u754c\u9762\u4e00\u76f4\u4f7f\u7528\u8c37\u6b4c\u7ffb\u8b6f\u7684\u672c\u5730\u5316\u3002\u660e\u767d\u9019\u4e0d\u662f\u4e00\u500b\u5b8c\u7f8e\u7684\u672c\u5730\u5316\uff0c\u4f46\u662f\u5982\u679c\u82f1\u8a9e\u4e0d\u662f\u4f60\u7684\u6bcd\u8a9e\uff0c\u4f60\u53ef\u80fd\u6703\u66f4\u597d\u7684\u7ffb\u8b6f\u3002"));
