			Rows.Add( new LocalizationRow("Select the path that GoogleFu will use when generating NGUI Localization files. ",
														"S\u00e9lectionnez le chemin que GoogleFu utilisera lors de la g\u00e9n\u00e9ration des fichiers Ngui localisation.",
