			Rows.Add( new LocalizationRow("Enable if you are running NGUI version prior to 3.5.0. The Localization format was changed to a CSV in this version.",
														"Activer si vous utilisez la version Ngui avant 3.5.0. Le format de la localisation a \u00e9t\u00e9 chang\u00e9 pour un fichier CSV dans cette version.",
														"Attiva se si esegue la versione Ngui prima 3.5.0. Il formato localizzazione \u00e8 stato cambiato in un file CSV in questa versione.",
														"Aktivieren, wenn Sie vor der 3.5.0 l\u00e4uft Ngui Version verwenden. Die Lokalisierung Format wurde in eine CSV in dieser Version ge\u00e4ndert.",
														"Activar si est\u00e1 ejecutando la versi\u00f3n ngui antes de la 3.5.0. El formato de localizaci\u00f3n fue cambiada a un archivo CSV en esta versi\u00f3n.",
														"\u062a\u0645\u0643\u064a\u0646 \u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0642\u0648\u0645 \u0628\u062a\u0634\u063a\u064a\u0644 \u0625\u0635\u062f\u0627\u0631 NGUI \u0642\u0628\u0644 3.5.0. \u062a\u0645 \u062a\u063a\u064a\u064a\u0631 \u0634\u0643\u0644 \u0627\u0644\u062a\u0639\u0631\u064a\u0628 \u0625\u0644\u0649 CSV \u0641\u064a \u0647\u0630\u0627 \u0627\u0644\u0625\u0635\u062f\u0627\u0631.",
														"\ub2f9\uc2e0\uc774 \uc774\uc804\uc5d0 3.5.0\uc5d0 NGUI \ubc84\uc804\uc744 \uc2e4\ud589\ud558\ub294 \uacbd\uc6b0 \uc0ac\uc6a9\ud569\ub2c8\ub2e4. \ud604\uc9c0\ud654 \ud615\uc2dd\uc740\uc774 \ubc84\uc804\uc5d0\uc11c CSV\ub85c \ubcc0\uacbd\ub418\uc5c8\uc2b5\ub2c8\ub2e4.",
														"\u542f\u7528\u5982\u679c\u60a8\u6b63\u5728\u8fd0\u884cNGUI\u4e4b\u524d\u7248\u672c3.5.0\u3002\u672c\u5730\u5316\u7684\u683c\u5f0f\u5df2\u66f4\u6539\u4e3aCSV\u5728\u8fd9\u4e2a\u7248\u672c\u3002",
														"\u3042\u306a\u305f\u304c\u524d\u306b3.5.0\u306bNGUI\u30d0\u30fc\u30b8\u30e7\u30f3\u3092\u5b9f\u884c\u3057\u3066\u3044\u308b\u5834\u5408\u306f\u3001\u6709\u52b9\u306b\u3057\u307e\u3059\u3002\u30ed\u30fc\u30ab\u30e9\u30a4\u30ba\u30d5\u30a9\u30fc\u30de\u30c3\u30c8\u306f\u3053\u306e\u30d0\u30fc\u30b8\u30e7\u30f3\u3067\u306f\u3001CSV\u306b\u5909\u66f4\u3057\u305f\u3002",
														"\u0412\u043a\u043b\u044e\u0447\u0438\u0442\u044c, \u0435\u0441\u043b\u0438 \u0432\u044b \u0440\u0430\u0431\u043e\u0442\u0430\u0435\u0442\u0435 NGUI \u0432\u0435\u0440\u0441\u0438\u044e \u0434\u043e \u0432\u0435\u0440\u0441\u0438\u0438 3.5.0. \u0424\u043e\u0440\u043c\u0430\u0442 \u041b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u044f \u0431\u044b\u043b \u0438\u0437\u043c\u0435\u043d\u0435\u043d \u043d\u0430 CSV \u0432 \u044d\u0442\u043e\u0439 \u0432\u0435\u0440\u0441\u0438\u0438.",
														"K\u00edch ho\u1ea1t n\u1ebfu b\u1ea1n \u0111ang ch\u1ea1y phi\u00ean b\u1ea3n NGUI tr\u01b0\u1edbc 3.5.0. C\u00e1c \u0111\u1ecbnh d\u1ea1ng c\u00e1c \u0111\u1ecba ph\u01b0\u01a1ng \u0111\u00e3 \u0111\u01b0\u1ee3c thay \u0111\u1ed5i th\u00e0nh m\u1ed9t CSV trong phi\u00ean b\u1ea3n n\u00e0y.",
														"Inschakelen als u werkt Ngui versie voorafgaand aan 3.5.0. De Localization indeling werd veranderd in een CSV in deze versie.",
														"In staat stel om as jy met Ngui weergawe voor 3.5.0. Die lokalisering formaat verander na 'n CSV in hierdie weergawe.",
