														"\u040e\u043a\u043b\u044e\u0447\u044b\u0446\u044c, \u043a\u0430\u043b\u0456 \u0432\u044b \u043f\u0440\u0430\u0446\u0443\u0435\u0446\u0435 NGUI \u0432\u0435\u0440\u0441\u0456\u044e \u0434\u0430 \u0432\u0435\u0440\u0441\u0456\u0456 3.5.0. \u0424\u0430\u0440\u043c\u0430\u0442 \u041b\u0430\u043a\u0430\u043b\u0456\u0437\u0430\u0446\u044b\u044f \u0431\u044b\u045e \u0437\u043c\u0435\u043d\u0435\u043d\u044b \u043d\u0430 CSV \u045e \u0433\u044d\u0442\u0430\u0439 \u0432\u0435\u0440\u0441\u0456\u0456.",
