														"Luba, kui teil on NGUI versioon enne 3.5.0. Localization formaat oli muutunud CSV selles versioonis.",
														"\u0641\u0639\u0627\u0644 \u06a9\u0631\u062f\u0646 \u0627\u06af\u0631 \u0634\u0645\u0627 \u062f\u0631 \u062d\u0627\u0644 \u0627\u062c\u0631\u0627 \u0646\u0633\u062e\u0647 NGUI \u0642\u0628\u0644 \u0627\u0632 3.5.0. \u0641\u0631\u0645\u062a \u0645\u062d\u0644\u06cc \u0633\u0627\u0632\u06cc \u062f\u0631 \u0627\u06cc\u0646 \u0646\u0633\u062e\u0647 \u0628\u0647 CSV \u062a\u063a\u06cc\u06cc\u0631 \u06cc\u0627\u0641\u062a.",
