														"Omogu\u0107ite ako radite NGUI verziju prije 3.5.0. Lokalizacija format je promijenio u CSV u ovoj verziji.",
														"P\u00e8m\u00e8t si ou se kouri NGUI v\u00e8syon anvan 3.5.0. F\u00f2ma a Lokalizasyon te chanje nan yon CSV nan v\u00e8syon sa a.",
														"Aktifkan jika Anda menjalankan versi NGUI sebelum 3.5.0. Format Localization berubah menjadi CSV dalam versi ini.",
