														"Membolehkan jika anda menjalankan versi Ngui sebelum 3.5.0. Format Localization telah ditukar kepada CSV dalam versi ini.",
														"Jippermettu jekk inti ta\u0127dem ver\u017cjoni NGUI qabel 3.5.0. Il-format Lokalizzazzjoni kien inbidel g\u0127al CSV f'dan il-ver\u017cjoni.",
														"Aktiver hvis du kj\u00f8rer NGUI versjon f\u00f8r 3.5.0. Lokalisering formatet ble endret til en CSV i denne versjonen.",
														"W\u0142\u0105cz, je\u015bli u\u017cywasz wersji NGUI przed 3.5.0. Format Localization zmieniono CSV w tej wersji.",
														"Ativar se voc\u00ea estiver executando a vers\u00e3o Ngui antes 3.5.0. O formato foi mudado de localiza\u00e7\u00e3o para um CSV nesta vers\u00e3o.",
														"Activa\u021bi dac\u0103 rula\u021bi versiunea NGUI \u00eenainte de 3.5.0. Formatul de localizare a fost schimbat la un CSV \u00een aceast\u0103 versiune.",
														"Povo\u013ete, ak pou\u017e\u00edvate NGUI verzie pred 3.5.0. Form\u00e1t Lokaliz\u00e1cia bola zmenen\u00e1 na CSV v tejto verzii.",
														"Omogo\u010dite, \u010de imate name\u0161\u010den NGUI razli\u010dico pred 3.5.0. Format Lokalizacija je spremenila v CSV v tej razli\u010dici.",
														"Aktivizo n\u00ebse ju jeni duke versionin NGUI para 3.5.0. Formati Lokalizim \u00ebsht\u00eb ndryshuar p\u00ebr nj\u00eb CSV n\u00eb k\u00ebt\u00eb version.",
														"\u041e\u043c\u043e\u0433\u0443\u045b\u0438 \u0430\u043a\u043e \u043a\u043e\u0440\u0438\u0441\u0442\u0438\u0442\u0435 \u041d\u0413\u0423\u0418 \u0432\u0435\u0440\u0437\u0438\u0458\u0443 \u043f\u0440\u0435 3.5.0. \u0424\u043e\u0440\u043c\u0430\u0442 \u041b\u043e\u043a\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0458\u0430 \u0458\u0435 \u043f\u0440\u043e\u043c\u0435\u045a\u0435\u043d \u0443 \u0426\u0421\u0412 \u0443 \u043e\u0432\u043e\u0458 \u0432\u0435\u0440\u0437\u0438\u0458\u0438.",
