														"Paganahin ang kung nagpapatakbo ka ng NGUI bersyon bago 3.5.0. Ang format lokalisasyon ay pinalitan ng isang CSV sa bersyon na ito.",
														"E\u011fer \u00f6nceden 3.5.0 i\u00e7in Ngui s\u00fcr\u00fcm\u00fcn\u00fc \u00e7al\u0131\u015ft\u0131r\u0131yorsan\u0131z etkinle\u015ftirin. Yerelle\u015ftirme format\u0131 bu s\u00fcr\u00fcmde bir CSV de\u011fi\u015ftirildi.",
														"\u0412\u043a\u043b\u044e\u0447\u0438\u0442\u0438, \u044f\u043a\u0449\u043e \u0432\u0438 \u043f\u0440\u0430\u0446\u044e\u0454\u0442\u0435 NGUI \u0432\u0435\u0440\u0441\u0456\u044e \u0434\u043e \u0432\u0435\u0440\u0441\u0456\u0457 3.5.0. \u0424\u043e\u0440\u043c\u0430\u0442 \u041b\u043e\u043a\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u044f \u0431\u0443\u0432 \u0437\u043c\u0456\u043d\u0435\u043d\u0438\u0439 \u043d\u0430 CSV \u0432 \u0446\u0456\u0439 \u0432\u0435\u0440\u0441\u0456\u0457.",
														"\u05d2\u05e2\u05d1\u05df \u05d0\u05d5\u05d9\u05d1 \u05d0\u05d9\u05e8 \u05d6\u05e2\u05e0\u05e2\u05df \u05e4\u05dc\u05d9\u05e1\u05e0\u05d3\u05d9\u05e7 \u05e0\u05d2\u05d5\u05d9 \u05d5\u05d5\u05e2\u05e8\u05e1\u05d9\u05e2 \u05e4\u05e8\u05d9\u05e2\u05e8\u05d3\u05d9\u05e7 \u05e6\u05d5 3.5.0. \u05d3\u05d9 \u05dc\u05d0\u05b8\u05e7\u05d0\u05b7\u05dc\u05d9\u05d6\u05d0\u05b7\u05d8\u05d9\u05d0\u05b8\u05df \u05e4\u05bf\u05d0\u05b8\u05e8\u05de\u05d0\u05b7\u05d8 \u05d0\u05d9\u05d6 \u05e4\u05d0\u05e8\u05e2\u05e0\u05d3\u05e2\u05e8\u05d8 \u05e6\u05d5 \u05d0\u05b7 \u05e7\u05e1\u05d5\u05d5 \u05d0\u05d9\u05df \u05d3\u05e2\u05dd \u05d5\u05d5\u05e2\u05e8\u05e1\u05d9\u05e2.",
														"\u555f\u7528\u5982\u679c\u60a8\u6b63\u5728\u904b\u884cNGUI\u4e4b\u524d\u7248\u672c3.5.0\u3002\u672c\u5730\u5316\u7684\u683c\u5f0f\u5df2\u66f4\u6539\u70baCSV\u5728\u9019\u500b\u7248\u672c\u3002"));
