			Rows.Add( new LocalizationRow("Select the path that GoogleFu will use when generating the Playmaker actions.  (Typically the root Playmaker Actions directory, subdirectories will be automatically generated for GoogleFu databases) ",
														"S\u00e9lectionnez le chemin que GoogleFu utilisera lors de la g\u00e9n\u00e9ration des actions Playmaker. (G\u00e9n\u00e9ralement, le r\u00e9pertoire racine Playmaker Actions, sous-r\u00e9pertoires seront automatiquement g\u00e9n\u00e9r\u00e9s pour les bases de donn\u00e9es GoogleFu)",
														"Selezionare il percorso che GoogleFu utilizzer\u00e0 quando si generano le azioni di Playmaker. (In genere la directory Playmaker Azioni di root, sottodirectory saranno generati automaticamente per i database GoogleFu)",
														"W\u00e4hlen Sie den Weg, der GoogleFu wird bei der Generierung der Spielmacher Aktionen verwenden. (In der Regel die Wurzel Spielmacher Aktionen Verzeichnis, Unterverzeichnisse werden automatisch f\u00fcr GoogleFu Datenbanken generiert werden)",
														"Seleccione la ruta que googleFU utilizar\u00e1 al generar las acciones Playmaker. (Normalmente, el directorio acciones Playmaker ra\u00edz, subdirectorios se generar\u00e1n autom\u00e1ticamente las bases de datos googleFU)",
														"\u062d\u062f\u062f \u0627\u0644\u0645\u0633\u0627\u0631 \u0627\u0644\u0630\u064a GoogleFu \u0633\u0648\u0641 \u062a\u0633\u062a\u062e\u062f\u0645 \u0639\u0646\u062f \u0625\u0646\u0634\u0627\u0621 \u0627\u0644\u0625\u062c\u0631\u0627\u0621\u0627\u062a \u0635\u0627\u0646\u0639 \u0623\u0644\u0639\u0627\u0628. (\u0639\u0627\u062f\u0629 \u0627\u0644\u062c\u0630\u0631 \u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0635\u0627\u0646\u0639 \u0623\u0644\u0639\u0627\u0628 \u0627\u0644\u062f\u0644\u064a\u0644\u060c \u0633\u064a\u062a\u0645 \u0625\u0646\u0634\u0627\u0621 \u0627\u0644\u062f\u0644\u0627\u0626\u0644 \u0627\u0644\u0641\u0631\u0639\u064a\u0629 \u062a\u0644\u0642\u0627\u0626\u064a\u0627 \u0644\u0642\u0648\u0627\u0639\u062f \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a GoogleFu)",
														"\ud50c\ub808\uc774 \uba54\uc774\ucee4 \uc791\uc5c5\uc744 \uc0dd\uc131 \ud560 \ub54c GoogleFu\uac00 \uc0ac\uc6a9\ud558\ub294 \uacbd\ub85c\ub97c \uc120\ud0dd\ud569\ub2c8\ub2e4. (\uc77c\ubc18\uc801\uc73c\ub85c \ub8e8\ud2b8 \ud50c\ub808\uc774 \uba54\uc774\ucee4 \uc791\uc5c5 \ub514\ub809\ud1a0\ub9ac, \ud558\uc704 \ub514\ub809\ud1a0\ub9ac\uac00 \uc790\ub3d9\uc73c\ub85c GoogleFu \ub370\uc774\ud130\ubca0\uc774\uc2a4 \uc0dd\uc131\ub429\ub2c8\ub2e4)",
														"\u9009\u62e9\u751f\u6210\u7b56\u52a8\u8fdb\u653b\u884c\u52a8\u65f6GoogleFu\u5c06\u4f7f\u7528\u7684\u8def\u5f84\u3002 \uff08\u901a\u5e38\u60c5\u51b5\u4e0b\uff0c\u6839\u7b56\u52a8\u8fdb\u653b\u884c\u52a8\u76ee\u5f55\uff0c\u5b50\u76ee\u5f55\u5c06\u7528\u4e8eGoogleFu\u6570\u636e\u5e93\u81ea\u52a8\u751f\u6210\uff09",
														"\u53f8\u4ee4\u5854\u306e\u30a2\u30af\u30b7\u30e7\u30f3\u3092\u751f\u6210\u3059\u308b\u3068\u304d\u306bGoogleFu\u304c\u4f7f\u7528\u3059\u308b\u30d1\u30b9\u3092\u9078\u629e\u3057\u307e\u3059\u3002 \uff08\u901a\u5e38\u3001\u30eb\u30fc\u30c8\u53f8\u4ee4\u5854\u30a2\u30af\u30b7\u30e7\u30f3\u30c7\u30a3\u30ec\u30af\u30c8\u30ea\u3001\u30b5\u30d6\u30c7\u30a3\u30ec\u30af\u30c8\u30ea\u304c\u81ea\u52d5\u7684\u306bGoogleFu\u30c7\u30fc\u30bf\u30d9\u30fc\u30b9\u7528\u306b\u751f\u6210\u3055\u308c\u307e\u3059\uff09",
														"\u0412\u044b\u0431\u0435\u0440\u0438\u0442\u0435 \u043f\u0443\u0442\u044c, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 GoogleFu \u0431\u0443\u0434\u0435\u0442 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u043f\u0440\u0438 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440\u0430. (\u041e\u0431\u044b\u0447\u043d\u043e \u043a\u043e\u0440\u043d\u0435\u0432\u043e\u0439 \u043a\u0430\u0442\u0430\u043b\u043e\u0433 \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0414\u0435\u0439\u0441\u0442\u0432\u0438\u044f, \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0438 \u0431\u0443\u0434\u0443\u0442 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0434\u043b\u044f \u0431\u0430\u0437 \u0434\u0430\u043d\u043d\u044b\u0445 GoogleFu)",
														"Ch\u1ecdn con \u0111\u01b0\u1eddng m\u00e0 GoogleFu s\u1ebd s\u1eed d\u1ee5ng khi t\u1ea1o ra c\u00e1c h\u00e0nh \u0111\u1ed9ng Playmaker. (Th\u00f4ng th\u01b0\u1eddng g\u1ed1c Playmaker Ho\u1ea1t \u0111\u1ed9ng th\u01b0 m\u1ee5c, th\u01b0 m\u1ee5c con s\u1ebd \u0111\u01b0\u1ee3c t\u1ef1 \u0111\u1ed9ng t\u1ea1o ra cho c\u01a1 s\u1edf d\u1eef li\u1ec7u GoogleFu)",
														"Selecteer het pad dat GoogleFu zal gebruiken bij het genereren van de spelmaker acties. (Typisch de wortel spelmaker Acties directory, submappen worden automatisch gegenereerd voor GoogleFu databases)",
														"Kies die pad wat GoogleFu gebruik sal word wanneer die opwekking van die Play Maker aksies. (Tipies van die wortel Play Maker aksies gids, subdirectory sal outomaties gegenereer word vir GoogleFu databasisse)",
														"\u0418\u0437\u0431\u0435\u0440\u0435\u0442\u0435 \u043f\u044a\u0442\u044f, \u043a\u043e\u0439\u0442\u043e GoogleFu \u0449\u0435 \u0438\u0437\u043f\u043e\u043b\u0437\u0432\u0430 \u043f\u0440\u0438 \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430\u043d\u0435\u0442\u043e \u043d\u0430 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f\u0442\u0430 \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u044a\u0440. (\u041e\u0431\u0438\u043a\u043d\u043e\u0432\u0435\u043d\u043e \u043a\u043e\u0440\u0435\u043d \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u044a\u0440 Actions \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u044f, \u043f\u043e\u0434\u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u0438 \u0449\u0435 \u0431\u044a\u0434\u0430\u0442 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430\u043d\u0438 \u0437\u0430 GoogleFu \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u043d\u0438)",
														"\u0412\u044b\u0431\u0435\u0440\u044b\u0446\u0435 \u0448\u043b\u044f\u0445, \u044f\u043a\u0456 GoogleFu \u0431\u0443\u0434\u0437\u0435 \u0432\u044b\u043a\u0430\u0440\u044b\u0441\u0442\u043e\u045e\u0432\u0430\u0446\u044c \u043f\u0440\u044b \u0441\u0442\u0432\u0430\u0440\u044d\u043d\u043d\u0456 \u0434\u0437\u0435\u044f\u043d\u043d\u0456 \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440\u0430. (\u0417\u0432\u044b\u0447\u0430\u0439\u043d\u0430 \u043a\u0430\u0440\u0430\u043d\u0451\u0432\u0430\u0439 \u043a\u0430\u0442\u0430\u043b\u043e\u0433 \u043f\u043b\u044d\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0414\u0437\u0435\u044f\u043d\u043d\u0456, \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0456 \u0431\u0443\u0434\u0443\u0446\u044c \u0430\u045e\u0442\u0430\u043c\u0430\u0442\u044b\u0447\u043d\u0430 \u0434\u043b\u044f \u0431\u0430\u0437 \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u0445 GoogleFu)",
														"Seleccioneu la ruta que googleFU utilitzar\u00e0 en generar les accions Playmaker. (Normalment, el directori accions Playmaker arrel, subdirectoris es generaran autom\u00e0ticament les bases de dades googleFU)",
														"Vyberte cestu, kter\u00e1 GoogleFu budou pou\u017e\u00edvat p\u0159i vytv\u00e1\u0159en\u00ed opat\u0159en\u00ed tvrd\u00fdch hol\u00ed. (Obvykle ko\u0159enov\u00fd Tv\u016frce hry Akce adres\u00e1\u0159e, podadres\u00e1\u0159e budou automaticky generov\u00e1ny datab\u00e1z\u00ed GoogleFu)",
														"Dewiswch y llwybr y bydd GoogleFu defnyddio wrth gynhyrchu y camau gweithredu Playmaker. (Fel arfer, mae'r gwraidd cyfeiriadur Playmaker Camau Gweithredu, bydd subdirectories yn awtomatig ar gyfer cronfeydd data GoogleFu)",
														"Valige tee, mis GoogleFu kasutame kui teeniva Playmaker tegevusi. (Tavaliselt root Playmaker Actions kataloogi alamkatalooge automaatselt genereeritakse GoogleFu andmebaasid)",
														"\u0631\u0627\u0647\u06cc \u06a9\u0647 GoogleFu \u062e\u0648\u0627\u0647\u062f \u0634\u062f \u06a9\u0647 \u062a\u0648\u0644\u06cc\u062f \u0627\u0642\u062f\u0627\u0645\u0627\u062a \u0628\u0627\u0632\u06cc\u0633\u0627\u0632 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0631\u0627 \u0627\u0646\u062a\u062e\u0627\u0628 \u06a9\u0646\u06cc\u062f. (\u0628\u0647 \u0637\u0648\u0631 \u0645\u0639\u0645\u0648\u0644 \u0631\u06cc\u0634\u0647 \u0639\u0645\u0644\u06cc\u0627\u062a \u0628\u0627\u0632\u06cc\u0633\u0627\u0632 \u062f\u0627\u06cc\u0631\u06a9\u062a\u0648\u0631\u06cc\u060c \u0632\u06cc\u0631\u0634\u0627\u062e\u0647 \u062e\u0648\u0627\u0647\u062f \u0634\u062f \u0628\u0647 \u0635\u0648\u0631\u062a \u062e\u0648\u062f\u06a9\u0627\u0631 \u0628\u0631\u0627\u06cc \u067e\u0627\u06cc\u06af\u0627\u0647 \u062f\u0627\u062f\u0647 GoogleFu \u062a\u0648\u0644\u06cc\u062f)",
