														"Roghnaigh an cos\u00e1n go mbeidh GoogleFu a \u00fas\u00e1id nuair na gn\u00edomha\u00edochta\u00ed playmaker ghini\u00faint. (De ghn\u00e1th an fhr\u00e9amh Gn\u00edomhartha playmaker eolaire, beidh fochomhadlann a ghintear go huathoibr\u00edoch le haghaidh bunachair GoogleFu)",
														"Escolla o cami\u00f1o que GoogleFu usar\u00e1 ao xerar as acci\u00f3ns organizador de xogo. (Normalmente o directorio Acci\u00f3ns Playmaker ra\u00edz, os subdirectorios ser\u00e1n xerados automaticamente a bases de datos GoogleFu)",
														"\u092a\u094d\u0932\u0947\u092e\u0947\u0915\u0930 \u0915\u093e\u0930\u094d\u092f\u094b\u0902 \u092a\u0948\u0926\u093e \u091c\u092c GoogleFu \u0909\u092a\u092f\u094b\u0917 \u0915\u0930\u0947\u0917\u093e \u0915\u093f \u092a\u0925 \u0915\u093e \u091a\u092f\u0928 \u0915\u0930\u0947\u0902. (\u0906\u092e\u0924\u094c\u0930 \u092a\u0930 \u091c\u0921\u093c \u092a\u094d\u0932\u0947\u092e\u0947\u0915\u0930 \u092a\u094d\u0930\u0915\u094d\u0930\u093f\u092f\u093e \u0928\u093f\u0930\u094d\u0926\u0947\u0936\u093f\u0915\u093e, \u0909\u092a\u0928\u093f\u0930\u094d\u0926\u0947\u0936\u093f\u0915\u093e \u0938\u094d\u0935\u0924\u0903 GoogleFu \u0921\u0947\u091f\u093e\u092c\u0947\u0938 \u0915\u0947 \u0932\u093f\u090f \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0939\u094b \u091c\u093e\u090f\u0917\u093e)",
														"Odaberite put koji \u0107e GoogleFu koristiti prilikom generiranja je razigrava\u010d akcije. (Obi\u010dno korijen razigrava\u010d Akcije imenik, poddirektoriji \u0107e se automatski izraditi GoogleFu baze podataka)",
														"Chwazi chemen an ki GoogleFu pral s\u00e8vi ak l\u00e8 g\u00e9n\u00e9ration aksyon sa yo Playmaker. (Tipikman rasin Aksyon Playmaker any\u00e8 a, subdirectories pral otomatikman pwodwi pou baz done GoogleFu)",
														"Pilih jalan yang GoogleFu akan menggunakan saat membuat tindakan Playmaker. (Biasanya akar Playmaker Actions direktori, subdirektori akan secara otomatis dihasilkan untuk database GoogleFu)",
														"Veldu lei\u00f0 sem GoogleFu mun nota \u00feegar a\u00f0 mynda sem snillinginn a\u00f0ger\u00f0ir. (Venjulega r\u00f3t snillinginn Actions skr\u00e1, undirm\u00f6ppum ver\u00f0ur sj\u00e1lfkrafa fyrir GoogleFu gagnagrunna)",
														"\u05d1\u05d7\u05e8 \u05d0\u05ea \u05d4\u05e0\u05ea\u05d9\u05d1 \u05e9GoogleFu \u05d9\u05e9\u05ea\u05de\u05e9 \u05d1\u05e2\u05ea \u05d9\u05e6\u05d9\u05e8\u05ea \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea. (\u05d1\u05d3\u05e8\u05da \u05db\u05dc\u05dc \u05d1\u05e1\u05e4\u05e8\u05d9\u05d9\u05ea \u05e4\u05e2\u05d5\u05dc\u05d5\u05ea \u05e4\u05e2\u05d9\u05dc\u05d5\u05ea \u05d4\u05e9\u05d5\u05e8\u05e9, \u05ea\u05d9\u05e7\u05d9\u05d5\u05ea \u05d4\u05de\u05e9\u05e0\u05d4 \u05d9\u05d5\u05e4\u05e7\u05d5 \u05d1\u05d0\u05d5\u05e4\u05df \u05d0\u05d5\u05d8\u05d5\u05de\u05d8\u05d9 \u05dc\u05de\u05d0\u05d2\u05e8 \u05e0\u05ea\u05d5\u05e0\u05d9 GoogleFu)",
														"Pasirinkite keli\u0105, kad GoogleFu naudos, kai generavimo \u012f\u017eaid\u0117jas veiksmus. (Paprastai \u0161aknis \u012f\u017eaid\u0117jas Veiksmai katalogas, pakatalogius bus sugeneruotas automati\u0161kai GoogleFu duomen\u0173 bazi\u0173)",
														"Izv\u0113lieties ce\u013c\u0161, kas GoogleFu izmantos, \u0123ener\u0113jot playmaker darb\u012bbas. (Parasti saknes playmaker Darb\u012bbas katalogs, subdirectories tiks autom\u0101tiski \u0123ener\u0113ts GoogleFu datub\u0101z\u0113m)",
														"\u0418\u0437\u0431\u0435\u0440\u0435\u0442\u0435 \u043f\u0430\u0442\u0435\u043a\u0430 \u043a\u043e\u0458\u0430 GoogleFu \u045c\u0435 \u0441\u0435 \u043a\u043e\u0440\u0438\u0441\u0442\u0438 \u043f\u0440\u0438 \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430\u045a\u0435 \u043d\u0430 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0438 \u043f\u043b\u0435\u0458\u043c\u0435\u0458\u043a\u0435\u0440. (\u041e\u0431\u0438\u0447\u043d\u043e \u043a\u043e\u0440\u0435\u043d\u043e\u0442 \u043f\u043b\u0435\u0458\u043c\u0435\u0458\u043a\u0435\u0440 \u041e\u043f\u0446\u0438\u0438 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u0443\u043c, \u043f\u043e\u0434\u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u0443\u043c\u0438 \u045c\u0435 \u0431\u0438\u0434\u0435 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430\u043d\u0430 \u0437\u0430 GoogleFu \u0431\u0430\u0437\u0438 \u043d\u0430 \u043f\u043e\u0434\u0430\u0442\u043e\u0446\u0438)",
														"Pilih jalan yang GoogleFu akan menggunakan apabila menjana tindakan perancang. (Biasanya akar direktori Tindakan perancang, subdirektori akan dijana secara automatik untuk pangkalan data GoogleFu)",
														"Ag\u0127\u017cel il-passa\u0121\u0121 li GoogleFu se tu\u017ca meta ji\u0121\u0121eneraw l-azzjonijiet playmaker. (Tipikament l-g\u0127erq Azzjonijiet playmaker direttorju, subdirectories se ji\u0121u \u0121\u0121enerati awtomatikament g\u0127al databases GoogleFu)",
														"Velg banen som GoogleFu skal bruke n\u00e5r du genererer playmakeren handlinger. (Vanligvis roten playmaker Handlinger katalogen, underkatalogene vil automatisk bli generert for GoogleFu databaser)",
														"Wybierz \u015bcie\u017ck\u0119, kt\u00f3ra GoogleFu b\u0119dzie u\u017cywa\u0142 podczas generowania dzia\u0142a\u0144 rozgrywaj\u0105cy. (Zazwyczaj g\u0142\u00f3wnym katalogu rozgrywaj\u0105cy Akcje, podkatalogi b\u0119d\u0105 generowane automatycznie dla baz danych GoogleFu)",
														"Escolha o caminho que GoogleFu vai usar ao gerar as a\u00e7\u00f5es organizador de jogo. (Normalmente o diret\u00f3rio A\u00e7\u00f5es Playmaker raiz, os subdiret\u00f3rios ser\u00e3o gerados automaticamente para bancos de dados GoogleFu)",
														"Selecta\u021bi calea pe care GoogleFu va folosi la generarea ac\u021biunile playmaker. (De obicei directorul playmaker Ac\u021biuni root, subdirectoarele vor fi generate automat pentru baze de date GoogleFu)",
														"Vyberte cestu, ktor\u00e1 GoogleFu bud\u00fa pou\u017e\u00edva\u0165 pri vytv\u00e1ran\u00ed opatren\u00ed tvrd\u00fdch pal\u00edc. (Obvykle kore\u0148ov\u00fd Tvorca hry Akcia adres\u00e1re, podadres\u00e1re bud\u00fa automaticky generovan\u00e9 datab\u00e1z GoogleFu)",
														"Izberite pot, ki bo GoogleFu uporabiti pri ustvarjanju dejanja Playmaker. (Zna\u010dilno je korenina Playmaker Actions imenik, podmape se bo samodejno ustvarjeno GoogleFu podatkovnih baz)",
														"Zgjidhni rrug\u00ebn q\u00eb GoogleFu do t\u00eb p\u00ebrdorin kur gjeneruar veprimet playmaker. (N\u00eb m\u00ebnyr\u00eb tipike root directory playmaker Veprimet, subdirectories do t\u00eb gjenerohet automatikisht p\u00ebr bazat e t\u00eb dh\u00ebnave GoogleFu)",
														"\u0418\u0437\u0430\u0431\u0435\u0440\u0438\u0442\u0435 \u043f\u0443\u0442\u0430\u045a\u0443 \u043a\u043e\u0458\u0430 \u045b\u0435 \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u043a\u043e\u0440\u0438\u0441\u0442\u0438\u0442\u0438 \u043f\u0440\u0438\u043b\u0438\u043a\u043e\u043c \u0433\u0435\u043d\u0435\u0440\u0438\u0441\u0430\u045a\u0430 \u043f\u043b\u0430\u0438\u043c\u0430\u043a\u0435\u0440 \u0430\u043a\u0446\u0438\u0458\u0435. (\u041e\u0431\u0438\u0447\u043d\u043e \u043a\u043e\u0440\u0435\u043d \u043f\u043b\u0435\u0458\u043c\u0435\u0458\u043a\u0435\u0440 \u0410\u043a\u0446\u0438\u0458\u0435 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u0458\u0443\u043c, \u043f\u043e\u0434\u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u0458\u0443\u043c\u0435 \u045b\u0435 \u0441\u0435 \u0430\u0443\u0442\u043e\u043c\u0430\u0442\u0441\u043a\u0438 \u0433\u0435\u043d\u0435\u0440\u0438\u0448\u0435 \u0437\u0430 \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u0431\u0430\u0437\u0435 \u043f\u043e\u0434\u0430\u0442\u0430\u043a\u0430)",
														"V\u00e4lj den v\u00e4g som GoogleFu kommer att anv\u00e4nda n\u00e4r du skapar speldirigenten \u00e5tg\u00e4rder. (Typiskt roten Playmaker \u00c5tg\u00e4rder katalog, underkataloger kommer att automatiskt bli GoogleFu databaser)",
