														"\u0e40\u0e25\u0e37\u0e2d\u0e01\u0e40\u0e2a\u0e49\u0e19\u0e17\u0e32\u0e07\u0e17\u0e35\u0e48 GoogleFu \u0e08\u0e30\u0e43\u0e0a\u0e49\u0e40\u0e21\u0e37\u0e48\u0e2d\u0e21\u0e35\u0e01\u0e32\u0e23\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e01\u0e32\u0e23\u0e01\u0e23\u0e30\u0e17\u0e33 Playmaker (\u0e42\u0e14\u0e22\u0e1b\u0e01\u0e15\u0e34\u0e23\u0e32\u0e01\u0e44\u0e14\u0e40\u0e23\u0e01\u0e17\u0e2d\u0e23\u0e35\u0e01\u0e23\u0e30\u0e17\u0e33 Playmaker \u0e44\u0e14\u0e40\u0e23\u0e01\u0e17\u0e2d\u0e23\u0e35\u0e22\u0e48\u0e2d\u0e22\u0e08\u0e30\u0e16\u0e39\u0e01\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e02\u0e36\u0e49\u0e19\u0e42\u0e14\u0e22\u0e2d\u0e31\u0e15\u0e42\u0e19\u0e21\u0e31\u0e15\u0e34\u0e2a\u0e33\u0e2b\u0e23\u0e31\u0e1a\u0e10\u0e32\u0e19\u0e02\u0e49\u0e2d\u0e21\u0e39\u0e25 GoogleFu)",
														"Piliin ang landas na GoogleFu gagamitin kapag bumubuo ng mga Playmaker mga pagkilos. (Karaniwan root directory Playmaker Mga Pagkilos, mga subdirectory ay awtomatikong nakabuo para sa mga database ng GoogleFu)",
														"Oyun kurucu eylemleri olu\u015ftururken GoogleFu kullanaca\u011f\u0131 yolu se\u00e7in. (Genellikle k\u00f6k Oyun kurucu Eylemler dizin, alt dizinleri otomatik GoogleFu veritabanlar\u0131 i\u00e7in olu\u015fturulur)",
														"\u0412\u0438\u0431\u0435\u0440\u0456\u0442\u044c \u0448\u043b\u044f\u0445, \u044f\u043a\u0438\u0439 GoogleFu \u0431\u0443\u0434\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0432\u0430\u0442\u0438 \u043f\u0440\u0438 \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u0456 \u0434\u0456\u0457 \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440\u0430. (\u0417\u0430\u0437\u0432\u0438\u0447\u0430\u0439 \u043a\u043e\u0440\u0435\u043d\u0435\u0432\u043e\u0457 \u043a\u0430\u0442\u0430\u043b\u043e\u0433 \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0414\u0456\u0457, \u043a\u0430\u0442\u0430\u043b\u043e\u0433\u0438 \u0431\u0443\u0434\u0443\u0442\u044c \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0434\u043b\u044f \u0431\u0430\u0437 \u0434\u0430\u043d\u0438\u0445 GoogleFu)",
														"\u05d0\u05d5\u05d9\u05e1\u05e7\u05dc\u05d9\u05d9\u05b7\u05d1\u05df \u05d3\u05d9 \u05d3\u05e8\u05da \u05d0\u05b7\u05d6 \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d5\u05d5\u05e2\u05d8 \u05e0\u05d5\u05e6\u05df \u05d5\u05d5\u05e2\u05df \u05d3\u05d6\u05e9\u05e2\u05e0\u05e2\u05e8\u05d9\u05d9\u05d8\u05d9\u05e0\u05d2 \u05d3\u05d9 \u05e4\u05bc\u05dc\u05d9\u05d9\u05b7\u05de\u05d0\u05b7\u05e7\u05e2\u05e8 \u05d0\u05b7\u05e7\u05e9\u05d0\u05b7\u05e0\u05d6. (\u05d8\u05d9\u05e4\u05bc\u05d9\u05e7\u05d0\u05b7\u05dc\u05dc\u05d9 \u05d3\u05d9 \u05e9\u05d5\u05e8\u05e9 \u05e4\u05bc\u05dc\u05d9\u05d9\u05b7\u05de\u05d0\u05b7\u05e7\u05e2\u05e8 \u05d0\u05b7\u05e7\u05d8\u05d9\u05d0\u05b8\u05e0\u05e1 \u05d5\u05d5\u05e2\u05d2\u05d5\u05d5\u05d9\u05d9\u05b7\u05d6\u05e2\u05e8, \u05e1\u05d5\u05d1\u05d3\u05d9\u05e8\u05e2\u05e7\u05d8\u05d0\u05b8\u05e8\u05d9\u05e2\u05e1 \u05d5\u05d5\u05e2\u05d8 \u05d5\u05d5\u05e2\u05e8\u05df \u05d0\u05d5\u05d9\u05d8\u05d0\u05b8\u05de\u05d0\u05b7\u05d8\u05d9\u05e9 \u05d3\u05d6\u05e9\u05e2\u05e0\u05e2\u05e8\u05d9\u05d9\u05d8\u05d0\u05b7\u05d3 \u05e4\u05bf\u05d0\u05b7\u05e8 \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d3\u05d9\u05d9\u05d8\u05d0\u05b7\u05d1\u05d9\u05d9\u05e1\u05d9\u05d6)",
