			Rows.Add( new LocalizationRow("Add a published workbook manually by copying the URL of the workbook and pasting it into the box below. The workbook will be checked for validity and made available to export if GoogleFu determines that it can access it.",
														"Ajouter un classeur publi\u00e9 manuellement en copiant l'URL du classeur et de le coller dans le champ ci-dessous. Le classeur sera v\u00e9rifi\u00e9e la validit\u00e9 et la mise \u00e0 disposition d'exporter si GoogleFu d\u00e9termine qu'il ne peut y acc\u00e9der.",
														"Aggiungere una cartella di lavoro pubblicata manualmente copiando l'URL della cartella di lavoro e incollarlo nella casella qui sotto. La cartella di lavoro verr\u00e0 controllato per la validit\u00e0 e reso disponibile per l'esportazione se GoogleFu determina che pu\u00f2 accedervi.",
														"F\u00fcgen Sie eine Arbeitsmappe ver\u00f6ffentlicht manuell durch Kopieren der URL der Arbeitsmappe und es in das Feld unten einf\u00fcgen. Die Arbeitsmappe wird auf G\u00fcltigkeit \u00fcberpr\u00fcft und zur Verf\u00fcgung zu exportieren, wenn GoogleFu bestimmt, dass es auf sie zugreifen werden.",
														"A\u00f1adir un libro publicado manualmente copiando el URL del libro y pegarlo en el cuadro de abajo. El libro de trabajo se comprobar\u00e1 la validez y la pondr\u00e1 a disposici\u00f3n de exportar si googleFU determina que puede acceder a \u00e9l.",
														"\u0625\u0636\u0627\u0641\u0629 \u0645\u0635\u0646\u0641 \u0646\u0634\u0631\u062a \u064a\u062f\u0648\u064a\u0627 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0646\u0633\u062e \u0645\u0646 \u0627\u0644\u0645\u0635\u0646\u0641 URL \u0648\u0644\u0635\u0642\u0647 \u0641\u064a \u0627\u0644\u0645\u0631\u0628\u0639 \u0623\u062f\u0646\u0627\u0647. \u0648\u0633\u064a\u062a\u0645 \u0641\u062d\u0635 \u0627\u0644\u0645\u0635\u0646\u0641 \u0635\u062d\u0629 \u0648\u0625\u062a\u0627\u062d\u062a\u0647\u0627 \u0644\u0644\u062a\u0635\u062f\u064a\u0631 \u0625\u0630\u0627 \u0642\u0631\u0631 GoogleFu \u0623\u0646\u0647 \u064a\u0645\u0643\u0646 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u064a\u0647.",
														"\ud1b5\ud569 \ubb38\uc11c\uc758 URL\uc744 \ubcf5\uc0ac\ud558\uace0 \uc544\ub798\uc758 \uc0c1\uc790\uc5d0 \ubd99\uc5ec \uc218\ub3d9\uc73c\ub85c \uac8c\uc2dc \ub41c \ud1b5\ud569 \ubb38\uc11c\ub97c \ucd94\uac00\ud569\ub2c8\ub2e4. \ud1b5\ud569 \ubb38\uc11c\uc758 \uc720\ud6a8\uc131\uc744 \ud655\uc778\ud558\uace0 GoogleFu\uc774 \uadf8\uac83\uc744 \uc561\uc138\uc2a4 \ud560 \uc218 \uc788\ub294\uc9c0 \ud310\ub2e8 \ud560 \uacbd\uc6b0 \uc218\ucd9c \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
														"\u901a\u8fc7\u590d\u5236\u5de5\u4f5c\u7c3f\u7684URL\u5e76\u7c98\u8d34\u5230\u4e0b\u9762\u7684\u6846\u4e2d\u624b\u52a8\u6dfb\u52a0\u53d1\u5e03\u7684\u5de5\u4f5c\u7c3f\u3002\u5de5\u4f5c\u7c3f\u5c06\u88ab\u68c0\u67e5\u7684\u6709\u6548\u6027\uff0c\u5e76\u63d0\u4f9b\u51fa\u53e3\uff0c\u5982\u679cGoogleFu\u51b3\u5b9a\u4e86\u5b83\u53ef\u4ee5\u8bbf\u95ee\u5b83\u3002",
														"\u30ef\u30fc\u30af\u30d6\u30c3\u30af\u306eURL\u3092\u30b3\u30d4\u30fc\u3057\u3001\u4e0b\u306e\u30dc\u30c3\u30af\u30b9\u306b\u8cbc\u308a\u4ed8\u3051\u308b\u3053\u3068\u3067\u3001\u624b\u52d5\u3067\u516c\u958b\u30ef\u30fc\u30af\u30d6\u30c3\u30af\u3092\u8ffd\u52a0\u3057\u307e\u3059\u3002\u30ef\u30fc\u30af\u30d6\u30c3\u30af\u306f\u3001\u59a5\u5f53\u6027\u3092\u30c1\u30a7\u30c3\u30af\u3057\u3001GoogleFu\u306f\u305d\u308c\u306b\u30a2\u30af\u30bb\u30b9\u3067\u304d\u308b\u3068\u5224\u65ad\u3057\u305f\u5834\u5408\u306b\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u3059\u308b\u3053\u3068\u304c\u5229\u7528\u53ef\u80fd\u306b\u306a\u308a\u307e\u3059\u3002",
														"\u0414\u043e\u0431\u0430\u0432\u0438\u0442\u044c \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u043d\u043e\u0433\u043e \u043a\u043d\u0438\u0433\u0443 \u0432\u0440\u0443\u0447\u043d\u0443\u044e, \u0441\u043a\u043e\u043f\u0438\u0440\u043e\u0432\u0430\u0432 URL \u0440\u0430\u0431\u043e\u0447\u0435\u0439 \u043a\u043d\u0438\u0433\u0438 \u0438 \u0432\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0435\u0433\u043e \u0432 \u043f\u043e\u043b\u0435 \u043d\u0438\u0436\u0435. \u0423\u0447\u0435\u0431\u043d\u043e\u0435 \u043f\u043e\u0441\u043e\u0431\u0438\u0435 \u0431\u0443\u0434\u0435\u0442 \u043f\u0440\u043e\u0432\u0435\u0440\u0435\u043d\u043e \u0438 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u044b \u0434\u043b\u044f \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0430, \u0435\u0441\u043b\u0438 GoogleFu \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u0435\u0442, \u0447\u0442\u043e \u043e\u043d \u043c\u043e\u0436\u0435\u0442 \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u044c \u043a \u043d\u0435\u043c\u0443 \u0434\u043e\u0441\u0442\u0443\u043f.",
														"Th\u00eam m\u1ed9t b\u1ea3ng t\u00ednh \u0111\u01b0\u1ee3c xu\u1ea5t b\u1ea3n b\u1eb1ng tay b\u1eb1ng c\u00e1ch sao ch\u00e9p URL c\u1ee7a t\u1eadp tin v\u00e0 d\u00e1n n\u00f3 v\u00e0o h\u1ed9p d\u01b0\u1edbi \u0111\u00e2y. S\u00e1ch s\u1ebd \u0111\u01b0\u1ee3c ki\u1ec3m tra t\u00ednh h\u1ee3p l\u1ec7 v\u00e0 s\u1eb5n s\u00e0ng cho xu\u1ea5t kh\u1ea9u n\u1ebfu GoogleFu x\u00e1c \u0111\u1ecbnh r\u1eb1ng n\u00f3 c\u00f3 th\u1ec3 truy c\u1eadp n\u00f3.",
