														"\u82e5\u8dcc\u7834\u8be5\u5217\u5b9a\u4e49\u7684\u7b2c\u4e00\u884c\u5305\u542b\u7684\u503c\u7c7b\u578b\uff08\u5b57\u7b26\u4e32\uff0c\u6574\u6570\uff0c\u7b49..\uff09\uff0c\u7136\u540e\u9009\u4e2d\u8be5\u590d\u9009\u6846\uff0cGoogleFu\u5c06\u5c1d\u8bd5\u521b\u5efa\u6307\u5b9a\u7c7b\u578b\u7684\u53d8\u91cf\u7684\u6570\u636e\u5e93\u3002\u5426\u5219GoogleFu\u5c06\u627f\u62c5\u6240\u6709\u7684\u503c\u662f\u5b57\u7b26\u4e32\u3002",
														"\u5217\u5b9a\u7fa9\u306e\u4e0b\u306e\u6700\u521d\u306e\u884c\u306f\u5024\u578b\uff08\u6587\u5b57\u5217\u3001\u6574\u6570\u3001\u306a\u3069\uff09\u306f\u3001\u3053\u306e\u30c1\u30a7\u30c3\u30af\u30dc\u30c3\u30af\u30b9\u3092\u30aa\u30f3\u306b\u542b\u307e\u308c\u3066\u3044\u308b\u5834\u5408\u306f\u3001GoogleFu\u306f\u3001\u6307\u5b9a\u3055\u308c\u305f\u578b\u306e\u5909\u6570\u3092\u4f7f\u7528\u3057\u3066\u30c7\u30fc\u30bf\u30d9\u30fc\u30b9\u3092\u4f5c\u6210\u3057\u3088\u3046\u3068\u3057\u307e\u3059\u3002\u305d\u3046\u3057\u306a\u3044\u3068GoogleFu\u3059\u3079\u3066\u306e\u5024\u304c\u6587\u5b57\u5217\u3067\u3042\u308b\u3068\u60f3\u5b9a\u3057\u307e\u3059\u3002",
														"\u0415\u0441\u043b\u0438 \u043f\u0435\u0440\u0432\u0430\u044f \u0441\u0442\u0440\u043e\u043a\u0430 \u043d\u0438\u0436\u0435 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u0439 \u0441\u0442\u043e\u043b\u0431\u0446\u043e\u0432 \u0441\u043e\u0434\u0435\u0440\u0436\u0438\u0442 \u0442\u0438\u043f\u044b \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0439 (\u0441\u0442\u0440\u043e\u043a\u0430, INT, \u0438 \u0442.\u0434. ..), \u0442\u043e \u044d\u0442\u043e\u0442 \u0444\u043b\u0430\u0436\u043e\u043a, GoogleFu \u043f\u043e\u043f\u044b\u0442\u0430\u0435\u0442\u0441\u044f \u0441\u043e\u0437\u0434\u0430\u0442\u044c \u0431\u0430\u0437\u0443 \u0434\u0430\u043d\u043d\u044b\u0445 \u0441 \u043f\u0435\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u043c \u0443\u043a\u0430\u0437\u0430\u043d\u043d\u044b\u0445 \u0442\u0438\u043f\u043e\u0432. \u0412 \u043f\u0440\u043e\u0442\u0438\u0432\u043d\u043e\u043c \u0441\u043b\u0443\u0447\u0430\u0435 GoogleFu \u0431\u0443\u0434\u0435\u0442 \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0442\u044c \u0432\u0441\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f, \u0447\u0442\u043e\u0431\u044b \u0431\u044b\u0442\u044c \u0441\u0442\u0440\u043e\u043a\u0430\u043c\u0438.",
														"N\u1ebfu d\u00f2ng \u0111\u1ea7u ti\u00ean d\u01b0\u1edbi \u0111\u00e2y \u0111\u1ecbnh ngh\u0129a c\u1ed9t ch\u1ee9a c\u00e1c lo\u1ea1i gi\u00e1 tr\u1ecb (string, int, vv ..) sau \u0111\u00f3 \u0111\u00e1nh d\u1ea5u v\u00e0o \u00f4 n\u00e0y, GoogleFu s\u1ebd c\u1ed1 g\u1eafng \u0111\u1ec3 t\u1ea1o ra m\u1ed9t c\u01a1 s\u1edf d\u1eef li\u1ec7u v\u1edbi c\u00e1c bi\u1ebfn s\u1ed1 c\u1ee7a lo\u1ea1i \u0111\u01b0\u1ee3c x\u00e1c \u0111\u1ecbnh. N\u1ebfu kh\u00f4ng GoogleFu s\u1ebd gi\u1ea3 \u0111\u1ecbnh t\u1ea5t c\u1ea3 c\u00e1c gi\u00e1 tr\u1ecb l\u00e0 chu\u1ed7i.",
														"Als de eerste rij onder de kolom definities bevat de types waarde (string, int, etc ..) check dan deze verpakking vindt GoogleFu proberen om een \u200b\u200bdatabase met variabelen van de gespecificeerde types te cre\u00ebren. Anders GoogleFu zullen alle waarden aannemen om strings te zijn.",
														"As die eerste ry onder die kolom definisies bevat die waarde tipes (string, int, ens ..), dan gaan hierdie boks, sal GoogleFu probeer om 'n databasis met veranderlikes van die gespesifiseerde tipes te skep. Anders GoogleFu alle waardes sal aanvaar snare te wees.",
														"\u0410\u043a\u043e \u043d\u0430 \u043f\u044a\u0440\u0432\u0438\u044f \u0440\u0435\u0434 \u043f\u043e-\u0434\u043e\u043b\u0443 \u0434\u0435\u0444\u0438\u043d\u0438\u0446\u0438\u0438 \u043d\u0430 \u043a\u043e\u043b\u043e\u043d\u0438\u0442\u0435 \u0441\u044a\u0434\u044a\u0440\u0436\u0430 \u0442\u0438\u043f\u043e\u0432\u0435\u0442\u0435 \u0441\u0442\u043e\u0439\u043d\u043e\u0441\u0442 (\u043d\u0438\u0437, \u041f\u041d\u0410, \u0438 \u0442.\u043d. ..), \u0441\u043b\u0435\u0434 \u0442\u043e\u0432\u0430 \u043c\u0430\u0440\u043a\u0438\u0440\u0430\u0439\u0442\u0435 \u0442\u0430\u0437\u0438 \u043e\u0442\u043c\u0435\u0442\u043a\u0430, GoogleFu \u0449\u0435 \u0441\u0435 \u043e\u043f\u0438\u0442\u0430 \u0434\u0430 \u0441\u0435 \u0441\u044a\u0437\u0434\u0430\u0434\u0435 \u0431\u0430\u0437\u0430 \u0434\u0430\u043d\u043d\u0438 \u0441 \u043f\u0440\u043e\u043c\u0435\u043d\u043b\u0438\u0432\u0438 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0441\u0442\u0438\u043a\u0438 \u043d\u0430 \u043f\u043e\u0441\u043e\u0447\u0435\u043d\u0438\u0442\u0435 \u0432\u0438\u0434\u043e\u0432\u0435. \u0412 \u043f\u0440\u043e\u0442\u0438\u0432\u0435\u043d \u0441\u043b\u0443\u0447\u0430\u0439 GoogleFu \u0449\u0435 \u043f\u043e\u0435\u043c\u0435 \u0432\u0441\u0438\u0447\u043a\u0438 \u0441\u0442\u043e\u0439\u043d\u043e\u0441\u0442\u0438 \u0434\u0430 \u0441\u0430 \u0441\u0442\u0440\u0443\u043d\u0438.",
														"\u041a\u0430\u043b\u0456 \u043f\u0435\u0440\u0448\u0430\u044f \u0440\u0430\u0434\u043e\u043a \u043d\u0456\u0436\u044d\u0439 \u0430\u0437\u043d\u0430\u0447\u044d\u043d\u043d\u044f\u045e \u0441\u043b\u0443\u043f\u043a\u043e\u045e \u045e\u0442\u0440\u044b\u043c\u043b\u0456\u0432\u0430\u0435 \u0442\u044b\u043f\u044b \u0437\u043d\u0430\u0447\u044d\u043d\u043d\u044f\u045e (\u0440\u0430\u0434\u043e\u043a, INT, \u0456 \u0433.\u0434. ..), \u0442\u043e \u0433\u044d\u0442\u044b \u0441\u0446\u044f\u0436\u043e\u043a, GoogleFu \u043f\u0430\u0441\u043f\u0440\u0430\u0431\u0443\u0435 \u0441\u0442\u0432\u0430\u0440\u044b\u0446\u044c \u0431\u0430\u0437\u0443 \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u0445 \u0437 \u043f\u0435\u0440\u0430\u043c\u0435\u043d\u043d\u044b\u043c \u043d\u0430\u0437\u0432\u0430\u043d\u044b\u0445 \u0442\u044b\u043f\u0430\u045e. \u0423 \u0430\u0434\u0432\u0430\u0440\u043e\u0442\u043d\u044b\u043c \u0432\u044b\u043f\u0430\u0434\u043a\u0443 GoogleFu \u0431\u0443\u0434\u0437\u0435 \u043f\u0440\u044b\u043c\u0430\u0446\u044c \u0443\u0441\u0435 \u0437\u043d\u0430\u0447\u044d\u043d\u043d\u044f, \u043a\u0430\u0431 \u0431\u044b\u0446\u044c \u0440\u0430\u0434\u043a\u0430\u043c\u0456.",
														"Si la primera fila sota les definicions de columna cont\u00e9 els tipus de valor (cadena, int, etc ..) i despr\u00e9s marqueu aquesta casella, googleFU intentar\u00e0 crear una base de dades amb les variables dels tipus especificats. En cas contrari googleFU assumir\u00e0 tots els valors a ser cadenes.",
														"Pokud prvn\u00ed \u0159\u00e1dek pod definice sloupc\u016f obsahuje hodnotov\u00e9 typy (string, int, etc ..), pak za\u0161krtn\u011bte toto pol\u00ed\u010dko, bude GoogleFu pokus\u00ed vytvo\u0159it datab\u00e1zi prom\u011bnn\u00fdch uveden\u00fdch typ\u016f. V opa\u010dn\u00e9m p\u0159\u00edpad\u011b bude GoogleFu p\u0159evz\u00edt v\u0161echny hodnoty jako \u0159et\u011bzce.",
														"Os bydd y rhes gyntaf o dan y diffiniadau colofn yn cynnwys y mathau gwerth (llinyn, int, etc ..), yna gwiriwch y blwch yma, bydd GoogleFu ceisio creu cronfa ddata gyda newidynnau o'r mathau a bennir. Fel arall, bydd yn cymryd yn ganiataol GoogleFu pob gwerth i fod llinynnau.",
														"Kui esimene rida allpool veerus m\u00f5isteid sisaldab v\u00e4\u00e4rtust t\u00fc\u00fcpi (string, int jne ..), siis m\u00e4rgi see kast, GoogleFu p\u00fc\u00fcab luua andmebaasi muutujad kindlaksm\u00e4\u00e4ratud liiki. Vastasel GoogleFu t\u00e4idab k\u00f5ik v\u00e4\u00e4rtused olema stringe.",
														"\u0627\u06af\u0631 \u0627\u0648\u0644\u06cc\u0646 \u0633\u0637\u0631 \u0632\u06cc\u0631 \u062a\u0639\u0631\u06cc\u0641 \u0633\u062a\u0648\u0646 \u0634\u0627\u0645\u0644 \u0627\u0646\u0648\u0627\u0639 \u0627\u0631\u0632\u0634 (\u0631\u0634\u062a\u0647\u060c \u0627\u0639\u0636\u0627\u06cc \u0647\u06cc\u0627\u062a\u060c \u0648 \u063a\u06cc\u0631\u0647.) \u0633\u067e\u0633 \u0628\u0631\u0631\u0633\u06cc \u0627\u06cc\u0646 \u06a9\u0627\u062f\u0631\u060c GoogleFu \u062a\u0644\u0627\u0634 \u062e\u0648\u0627\u0647\u062f \u06a9\u0631\u062f \u0628\u0647 \u0627\u06cc\u062c\u0627\u062f \u06cc\u06a9 \u067e\u0627\u06cc\u06af\u0627\u0647 \u062f\u0627\u062f\u0647 \u0628\u0627 \u0645\u062a\u063a\u06cc\u0631\u0647\u0627\u06cc \u0627\u0632 \u0646\u0648\u0639 \u0645\u0634\u062e\u0635 \u0634\u062f\u0647 \u0627\u0633\u062a. \u062f\u0631 \u063a\u06cc\u0631 \u0627\u06cc\u0646 \u0635\u0648\u0631\u062a GoogleFu \u0647\u0645\u0647 \u0627\u0631\u0632\u0634 \u0641\u0631\u0636 \u06a9\u0646\u06cc\u0645 \u0628\u0647 \u0631\u0634\u062a\u0647.",
														"Jos ensimm\u00e4inen rivi alla sarakem\u00e4\u00e4rityksi\u00e4 sis\u00e4lt\u00e4\u00e4 arvon tyypit (merkkijono, int, etc ..) valitse t\u00e4m\u00e4 nappi, GoogleFu yritt\u00e4\u00e4 luoda tietokanta, jossa muuttujat erityiseen tyyppiin. Muuten GoogleFu olettaa kaikkien arvojen olevan jouset.",
														"M\u00e1 t\u00e1 an ch\u00e9ad sraith faoi bhun na sainmh\u00ednithe col\u00fan na cine\u00e1lacha luach (teaghr\u00e1n, o, etc ..) ansin a sheice\u00e1il sa bhosca seo, beidh GoogleFu iarracht chun bunachar sonra\u00ed a bhfuil athr\u00f3g de na cine\u00e1lacha a shonra\u00edtear a chruth\u00fa. Seachas sin beidh GoogleFu glacadh ar fad na luachanna a bheith teaghr\u00e1in.",
														"Se a primeira li\u00f1a por debaixo das definici\u00f3ns de columna cont\u00e9n tipo de valor (cadea, int, etc ..) marque esta caixa, GoogleFu intentar\u00e1 crear unha base de datos coas variables dos tipos especificados. Se non GoogleFu asumir\u00e1 todos os valores que se cadeas.",
														"\u0938\u094d\u0924\u0902\u092d \u092a\u0930\u093f\u092d\u093e\u0937\u093e\u0913\u0902 \u0928\u0940\u091a\u0947 \u092a\u0939\u0932\u0940 \u092a\u0902\u0915\u094d\u0924\u093f \u092e\u0942\u0932\u094d\u092f \u092a\u094d\u0930\u0915\u093e\u0930 (\u0938\u094d\u091f\u094d\u0930\u093f\u0902\u0917, \u092a\u0942\u0930\u094d\u0923\u093e\u0902\u0915, \u0906\u0926\u093f ..) \u0924\u094b \u0907\u0938 \u092c\u0949\u0915\u094d\u0938 \u0915\u0940 \u091c\u093e\u0902\u091a \u092e\u0947\u0902 \u0936\u093e\u092e\u093f\u0932 \u0939\u0948\u0902, GoogleFu \u0928\u093f\u0930\u094d\u0926\u093f\u0937\u094d\u091f \u092a\u094d\u0930\u0915\u093e\u0930 \u0915\u0947 \u091a\u0930 \u0915\u0947 \u0938\u093e\u0925 \u090f\u0915 \u0921\u0947\u091f\u093e\u092c\u0947\u0938 \u092c\u0928\u093e\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u092a\u094d\u0930\u092f\u093e\u0938 \u0915\u0930\u0947\u0902\u0917\u0947. \u0905\u0928\u094d\u092f\u0925\u093e GoogleFu \u0924\u093e\u0930 \u0939\u094b\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0938\u092d\u0940 \u092e\u093e\u0928\u094b\u0902 \u0917\u094d\u0930\u0939\u0923 \u0915\u0930\u0947\u0902\u0917\u0947.",
														"Ako prvi redak ispod definicijama stupac sadr\u017ei vrste \u0161to je vrijednost (string, int, itd ..), a zatim ozna\u010dite ovu ku\u0107icu, GoogleFu \u0107e poku\u0161ati stvoriti bazu podataka s varijabli navedenih tipova. Ina\u010de GoogleFu \u0107e preuzeti sve vrijednosti koje \u0107e se \u017eice.",
														"Si premye ranje ki anba la a definisyon yo kol\u00f2n gen kalite yo val\u00e8 (fis\u00e8l, int, elatriye ..) L\u00e8 sa a, tcheke ti kare sa a, GoogleFu pral eseye kreye yon baz done ak varyab nan kalite yo espesifye. Otreman GoogleFu pral asime tout val\u00e8 yo dwe strings.",
														"Jika baris pertama di bawah definisi kolom berisi jenis nilai (string, int, dll ..) kemudian memeriksa kotak ini, GoogleFu akan mencoba untuk membuat database dengan variabel jenis tertentu. Jika tidak GoogleFu akan menganggap semua nilai menjadi string.",
														"Ef fyrsta r\u00f6\u00f0in fyrir ne\u00f0an skilgreiningar inniheldur gildi tegundir (strengur, int, osfrv ..) \u00fe\u00e1 st\u00f6\u00f0va \u00feennan reit GoogleFu mun reyna a\u00f0 b\u00faa til gagnagrunn me\u00f0 breytur \u00ed tilgreindum tegundum. Annars GoogleFu mun taka \u00f6ll gildi a\u00f0 vera strengir.",
														"\u05d0\u05dd \u05d4\u05e9\u05d5\u05e8\u05d4 \u05d4\u05e8\u05d0\u05e9\u05d5\u05e0\u05d4 \u05de\u05ea\u05d7\u05ea \u05dc\u05d4\u05d2\u05d3\u05e8\u05d5\u05ea \u05d4\u05e2\u05de\u05d5\u05d3\u05d4 \u05de\u05db\u05d9\u05dc\u05d4 \u05e1\u05d5\u05d2\u05d9 \u05d4\u05e2\u05e8\u05da (\u05de\u05d7\u05e8\u05d5\u05d6\u05ea, int, \u05d5\u05db\u05d5 '..) \u05d5\u05dc\u05d0\u05d7\u05e8 \u05de\u05db\u05df \u05dc\u05d1\u05d3\u05d5\u05e7 \u05d0\u05ea \u05d4\u05ea\u05d9\u05d1\u05d4 \u05d4\u05d6\u05d5, GoogleFu \u05d9\u05e0\u05e1\u05d4 \u05dc\u05d9\u05e6\u05d5\u05e8 \u05de\u05e1\u05d3 \u05e0\u05ea\u05d5\u05e0\u05d9\u05dd \u05e2\u05dd \u05de\u05e9\u05ea\u05e0\u05d9\u05dd \u05de\u05d4\u05e1\u05d5\u05d2\u05d9\u05dd \u05e9\u05e6\u05d5\u05d9\u05e0\u05d5. \u05d0\u05d7\u05e8\u05ea GoogleFu \u05d9\u05e0\u05d9\u05d7 \u05d0\u05ea \u05db\u05dc \u05d4\u05e2\u05e8\u05db\u05d9\u05dd \u05dc\u05d4\u05d9\u05d5\u05ea \u05de\u05d7\u05e8\u05d5\u05d6\u05d5\u05ea.",
														"Jei pirm\u0105 eilut\u0119 \u017eemiau stulpeli\u0173 apibr\u0117\u017eimai yra tipus vert\u0117s (string, int ir tt ..) pa\u017eym\u0117ti \u0161\u012f langel\u012f, tada GoogleFu bandys sukurti duomen\u0173 baz\u0119 su kintam\u0173j\u0173, nurodyt\u0173 tip\u0173. Prie\u0161ingu GoogleFu laikys visas vertybes, kad b\u016bt\u0173 stygos.",
														"Ja pirmaj\u0101 rind\u0101 zem kolonnu defin\u012bcijas satur v\u0113rt\u012bbu veidus (string, int, utt ..), p\u0113c tam p\u0101rbaud\u012bt \u0161o lodzi\u0146u, GoogleFu m\u0113\u0123in\u0101s izveidot datu b\u0101zi ar main\u012bgajiem nor\u0101d\u012btajiem veidiem. Pret\u0113j\u0101 GoogleFu uz\u0146emsies visas v\u0113rt\u012bbas ir st\u012bgas.",
														"\u0410\u043a\u043e \u043f\u0440\u0432\u0438\u043e\u0442 \u0440\u0435\u0434 \u043f\u043e\u0434 \u043a\u043e\u043b\u043e\u043d\u0430 \u0434\u0435\u0444\u0438\u043d\u0438\u0446\u0438\u0438 \u0441\u043e\u0434\u0440\u0436\u0438 \u0432\u0440\u0435\u0434\u043d\u043e\u0441\u0442\u0430 \u0442\u0438\u043f\u043e\u0432\u0438 (\u0441\u0442\u0440\u0438\u043d\u0433, \u0446\u0435\u043b, \u0438\u0442\u043d ..), \u0442\u043e\u0433\u0430\u0448 \u0438\u0437\u0431\u0435\u0440\u0435\u0442\u0435 \u0458\u0430 \u043e\u0432\u0430\u0430 \u043e\u043f\u0446\u0438\u0458\u0430, GoogleFu \u045c\u0435 \u043f\u0440\u043e\u0431\u0430\u0430\u0442 \u0434\u0430 \u0441\u0435 \u0441\u043e\u0437\u0434\u0430\u0434\u0435 \u0431\u0430\u0437\u0430 \u043d\u0430 \u043f\u043e\u0434\u0430\u0442\u043e\u0446\u0438 \u0441\u043e \u043f\u0440\u043e\u043c\u0435\u043d\u043b\u0438\u0432\u0438 \u043d\u0430 \u0441\u043f\u0435\u0446\u0438\u0444\u0438\u0447\u043d\u0438 \u0432\u0438\u0434\u043e\u0432\u0438. \u0418\u043d\u0430\u043a\u0443 GoogleFu \u045c\u0435 \u0433\u0438 \u043f\u0440\u0435\u0437\u0435\u043c\u0435 \u0441\u0438\u0442\u0435 \u0432\u0440\u0435\u0434\u043d\u043e\u0441\u0442\u0438 \u0434\u0430 \u0431\u0438\u0434\u0430\u0442 \u0436\u0438\u0446\u0438.",
														"Jika baris pertama di bawah takrifan kolum mengandungi jenis nilai (string, int, dan lain-lain ..) kemudian semak kotak ini, GoogleFu akan cuba untuk mewujudkan satu pangkalan data dengan pembolehubah daripada jenis yang dinyatakan. Jika tidak GoogleFu akan mengambil alih semua nilai menjadi tali.",
														"Jekk l-ewwel ringiela ta\u0127t id-definizzjonijiet kolonna fiha t-tipi ta 'valur (string, INT, e\u010b\u010b ..) mbag\u0127ad ti\u010b\u010bekkja din il-kaxxa, GoogleFu se tipprova li tin\u0127oloq database ma' varjabbli tat-tipi spe\u010bifikati. Inkella GoogleFu ser tassumi l-valuri kollha li jkunu kordi.",
														"Hvis den f\u00f8rste raden under kolonnedefinisjonene inneholder verdityper (string, int, etc ..) s\u00e5 sjekk denne boksen, vil GoogleFu fors\u00f8ke \u00e5 lage en database med variabler av de spesifiserte typer. Ellers vil GoogleFu anta alle verdier \u00e5 v\u00e6re strenger.",
														"Je\u015bli pierwszy wiersz poni\u017cej definicji kolumna zawiera typy warto\u015bci (string, int, etc ..), nast\u0119pnie zaznaczy\u0107 to pole, GoogleFu spr\u00f3buje utworzy\u0107 baz\u0119 danych zmiennych okre\u015blonych typ\u00f3w. Inaczej GoogleFu przejmie wszystkie warto\u015bci za sznurki.",
														"Se a primeira linha abaixo das defini\u00e7\u00f5es de coluna cont\u00e9m os tipos de valor (string, int, etc ..) marque essa caixa, GoogleFu tentar\u00e1 criar um banco de dados com as vari\u00e1veis \u200b\u200bdos tipos especificados. Caso contr\u00e1rio GoogleFu assumir\u00e1 todos os valores a ser strings.",
														"Dac\u0103 primul r\u00e2nd de mai jos defini\u021biile de coloan\u0103 con\u021bine tipuri de valoare (string, int, etc ..), apoi verifica\u021bi aceast\u0103 caset\u0103, GoogleFu va \u00eencerca s\u0103 creeze o baz\u0103 de date cu variabile ale tipurilor specificate. \u00cen caz contrar, GoogleFu va asuma toate valorile s\u0103 fie siruri de caractere.",
														"Ak prv\u00fd riadok pod defin\u00edcie st\u013apcov obsahuje hodnotov\u00e9 typy (string, int, etc ..), potom za\u0161krtnite toto pol\u00ed\u010dko, bude GoogleFu pok\u00fasi vytvori\u0165 datab\u00e1zu premenn\u00fdch uveden\u00fdch typov. V opa\u010dnom pr\u00edpade bude GoogleFu prevzia\u0165 v\u0161etky hodnoty ako re\u0165azce.",
														"\u010ce prva vrstica pod opredelitvami stolpec vsebuje vrste vrednosti (niz, int, itd ..), nato potrdite to polje, bo GoogleFu posku\u0161ali ustvariti zbirko podatkov s spremenljivkami opredeljenih vrst. V nasprotnem primeru bo GoogleFu prevzeti vse vrednosti, da se strune.",
														"N\u00ebse n\u00eb radh\u00ebn e par\u00eb m\u00eb posht\u00eb p\u00ebrkufizimet kolona p\u00ebrmban llojet vler\u00eb (string, int, etj ..), at\u00ebher\u00eb kontrolloni k\u00ebt\u00eb kuti, GoogleFu do t\u00eb p\u00ebrpiqet t\u00eb krijoj\u00eb nj\u00eb baz\u00eb t\u00eb dh\u00ebnash me variablat e lloje t\u00eb specifikuara. P\u00ebrndryshe GoogleFu do t\u00eb marr\u00eb t\u00eb gjitha vlerat t\u00eb jen\u00eb vargjet.",
														"\u0423\u043a\u043e\u043b\u0438\u043a\u043e \u043f\u0440\u0432\u0438 \u0440\u0435\u0434 \u0438\u0441\u043f\u043e\u0434 \u0434\u0435\u0444\u0438\u043d\u0438\u0446\u0438\u0458\u0430 \u043a\u043e\u043b\u043e\u043d\u0430 \u0441\u0430\u0434\u0440\u0436\u0438 \u0442\u0438\u043f\u043e\u0432\u0435 \u0432\u0440\u0435\u0434\u043d\u043e\u0441\u0442\u0438 (\u0421\u0442\u0440\u0438\u043d\u0433, \u0438\u043d\u0442, \u0438\u0442\u0434 ..) \u0430 \u0437\u0430\u0442\u0438\u043c \u043f\u0440\u043e\u0432\u0435\u0440\u0438\u0442\u0435 \u043e\u0432\u0443 \u043a\u0443\u045b\u0438\u0446\u0443, \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u045b\u0435 \u043f\u043e\u043a\u0443\u0448\u0430\u0442\u0438 \u0434\u0430 \u0441\u0442\u0432\u043e\u0440\u0438 \u0431\u0430\u0437\u0443 \u043f\u043e\u0434\u0430\u0442\u0430\u043a\u0430 \u0441\u0430 \u043f\u0440\u043e\u043c\u0435\u043d\u0459\u0438\u0432\u0438\u0445 \u043d\u0430 \u043e\u0434\u0440\u0435\u0434\u0458\u0435\u043d\u0435 \u0432\u0440\u0441\u0442\u0435. \u0423 \u0441\u0443\u043f\u0440\u043e\u0442\u043d\u043e\u043c \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u045b\u0435 \u043f\u0440\u0435\u0443\u0437\u0435\u0442\u0438 \u0441\u0432\u0435 \u0432\u0440\u0435\u0434\u043d\u043e\u0441\u0442\u0438 \u0434\u0430 \u0431\u0443\u0434\u0435 \u0436\u0438\u0446\u0435.",
														"Om den f\u00f6rsta raden under kolumndefinitioner inneh\u00e5ller v\u00e4rdetyper (str\u00e4ng, int, etc. ..) s\u00e5 kolla denna ruta kommer GoogleFu f\u00f6rs\u00f6ka skapa en databas med variabler av de angivna typerna. Annars GoogleFu \u00f6vertar alla v\u00e4rden som str\u00e4ngar.",
														"Kama safu ya kwanza chini ya safu ya ufafanuzi ina aina thamani (kamba, int, nk ..) kisha kuangalia sanduku hili, GoogleFu jaribio kujenga database na vigezo ya aina maalum. Vinginevyo GoogleFu kudhani maadili yote kuwa masharti.",
														"\u0e16\u0e49\u0e32\u0e41\u0e16\u0e27\u0e41\u0e23\u0e01\u0e14\u0e49\u0e32\u0e19\u0e25\u0e48\u0e32\u0e07\u0e04\u0e33\u0e19\u0e34\u0e22\u0e32\u0e21\u0e04\u0e2d\u0e25\u0e31\u0e21\u0e19\u0e4c\u0e21\u0e35\u0e04\u0e48\u0e32\u0e0a\u0e19\u0e34\u0e14 (\u0e2a\u0e15\u0e23\u0e34\u0e07 int, etc .. ) \u0e08\u0e32\u0e01\u0e19\u0e31\u0e49\u0e19\u0e15\u0e23\u0e27\u0e08\u0e2a\u0e2d\u0e1a\u0e01\u0e25\u0e48\u0e2d\u0e07\u0e19\u0e35\u0e49 GoogleFu \u0e08\u0e30\u0e1e\u0e22\u0e32\u0e22\u0e32\u0e21\u0e17\u0e35\u0e48\u0e08\u0e30\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e10\u0e32\u0e19\u0e02\u0e49\u0e2d\u0e21\u0e39\u0e25\u0e17\u0e35\u0e48\u0e21\u0e35\u0e15\u0e31\u0e27\u0e41\u0e1b\u0e23\u0e1b\u0e23\u0e30\u0e40\u0e20\u0e17\u0e17\u0e35\u0e48\u0e23\u0e30\u0e1a\u0e38 \u0e21\u0e34\u0e09\u0e30\u0e19\u0e31\u0e49\u0e19\u0e08\u0e30\u0e16\u0e37\u0e2d\u0e27\u0e48\u0e32 GoogleFu \u0e04\u0e48\u0e32\u0e17\u0e31\u0e49\u0e07\u0e2b\u0e21\u0e14\u0e17\u0e35\u0e48\u0e08\u0e30\u0e40\u0e1b\u0e47\u0e19\u0e2a\u0e15\u0e23\u0e34\u0e07",
														"Kung ang unang hilera sa ibaba ang mga kahulugan haligi ay naglalaman ng mga uri ng halaga (string, int, atbp ..) pagkatapos check ang kahong ito, GoogleFu ay subukang gumawa ng isang database sa mga variable ng tinukoy na uri. Kung hindi man GoogleFu ay ipinapalagay lahat ng mga halaga na maging mga string.",
														"S\u00fctun tan\u0131mlar\u0131 a\u015fa\u011f\u0131daki ilk sat\u0131r de\u011fer t\u00fcrleri (string, int, vb ..) sonra bu onay kutusunu i\u00e7eriyorsa, GoogleFu belirtilen tipte de\u011fi\u015fkenler ile bir veritaban\u0131 olu\u015fturmak i\u00e7in \u00e7al\u0131\u015facakt\u0131r. Aksi GoogleFu dizeleri olmak \u00fczere t\u00fcm de\u011ferleri kabul edecektir.",
														"\u042f\u043a\u0449\u043e \u043f\u0435\u0440\u0448\u0438\u0439 \u0440\u044f\u0434\u043e\u043a \u043d\u0438\u0436\u0447\u0435 \u0432\u0438\u0437\u043d\u0430\u0447\u0435\u043d\u044c \u0441\u0442\u043e\u0432\u043f\u0446\u0456\u0432 \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u0442\u0438\u043f\u0438 \u0437\u043d\u0430\u0447\u0435\u043d\u044c (\u0440\u044f\u0434\u043e\u043a, INT, \u0456 \u0442.\u0434. ..), \u0442\u043e \u0446\u0435\u0439 \u043f\u0440\u0430\u043f\u043e\u0440\u0435\u0446\u044c, GoogleFu \u0441\u043f\u0440\u043e\u0431\u0443\u0454 \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u0431\u0430\u0437\u0443 \u0434\u0430\u043d\u0438\u0445 \u0437 \u043f\u0435\u0440\u0435\u043c\u0456\u043d\u043d\u0438\u043c \u0437\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0445 \u0442\u0438\u043f\u0456\u0432. \u0412 \u0456\u043d\u0448\u043e\u043c\u0443 \u0432\u0438\u043f\u0430\u0434\u043a\u0443 GoogleFu \u043f\u0440\u0438\u0439\u043c\u0430\u0442\u0438\u043c\u0435 \u0432\u0441\u0456 \u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f, \u0449\u043e\u0431 \u0431\u0443\u0442\u0438 \u0440\u044f\u0434\u043a\u0430\u043c\u0438.",
														"\u05d0\u05d5\u05d9\u05d1 \u05d3\u05e2\u05e8 \u05e2\u05e8\u05e9\u05d8\u05e2\u05e8 \u05e8\u05d5\u05d3\u05e2\u05e8\u05df \u05d5\u05e0\u05d8\u05e2\u05e8 \u05d3\u05e2\u05e8 \u05d6\u05d9\u05d9\u05b7\u05dc \u05d6\u05d5\u05da \u05db\u05bc\u05d5\u05dc\u05dc \u05d3\u05d9 \u05d5\u05d5\u05e2\u05e8\u05d8 \u05d8\u05d9\u05d9\u05e4\u05bc\u05e1 (\u05e9\u05d8\u05e8\u05d9\u05e7\u05dc, \u05d9\u05e0\u05d8, \u05d0\u05d0\u05d6\"\u05d5 ..) \u05d3\u05e2\u05de\u05d0\u05b8\u05dc\u05d8 \u05d8\u05e9\u05e2\u05e7 \u05d3\u05e2\u05dd \u05e7\u05e2\u05e1\u05d8\u05dc, \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d5\u05d5\u05e2\u05d8 \u05e4\u05bc\u05e8\u05d5\u05d5\u05d5\u05df \u05e6\u05d5 \u05e9\u05d0\u05b7\u05e4\u05bf\u05df \u05d0\u05b7 \u05d3\u05d0\u05b7\u05d8\u05d0\u05b7\u05d1\u05d0\u05b7\u05e1\u05e2 \u05de\u05d9\u05d8 \u05d5\u05d5\u05e2\u05e8\u05d9\u05d0\u05b7\u05d1\u05d0\u05b7\u05dc\u05d6 \u05e4\u05d5\u05df \u05d3\u05d9 \u05e1\u05e4\u05bc\u05e2\u05e1\u05d0\u05b7\u05e4\u05d9\u05d9\u05d3 \u05d8\u05d9\u05d9\u05e4\u05bc\u05e1. \u05d0\u05b7\u05e0\u05d3\u05e2\u05e8\u05e9 \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d5\u05d5\u05e2\u05d8 \u05d9\u05d1\u05e2\u05e8\u05e0\u05e2\u05de\u05e2\u05df \u05d0\u05b7\u05dc\u05e2 \u05d5\u05d5\u05d0\u05b7\u05dc\u05d5\u05e2\u05e1 \u05e6\u05d5 \u05d5\u05d5\u05e2\u05e8\u05df \u05e1\u05d8\u05e8\u05d9\u05e0\u05d2\u05e1.",
														"\u82e5\u8dcc\u7834\u8a72\u5217\u5b9a\u7fa9\u7684\u7b2c\u4e00\u884c\u5305\u542b\u7684\u503c\u985e\u578b\uff08\u5b57\u7b26\u4e32\uff0c\u6574\u6578\uff0c\u7b49..\uff09\uff0c\u7136\u5f8c\u9078\u4e2d\u8a72\u8907\u9078\u6846\uff0cGoogleFu\u5c07\u5617\u8a66\u5275\u5efa\u6307\u5b9a\u985e\u578b\u7684\u8b8a\u91cf\u7684\u6578\u64da\u5eab\u3002\u5426\u5247GoogleFu\u5c07\u627f\u64d4\u6240\u6709\u7684\u503c\u662f\u5b57\u7b26\u4e32\u3002"));
			Rows.Add( new LocalizationRow("When the GameObject associated with the database is created in the scene, ensure it persists when the scene is changed. This is necessary for databases that need to remain loaded for the duration of the game.",
														"Lorsque la gameobject associ\u00e9 \u00e0 la base de donn\u00e9es est cr\u00e9\u00e9e dans la sc\u00e8ne, en sorte qu'il persiste quand la sc\u00e8ne a chang\u00e9. Cela est n\u00e9cessaire pour les bases de donn\u00e9es qui doivent rester charg\u00e9 pour la dur\u00e9e de la partie.",
														"Quando il GameObject associato al database viene creato nella scena, assicurarsi che persiste quando la scena \u00e8 cambiata. Ci\u00f2 \u00e8 necessario per i database che devono rimanere caricato per la durata del gioco.",
														"Wenn der Gameobject mit der Datenbank zugeordnet ist, in der Szene erzeugt, damit es vor, wenn sich die Szene ver\u00e4ndert. Dies ist f\u00fcr Datenbanken, die f\u00fcr die Dauer des Spiels geladen bleiben m\u00fcssen notwendig.",
														"Cuando se crea el GameObject asociado con la base de datos en la escena, asegurarse de que persiste cuando se cambia la escena. Esto es necesario para bases de datos que necesitan para permanecer cargado durante la duraci\u00f3n del juego.",
														"\u0639\u0646\u062f \u0625\u0646\u0634\u0627\u0621 GameObject \u0627\u0644\u0645\u0631\u062a\u0628\u0637\u0629 \u0645\u0639 \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0641\u064a \u0627\u0644\u0645\u0634\u0647\u062f\u060c \u0648\u0636\u0645\u0627\u0646 \u0627\u0633\u062a\u0645\u0631\u0627\u0631\u0647\u0627 \u0639\u0646\u062f \u062a\u063a\u064a\u064a\u0631 \u0627\u0644\u0645\u0634\u0647\u062f. \u0648\u0647\u0630\u0627 \u0623\u0645\u0631 \u0636\u0631\u0648\u0631\u064a \u0644\u0642\u0648\u0627\u0639\u062f \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u062d\u062a\u0627\u062c \u0625\u0644\u0649 \u062a\u062d\u0645\u064a\u0644\u0647\u0627 \u062a\u0628\u0642\u0649 \u0644\u0645\u062f\u0629 \u0627\u0644\u0644\u0639\u0628\u0629.",
														"\ub370\uc774\ud130\ubca0\uc774\uc2a4\uc640 \uc5f0\uad00\ub41c \uac8c\uc784 \uc624\ube0c\uc81d\ud2b8\uac00 \uc7a5\uba74\uc744 \ub9cc\ub4e4 \ub54c, \uc7a5\uba74 \ubcc0\uacbd\uc2dc\uac00 \uc9c0\uc18d\ub418\ub3c4\ub85d. \uc774 \uac8c\uc784\uc758 \uc9c0\uc18d \uc2dc\uac04\uc5d0 \ub300\ud55c\ub85c\ub4dc \uc0c1\ud0dc\ub97c \uc720\uc9c0\ud560 \ud544\uc694\uac00 \ub370\uc774\ud130\ubca0\uc774\uc2a4 \ud544\uc694\ud558\ub2e4.",
														"\u5f53\u4e0e\u6570\u636e\u5e93\u76f8\u5173\u8054\u7684\u6e38\u620f\u7269\u4f53\u5728\u573a\u666f\u4e2d\u521b\u5efa\uff0c\u786e\u4fdd\u5176\u6301\u7eed\u65f6\uff0c\u73b0\u573a\u5df2\u66f4\u6539\u3002\u8fd9\u662f\u5fc5\u8981\u7684\u9700\u8981\u4e3a\u6e38\u620f\u7684\u6301\u7eed\u65f6\u95f4\uff0c\u4ee5\u4fdd\u6301\u52a0\u8f7d\u6570\u636e\u5e93\u3002",
														"\u30c7\u30fc\u30bf\u30d9\u30fc\u30b9\u306b\u95a2\u9023\u4ed8\u3051\u3089\u308c\u305f\u30b2\u30fc\u30e0\u30aa\u30d6\u30b8\u30a7\u30af\u30c8\u3092\u30b7\u30fc\u30f3\u306b\u4f5c\u6210\u3055\u308c\u308b\u3068\u3001\u30b7\u30fc\u30f3\u304c\u5909\u66f4\u3055\u308c\u305f\u3068\u304d\u3001\u305d\u308c\u304c\u89e3\u6d88\u3055\u308c\u306a\u3044\u3053\u3068\u3092\u78ba\u8a8d\u3057\u3066\u304f\u3060\u3055\u3044\u3002\u3053\u308c\u306f\u3001\u30b2\u30fc\u30e0\u306e\u671f\u9593\u4e2d\u3001\u30ed\u30fc\u30c9\u3055\u308c\u305f\u307e\u307e\u306b\u3059\u308b\u5fc5\u8981\u304c\u3042\u308b\u30c7\u30fc\u30bf\u30d9\u30fc\u30b9\u304c\u5fc5\u8981\u3067\u3042\u308b\u3002",
														"\u041a\u043e\u0433\u0434\u0430 GameObject \u0441\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0439 \u0441 \u0431\u0430\u0437\u043e\u0439 \u0434\u0430\u043d\u043d\u044b\u0445 \u0441\u043e\u0437\u0434\u0430\u0435\u0442\u0441\u044f \u0432 \u0441\u0446\u0435\u043d\u0435, \u0443\u0431\u0435\u0434\u0438\u0442\u0435\u0441\u044c, \u0447\u0442\u043e \u043e\u043d \u0441\u043e\u0445\u0440\u0430\u043d\u044f\u0435\u0442\u0441\u044f, \u043a\u043e\u0433\u0434\u0430 \u0441\u0446\u0435\u043d\u0430 \u0438\u0437\u043c\u0435\u043d\u044f\u0435\u0442\u0441\u044f. \u042d\u0442\u043e \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e \u0434\u043b\u044f \u0431\u0430\u0437 \u0434\u0430\u043d\u043d\u044b\u0445, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0434\u043e\u043b\u0436\u043d\u044b \u043e\u0441\u0442\u0430\u0432\u0430\u0442\u044c\u0441\u044f \u0437\u0430\u0433\u0440\u0443\u0436\u0430\u043b\u0430\u0441\u044c \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u0432\u0441\u0435\u0433\u043e \u0441\u0440\u043e\u043a\u0430 \u0438\u0433\u0440\u044b.",
														"Khi GameObject li\u00ean k\u1ebft v\u1edbi c\u00e1c c\u01a1 s\u1edf d\u1eef li\u1ec7u \u0111\u01b0\u1ee3c t\u1ea1o ra trong hi\u1ec7n tr\u01b0\u1eddng, \u0111\u1ea3m b\u1ea3o n\u00f3 v\u1eabn t\u1ed3n t\u1ea1i khi c\u1ea3nh thay \u0111\u1ed5i. \u0110i\u1ec1u n\u00e0y l\u00e0 c\u1ea7n thi\u1ebft cho c\u01a1 s\u1edf d\u1eef li\u1ec7u c\u1ea7n ph\u1ea3i v\u1eabn n\u1ea1p trong su\u1ed1t th\u1eddi gian c\u1ee7a tr\u00f2 ch\u01a1i.",
														"Wanneer de GameObject geassocieerd met de database is gemaakt in de sc\u00e8ne, zorg dan dat blijft bestaan \u200b\u200bals de sc\u00e8ne is veranderd. Dit is noodzakelijk om databases die moeten blijven geladen gedurende de duur van het spel.",
														"Wanneer die GameObject wat verband hou met die databasis is geskep in die toneel, verseker dat dit voortduur wanneer die toneel verander. Dit is nodig vir databasisse wat bly gelaai vir die duur van die spel nodig.",
														"\u041a\u043e\u0433\u0430\u0442\u043e GameObject \u0441\u0432\u044a\u0440\u0437\u0430\u043d\u0430 \u0441 \u0431\u0430\u0437\u0430\u0442\u0430 \u0434\u0430\u043d\u043d\u0438 \u0435 \u0441\u044a\u0437\u0434\u0430\u0434\u0435\u043d\u0430 \u0432 \u0441\u0446\u0435\u043d\u0430\u0442\u0430, \u0433\u0430\u0440\u0430\u043d\u0442\u0438\u0440\u0430, \u0447\u0435 \u0442\u044f \u043f\u0440\u043e\u0434\u044a\u043b\u0436\u0430\u0432\u0430 \u0434\u0430 \u0441\u044a\u0449\u0435\u0441\u0442\u0432\u0443\u0432\u0430, \u043a\u043e\u0433\u0430\u0442\u043e \u043d\u0430 \u0441\u0446\u0435\u043d\u0430\u0442\u0430 \u0441\u0435 \u043f\u0440\u043e\u043c\u0435\u043d\u044f. \u0422\u043e\u0432\u0430 \u0435 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e, \u0437\u0430 \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u043d\u0438, \u043a\u043e\u0438\u0442\u043e \u0442\u0440\u044f\u0431\u0432\u0430 \u0434\u0430 \u043e\u0441\u0442\u0430\u043d\u0430\u0442 \u043d\u0430\u0442\u043e\u0432\u0430\u0440\u0435\u043d\u0438 \u0437\u0430 \u043f\u0440\u043e\u0434\u044a\u043b\u0436\u0438\u0442\u0435\u043b\u043d\u043e\u0441\u0442\u0442\u0430 \u043d\u0430 \u0438\u0433\u0440\u0430\u0442\u0430.",
														"\u041a\u0430\u043b\u0456 GameObject \u0437\u0432\u044f\u0437\u0430\u043d\u044b \u0437 \u0431\u0430\u0437\u0430\u0439 \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u0445 \u0441\u0442\u0432\u0430\u0440\u0430\u0435\u0446\u0446\u0430 \u045e \u0441\u0446\u044d\u043d\u0435, \u043f\u0435\u0440\u0430\u043a\u0430\u043d\u0430\u0439\u0446\u0435\u0441\u044f, \u0448\u0442\u043e \u0451\u043d \u0437\u0430\u0445\u043e\u045e\u0432\u0430\u0435\u0446\u0446\u0430, \u043a\u0430\u043b\u0456 \u0441\u0446\u044d\u043d\u0430 \u0437\u043c\u044f\u043d\u044f\u0435\u0446\u0446\u0430. \u0413\u044d\u0442\u0430 \u043d\u0435\u0430\u0431\u0445\u043e\u0434\u043d\u0430 \u0434\u043b\u044f \u0431\u0430\u0437 \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u0445, \u044f\u043a\u0456\u044f \u043f\u0430\u0432\u0456\u043d\u043d\u044b \u0437\u0430\u0441\u0442\u0430\u0432\u0430\u0446\u0446\u0430 \u0437\u0430\u0433\u0440\u0443\u0436\u0430\u043b\u0430\u0441\u044f \u043d\u0430 \u043f\u0440\u0430\u0446\u044f\u0433\u0443 \u045e\u0441\u044f\u0433\u043e \u0442\u044d\u0440\u043c\u0456\u043d\u0443 \u0433\u0443\u043b\u044c\u043d\u0456.",
														"Quan es crea el GameObject associat amb la base de dades en l'escena, assegurar-se que persisteix quan es canvia l'escena. Aix\u00f2 \u00e9s necessari per a bases de dades que necessiten per a romandre carregat durant la durada del joc.",
														"Kdy\u017e GameObject spojen\u00e1 s datab\u00e1z\u00ed je vytvo\u0159ena ve sc\u00e9n\u011b, ujist\u011bte se, \u017ee p\u0159etrv\u00e1v\u00e1 p\u0159i zm\u011bn\u011b sc\u00e9ny. To je nezbytn\u00e9 pro datab\u00e1ze, kter\u00e9 mus\u00ed z\u016fstat vlo\u017een po celou dobu hry.",
														"Pan fydd y GameObject sy'n gysylltiedig \u00e2'r gronfa ddata yn cael ei greu yn y fan a'r lle, yn sicrhau ei fod yn parhau pan fydd yr olygfa yn cael ei newid. Mae hyn yn angenrheidiol ar gyfer cronfeydd data y mae angen parhau i fod yn llwytho drwy gydol y g\u00eam.",
														"Kui GameObject seotud andmebaas on loodud areenil, tagamaks, et see ei kao, kui stseen on muutunud. See on vajalik andmebaasidest, mis peavad j\u00e4\u00e4ma laaditud kestus m\u00e4ng.",
														"\u0647\u0646\u06af\u0627\u0645\u06cc \u06a9\u0647 GameObject \u062f\u0631 \u0627\u0631\u062a\u0628\u0627\u0637 \u0628\u0627 \u067e\u0627\u06cc\u06af\u0627\u0647 \u062f\u0627\u062f\u0647 \u0631\u0627 \u062f\u0631 \u0635\u062d\u0646\u0647 \u0627\u06cc\u062c\u0627\u062f \u0645\u06cc \u0634\u0648\u062f\u060c \u0627\u0637\u0645\u06cc\u0646\u0627\u0646 \u062d\u0627\u0635\u0644 \u0634\u0648\u062f \u0622\u0646 \u0647\u0645\u0686\u0646\u0627\u0646 \u0627\u062f\u0627\u0645\u0647 \u062f\u0627\u0631\u062f \u0632\u0645\u0627\u0646\u06cc \u06a9\u0647 \u0635\u062d\u0646\u0647 \u062a\u063a\u06cc\u06cc\u0631 \u0645\u06cc \u06a9\u0646\u062f. \u0627\u06cc\u0646 \u0644\u0627\u0632\u0645 \u0628\u0631\u0627\u06cc \u067e\u0627\u06cc\u06af\u0627\u0647 \u062f\u0627\u062f\u0647 \u06a9\u0647 \u0646\u06cc\u0627\u0632 \u0628\u0647 \u0628\u0627\u0642\u06cc \u0645\u06cc \u0645\u0627\u0646\u062f \u0628\u0631\u0627\u06cc \u0645\u062f\u062a \u0632\u0645\u0627\u0646 \u0628\u0627\u0632\u06cc \u0644\u0648\u062f \u0634\u062f\u0647 \u0627\u0633\u062a.",
														"Kun GameObject liittyv\u00e4 tietokanta on luotu kohtaus, jotta se ei h\u00e4vi\u00e4, kun kohtaus on muuttunut. T\u00e4m\u00e4 on tarpeen tietokantoja, jotka on edelleen ladattu ajaksi pelin.",
														"Nuair a bh\u00edonn an GameObject a bhaineann leis an mbunachar sonra\u00ed a crutha\u00edodh sa radharc, a chinnti\u00fa go leanann s\u00e9 nuair a bheidh an ard\u00e1n athr\u00fa. T\u00e1 s\u00e9 seo riachtanach chun bunachair shonra\u00ed gur g\u00e1 fanacht luchtaithe le linn an chluiche.",
														"Cando o GameObject asociado con a base de datos ser\u00e1 creada no lugar, garantir que persiste cando a escena \u00e9 alterada. Isto \u00e9 necesario para a base de datos que te\u00f1en que permanecer cargado durante a duraci\u00f3n do xogo.",
														"\u0921\u0947\u091f\u093e\u092c\u0947\u0938 \u0915\u0947 \u0938\u093e\u0925 \u091c\u0941\u0921\u093c\u0947 GameObject \u0926\u0943\u0936\u094d\u092f \u092e\u0947\u0902 \u092c\u0928\u093e\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948, \u0924\u094b \u0926\u0943\u0936\u094d\u092f \u092c\u0926\u0932 \u091c\u093e\u0924\u093e \u0939\u0948 \u091c\u092c \u092f\u0939 \u092c\u0928\u0940 \u0930\u0939\u0924\u0940 \u0939\u0948\u0902. \u0907\u0938 \u0916\u0947\u0932 \u0915\u0940 \u0905\u0935\u0927\u093f \u0915\u0947 \u0932\u093f\u090f \u0932\u094b\u0921 \u0930\u0939\u0928\u0947 \u0915\u0940 \u091c\u0930\u0942\u0930\u0924 \u0939\u0948 \u0915\u093f \u0921\u0947\u091f\u093e\u092c\u0947\u0938 \u0915\u0947 \u0932\u093f\u090f \u0906\u0935\u0936\u094d\u092f\u0915 \u0939\u0948.",
														"Kad GameObject povezan s bazom podataka stvara se u sceni, uvjerite se da postoji i kad scena se mijenja. To je nu\u017eno za baze podataka koji trebaju ostati u\u010ditan za vrijeme trajanja igre.",
														"L\u00e8 yo GameObject la ki asosye ak baz done a ki te kreye nan s\u00e8n nan, asire li ap p\u00e8siste l\u00e8 se s\u00e8n nan chanje. Sa a se neses\u00e8 pou baz done ki bezwen rete chaje pou dire a nan jw\u00e8t la.",
														"Ketika GameObject terkait dengan database dibuat dalam adegan, memastikan tetap saat adegan berubah. Hal ini diperlukan untuk database yang perlu tetap dimuat selama permainan.",
														"\u00deegar GameObject tengslum vi\u00f0 gagnagrunninn er b\u00fain \u00e1 vettvangi, a\u00f0 tryggja a\u00f0 \u00fea\u00f0 er vi\u00f0varandi \u00feegar senan breyst. \u00deetta er nau\u00f0synlegt fyrir gagnagrunna sem \u00fearf til a\u00f0 haldast hla\u00f0inn \u00e1 me\u00f0an leiknum.",
														"\u05db\u05d0\u05e9\u05e8: \u05dc\u05d4\u05db\u05d9\u05df \u05d0\u05ea \u05e7\u05e9\u05d5\u05e8\u05d9\u05dd \u05d1\u05de\u05e1\u05d3 \u05d4\u05e0\u05ea\u05d5\u05e0\u05d9\u05dd \u05e0\u05d5\u05e6\u05e8 \u05d1\u05e1\u05e6\u05e0\u05d4, \u05dc\u05d4\u05d1\u05d8\u05d9\u05d7 \u05e9\u05d6\u05d4 \u05e0\u05de\u05e9\u05da \u05db\u05d0\u05e9\u05e8 \u05d4\u05e1\u05e6\u05e0\u05d4 \u05de\u05e9\u05ea\u05e0\u05d4. \u05d6\u05d4 \u05d4\u05db\u05e8\u05d7\u05d9 \u05e2\u05d1\u05d5\u05e8 \u05de\u05e1\u05d3\u05d9 \u05e0\u05ea\u05d5\u05e0\u05d9\u05dd \u05e9\u05e6\u05e8\u05d9\u05db\u05d9\u05dd \u05dc\u05d4\u05d9\u05e9\u05d0\u05e8 \u05d8\u05e2\u05d5\u05e0\u05d9\u05dd \u05dc\u05de\u05e9\u05da \u05d4\u05de\u05e9\u05d7\u05e7.",
														"Kai GameObject susijusi su duomen\u0173 baz\u0117s sukurtos scenos, u\u017etikrinti, kad ji i\u0161lieka, kai scena pasikeit\u0117. Tai yra b\u016btina, duomen\u0173 bazi\u0173, kurios turi likti pakrauti \u017eaidimo trukm\u0119.",
														"Kad GameObject saist\u012bts ar datu b\u0101zi ir izveidots skatuves, nodro\u0161in\u0101tu, ka t\u0101 saglab\u0101jas, kad aina ir main\u012bjusies. Tas ir nepiecie\u0161ams, lai datu b\u0101z\u0113m, kas ir nepiecie\u0161ams, lai paliek iekraus laiku sp\u0113li.",
														"\u041a\u043e\u0433\u0430 GameObject \u043f\u043e\u0432\u0440\u0437\u0430\u043d\u0438 \u0441\u043e \u0431\u0430\u0437\u0430 \u043d\u0430 \u043f\u043e\u0434\u0430\u0442\u043e\u0446\u0438 \u0435 \u0441\u043e\u0437\u0434\u0430\u0434\u0435\u043d\u0430 \u0432\u043e \u0441\u0446\u0435\u043d\u0430\u0442\u0430, \u0441\u0435 \u043e\u0441\u0438\u0433\u0443\u0440\u0430\u0442\u0435 \u0434\u0435\u043a\u0430 \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0443\u0432\u0430 \u043a\u043e\u0433\u0430 \u043d\u0430 \u0441\u0446\u0435\u043d\u0430\u0442\u0430 \u0441\u0435 \u043c\u0435\u043d\u0443\u0432\u0430. \u041e\u0432\u0430 \u0435 \u043d\u0435\u043e\u043f\u0445\u043e\u0434\u043d\u043e \u0437\u0430 \u0431\u0430\u0437\u0438 \u043d\u0430 \u043f\u043e\u0434\u0430\u0442\u043e\u0446\u0438 \u043a\u043e\u0438 \u0442\u0440\u0435\u0431\u0430 \u0434\u0430 \u043e\u0441\u0442\u0430\u043d\u0430\u0442 \u0432\u0447\u0438\u0442\u0430\u043d\u0430 \u0437\u0430 \u0432\u0440\u0435\u043c\u0435 \u043d\u0430 \u0442\u0440\u0430\u0435\u045a\u0435\u0442\u043e \u043d\u0430 \u0438\u0433\u0440\u0430\u0442\u0430.",
														"Apabila GameObject yang berkaitan dengan pangkalan data yang dicipta di tempat kejadian, memastikan ia berterusan apabila tempat kejadian ditukar. Ini adalah perlu untuk pangkalan data yang perlu dimuatkan kekal untuk jangka masa permainan.",
														"Meta l-GameObject asso\u010bjat mad-database hi ma\u0127luqa fil-xena, ti\u017cgura tippersisti meta l-xena tinbidel. Dan huwa me\u0127tie\u0121 g\u0127all databases li je\u0127tie\u0121 li jibqg\u0127u mg\u0127obbija g\u0127at-tul tal-log\u0127ba.",
														"N\u00e5r GameObject forbundet med databasen er opprettet i scenen, sikre det vedvarer n\u00e5r scenen er endret. Dette er n\u00f8dvendig for databaser som m\u00e5 forbli lastet for varigheten av spillet.",
														"Kiedy GameObject zwi\u0105zane z baz\u0105 danych jest tworzony w miejscu, upewnij si\u0119, \u017ce nie ust\u0105pi, gdy scena jest zmieniany. Jest to niezb\u0119dne dla bazy danych, kt\u00f3re musz\u0105 pozosta\u0107 \u0142adowane w czasie trwania gry.",
														"Quando o GameObject associado com o banco de dados ser\u00e1 criado no local, garantir que persiste quando a cena \u00e9 alterada. Isto \u00e9 necess\u00e1rio para a base de dados que t\u00eam de permanecer carregado durante a dura\u00e7\u00e3o do jogo.",
														"C\u00e2nd GameObject asociat cu baza de date este creat \u00een scen\u0103, asigura\u021bi-v\u0103 c\u0103 persist\u0103 atunci c\u00e2nd scena este schimbat. Acest lucru este necesar pentru baze de date care trebuie s\u0103 r\u0103m\u00e2n\u0103 \u00eenc\u0103rcate pe durata jocului.",
														"Ke\u010f GameObject spojen\u00e1 s datab\u00e1zou je vytvoren\u00e1 v sc\u00e9ne, uistite sa, \u017ee pretrv\u00e1va pri zmene sc\u00e9ny. To je nevyhnutn\u00e9 pre datab\u00e1zy, ktor\u00e9 musia zosta\u0165 vlo\u017een\u00fd po cel\u00fa dobu hry.",
														"Ko je GameObject povezana z zbirko podatkov ustvarili v prizoru, se prepri\u010dajte, da vztraja pri menjavi scene. To je potrebno za podatkovne baze, ki morajo ostati nalo\u017een za \u010das trajanja igre.",
														"Kur GameObject lidhur me baz\u00ebn e t\u00eb dh\u00ebnave \u00ebsht\u00eb krijuar n\u00eb vendin e ngjarjes, t\u00eb siguruar se ajo vazhdon kur skena \u00ebsht\u00eb ndryshuar. Kjo \u00ebsht\u00eb e nevojshme p\u00ebr bazat e t\u00eb dh\u00ebnave q\u00eb duhet t\u00eb mbetet e ngarkuar p\u00ebr koh\u00ebzgjatjen e loj\u00ebs.",
														"\u041a\u0430\u0434\u0430 \u0413\u0430\u043c\u0435\u041e\u0431\u0458\u0435\u0446\u0442 \u043f\u043e\u0432\u0435\u0437\u0430\u043d\u0430 \u0441\u0430 \u0431\u0430\u0437\u043e\u043c \u043f\u043e\u0434\u0430\u0442\u0430\u043a\u0430 \u0441\u0435 \u043a\u0440\u0435\u0438\u0440\u0430 \u0443 \u0441\u0446\u0435\u043d\u0438, \u043f\u0440\u043e\u0432\u0435\u0440\u0438\u0442\u0435 \u0434\u0430 \u043b\u0438 \u0438 \u0434\u0430\u0459\u0435 \u043f\u043e\u0441\u0442\u043e\u0458\u0438, \u043a\u0430\u0434\u0430 \u0441\u0435 \u043c\u0435\u045a\u0430 \u0441\u0446\u0435\u043d\u0430. \u041e\u0432\u043e \u0458\u0435 \u043d\u0435\u043e\u043f\u0445\u043e\u0434\u043d\u043e \u0437\u0430 \u0431\u0430\u0437\u0435 \u043f\u043e\u0434\u0430\u0442\u0430\u043a\u0430 \u043a\u043e\u0458\u0435 \u0442\u0440\u0435\u0431\u0430 \u0434\u0430 \u043e\u0441\u0442\u0430\u043d\u0443 \u0443\u0447\u0438\u0442\u0430 \u0437\u0430 \u0432\u0440\u0435\u043c\u0435 \u0442\u0440\u0430\u0458\u0430\u045a\u0430 \u0438\u0433\u0440\u0435.",
														"N\u00e4r GameObject samband med databasen skapas i scenen, se till att den kvarst\u00e5r n\u00e4r scenen \u00e4ndras. Detta \u00e4r n\u00f6dv\u00e4ndigt f\u00f6r databaser som beh\u00f6ver f\u00f6rbli laddad under hela matchen.",
														"Wakati GameObject kuhusishwa na database ni kuundwa katika eneo la tukio, kuhakikisha kuwa likiendelea wakati eneo ni iliyopita. Hii ni muhimu kwa ajili ya database kwamba haja ya kubaki kubeba kwa muda wa mchezo.",
														"\u0e40\u0e21\u0e37\u0e48\u0e2d GameObject \u0e17\u0e35\u0e48\u0e40\u0e01\u0e35\u0e48\u0e22\u0e27\u0e02\u0e49\u0e2d\u0e07\u0e01\u0e31\u0e1a\u0e10\u0e32\u0e19\u0e02\u0e49\u0e2d\u0e21\u0e39\u0e25\u0e17\u0e35\u0e48\u0e16\u0e39\u0e01\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e02\u0e36\u0e49\u0e19\u0e43\u0e19\u0e17\u0e35\u0e48\u0e40\u0e01\u0e34\u0e14\u0e40\u0e2b\u0e15\u0e38\u0e43\u0e2b\u0e49\u0e41\u0e19\u0e48\u0e43\u0e08\u0e27\u0e48\u0e32\u0e21\u0e31\u0e19\u0e22\u0e31\u0e07\u0e04\u0e07\u0e21\u0e35\u0e2d\u0e22\u0e39\u0e48\u0e40\u0e21\u0e37\u0e48\u0e2d\u0e40\u0e01\u0e34\u0e14\u0e40\u0e2b\u0e15\u0e38\u0e08\u0e30\u0e21\u0e35\u0e01\u0e32\u0e23\u0e40\u0e1b\u0e25\u0e35\u0e48\u0e22\u0e19\u0e41\u0e1b\u0e25\u0e07 \u0e19\u0e35\u0e49\u0e40\u0e1b\u0e47\u0e19\u0e2a\u0e34\u0e48\u0e07\u0e08\u0e33\u0e40\u0e1b\u0e47\u0e19\u0e2a\u0e33\u0e2b\u0e23\u0e31\u0e1a\u0e10\u0e32\u0e19\u0e02\u0e49\u0e2d\u0e21\u0e39\u0e25\u0e17\u0e35\u0e48\u0e08\u0e30\u0e15\u0e49\u0e2d\u0e07\u0e22\u0e31\u0e07\u0e04\u0e07\u0e40\u0e15\u0e47\u0e21\u0e44\u0e1b\u0e2a\u0e33\u0e2b\u0e23\u0e31\u0e1a\u0e23\u0e30\u0e22\u0e30\u0e40\u0e27\u0e25\u0e32\u0e02\u0e2d\u0e07\u0e40\u0e01\u0e21",
														"Kapag ang GameObject na nauugnay sa database ay nilikha sa eksena, tiyakin na ito ay nagpatuloy kapag ang tanawin ay nagbago. Ito ay kinakailangan para sa mga database na kailangan upang manatiling load para sa tagal ng laro.",
														"Veritaban\u0131 ile ili\u015fkili GameObject sahne olu\u015fturuldu\u011funda, sahne de\u011fi\u015ftirildi\u011finde e\u011fer devam ediyor. Bu oyunun s\u00fcresince y\u00fckl\u00fc kal\u0131r gereken veri tabanlar\u0131 i\u00e7in gereklidir.",
														"\u041a\u043e\u043b\u0438 GameObject \u043f\u043e\u0432'\u044f\u0437\u0430\u043d\u0438\u0439 \u0437 \u0431\u0430\u0437\u043e\u044e \u0434\u0430\u043d\u0438\u0445 \u0441\u0442\u0432\u043e\u0440\u044e\u0454\u0442\u044c\u0441\u044f \u0432 \u0441\u0446\u0435\u043d\u0456, \u043f\u0435\u0440\u0435\u043a\u043e\u043d\u0430\u0439\u0442\u0435\u0441\u044f, \u0449\u043e \u0432\u0456\u043d \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u0454\u0442\u044c\u0441\u044f, \u043a\u043e\u043b\u0438 \u0441\u0446\u0435\u043d\u0430 \u0437\u043c\u0456\u043d\u044e\u0454\u0442\u044c\u0441\u044f. \u0426\u0435 \u043d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e \u0434\u043b\u044f \u0431\u0430\u0437 \u0434\u0430\u043d\u0438\u0445, \u044f\u043a\u0456 \u043f\u043e\u0432\u0438\u043d\u043d\u0456 \u0437\u0430\u043b\u0438\u0448\u0430\u0442\u0438\u0441\u044f \u0437\u0430\u0432\u0430\u043d\u0442\u0430\u0436\u0443\u0432\u0430\u043b\u0430\u0441\u044f \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u0443\u0441\u044c\u043e\u0433\u043e \u0442\u0435\u0440\u043c\u0456\u043d\u0443 \u0433\u0440\u0438.",
														"\u05d5\u05d5\u05e2\u05df \u05d3\u05d9 \u05d2\u05d0\u05b7\u05de\u05e2\u05d0\u05b8\u05d1\u05d3\u05d6\u05e9\u05e2\u05e7\u05d8 \u05e4\u05d0\u05e8\u05d1\u05d5\u05e0\u05d3\u05df \u05de\u05d9\u05d8 \u05d3\u05d9 \u05d3\u05d0\u05b7\u05d8\u05d0\u05b7\u05d1\u05d0\u05b7\u05e1\u05e2 \u05d0\u05d9\u05d6 \u05d1\u05d0\u05e9\u05d0\u05e4\u05df \u05d0\u05d9\u05df \u05d3\u05d9 \u05e1\u05e6\u05e2\u05e0\u05e2, \u05e2\u05e0\u05e9\u05d5\u05e8 \u05e2\u05e1 \u05d1\u05dc\u05d9\u05d9\u05b7\u05d1\u05d8 \u05d5\u05d5\u05e2\u05df \u05d3\u05d9 \u05e1\u05e6\u05e2\u05e0\u05e2 \u05d0\u05d9\u05d6 \u05e4\u05d0\u05e8\u05e2\u05e0\u05d3\u05e2\u05e8\u05d8. \u05d3\u05d0\u05e1 \u05d0\u05d9\u05d6 \u05e0\u05d9\u05d9\u05d8\u05d9\u05e7 \u05e4\u05bf\u05d0\u05b7\u05e8 \u05d3\u05d9\u05d9\u05d8\u05d0\u05b7\u05d1\u05d9\u05d9\u05e1\u05d9\u05d6 \u05d0\u05b7\u05d6 \u05d3\u05d0\u05b7\u05e8\u05e4\u05bf\u05df \u05e6\u05d5 \u05d1\u05dc\u05d9\u05d9\u05b7\u05d1\u05df \u05dc\u05d0\u05b8\u05d5\u05d3\u05d9\u05d3 \u05e4\u05bf\u05d0\u05b7\u05e8 \u05d3\u05e2\u05e8 \u05d2\u05e2\u05d3\u05d5\u05d9\u05e2\u05e8 \u05e4\u05d5\u05df \u05d3\u05d9 \u05e9\u05e4\u05bc\u05d9\u05dc.",
														"\u7576\u8207\u6578\u64da\u5eab\u76f8\u95dc\u806f\u7684\u904a\u6232\u7269\u9ad4\u5728\u5834\u666f\u4e2d\u5275\u5efa\uff0c\u78ba\u4fdd\u5176\u6301\u7e8c\u6642\uff0c\u73fe\u5834\u5df2\u66f4\u6539\u3002\u9019\u662f\u5fc5\u8981\u7684\u9700\u8981\u70ba\u904a\u6232\u7684\u6301\u7e8c\u6642\u9593\uff0c\u4ee5\u4fdd\u6301\u52a0\u8f09\u6578\u64da\u5eab\u3002"));
			Rows.Add( new LocalizationRow("Select a specific GameObject in the scene to attach the GoogleFu database to.  If no object is specified, a GameObject will be created for this purpose. ",
														"S\u00e9lectionnez un gameobject sp\u00e9cifique dans la sc\u00e8ne d'attacher la base de donn\u00e9es \u00e0 GoogleFu. Si aucun objet n'est sp\u00e9cifi\u00e9, un gameobject sera cr\u00e9\u00e9 \u00e0 cet effet.",
														"Selezionare un GameObject specifico nella scena per collegare il database GoogleFu a. Se non viene specificato alcun oggetto, verr\u00e0 creata una GameObject per questo scopo.",
														"W\u00e4hlen Sie einen bestimmten Gameobject in der Szene, um die Datenbank zu GoogleFu befestigen. Wenn kein Objekt angegeben, wird ein Gameobject f\u00fcr diesen Zweck erstellt werden.",
														"Seleccionar un GameObject espec\u00edfico en la escena para conectar a la base de datos googleFU. Si no se especifica ning\u00fan objeto, un GameObject se crear\u00e1 a tal efecto.",
														"\u0627\u062e\u062a\u0631 GameObject \u0645\u062d\u062f\u062f\u0629 \u0641\u064a \u0645\u0643\u0627\u0646 \u0627\u0644\u062d\u0627\u062f\u062b \u0644\u0625\u0631\u0641\u0627\u0642 \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a GoogleFu \u0644. \u0625\u0630\u0627 \u062a\u0645 \u062a\u062d\u062f\u064a\u062f \u0623\u064a \u0643\u0627\u0626\u0646\u060c \u0633\u064a\u062a\u0645 \u0625\u0646\u0634\u0627\u0621 GameObject \u0644\u0647\u0630\u0627 \u0627\u0644\u063a\u0631\u0636.",
														"\uc5d0 GoogleFu \ub370\uc774\ud130\ubca0\uc774\uc2a4\ub97c \uc5f0\uacb0\ud558\ub294 \uc7a5\uba74\uc5d0\uc11c \ud2b9\uc815 \uac8c\uc784 \uc624\ube0c\uc81d\ud2b8\ub97c \uc120\ud0dd\ud569\ub2c8\ub2e4. \uc5b4\ub5a4 \uac1d\uccb4\ub97c \uc9c0\uc815\ud558\uc9c0 \uc54a\ub294 \uacbd\uc6b0, \uac8c\uc784 \uc624\ube0c\uc81d\ud2b8\ub294\uc774 \ubaa9\uc801\uc744 \uc704\ud574 \ub9cc\ub4e4\uc5b4\uc9d1\ub2c8\ub2e4.",
														"\u5728\u573a\u666f\u4e2d\u9009\u62e9\u4e00\u4e2a\u7279\u5b9a\u7684\u6e38\u620f\u7269\u4f53\u5230GoogleFu\u6570\u636e\u5e93\u9644\u52a0\u5230\u3002\u5982\u679c\u6ca1\u6709\u6307\u5b9a\u5bf9\u8c61\uff0c\u4e00\u4e2a\u7269\u4f53\u4f1a\u4e3a\u6b64\u521b\u5efa\u3002",
														"\u306bGoogleFu\u30c7\u30fc\u30bf\u30d9\u30fc\u30b9\u3092\u30a2\u30bf\u30c3\u30c1\u3059\u308b\u5834\u9762\u3067\u7279\u5b9a\u306e\u30b2\u30fc\u30e0\u30aa\u30d6\u30b8\u30a7\u30af\u30c8\u3092\u9078\u629e\u3057\u307e\u3059\u3002\u30aa\u30d6\u30b8\u30a7\u30af\u30c8\u304c\u6307\u5b9a\u3055\u308c\u3066\u3044\u306a\u3044\u5834\u5408\u3001\u30b2\u30fc\u30e0\u30aa\u30d6\u30b8\u30a7\u30af\u30c8\u306f\u3001\u3053\u306e\u76ee\u7684\u306e\u305f\u3081\u306b\u4f5c\u6210\u3055\u308c\u308b\u3002",
														"\u0412\u044b\u0431\u043e\u0440 \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u043e\u0433\u043e GameObject \u0432 \u0441\u0446\u0435\u043d\u0435 \u0434\u043b\u044f \u043f\u043e\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u044f \u0431\u0430\u0437\u044b \u0434\u0430\u043d\u043d\u044b\u0445 GoogleFu \u0432. \u0415\u0441\u043b\u0438 \u043e\u0431\u044a\u0435\u043a\u0442 \u043d\u0435 \u0443\u043a\u0430\u0437\u0430\u043d, GameObject \u0431\u0443\u0434\u0435\u0442 \u0441\u043e\u0437\u0434\u0430\u043d\u0430 \u0434\u043b\u044f \u044d\u0442\u043e\u0439 \u0446\u0435\u043b\u0438.",
														"Ch\u1ecdn m\u1ed9t GameObject c\u1ee5 th\u1ec3 trong tr\u01b0\u1eddng \u0111\u1ec3 \u0111\u00ednh k\u00e8m c\u00e1c c\u01a1 s\u1edf d\u1eef li\u1ec7u \u0111\u1ec3 GoogleFu. N\u1ebfu kh\u00f4ng c\u00f3 \u0111\u1ed1i t\u01b0\u1ee3ng \u0111\u01b0\u1ee3c x\u00e1c \u0111\u1ecbnh, m\u1ed9t GameObject s\u1ebd \u0111\u01b0\u1ee3c t\u1ea1o ra cho m\u1ee5c \u0111\u00edch n\u00e0y.",
														"Selecteer een bepaald GameObject in de sc\u00e8ne om de GoogleFu database te koppelen aan. Als er geen object is gespecificeerd, zal een GameObject worden gemaakt voor dit doel.",
														"Kies 'n spesifieke GameObject in die toneel om die GoogleFu databasis te heg aan. Indien geen voorwerp is verskaf, sal 'n GameObject geskep word vir hierdie doel.",
														"\u0418\u0437\u0431\u0435\u0440\u0435\u0442\u0435 \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u0430 GameObject \u0432 \u0441\u0446\u0435\u043d\u0430 \u0437\u0430 \u0437\u0430\u043a\u0440\u0435\u043f\u0432\u0430\u043d\u0435 \u043d\u0430 \u0431\u0430\u0437\u0430\u0442\u0430 \u0434\u0430\u043d\u043d\u0438 GoogleFu \u0434\u0430. \u0410\u043a\u043e \u043d\u0435 \u043e\u0431\u0435\u043a\u0442 \u0435 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u043e, GameObject \u0449\u0435 \u0431\u044a\u0434\u0435 \u0441\u044a\u0437\u0434\u0430\u0434\u0435\u043d \u0437\u0430 \u0442\u0430\u0437\u0438 \u0446\u0435\u043b.",
														"\u0412\u044b\u0431\u0430\u0440 \u043f\u044d\u045e\u043d\u0430\u0433\u0430 GameObject \u0443 \u0441\u0446\u044d\u043d\u0435 \u0434\u043b\u044f \u043f\u0430\u0434\u043b\u0443\u0447\u044d\u043d\u043d\u044f \u0431\u0430\u0437\u044b \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u0445 GoogleFu \u0441\u0442. \u041a\u0430\u043b\u0456 \u0430\u0431'\u0435\u043a\u0442 \u043d\u0435 \u043f\u0430\u043a\u0430\u0437\u0430\u043d\u044b, GameObject \u0431\u0443\u0434\u0437\u0435 \u0441\u0442\u0432\u043e\u0440\u0430\u043d\u0430 \u0434\u043b\u044f \u0433\u044d\u0442\u0430\u0439 \u043c\u044d\u0442\u044b.",
														"Seleccioneu un GameObject espec\u00edfic en l'escena per connectar a la base de dades googleFU. Si no s'especifica cap objecte, un GameObject es crear\u00e0 a aquest efecte.",
														"Vyberte konkr\u00e9tn\u00ed GameObject ve sc\u00e9n\u011b p\u0159ipojit datab\u00e1zi GoogleFu na. Pokud nen\u00ed zad\u00e1n \u017e\u00e1dn\u00fd objekt, GameObject vytvo\u0159en pro tento \u00fa\u010del.",
														"Dewiswch GameObject penodol yn yr olygfa i osod y gronfa ddata GoogleFu i. Os na gwrthrych ei nodi, bydd GameObject eu creu ar gyfer y diben hwn.",
														"Valige konkreetne GameObject stseen lisada GoogleFu andmebaasi. Kui \u00fckski objekt ei ole m\u00e4\u00e4ratud, GameObject luuakse selleks.",
														"\u0627\u0646\u062a\u062e\u0627\u0628 GameObject \u062e\u0627\u0635 \u062f\u0631 \u0635\u062d\u0646\u0647 \u0628\u0647 \u0636\u0645\u06cc\u0645\u0647 \u067e\u0627\u06cc\u06af\u0627\u0647 \u062f\u0627\u062f\u0647 GoogleFu \u0628\u0647. \u0627\u06af\u0631 \u0647\u06cc\u0686 \u062c\u0633\u0645 \u0645\u0634\u062e\u0635 \u0627\u0633\u062a\u060c GameObject \u062e\u0648\u0627\u0647\u062f \u0634\u062f \u0628\u0631\u0627\u06cc \u0627\u06cc\u0646 \u0645\u0646\u0638\u0648\u0631 \u0627\u06cc\u062c\u0627\u062f \u0634\u062f\u0647 \u0627\u0633\u062a.",
														"Valitse erityinen GameObject kohtaus liitt\u00e4\u00e4 GoogleFu tietokanta. Jos mit\u00e4\u00e4n objektia ei ole m\u00e4\u00e4ritetty, GameObject luodaan t\u00e4t\u00e4 tarkoitusta varten.",
														"Roghnaigh GameObject leith sa radharc ar an mbunachar sonra\u00ed GoogleFu ag gabh\u00e1il leis. Mura mbeidh aon r\u00e9ad sonraithe, beidh GameObject a chruth\u00fa chun na cr\u00edche sin.",
														"Seleccione un GameObject espec\u00edfico na escena para achegar a base de datos para GoogleFu. Se ning\u00fan obxecto se especifica, un GameObject ser\u00e1 creado para esta finalidade.",
														"\u0915\u094b GoogleFu \u0921\u0947\u091f\u093e\u092c\u0947\u0938 \u0938\u0902\u0932\u0917\u094d\u0928 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0926\u0943\u0936\u094d\u092f \u092e\u0947\u0902 \u090f\u0915 \u0935\u093f\u0936\u093f\u0937\u094d\u091f GameObject \u091a\u0941\u0928\u0947\u0902. \u0915\u094b\u0908 \u0935\u0938\u094d\u0924\u0941 \u0928\u093f\u0930\u094d\u0926\u093f\u0937\u094d\u091f \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948, \u090f\u0915 GameObject \u0907\u0938 \u0909\u0926\u094d\u0926\u0947\u0936\u094d\u092f \u0915\u0947 \u0932\u093f\u090f \u092c\u0928\u093e\u092f\u093e \u091c\u093e\u090f\u0917\u093e.",
														"Odaberite odre\u0111eni GameObject u sceni pri\u010dvrstiti GoogleFu baze podataka za. Ako nije naveden objekt, GameObject \u0107e biti stvoren za tu svrhu.",
														"Chwazi yon GameObject espesifik nan s\u00e8n nan yo tache baz done a GoogleFu. Si yo pa gen okenn obj\u00e8 ki espesifye, y ap f\u00e8 yon GameObject dwe kreye pou objektif sa a.",
														"Pilih GameObject tertentu dalam adegan untuk melampirkan database GoogleFu ke. Jika ada objek yang ditentukan, GameObject akan dibuat untuk tujuan ini.",
														"Velja \u00e1kve\u00f0na GameObject \u00ed vettvangur til a\u00f0 festa GoogleFu gagnagrunn til. Ef enginn hlutur er ekki tiltekinn GameObject ver\u00f0ur b\u00fain \u00ed \u00feessu skyni.",
														"\u05d1\u05d7\u05e8: \u05dc\u05d4\u05db\u05d9\u05df \u05e1\u05e4\u05e6\u05d9\u05e4\u05d9 \u05d1\u05e1\u05e6\u05e0\u05d4 \u05dc\u05e6\u05e8\u05e3 \u05d0\u05ea \u05de\u05e1\u05d3 \u05e0\u05ea\u05d5\u05e0\u05d9 GoogleFu \u05dc. \u05d0\u05dd \u05dc\u05d0 \u05e6\u05d5\u05d9\u05df \u05d0\u05d5\u05d1\u05d9\u05d9\u05e7\u05d8,: \u05dc\u05d4\u05db\u05d9\u05df \u05d9\u05d9\u05d5\u05d5\u05e6\u05e8 \u05dc\u05de\u05d8\u05e8\u05d4 \u05d6\u05d5.",
														"Pasirinkite konkre\u010di\u0105 GameObject \u012f scen\u0105 prid\u0117ti GoogleFu duomen\u0173 baz\u0119. Jei objektas yra nurodyta, GameObject bus sukurta \u0161iam tikslui.",
														"Izv\u0113l\u0113ties konkr\u0113tu GameObject uz skatuves, lai piestiprin\u0101tu GoogleFu datub\u0101zi. Ja nav objektu ir nor\u0101d\u012bts, GameObject tiks izveidots \u0161im nol\u016bkam.",
														"\u0418\u0437\u0431\u0435\u0440\u0435\u0442\u0435 \u043e\u0434\u0440\u0435\u0434\u0435\u043d\u0430 GameObject \u0432\u043e \u0441\u0446\u0435\u043d\u0430\u0442\u0430 \u0434\u0430 \u0441\u0435 \u0437\u0430\u043a\u0430\u0447\u0438\u0442\u0435 \u043d\u0430 \u0431\u0430\u0437\u0430 \u043d\u0430 \u043f\u043e\u0434\u0430\u0442\u043e\u0446\u0438 GoogleFu \u0434\u0430. \u0410\u043a\u043e \u043d\u0435 \u0441\u043f\u0435\u0446\u0438\u0444\u0438\u0446\u0438\u0440\u0430\u0442\u0435 \u043e\u0431\u0458\u0435\u043a\u0442, GameObject \u045c\u0435 \u0431\u0438\u0434\u0430\u0442 \u043a\u0440\u0435\u0438\u0440\u0430\u043d\u0438 \u0437\u0430 \u043e\u0432\u0430\u0430 \u043d\u0430\u043c\u0435\u043d\u0430.",
														"Pilih GameObject tertentu di tempat kejadian untuk melampirkan pangkalan data GoogleFu untuk. Jika tiada objek dinyatakan, GameObject akan diwujudkan untuk tujuan ini.",
														"Ag\u0127\u017cel GameObject spe\u010bifiku fl-xena sabiex iwa\u0127\u0127lu l-database GoogleFu g\u0127all. Jekk l-ebda o\u0121\u0121ett ti\u0121i spe\u010bifikata, GameObject se jin\u0127olqu g\u0127al dan il-g\u0127an.",
														"Velg en bestemt GameObject i scenen til \u00e5 feste GoogleFu databasen til. Hvis ingen objekt er spesifisert, vil en GameObject bli opprettet for dette form\u00e5let.",
														"Wybierz konkretn\u0105 GameObject w scenie, aby do\u0142\u0105czy\u0107 do bazy danych GoogleFu do. Je\u015bli \u017caden obiekt nie jest okre\u015blony, GameObject zostanie utworzone w tym celu.",
														"Selecione um GameObject espec\u00edfico na cena para anexar o banco de dados para GoogleFu. Se nenhum objeto for especificado, um GameObject ser\u00e1 criado para esta finalidade.",
														"Selecta\u021bi un specific GameObject \u00een scen\u0103 pentru a ata\u0219a baza de date GoogleFu a. Dac\u0103 nu este specificat nici un obiect, un GameObject va fi creat \u00een acest scop.",
														"Vyberte konkr\u00e9tny GameObject v sc\u00e9ne pripoji\u0165 datab\u00e1ze GoogleFu na. Ak nie je zadan\u00fd \u017eiadny objekt, GameObject vytvoren\u00fd na tento \u00fa\u010del.",
														"Izberite poseben GameObject v prizoru za pritrditev baze podatkov GoogleFu da. \u010ce noben predmet dolo\u010deno, bo ustvarjena GameObject za ta namen.",
														"Zgjidh nj\u00eb GameObject ve\u00e7ant\u00eb n\u00eb sken\u00eb p\u00ebr t\u00eb bashk\u00ebngjitni baz\u00ebn e t\u00eb dh\u00ebnave GoogleFu t\u00eb. N\u00ebse nuk ka objekt \u00ebsht\u00eb specifikuar, nj\u00eb GameObject do t\u00eb krijohen p\u00ebr k\u00ebt\u00eb q\u00ebllim.",
														"\u0418\u0437\u0430\u0431\u0435\u0440\u0438\u0442\u0435 \u043e\u0434\u0440\u0435\u0452\u0435\u043d\u0443 \u0413\u0430\u043c\u0435\u041e\u0431\u0458\u0435\u0446\u0442 \u0443 \u0441\u0446\u0435\u043d\u0438 \u0434\u0430 \u043f\u0440\u0438\u043b\u043e\u0436\u0438\u0442\u0435 \u0413\u043e\u043e\u0433\u043b\u0435\u0424\u0443 \u0431\u0430\u0437\u0443 \u043f\u043e\u0434\u0430\u0442\u0430\u043a\u0430 \u0443. \u0410\u043a\u043e \u043d\u0435\u043c\u0430 \u043e\u0431\u0458\u0435\u043a\u0430\u0442 \u0458\u0435 \u043d\u0430\u0432\u0435\u0434\u0435\u043d\u043e, \u0413\u0430\u043c\u0435\u041e\u0431\u0458\u0435\u0446\u0442 \u045b\u0435 \u0431\u0438\u0442\u0438 \u043a\u0440\u0435\u0438\u0440\u0430\u043d \u0437\u0430 \u043e\u0432\u0443 \u0441\u0432\u0440\u0445\u0443.",
														"V\u00e4lj en specifik GameObject i scenen f\u00f6r att f\u00e4sta GoogleFu databas till. Om inget objekt anges, kommer ett GameObject att skapas f\u00f6r detta \u00e4ndam\u00e5l.",
														"Kuchagua GameObject maalum katika eneo ambatisha database GoogleFu kwa. Kama hakuna kitu ni maalum, GameObject zitapatikana kwa lengo hili.",
														"\u0e40\u0e25\u0e37\u0e2d\u0e01 GameObject \u0e40\u0e09\u0e1e\u0e32\u0e30\u0e43\u0e19\u0e09\u0e32\u0e01\u0e17\u0e35\u0e48\u0e08\u0e30\u0e41\u0e19\u0e1a\u0e10\u0e32\u0e19\u0e02\u0e49\u0e2d\u0e21\u0e39\u0e25 GoogleFu \u0e44\u0e1b \u0e16\u0e49\u0e32\u0e27\u0e31\u0e15\u0e16\u0e38\u0e44\u0e21\u0e48\u0e21\u0e35\u0e01\u0e32\u0e23\u0e23\u0e30\u0e1a\u0e38 GameObject \u0e08\u0e30\u0e16\u0e39\u0e01\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e02\u0e36\u0e49\u0e19\u0e40\u0e1e\u0e37\u0e48\u0e2d\u0e01\u0e32\u0e23\u0e19\u0e35\u200b\u200b\u0e49",
														"Pumili ng tukoy na GameObject sa pinangyarihan upang i-attach ang GoogleFu database sa. Kung walang bagay ay tinukoy, ang isang GameObject ay lilikhain para sa layuning ito.",
														"I\u00e7in GoogleFu veritaban\u0131na eklemek i\u00e7in sahnede belirli bir GameObject se\u00e7in. Hi\u00e7bir nesne belirtilmemi\u015fse, bir GameObject bu ama\u00e7 i\u00e7in olu\u015fturulur.",
														"\u0412\u0438\u0431\u0456\u0440 \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u043e\u0433\u043e GameObject \u0432 \u0441\u0446\u0435\u043d\u0456 \u0434\u043b\u044f \u043f\u0456\u0434\u043a\u043b\u044e\u0447\u0435\u043d\u043d\u044f \u0431\u0430\u0437\u0438 \u0434\u0430\u043d\u0438\u0445 GoogleFu \u0432. \u042f\u043a\u0449\u043e \u043e\u0431'\u0454\u043a\u0442 \u043d\u0435 \u0432\u043a\u0430\u0437\u0430\u043d\u0438\u0439, GameObject \u0431\u0443\u0434\u0435 \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u0430 \u0434\u043b\u044f \u0446\u0456\u0454\u0457 \u043c\u0435\u0442\u0438.",
														"\u05d0\u05d5\u05d9\u05e1\u05e7\u05dc\u05d9\u05d9\u05b7\u05d1\u05df \u05d0\u05b7 \u05e1\u05e4\u05bc\u05e2\u05e6\u05d9\u05e4\u05d9\u05e9 \u05d2\u05d0\u05b7\u05de\u05e2\u05d0\u05b8\u05d1\u05d3\u05d6\u05e9\u05e2\u05e7\u05d8 \u05d0\u05d9\u05df \u05d3\u05d9 \u05e1\u05e6\u05e2\u05e0\u05e2 \u05e6\u05d5 \u05e6\u05d5\u05d8\u05e9\u05e2\u05e4\u05bc\u05e2\u05df \u05d3\u05d9 \u05d2\u05d0\u05b8\u05d0\u05b8\u05d2\u05dc\u05e2\u05e4\u05d5 \u05d3\u05d0\u05b7\u05d8\u05d0\u05b7\u05d1\u05d0\u05b7\u05e1\u05e2 \u05e6\u05d5. \u05d0\u05d5\u05d9\u05d1 \u05e7\u05d9\u05d9\u05df \u05db\u05d9\u05d9\u05e4\u05e2\u05e5 \u05d0\u05d9\u05d6 \u05e1\u05e4\u05bc\u05e2\u05e1\u05d0\u05b7\u05e4\u05d9\u05d9\u05d3, \u05d0\u05b7 \u05d2\u05d0\u05b7\u05de\u05e2\u05d0\u05b8\u05d1\u05d3\u05d6\u05e9\u05e2\u05e7\u05d8 \u05d5\u05d5\u05e2\u05d8 \u05d6\u05d9\u05d9\u05b7\u05df \u05d1\u05d0\u05e9\u05d0\u05e4\u05df \u05e4\u05bf\u05d0\u05b7\u05e8 \u05d3\u05e2\u05dd \u05e6\u05d5\u05d5\u05e2\u05e7.",
														"\u5728\u5834\u666f\u4e2d\u9078\u64c7\u4e00\u500b\u7279\u5b9a\u7684\u904a\u6232\u7269\u9ad4\u5230GoogleFu\u6578\u64da\u5eab\u9644\u52a0\u5230\u3002\u5982\u679c\u6c92\u6709\u6307\u5b9a\u5c0d\u8c61\uff0c\u4e00\u500b\u7269\u9ad4\u6703\u70ba\u6b64\u5275\u5efa\u3002"));
			Rows.Add( new LocalizationRow("Allow GoogleFu to generate Playmaker actions for accessing the values of the generated database. ",
														"Laisser GoogleFu pour g\u00e9n\u00e9rer des actions Playmaker pour acc\u00e9der aux valeurs de la base de donn\u00e9es g\u00e9n\u00e9r\u00e9e.",
														"Lasciare GoogleFu per generare azioni Playmaker per accedere ai valori del database generato.",
														"Erm\u00f6glichen GoogleFu um Spielmacher Aktionen f\u00fcr den Zugriff auf die Werte der erzeugten Datenbank zu generieren.",
														"Permitir googleFU para generar acciones Playmaker para acceder a los valores de la base de datos generada.",
														"\u062a\u0633\u0645\u062d GoogleFu \u0644\u062a\u0648\u0644\u064a\u062f \u0627\u0644\u0625\u062c\u0631\u0627\u0621\u0627\u062a \u0635\u0627\u0646\u0639 \u0627\u0644\u0627\u0644\u0639\u0627\u0628 \u0644\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u0627\u0644\u0642\u064a\u0645 \u0645\u0646 \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u0645 \u0625\u0646\u0634\u0627\u0624\u0647\u0627.",
														"GoogleFu\uac00 \uc0dd\uc131 \ub41c \ub370\uc774\ud130\ubca0\uc774\uc2a4\uc758 \uac12\uc744 \uc561\uc138\uc2a4\ud558\uae30\uc704\ud55c \ud50c\ub808\uc774 \uba54\uc774\ucee4 \uc561\uc158\uc744 \uc0dd\uc131 \ud560 \uc218\uc788\ub2e4.",
														"\u5141\u8bb8GoogleFu\u4ee5\u4ea7\u751f\u7ec4\u7ec7\u6838\u5fc3\u64cd\u4f5c\u7528\u4e8e\u8bbf\u95ee\u6240\u751f\u6210\u7684\u6570\u636e\u5e93\u4e2d\u7684\u503c\u3002",
														"GoogleFu\u304c\u751f\u6210\u3055\u308c\u305f\u30c7\u30fc\u30bf\u30d9\u30fc\u30b9\u306e\u5024\u306b\u30a2\u30af\u30bb\u30b9\u3059\u308b\u305f\u3081\u306e\u53f8\u4ee4\u5854\u30a2\u30af\u30b7\u30e7\u30f3\u3092\u751f\u6210\u3059\u308b\u3053\u3068\u3092\u8a31\u53ef\u3057\u307e\u3059\u3002",
														"\u0420\u0430\u0437\u0440\u0435\u0448\u0438\u0442\u044c GoogleFu \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0430 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0443\u0435\u043c\u043e\u0433\u043e \u0431\u0430\u0437\u0435 \u0434\u0430\u043d\u043d\u044b\u0445.",
														"Cho ph\u00e9p GoogleFu \u0111\u1ec3 t\u1ea1o ra h\u00e0nh \u0111\u1ed9ng Playmaker \u0111\u1ec3 truy c\u1eadp c\u00e1c gi\u00e1 tr\u1ecb c\u1ee7a c\u01a1 s\u1edf d\u1eef li\u1ec7u \u0111\u01b0\u1ee3c t\u1ea1o ra.",
														"Laat GoogleFu om spelmaker acties genereren voor toegang tot de waarden van de gegenereerde database.",
														"Laat GoogleFu Play Maker aksies te genereer vir toegang tot die waardes van die gegenereerde databasis.",
														"\u041f\u043e\u0437\u0432\u043e\u043b\u0435\u0442\u0435 GoogleFu \u0434\u0430 \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043f\u043b\u0435\u0439\u043c\u0435\u0439\u043a\u044a\u0440 \u0437\u0430 \u0434\u043e\u0441\u0442\u044a\u043f \u0434\u043e \u0441\u0442\u043e\u0439\u043d\u043e\u0441\u0442\u0438\u0442\u0435 \u043d\u0430 \u0433\u0435\u043d\u0435\u0440\u0438\u0440\u0430\u043d\u0430\u0442\u0430 \u0431\u0430\u0437\u0430 \u0434\u0430\u043d\u043d\u0438.",
														"\u0414\u0430\u0437\u0432\u043e\u043b\u0456\u0446\u044c GoogleFu \u0433\u0435\u043d\u0435\u0440\u0430\u0432\u0430\u0446\u044c \u0434\u0437\u0435\u044f\u043d\u043d\u0456 \u043f\u043b\u044d\u0439\u043c\u0435\u0439\u043a\u0435\u0440 \u0434\u043b\u044f \u0434\u043e\u0441\u0442\u0443\u043f\u0443 \u0437\u043d\u0430\u0447\u044d\u043d\u043d\u044f \u0433\u0435\u043d\u0435\u0440\u0430\u0432\u0430\u043d\u0430\u0433\u0430 \u0431\u0430\u0437\u0435 \u0434\u0430\u0434\u0437\u0435\u043d\u044b\u0445.",
														"Permetre googleFU per generar accions Playmaker per accedir als valors de la base de dades generada.",
														"Nechte GoogleFu generovat Tv\u016frce hry opat\u0159en\u00ed pro p\u0159\u00edstup hodnoty generovan\u00e9 datab\u00e1ze.",
														"Caniat\u00e1u GoogleFu i gynhyrchu camau gweithredu Playmaker ar gyfer cael mynediad i'r gwerthoedd y gronfa ddata a gynhyrchir.",
														"Laske GoogleFu genereerida Playmaker meetmete tutvumise v\u00e4\u00e4rtused loodud andmebaasi.",
