			Rows.Add( new LocalizationRow("This is the Google workbook that is currently active. You will be able to export data from the Worksheets contained within it. ",
														"C'est le classeur Google qui est actuellement actif. Vous serez en mesure d'exporter des donn\u00e9es \u00e0 partir des feuilles de calcul qu'il contient.",
