														"\u8fd9\u662f\u8c37\u6b4c\u7684\u5de5\u4f5c\u7c3f\u5f53\u524d\u5904\u4e8e\u6d3b\u52a8\u72b6\u6001\u3002\u60a8\u5c06\u80fd\u591f\u5c06\u6570\u636e\u4ece\u5b83\u6240\u5305\u542b\u7684\u5de5\u4f5c\u8868\u5bfc\u51fa\u3002",
														"\u3053\u308c\u306f\u3001\u73fe\u5728\u30a2\u30af\u30c6\u30a3\u30d6\u306b\u306a\u3063\u3066\u3044\u308bGoogle\u306e\u30d6\u30c3\u30af\u3067\u3059\u3002\u3042\u306a\u305f\u306f\u305d\u306e\u4e2d\u306b\u542b\u307e\u308c\u308b\u30ef\u30fc\u30af\u30b7\u30fc\u30c8\u304b\u3089\u30c7\u30fc\u30bf\u3092\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u3059\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002",
