														"Detta alternativ kommer automatiskt att undkomma alla Unicode-tecken till en UTF-8-format.",
														"Hii chaguo moja kwa moja kutoroka wahusika wote Unicode kwa UTF-8 format.",
														"\u0e15\u0e31\u0e27\u0e40\u0e25\u0e37\u0e2d\u0e01\u0e19\u0e35\u0e49\u0e42\u0e14\u0e22\u0e2d\u0e31\u0e15\u0e42\u0e19\u0e21\u0e31\u0e15\u0e34\u0e08\u0e30\u0e2b\u0e25\u0e1a\u0e2b\u0e19\u0e35\u0e2d\u0e31\u0e01\u0e02\u0e23\u0e30 Unicode \u0e17\u0e31\u0e49\u0e07\u0e2b\u0e21\u0e14\u0e40\u0e1b\u0e47\u0e19\u0e23\u0e39\u0e1b\u0e41\u0e1a\u0e1a UTF-8",
														"Ang pagpipilian na ito ay awtomatikong i-escape ang lahat ng mga Unicode na character sa isang format na UTF-8.",
														"Bu se\u00e7enek otomatik olarak UTF-8 format\u0131nda t\u00fcm Unicode karakterler ka\u00e7\u0131\u015f olacak.",
														"\u0426\u044f \u043e\u043f\u0446\u0456\u044f \u0431\u0443\u0434\u0435 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u043d\u043e \u0443\u043d\u0438\u043a\u043d\u0443\u0442\u0438 \u0432\u0441\u0456\u0445 \u0441\u0438\u043c\u0432\u043e\u043b\u0456\u0432 Unicode \u0432 \u0444\u043e\u0440\u043c\u0430\u0442 UTF-8.",
														"\u05d3\u05e2\u05dd \u05d0\u05b8\u05e4\u05bc\u05e6\u05d9\u05e2 \u05d5\u05d5\u05e2\u05d8 \u05d0\u05d5\u05d9\u05d8\u05d0\u05b8\u05de\u05d0\u05b7\u05d8\u05d9\u05e9 \u05d0\u05b7\u05e0\u05d8\u05dc\u05d5\u05d9\u05e4\u05df \u05d0\u05b7\u05dc\u05e2 \u05d0\u05d5\u05e0\u05d9\u05e7\u05d0\u05b8\u05d3 \u05d0\u05d5\u05ea\u05d9\u05d5\u05ea \u05e6\u05d5 \u05d0\u05b7 UTF-8 \u05e4\u05bf\u05d0\u05b8\u05e8\u05de\u05d0\u05b7\u05d8.",
														"\u6b64\u9078\u9805\u5c07\u81ea\u52d5\u8df3\u812b\u6240\u6709Unicode\u5b57\u7b26\u70baUTF-8\u683c\u5f0f\u3002"));
			Rows.Add( new LocalizationRow("If enabled, all sheets that are exported as JSON will be combined into one JSON object. Otherwise each JSON object will be exported as individual files.  ",
														"Si elle est activ\u00e9e, toutes les feuilles qui sont export\u00e9s en tant que JSON seront combin\u00e9s en un seul objet JSON. Sinon, chaque objet JSON sera export\u00e9e sous forme de fichiers individuels.",
														"Se abilitata, tutti i fogli che vengono esportati come JSON verranno combinati in un oggetto JSON. In caso contrario, ogni oggetto JSON verr\u00e0 esportato come singoli file.",
														"Wenn aktiviert, werden alle Bl\u00e4tter, die als JSON exportiert werden in eine JSON-Objekt kombiniert werden. Andernfalls wird jeder JSON-Objekt wird als einzelne Dateien exportiert werden.",
														"Si est\u00e1 activado, todas las hojas que se exportan como JSON se combinar\u00e1n en un objeto JSON. De lo contrario cada objeto JSON se puede exportar como archivos individuales.",
														"\u0625\u0630\u0627 \u062a\u0645\u0643\u064a\u0646\u060c \u0633\u064a\u062a\u0645 \u062f\u0645\u062c \u0643\u0627\u0641\u0629 \u0627\u0644\u0623\u0648\u0631\u0627\u0642 \u0627\u0644\u062a\u064a \u064a\u062a\u0645 \u062a\u0635\u062f\u064a\u0631\u0647\u0627 \u0643\u0645\u0627 JSON JSON \u0625\u0644\u0649 \u0643\u0627\u0626\u0646 \u0648\u0627\u062d\u062f. \u0648\u0625\u0644\u0627 \u0633\u064a\u062a\u0645 \u062a\u0635\u062f\u064a\u0631 \u0643\u0644 \u0643\u0627\u0626\u0646 JSON \u0643\u0645\u0644\u0641\u0627\u062a \u0641\u0631\u062f\u064a\u0629.",
														"\uc0ac\uc6a9\ud558\ub3c4\ub85d \uc124\uc815 \ud55c \uacbd\uc6b0, JSON\uc73c\ub85c \uc218\ucd9c\ub418\ub294 \ubaa8\ub4e0 \uc2dc\ud2b8\ub294 \ud55c JSON \uac1d\uccb4\ub85c \uacb0\ud569\ub429\ub2c8\ub2e4. \uadf8\ub807\uc9c0 \uc54a\uc73c\uba74 \uac01 JSON \uac1d\uccb4\ub294 \uac1c\ubcc4 \ud30c\uc77c\ub85c \ub0b4\ubcf4\ub0bc \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
														"\u5982\u679c\u542f\u7528\uff0c\u5c06\u5bfc\u51fa\u4e3aJSON\u7684\u6240\u6709\u8868\u5c06\u88ab\u5408\u5e76\u6210\u4e00\u4e2aJSON\u5bf9\u8c61\u3002\u5426\u5219\uff0c\u6bcf\u4e2aJSON\u5bf9\u8c61\u5c06\u88ab\u5bfc\u51fa\u4e3a\u5355\u4e2a\u6587\u4ef6\u3002",
														"\u6709\u52b9\u306b\u3059\u308b\u3068\u3001JSON\u5f62\u5f0f\u3068\u3057\u3066\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u3055\u308c\u3066\u3044\u308b\u3059\u3079\u3066\u306e\u30b7\u30fc\u30c8\u304c1 JSON\u30aa\u30d6\u30b8\u30a7\u30af\u30c8\u306b\u7d71\u5408\u3055\u308c\u307e\u3059\u3002\u305d\u3046\u3067\u306a\u3044\u5834\u5408\u306f\u3001\u5404JSON\u30aa\u30d6\u30b8\u30a7\u30af\u30c8\u306f\u3001\u500b\u5225\u306e\u30d5\u30a1\u30a4\u30eb\u3068\u3057\u3066\u30a8\u30af\u30b9\u30dd\u30fc\u30c8\u3055\u308c\u307e\u3059\u3002",
														"\u0415\u0441\u043b\u0438 \u0432\u043a\u043b\u044e\u0447\u0435\u043d\u043e, \u0432\u0441\u0435 \u043b\u0438\u0441\u0442\u044b, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0438\u0440\u0443\u044e\u0442\u0441\u044f \u043a\u0430\u043a JSON \u0431\u0443\u0434\u0443\u0442 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u044b \u0432 \u043e\u0434\u0438\u043d \u043e\u0431\u044a\u0435\u043a\u0442 JSON. \u0412 \u043f\u0440\u043e\u0442\u0438\u0432\u043d\u043e\u043c \u0441\u043b\u0443\u0447\u0430\u0435 \u043a\u0430\u0436\u0434\u044b\u0439 \u043e\u0431\u044a\u0435\u043a\u0442 JSON \u0431\u0443\u0434\u0435\u0442 \u044d\u043a\u0441\u043f\u043e\u0440\u0442\u0438\u0440\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0432 \u0432\u0438\u0434\u0435 \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u044b\u0445 \u0444\u0430\u0439\u043b\u043e\u0432.",
														"N\u1ebfu \u0111\u01b0\u1ee3c k\u00edch ho\u1ea1t, t\u1ea5t c\u1ea3 c\u00e1c t\u1edd \u0111\u01b0\u1ee3c xu\u1ea5t kh\u1ea9u d\u01b0\u1edbi d\u1ea1ng JSON s\u1ebd \u0111\u01b0\u1ee3c k\u1ebft h\u1ee3p v\u00e0o m\u1ed9t \u0111\u1ed1i t\u01b0\u1ee3ng JSON. N\u1ebfu kh\u00f4ng t\u1eebng \u0111\u1ed1i t\u01b0\u1ee3ng JSON s\u1ebd \u0111\u01b0\u1ee3c xu\u1ea5t kh\u1ea9u d\u01b0\u1edbi d\u1ea1ng t\u1eadp tin c\u00e1 nh\u00e2n.",
														"Indien ingeschakeld, worden alle bladen die worden ge\u00ebxporteerd als JSON worden gecombineerd in een JSON object. Anders wordt ieder JSON object wordt ge\u00ebxporteerd als afzonderlijke bestanden.",
														"Indien geaktiveer, sal al velle wat uitgevoer word as into in een into voorwerp gekombineer word. Anders elke into voorwerp sal uitgevoer word as individuele l\u00eaers.",
														"\u0410\u043a\u043e \u0435 \u0430\u043a\u0442\u0438\u0432\u0438\u0440\u0430\u043d\u0430, \u0432\u0441\u0438\u0447\u043a\u0438 \u043b\u0438\u0441\u0442\u043e\u0432\u0435, \u043a\u043e\u0438\u0442\u043e \u0441\u0430 \u0438\u0437\u043d\u0435\u0441\u0435\u043d\u0438 \u043a\u0430\u0442\u043e JSON \u0449\u0435 \u0431\u044a\u0434\u0430\u0442 \u043e\u0431\u0435\u0434\u0438\u043d\u0435\u043d\u0438 \u0432 \u0435\u0434\u043d\u0430 JSON \u043e\u0431\u0435\u043a\u0442. \u0412 \u043f\u0440\u043e\u0442\u0438\u0432\u0435\u043d \u0441\u043b\u0443\u0447\u0430\u0439 \u0432\u0441\u0435\u043a\u0438 JSON \u043e\u0431\u0435\u043a\u0442 \u0449\u0435 \u0431\u044a\u0434\u0435 \u0438\u0437\u043d\u0435\u0441\u0435\u043d\u043e \u043a\u0430\u0442\u043e \u043e\u0442\u0434\u0435\u043b\u043d\u0438 \u0444\u0430\u0439\u043b\u043e\u0432\u0435.",
														"\u041a\u0430\u043b\u0456 \u045e\u043a\u043b\u044e\u0447\u0430\u043d\u0430, \u0443\u0441\u0435 \u043b\u0456\u0441\u0442\u044b, \u044f\u043a\u0456\u044f \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u0443\u044e\u0446\u0446\u0430 \u044f\u043a JSON \u0431\u0443\u0434\u0443\u0446\u044c \u0430\u0431'\u044f\u0434\u043d\u0430\u043d\u044b \u045e \u0430\u0434\u0437\u0456\u043d \u0430\u0431'\u0435\u043a\u0442 JSON. \u0423 \u0430\u0434\u0432\u0430\u0440\u043e\u0442\u043d\u044b\u043c \u0432\u044b\u043f\u0430\u0434\u043a\u0443 \u043a\u043e\u0436\u043d\u044b \u0430\u0431'\u0435\u043a\u0442 JSON \u0431\u0443\u0434\u0437\u0435 \u044d\u043a\u0441\u043f\u0430\u0440\u0442\u0430\u0432\u0430\u0446\u0446\u0430 \u045e \u0432\u044b\u0433\u043b\u044f\u0434\u0437\u0435 \u0430\u0441\u043e\u0431\u043d\u044b\u0445 \u0444\u0430\u0439\u043b\u0430\u045e.",
														"Si est\u00e0 habilitat, tots els fulls que s'exporten com JSON es combinaran en un objecte JSON. En cas contrari cada objecte JSON es pot exportar com arxius individuals.",
														"Pokud je povoleno, budou v\u0161echny listy, kter\u00e9 jsou exportov\u00e1ny jako JSON b\u00fdt slou\u010deny do jednoho objektu JSON. Jinak ka\u017ed\u00fd objekt JSON bude exportovat jako samostatn\u00e9 soubory.",
														"Wedi'i alluogi, bydd pob taflenni sy'n cael eu hallforio fel JSON yn cael eu cyfuno i mewn i un gwrthrych JSON. Fel arall, bydd pob gwrthrych JSON cael ei allforio fel ffeiliau unigol.",
														"Kui on lubatud, k\u00f5ik lehed, mis on eksporditud JSON on kombineeritud \u00fchte JSON objekti. Muidu iga JSON objekti eksporditakse nii \u00fcksikuid faile.",
														"\u0627\u06af\u0631 \u0641\u0639\u0627\u0644 \u0628\u0627\u0634\u062f\u060c \u062a\u0645\u0627\u0645 \u0648\u0631\u0642 \u0627\u0633\u062a \u06a9\u0647 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 JSON \u0635\u0627\u062f\u0631 \u062e\u0648\u0627\u0647\u062f \u0634\u062f \u0631\u0627 \u0628\u0647 \u06cc\u06a9 \u0634\u06cc JSON \u062a\u0631\u06a9\u06cc\u0628 \u0634\u062f\u0647 \u0627\u0633\u062a. \u062f\u0631 \u063a\u06cc\u0631 \u0627\u06cc\u0646 \u0635\u0648\u0631\u062a \u0647\u0631 \u06cc\u06a9 \u0627\u0632 \u0634\u06cc JSON \u062e\u0648\u0627\u0647\u062f \u0634\u062f \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u0641\u0627\u06cc\u0644 \u0647\u0627\u06cc \u0641\u0631\u062f\u06cc \u0635\u0627\u062f\u0631 \u0645\u06cc \u0634\u0648\u062f.",
														"Jos k\u00e4yt\u00f6ss\u00e4, kaikki levyt, jotka vied\u00e4\u00e4n JSON yhdistet\u00e4\u00e4n yhdeksi JSON objekti. Muutoin kukin JSON esine vied\u00e4\u00e4n yksitt\u00e4isin\u00e4 tiedostoina.",
														"M\u00e1 cumasaithe, beidh gach bileog a dh\u00e9antar a onnmhairi\u00fa mar JSON a chur le ch\u00e9ile i amh\u00e1in JSON r\u00e9ad. Seachas sin beidh gach rud JSON a onnmhairi\u00fa mar chomhaid aonair.",
														"Se est\u00e1 activado, as follas que son exportados como JSON ser\u00e1n combinados nun obxecto JSON. Se non, cada obxecto JSON ser\u00e1 exportado como ficheiros individuais.",
														"\u0905\u0917\u0930 \u0938\u0915\u094d\u0930\u093f\u092f, JSON \u0915\u0947 \u0930\u0942\u092a \u092e\u0947\u0902 \u0928\u093f\u0930\u094d\u092f\u093e\u0924 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902 \u0915\u093f \u0938\u092d\u0940 \u092a\u0924\u094d\u0930\u0915 \u090f\u0915 JSON \u0935\u0938\u094d\u0924\u0941 \u092e\u0947\u0902 \u0938\u0902\u092f\u0941\u0915\u094d\u0924 \u0939\u094b \u091c\u093e\u090f\u0917\u093e. \u0905\u0928\u094d\u092f\u0925\u093e \u092a\u094d\u0930\u0924\u094d\u092f\u0947\u0915 JSON \u0935\u0938\u094d\u0924\u0941 \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u0917\u0924 \u092b\u093e\u0907\u0932 \u0915\u0947 \u0930\u0942\u092a \u092e\u0947\u0902 \u0928\u093f\u0930\u094d\u092f\u093e\u0924 \u0915\u093f\u092f\u093e \u091c\u093e\u090f\u0917\u093e.",
														"Ako je omogu\u0107eno, svi listovi koji se izvoze kao JSON \u0107e se kombinirati u jednu JSON objekt. Ina\u010de svaki JSON objekt \u0107e se izvesti kao pojedina\u010dne datoteke.",
														"Si p\u00e8m\u00e8t, tout dra ke yo eksp\u00f2te k\u00f2m JSON pral konbine nan yon s\u00e8l JSON obj\u00e8. Otreman pral chak obj\u00e8 JSON dwe eksp\u00f2te k\u00f2m dosye endividy\u00e8l el\u00e8v yo.",
														"Jika diaktifkan, semua lembar yang diekspor sebagai JSON akan digabungkan menjadi satu objek JSON. Jika setiap objek JSON akan diekspor sebagai file individual.",
														"Ef virkt, \u00f6ll bl\u00f6\u00f0in sem eru flutt sem JSON ver\u00f0a sameinu\u00f0 \u00ed eitt JSON m\u00f3tm\u00e6la. Annars er hver einasta JSON m\u00f3tm\u00e6la ver\u00f0ur flutt sem einstakar skr\u00e1r.",
														"\u05d0\u05dd \u05de\u05d0\u05d5\u05e4\u05e9\u05e8, \u05db\u05dc \u05d4\u05d2\u05d9\u05dc\u05d9\u05d5\u05e0\u05d5\u05ea \u05e9\u05de\u05d9\u05d5\u05e6\u05d0\u05d9\u05dd \u05dbJSON \u05d9\u05e9\u05d5\u05dc\u05d1\u05d5 \u05dc\u05ea\u05d5\u05da \u05d0\u05d5\u05d1\u05d9\u05d9\u05e7\u05d8 \u05d0\u05d7\u05d3 JSON. \u05d0\u05d7\u05e8\u05ea \u05db\u05dc \u05d0\u05d5\u05d1\u05d9\u05d9\u05e7\u05d8 JSON \u05d9\u05d9\u05d5\u05e6\u05d0 \u05db\u05e7\u05d1\u05e6\u05d9\u05dd \u05d1\u05d5\u05d3\u05d3\u05d9\u05dd.",
														"Jei \u012fjungta, visi lapai, kurie eksportuojami kaip JSON bus sujungti \u012f vien\u0105 JSON. Kitais atvejais kiekvienas JSON objektas bus eksportuojami kaip atskirus failus.",
														"Ja aktiviz\u0113ts, visas lapas, kas tiek eksport\u0113ti JSON tiks apvienoti vien\u0101 JSON objektu. Pret\u0113j\u0101 gad\u012bjum\u0101 katrs JSON objekts tiks eksport\u0113ti k\u0101 atsevi\u0161\u0137us failus.",
														"\u0410\u043a\u043e \u0435 \u043e\u0432\u043e\u0437\u043c\u043e\u0436\u0435\u043d\u043e, \u0441\u0438\u0442\u0435 \u043b\u0438\u0441\u0442\u043e\u0432\u0438 \u043a\u043e\u0438 \u0441\u0435 \u0438\u0437\u0432\u0435\u0437\u0443\u0432\u0430\u0430\u0442 \u043a\u0430\u043a\u043e JSON \u045c\u0435 \u0431\u0438\u0434\u0430\u0442 \u043e\u0431\u0435\u0434\u0438\u043d\u0435\u0442\u0438 \u0432\u043e \u0435\u0434\u0435\u043d JSON \u043e\u0431\u0458\u0435\u043a\u0442. \u0418\u043d\u0430\u043a\u0443 \u0441\u0435\u043a\u043e\u0458\u0430 JSON \u043e\u0431\u0458\u0435\u043a\u0442\u043e\u0442 \u045c\u0435 \u0441\u0435 \u0438\u0437\u0432\u0435\u0437\u0443\u0432\u0430 \u043a\u0430\u043a\u043e \u043f\u043e\u0435\u0434\u0438\u043d\u0435\u0447\u043d\u0438 \u0444\u0430\u0458\u043b\u043e\u0432\u0438.",
														"Jika didayakan, semua kertas yang dieksport sebagai JSON akan digabungkan ke dalam satu objek JSON. Jika tidak setiap objek JSON akan dieksport sebagai fail individu.",
														"Jekk ppermettiet, folji kollha li huma esportati b\u0127ala JSON se jkun ikkombinat fis o\u0121\u0121ett JSON wie\u0127ed. Inkella kull o\u0121\u0121ett JSON se ji\u0121u esportati b\u0127ala fajls individwali.",
														"Hvis dette er aktivert, vil alle ark som eksporteres som JSON sl\u00e5s sammen til ett JSON objekt. Ellers hver JSON objekt vil bli eksportert som enkeltfiler.",
														"Je\u015bli opcja jest w\u0142\u0105czona, wszystkie arkusze, kt\u00f3re s\u0105 wywo\u017cone jako JSON zostan\u0105 po\u0142\u0105czone w jeden obiekt JSON. W przeciwnym razie ka\u017cdy obiekt JSON b\u0119dzie eksportowane jako pojedyncze pliki.",
														"Se ativado, todas as folhas que s\u00e3o exportados como JSON ser\u00e3o combinados em um objeto JSON. Caso contr\u00e1rio, cada objeto JSON ser\u00e1 exportado como arquivos individuais.",
														"Dac\u0103 este activat\u0103, toate foile care sunt exportate ca JSON vor fi combinate \u00eentr-un singur obiect JSON. \u00cen caz contrar, fiecare obiect JSON vor fi exportate ca fi\u0219iere individuale.",
