														"\u0410\u043a\u043e \u0458\u0435 \u043e\u043c\u043e\u0433\u0443\u045b\u0435\u043d\u0430, \u0441\u0432\u0438 \u043b\u0438\u0441\u0442\u043e\u0432\u0438 \u043a\u043e\u0458\u0438 \u0441\u0435 \u0438\u0437\u0432\u043e\u0437\u0435 \u043a\u0430\u043e \u0408\u0421\u041e\u041d \u045b\u0435 \u0431\u0438\u0442\u0438 \u043a\u043e\u043c\u0431\u0438\u043d\u043e\u0432\u0430\u043d\u0438 \u0443 \u0458\u0435\u0434\u0430\u043d \u0408\u0421\u041e\u041d \u043e\u0431\u0458\u0435\u043a\u0430\u0442. \u0423 \u0441\u0443\u043f\u0440\u043e\u0442\u043d\u043e\u043c \u0441\u0432\u0430\u043a\u0438 \u0408\u0421\u041e\u041d \u043e\u0431\u0458\u0435\u043a\u0430\u0442 \u045b\u0435 \u0441\u0435 \u0438\u0437\u0432\u043e\u0437\u0438\u0442\u0438 \u043a\u0430\u043e \u043f\u043e\u0458\u0435\u0434\u0438\u043d\u0430\u0447\u043d\u0435 \u0434\u0430\u0442\u043e\u0442\u0435\u043a\u0435.",
