														"\u041a\u0430\u043b\u0456 \u045e\u043a\u043b\u044e\u0447\u0430\u043d\u044b, \u0442\u044b\u043f\u044b \u043c\u0430\u0441\u0456\u0432\u0430\u045e \u0431\u0443\u0434\u0443\u0446\u044c \u043f\u0435\u0440\u0430\u0442\u0432\u043e\u0440\u0430\u043d\u044b\u044f \u045e \u045e\u043a\u043b\u0430\u0434\u0437\u0435\u043d\u0430\u0433\u0430 \u043c\u0430\u0441\u0456\u0432\u0430. \u0423 \u0430\u0434\u0432\u0430\u0440\u043e\u0442\u043d\u044b\u043c \u0432\u044b\u043f\u0430\u0434\u043a\u0443 \u044f\u043d\u044b \u0437\u0430\u0441\u0442\u0430\u043d\u0443\u0446\u0446\u0430 \u044f\u043a \u0440\u0430\u0434\u043e\u043a \u0437 \u043f\u0430\u0434\u0437\u0435\u043b\u044c\u043d\u0456\u043a\u0430\u043c\u0456.",
