			Rows.Add( new LocalizationRow("Complex Type Arrays are Arrays of Vector2, Vector3, Color, or Quaternions. Each individual Complex Type is delimited separately, and this Delimiter needs to be different to designate each index in the array of complext types.  The Pipe \"|\" is the default delimiter.\n\nExample of a Vector3 Array:\n1.1, 1.2, 1.3 | 2.1, 2.2, 2.3 | 3.1, 3.2, 3.3  ",
														"Complexes de type tableaux sont des ensembles de vector2, Vecteur3, la couleur ou Quaternions. Chaque type complexe individu est d\u00e9limit\u00e9 s\u00e9par\u00e9ment, et ce d\u00e9limiteur doit \u00eatre diff\u00e9rent pour d\u00e9signer chaque index dans le tableau des types de complext. La Pipe \"|\" est le d\u00e9limiteur par d\u00e9faut.\n\nExemple d'un tableau Vecteur3:\n1.1, 1.2, 1.3 | 2.1, 2.2, 2.3 | 3.1, 3.2, 3.3",
														"Complesso di tipo array sono array di Vettore2, Vector3, colori, o quaternioni. Ogni singolo tipo complesso \u00e8 delimitato separatamente, e questo delimitatore deve essere diverso per designare ogni indice nella matrice di tipi complext. The Pipe \"|\" \u00e8 il delimitatore di default.\n\nEsempio di un Array Vector3:\n1.1, 1.2, 1.3 | 2.1, 2.2, 2.3 | 3.1, 3.2, 3.3",
														"Complex Type Arrays sind Arrays von Vector2, Vector3, Farbe oder Quaternionen. Jeder einzelne komplexer Typ wird separat begrenzt, und das Trennzeichen braucht andere, um jeden Index in dem Array von complext Arten bestimmen k\u00f6nnen. The Pipe \"|\" ist der Standard-Trennzeichen.\n\nBeispiel f\u00fcr eine Vector3 Array:\n1.1, 1.2, 1.3 | 2.1, 2.2, 2.3 | 3.1, 3.2, 3.3",
