														"\u0421\u043a\u043b\u0430\u0434\u043d\u0456 \u0422\u0438\u043f \u041c\u0430\u0441\u0438\u0432\u0438 \u041c\u0430\u0441\u0438\u0432\u0438 Vector2, Vector3, \u043a\u043e\u043b\u0456\u0440 \u0430\u0431\u043e \u043a\u0432\u0430\u0442\u0435\u0440\u043d\u0456\u043e\u043d\u0456\u0432. \u041a\u043e\u0436\u0435\u043d \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u0422\u0438\u043f \u043e\u0431\u043c\u0435\u0436\u0435\u043d\u0430 \u043e\u043a\u0440\u0435\u043c\u043e, \u0456 \u0446\u0435 \u0440\u043e\u0437\u0434\u0456\u043b\u044c\u043d\u0438\u043a \u043f\u043e\u0432\u0438\u043d\u0435\u043d \u0432\u0456\u0434\u0440\u0456\u0437\u043d\u044f\u0442\u0438\u0441\u044f \u0434\u043b\u044f \u043f\u043e\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u044f \u043a\u043e\u0436\u043d\u043e\u0433\u043e \u0456\u043d\u0434\u0435\u043a\u0441\u0443 \u0432 \u043c\u0430\u0441\u0438\u0432\u0456 \u0442\u0438\u043f\u0456\u0432 complext. \u0422\u0440\u0443\u0431\u0430 \"|\" \u0454 \u0440\u043e\u0437\u0434\u0456\u043b\u044c\u043d\u0438\u043a\u043e\u043c \u0437\u0430 \u0437\u0430\u043c\u043e\u0432\u0447\u0443\u0432\u0430\u043d\u043d\u044f\u043c.\n\n\u041f\u0440\u0438\u043a\u043b\u0430\u0434 \u043c\u0430\u0441\u0438\u0432\u0443 Vector3:\n1.1, 1.2, 1.3 | 2.1, 2.2, 2.3 | 3.1, 3.2, 3.3",
														"\u05e7\u05d0\u05b8\u05de\u05e4\u05bc\u05dc\u05e2\u05e7\u05e1 \u05d8\u05d9\u05e4\u05bc \u05e2\u05e8\u05d9\u05d9\u05d6 \u05d6\u05e2\u05e0\u05e2\u05df \u05e2\u05e8\u05d9\u05d9\u05d6 \u05e4\u05d5\u05df \u05d5\u05d5\u05e2\u05e7\u05d8\u05d0\u05b8\u05e82, \u05d5\u05d5\u05e2\u05e7\u05d8\u05d0\u05b8\u05e83, \u05e7\u05d0\u05b8\u05dc\u05d9\u05e8, \u05d0\u05b8\u05d3\u05e2\u05e8 \u05e7\u05d5\u05d5\u05d0\u05b7\u05d8\u05e2\u05e8\u05e0\u05d9\u05d0\u05b8\u05e0\u05e1. \u05d9\u05e2\u05d3\u05e2\u05e8 \u05d9\u05d7\u05d9\u05d3 \u05e7\u05d0\u05b8\u05de\u05e4\u05bc\u05dc\u05e2\u05e7\u05e1 \u05d8\u05d9\u05e4\u05bc \u05d0\u05d9\u05d6 \u05d3\u05e2\u05dc\u05d9\u05de\u05d9\u05d8\u05e2\u05d3 \u05e1\u05e2\u05e4\u05bc\u05e8\u05d0\u05b7\u05d8\u05dc\u05d9, \u05d0\u05d5\u05df \u05d3\u05e2\u05dd \u05d3\u05e2\u05dc\u05d9\u05de\u05d9\u05d8\u05e2\u05e8 \u05d1\u05d0\u05d3\u05e2\u05e8\u05e4\u05e2\u05e0\u05d9\u05e9\u05df \u05e6\u05d5 \u05d6\u05d9\u05d9\u05df \u05d0\u05b7\u05e0\u05d3\u05e2\u05e8\u05e9 \u05e6\u05d5 \u05d3\u05e2\u05d6\u05d9\u05d2\u05e0\u05d9\u05d9\u05d8 \u05d9\u05e2\u05d3\u05e2\u05e8 \u05d0\u05d9\u05e0\u05d3\u05e2\u05e7\u05e1 \u05d0\u05d9\u05df \u05d3\u05d9 \u05de\u05e2\u05e0\u05d2\u05e2 \u05e4\u05d5\u05df \u200b\u200b\u05e7\u05d0\u05b8\u05de\u05e4\u05bc\u05dc\u05e2\u05e7\u05e1\u05d8 \u05d8\u05d9\u05d9\u05e4\u05bc\u05e1. \u05d3\u05d9 \u05e4\u05bc\u05d9\u05d9\u05e4\u05bc \"|\" \u05d0\u05d9\u05d6 \u05d3\u05d9 \u05e4\u05e2\u05dc\u05d9\u05e7\u05d9\u05d9\u05b7\u05d8 \u05d3\u05e2\u05dc\u05d9\u05de\u05d9\u05d8\u05e2\u05e8.\n\n\u05d1\u05d9\u05d9\u05b7\u05e9\u05e4\u05bc\u05d9\u05dc \u05e4\u05d5\u05df \u05d0\u05b7 \u05d5\u05d5\u05e2\u05e7\u05d8\u05d0\u05b8\u05e83 Array:\n1.1, 1.2, 1.3 | 2.1, 2.2, 2.3 | 3.1, 3.2, 3.3",
														"\u8907\u96dc\u985e\u578b\u6578\u7d44\u662fVector2\uff0c\u4e09\u7dad\u5411\u91cf\uff0c\u984f\u8272\uff0c\u6216\u56db\u5143\u6578\u7684\u6578\u7d44\u3002\u6bcf\u500b\u55ae\u7368\u7684\u8907\u5408\u985e\u578b\u5206\u5225\u754c\u5b9a\uff0c\u4e26\u4e14\u8a72\u5206\u9694\u7b26\u9700\u8981\u662f\u4e0d\u540c\u7684\u6307\u5b9acomplext\u985e\u578b\u7684\u9663\u5217\u4e2d\u7684\u6bcf\u500b\u7d22\u5f15\u3002\u7ba1\u9053\u201c|\u201d\u662f\u9ed8\u8a8d\u7684\u5206\u9694\u7b26\u3002\n\n\u00e0\u4e09\u7dad\u5411\u91cf\u6578\u7d44\u7684\u4f8b\u5b50\uff1a\n1.1\uff0c1.2\uff0c1.3 | 2.1\uff0c2.2\uff0c2.3 | 3.1\uff0c3.2\uff0c3.3"));
