			Rows.Add( new LocalizationRow("String Arrays are a special type where commas do not always make sense as delimiters. The Pipe is the default delimiter. \n\nExample of a String Array:\nHello|Hola|Bonjour  ",
														"Les tableaux de cha\u00eenes de caract\u00e8res sont un type particulier o\u00f9 virgules ne font pas toujours sens comme s\u00e9parateurs. Le tuyau est le d\u00e9limiteur par d\u00e9faut.\n\nExemple d'un tableau de cha\u00eenes:\nBonjour | Hola | Bonjour",
														"Gli array String sono un tipo speciale dove le virgole non sempre hanno senso come delimitatori. Il tubo \u00e8 il delimitatore di default.\n\nEsempio di una matrice di stringhe:\nCiao | Hola | Bonjour",
														"String-Arrays sind eine besondere Art, wo Kommas nicht immer Sinn machen als Trennzeichen. Das Rohr ist die Standard-Trennzeichen.\n\nBeispiel f\u00fcr einen String Array:\nHallo | Hola | Bonjour",
														"Arrays de cadena son un tipo especial donde las comas no siempre tienen sentido como delimitadores. La pipa es el delimitador predeterminado.\n\nEjemplo de una matriz de cadenas:\nHola | hola | Bonjour",
														"\u0635\u0641\u0627\u0626\u0641 \u0633\u0644\u0633\u0644\u0629 \u0647\u064a \u0646\u0648\u0639 \u062e\u0627\u0635 \u062d\u064a\u062b \u0641\u0648\u0627\u0635\u0644 \u0644\u0627 \u062a\u062c\u0639\u0644 \u0627\u0644\u0634\u0639\u0648\u0631 \u062f\u0627\u0626\u0645\u0627 \u0643\u0645\u062d\u062f\u062f\u0627\u062a. \u0627\u0644\u0623\u0646\u0627\u0628\u064a\u0628 \u063a\u064a\u0631 \u0645\u062d\u062f\u062f \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a\u0629.\n\n\u0645\u062b\u0627\u0644 \u0639\u0644\u0649 \u0635\u0641\u064a\u0641 \u0633\u0644\u0633\u0644\u0629:\n\u0645\u0631\u062d\u0628\u0627 | \u062d\u0648\u0644\u0627 | \u0635\u0628\u0627\u062d \u0627\u0644\u062e\u064a\u0631",
														"\ubb38\uc790\uc5f4 \ubc30\uc5f4\uc740 \uc27c\ud45c\ub294 \ud56d\uc0c1 \uad6c\ubd84 \uae30\ud638\ub85c \uc774\ud574\uac00\ub418\uc9c0 \uc54a\ub294 \ud2b9\uc218\ud55c \uc720\ud615\uc785\ub2c8\ub2e4. \ud30c\uc774\ud504\ub294 \uae30\ubcf8 \ubd84\ub9ac \ubb38\uc790\uc785\ub2c8\ub2e4.\n\n\ubb38\uc790\uc5f4 \ubc30\uc5f4\uc758 \uc608 :\n\uc548\ub155 | \uc548\ub155 | \ubd09\uc96c\ub974",
														"\u5b57\u7b26\u4e32\u6570\u7ec4\u662f\u4e00\u79cd\u7279\u6b8a\u7c7b\u578b\uff0c\u5176\u4e2d\u9017\u53f7\u5e76\u4e0d\u603b\u662f\u6709\u610f\u4e49\u7684\u5206\u9694\u7b26\u3002\u7ba1\u9053\u662f\u9ed8\u8ba4\u7684\u5206\u9694\u7b26\u3002\n\n\u4e00\u4e2a\u5b57\u7b26\u4e32\u6570\u7ec4\u7684\u4f8b\u5b50\uff1a\n\u4f60\u597d|\u970d\u62c9|\u5353\u60a6",
														"\u6587\u5b57\u5217\u306e\u914d\u5217\u306f\u30b3\u30f3\u30de\u306f\u5e38\u306b\u533a\u5207\u308a\u6587\u5b57\u3068\u3057\u3066\u610f\u5473\u304c\u306a\u3044\u7279\u6b8a\u306a\u30bf\u30a4\u30d7\u3067\u3059\u3002\u30d1\u30a4\u30d7\u306f\u3001\u30c7\u30d5\u30a9\u30eb\u30c8\u306e\u533a\u5207\u308a\u6587\u5b57\u3067\u3059\u3002\n\n\u6587\u5b57\u5217\u914d\u5217\u306e\u4f8b\uff1a\n\u3053\u3093\u306b\u3061\u306f|\u30aa\u30e9|\u30dc\u30f3\u30b8\u30e5\u30fc\u30eb",
														"\u0421\u0442\u0440\u0443\u043d\u043d\u044b\u0435 \u043c\u0430\u0441\u0441\u0438\u0432\u044b \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0442 \u0441\u043e\u0431\u043e\u0439 \u043e\u0441\u043e\u0431\u044b\u0439 \u0442\u0438\u043f, \u0433\u0434\u0435 \u0437\u0430\u043f\u044f\u0442\u044b\u0435 \u043d\u0435 \u0432\u0441\u0435\u0433\u0434\u0430 \u0438\u043c\u0435\u0435\u0442 \u0441\u043c\u044b\u0441\u043b \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0440\u0430\u0437\u0434\u0435\u043b\u0438\u0442\u0435\u043b\u0435\u0439. \u0422\u0440\u0443\u0431\u0430 \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u0440\u0430\u0437\u0434\u0435\u043b\u0438\u0442\u0435\u043b\u044c \u043f\u043e \u0443\u043c\u043e\u043b\u0447\u0430\u043d\u0438\u044e.\n\n\u041f\u0440\u0438\u043c\u0435\u0440 \u043c\u0430\u0441\u0441\u0438\u0432 \u0441\u0442\u0440\u043e\u043a:\n\u041f\u0440\u0438\u0432\u0435\u0442 | Hola | Bonjour",
														"M\u1ea3ng chu\u1ed7i l\u00e0 m\u1ed9t lo\u1ea1i \u0111\u1eb7c bi\u1ec7t, d\u1ea5u ph\u1ea9y kh\u00f4ng ph\u1ea3i lu\u00f4n lu\u00f4n c\u00f3 \u00fd ngh\u0129a nh\u01b0 d\u1ea5u ph\u00e2n c\u00e1ch. C\u00e1c \u1ed1ng l\u00e0 d\u1ea5u ph\u00e2n c\u00e1ch m\u1eb7c \u0111\u1ecbnh.\n\nV\u00ed d\u1ee5 v\u1ec1 m\u1ed9t m\u1ea3ng String:\nXin ch\u00e0o | Hola | Bonjour",
														"String Arrays zijn een speciaal type waar komma's niet altijd zinvol als scheidingstekens. De Pijp is de standaard scheidingsteken.\n\nVoorbeeld van een String Array:\nHello | Hola | Bonjour",
